5e68ea97-f150-43a8-8b19-49219e522585	2	post	Как приятно найти биткоин в кармане зимней куртки: мой опыт и мысли про ретродроп	>Дисклеймеры: так вышло, что я амбассадор (тут это не модное слово, а, вроде, должности) криптопроекта со своей приваткой (платным каналом, где разбираются пути заработка в крипте) и, дабы не вышло конфликтов интересов, сообщаю что я вам ничего не продаю в данной статье и не распространяю тут информацию из этого сообщества. Кроме того, в тексте вам будут попадаться ссылки, некоторые из них реферальные, если для вас это неприемлемо, то в конце я дам ссылки на все эти проекты без реферальной составляющей, но буду признателен, если вы используете ссылки из текста. Некоторые слова и понятия я буду приводить в корявой транслитерации, такой сленг в моих источниках, если что непонятно - уточняйте в комментариях. Отдельно отмечу, что безопасность в сфере криптовалют это отдельная тема, всегда думайте куда подключаете свой кошелек и что подписываете. В данном тексте нет ни одной финансовой рекомендации (NFA) и всегда стоит подумать своей головой (DYOR). В тексте вы встретите очень много скобок, ни одна из них не смайлик, это лишь наследие образования в области формальной логики. И еще: автор знает разницу между coin и token, но в тексте может использовать эти понятия не всегда корректно, простите его, пожалуйста.\r\n\r\nДавеча в нашем уютном Вастрик.Крипта попросили поделиться мыслями/опытом про такого зверя, как ретродроп. Не то, что бы я прямо большой знаток, но немного погрузился в эту сферу последнее время, а ценности клуба подстегивают написать пост несмотря на то, что в клубе полно людей с большим опытом/успехами в этом нелегком деле.\r\n\r\n# Первая часть, она же вступление, биографическая:\r\nДо 24 февраля прошлого года у меня были:\r\n- Стабильная работа с устраивающей меня зарплатой и приключениями в придачу (все еще думаю, что когда-то напишу пост про дальнюю (во всех смыслах) радиолокации и как я провел в ней 15 лет, но не уверен, что после [этого](https://vas3k.club/post/19055/) поста осталась необходимость);\r\n- Интерес к бонус-хантингу от банков (скорее спортивный азарт, чем желание прямо зарабатывать), да, я был тем человеком из реклам каналов в телеграмме с десятками банков и сотнями карт который знает какую карту с каким MCC кодом надо сочетать для сказочного кэшбека или как строить лесенки в ТКС;\r\n- Некоторый интерес к крипте, как к технологии. У моей первой транзакции в биткоине скоро 10-летний юбилей, а мощностью моей майнинг фермы, что крутилась на роутере с подключенными в USB-hub внешними устройствами можно сильно повеселить современные сложности. Прошел я и через крах нескольких бирж, оставляя на каждой приличную для меня на тот момент сумму и через пропуск предыдущих бычьих фаз рынка.\r\n\r\nПосле 24 февраля у меня:\r\n- стало много идей пожить за пределами РФ (что не сильно сочеталось с имеющейся работой);\r\n- пропал интерес к бонус-хантингу от банков;\r\n- значительно возрос интерес к крипте.\r\n\r\nЯ подписался на много разнокалиберных телеграмм каналов, по изучал в них посты с кричащими заголовками, потом отписался от 99% и через некоторое время “залутал первый жирный ретродроп”. Не пугайтесь “профессионального” сленга в прошлом предложении, ниже попробую разъяснить.\r\n\r\nСейчас я временно безработный (если у кого есть какая-никакая осмысленная вакансия в области построения команд, математики или программирования на С/С++ - дайте знать) и освободил немного времени для написания текстов которые раньше не успевал писать. Ниже один из таких текстов.\r\n\r\n# Что  такое ретродроп и в чем смысл его существования.\r\nЕсли вы что-то слышали про криптовалюты в период их прошлого пришествия (в 2015-2019 годах), то наверняка вспомните, что в моде были ICO. Это когда новый криптопроект продавал свои монеты до начала разработки продукта по самостоятельно придуманным командой ценам. На полученные деньги начиналась разработка, проект строил обещанный продукт, выводил монету на биржи и счастливые участники ICO, они же инверторы, становились богаче. Это в идеале. На самом деле значительная часть проектов даже не начинала разрабатываться, а инстаграмы фаундеров пополнялись фотографиями свеженьких ламборгини. В те времена на канале нашего бывшего соклубника была познавательная рубрика с разбором “Честный обзор ICO” ([1](https://t.me/golden_borodutch/2551),[2](https://t.me/golden_borodutch/3783)) , хоть и без ссылок на пабмед, но познавательно. Где-то на рубеже 2017/2018 годов такие игры стали интересовать правоохранительные органы разных стран и всякие там SECи. \r\n![Ворованная картинка с циклами рынка, сделаю вид, что разбираюсь](https://tradeinex.com/_pu/1/57103707.jpg)\r\nВместе с тем отрасль росла, крепла и в ней стали появляться более фундаментальные проекты, которые могли внятно сформулировать свою идею и попросить денег на разработку не у абстрактных криптанов на форумах, а у институциональных инвесторов (часть из которых уже смогла осознать что крипта не всегда тождественно равна мошенничеству). Покупать ламборгини стало сложнее, не абстрактные инвесторы намекали на результат и хотели видеть цифры и отчеты и, внезапно, отбить свои инвестиции. Такие условия в отрасли породили идею о дропах (от английского drops)/аирдропах(это когда деньги с вертолета разбрасывают)/ретродропах(за былые заслуги). Фокус тут в том, что когда проект, с у же как-то работающим продуктом хочет как-то заработать и вернуть инвестиции самым простым оказалось выпустить свой собственный токен (часто, кстати, такой актив и применения никакого не имеет), распределить себе некоторую часть от общего числа, нанять маркетмейкера, завести ликвидность на биржи и начать торги. Только вот неплохо, чтобы в торгах было побольше участников.Для этого придумали раздавать часть общего количества новоявленной монеты ранним пользователям продукта. У этого сразу несколько побочных эффектов:\r\n\r\n1. Про проект начинают много говорить;\r\n2. Информационное пространство заливают волны специфического чувства FOMO;\r\n3. Следствие двух предыдущих пунктов - начинаются очень активные торги;\r\n4. Команда имеет удачный момент продать часть своей доли и порадовать инвесторов.\r\n5. Вроде как к такой схеме меньше претензий регуляторов (или было меньше претензий регуляторов до недавнего времени).\r\n\r\nИтого все в плюсе. Схема начала приживаться, начиная с дропа Uniswap осенью 2020 года. Это был не самый первый дроп, но самый на тот момент большой и громкий, ведь сумма полученные за хотя бы одну когда-то сделанную транзакцию составляла порядка 1000$. С тех пор история насчитывает порядка двух десятков крупных раздач и несчетное количество всякой мелочи. Причем раздают дропы, зачастую, достаточно большому количеству ~~людей~~ кошельков - порядка 600К.\r\n\r\n# Перейдем к практике.\r\n\r\nИтак, что бы получить своеобразный комплимент от протокола, DeFi-площадки, NFT-маркетплейса и т.д. нужно прослыть его активным пользователем (дропы за одну транзакцию теперь дают уже менее охотно, вместо этого практикуется схема с мультипликаторами). Кроме того, все больше слышно разговоров о том, что дропы должны получать реальные пользователи этих ваших блохчейнов, а не залетные кошельки с одной транзакцией.  Сформировались даже отдельные проекты для отсеивания, так называемых, *Sybil* accounts (не путать с атакой Sybil атакой) - множества аккаунтов с минимальной активностью имеющих одного физического владельца.\r\n![Немножко сетей в моем MetaMask](https://i.ibb.co/vsDgTRZ/2023-06-15-21-01-18.png)\r\nУлучшить репутацию своего кошелька (ее еще называют ончейн идентичностью) можно многими способами, почти все из них сводятся к осуществлению транзакций в различных сетях (в рамках данной публикации я рассматриваю EVM сети, т.е. все те сети что имеют один общий адрес с вашем адресом в сети Ethereum и могут быть добавлены в MetaMask) и влекут комиссии (тут отмечу один, как оказалось, не очевидный момент: величина комиссии, в общем случае, не зависит от суммы операции, а только от сложности смартконтракта/типа операции и текущей загруженности блокчейна/цены газа, т.е. комиссия за перевод 10$ будет такой же, что и при переводе 1000$). Ниже несколько мыслей как такую репутацию “прокачать”:\r\n\r\n1. В сети Ethereum полезно (дорого, больно, но минимально необходимо, для удешевления транзакций следите за ценой газа, в последнее время удачным считается значение в районе 20 gwei):\r\n- Иметь не нулевой баланс в L1 (для этого достаточно вывести немного средств с биржи);\r\n- Произвести хотя бы одну транзакцию в сети Ethereum (дешевым вариантом тут может быть перевод на другой адрес или оборачивание небольшой суммы Eth например [тут](https://bebop.xyz/trade?buy=WETH&sell=&network=ethereum)); \r\n- Обладать хотя бы один NFT в сети Ethereum;\r\n- Владеть [ENS доменом](https://app.ens.domains/), эта активность покроет и два предыдущих пункта, т.к. домен является NFT. ENS домен это такой способ иметь в дополнение к адресу кошелька состоящему из длинной последовательности букв и цифр дополнительный адрес того же кошелька состоящий из чуть меньшего количества букв, цифр и символов по вашему выбору (например, средства отправленные на vitalik.eth придут на кошелек с адресом 0xd8dA6BF26964aF9D7eEd9e03E53415D37aA96045). Домен на год обойдется в ~20$ при 20 gwei.\r\n- Из не очевидного, возможно будет полезно, например, участие в [этой церемонии](https://ceremony.ethereum.org/).\r\n2. В дешевых сетях (каковыми, на данный, момент являются Polygon, BSC, Arbitrum, Optimism и т.д.) комиссии значительно ниже и редко будут превышать 0,5$ за транзакцию. Имеет смысл попробовать различные DeFi приложения, DEX обменники и мосты (перевод средств из одного блокчейна в другой минуя централизованные биржи, дороже обычной транзакции). Список различных приложений по категориям можно найти, например, [тут](https://tools.crypton.xyz/ru/T0).\r\n![Комиссии за переводы между основными сетями, Эфир = Боль ](https://i.ibb.co/s59CT5v/2023-06-15-21-15-31.png)\r\n    \r\n\t\r\n\t3. Гейимификация или агрегаторы квестов:\r\n    Тут целое раздолье различных площадок выдающих различные памятные NFT, OAT, WEST или любое другое название памятной картинки за ваши действия в различных сетях, как правило, каждое задание подробно описано. Основные на данный момент площадки:\r\n   - [galxe](https://galxe.com/) (миллионы ОАТ от многих-многих проектов), бывают как ончейн задания, так и социальные, по типу подписки на Twitter и вступления в Discord. Если за клейм НФТ с вас просят комиссию дважды подумайте надо ли оно вам;\r\n   - [link3 aka cyberconnect](https://link3.to/cyberconnect/fanclub?r=0x12kda) выдают WEST-токены за присутствие на различных социальных мероприятиях (AMA-сессии, Recap, созвоны с командой и т.д.) все в том же Twitter и  Discord. Осенью собираются выпустить свой токен, возможно часть из них перепадет владельцам большого количества WEST, а быть может и нет;\r\n   - [Philand](https://quest.philand.xyz/list) интересен тем, что за каждый выполненный квест (а тут основная часть ончейн) дают НФТ фигурку которую потом можно разместить на своем участке и построить красивый или не очень городок. Все фигурки в сети Polygon (низкие комиссии), для логина нужен ENS домен;\r\n      ![Мой корявый городок](https://i.ibb.co/7tzsvWm/2023-06-15-20-48-05.png)\r\n    -  [Layer3](https://layer3.xyz/?ref=OQ8Q) - ИМХО, лучший из доступных сейчас вариантов, содержит множество квестов затрагивающих различные проекты (дропы от всех этих проектов тоже исключать нельзя, иначе зачем они привлекают аудиторию) которые отлично прогревают кошелек. Есть фильтры по сетям. В награды раздают абстрактную экспу, с которой потом можно потешить ЧСВ. Реже встречаются наградные НФТ, некоторые из которых весьма успешно торгуются на [OpenSea](https://opensea.io/collection/layer3). Так же есть простые социальные квесты или викторины, кошелек они не прогревают, но XP подзаработать можно. Задания с репостами и лайками в Twitter почти всегда можно пропустить, чтобы не замусоривать личный аккаунт.\r\n    \r\n4. Голосования в DAO\r\nБольшая часть доступных сейчас токенов имеют свое основное ютилити - вес голоса в DAO. Известен по крайней мере один случай, когда участие в такого вида демократии служило критерием дропа. Голосования бывают на разные темы и на разных площадках, вот основные из них: [snapshot](https://snapshot.org/), [tally](https://www.tally.xyz/). \r\n5. Soulbound Tokens или токены идентификации и сертификаты\r\nЭто непередаваемые токены выпускаемые большой площадкой, вроде Binance (BAB-token) или упомянутый выше  [galxe](https://galxe.com/) (galxe паспорт). Для получения такого НФТ придется пройти KYC процедуру, т.е. показать паспорт и лицо в камеру. Если для вас это неприемлемо можете попробовать, например, заполучить [DegenScore Beacon SBT](https://degenscore.com/beacon), это дорого (не менее 400$), но открывает много приятных перспектив. Получение любых других SBT, например, бейджей [Voltz](https://app.voltz.xyz/#/welcome?invitedBy=GlZZcXXu) или  [Sismo](http://app.sismo.io) тоже сделают ваш кошелек живее и реалистичнее.\r\n6. Участие в Gitcoin и актуализация gitcoin passport\r\n[Gitcoin](https://www.gitcoin.co/) - платформа для со финансирования различных блокчейн разработок и инициатив. Как правило, дважды в год они запускают двухнедельный раунд в ходе которого можно закинуть копеечку понравившимся вам проектам. Кроме того, что проекты, если доживают до выхода в продакшн, любят вознаградить своих спонсоров это еще и однозначный плюс в ончейн и офчейн карму. Для донатов потребуется определенный score [Gitcoin pasport](https://passport.gitcoin.co/#/dashboard) (место где можно связать все свои социальные сети и кошелек в один неразделимый “документ”). Сейчас порог небольшой, получить его весьма легко. Думаю, со временем порог поднимут, а определенный уровень будет необходим для получения будущих ретродропов. Некоторые проекты уже сейчас просят предъявлять  паспорт со значением 20+ даже для доступа к тестнету.\r\n\r\n# Как выбирать проекты\r\n\r\nТут у меня нет однозначного ответа, но при выборе не лишним будет:\r\n- изучить Twitter проекта, подписки и активности в нем;\r\n- изучить активность в Discord проекта (если ее нет, или она на уровне gm-gn, а в ветке Announcement пустовато - то, возможно, и проекта никакого на самом деле нет);\r\n- изучить кто, сколько и когда [инвестировал в проект](https://www.crunchbase.com/) (хорошим признаком является присутствие среди инвесторов [a16z](https://twitter.com/janehk), [Binance Labs](https://labs.binance.com/), [Animoca Brands](https://www.animocabrands.com/) и т.д.);\r\n- изучить кто пользуется проектом и насколько активно, тут вам могут помочь такие инструменты как [Dune](dune.com), [DeBank](https://debank.com/profile/0x9026a229b535ecf0162dfe48fdeb3c75f7b2a7ae?t=1686832835984&r=34552), [Arkhami](https://platform.arkhamintelligence.com/waitlist?referrer=a2RheDEyLmV0aEBtYWlsMy5tZQ) или поискать в [наших чатах](https://t.me/c/1403326900/1/32797);\r\n\r\n![Дашборд со статистикой по самому ожидаемому на данный момент ретродропу](https://i.ibb.co/nRjk3Gf/2023-06-15-20-39-45.png)\r\n\r\n- если на github доступен код, то можно по изучать и его на предмет упоминания токена;\r\n- если смотреть только в разрезе ретродропа, то не так уж и важно полезен ли разрабатываемый продукт, насколько он нужен и имеет ли смысл выпускать токен, т.к. любая команда стремится выйти на рынок и заработать, а потом уже можно и закрываться. Не имеет смысла и доверять заявлениям команды и CEO о том, что никакого токена, а уж, тем более, его раздачи не предвидится. \r\n\r\nЕсли самостоятельным анализом заниматься не хочется можно опуститься на дно Tg каналов по теме, информация там циркулирует примерно одна и та же, не зависимо от автора.\r\n\r\n# Проект выбран, что дальше\r\n\r\nВсе просто: нужно оставить как можно более очевидный след в проекте и пользоваться им, причем периодическое использование на протяжении нескольких месяцев лучше, чем много транзакций в один день. Полезно бывает написать багрепорт или установить ноду если у вас есть на это время и желание. Следим за соцсетями проекта и ключевых членов команды (возможно не только оповещение о дропе или снепшоте для него, но и какие-то дополнительные активности). Если забивать ленту многими источниками не сильно хочется можно использовать, например, [этот бот](https://t.me/crypton_research_bot) подписавшись на интересные проекты.\r\n\r\nОстается только дождаться дропа (можно периодически проверять сервисы вроде [daylight](https://www.daylight.xyz/) или [earn.fi](https://earni.fi/)) и грамотно его продать, но тут я совсем не советчик, это к трейдерам.\r\n\r\n# Капелька личного опыта\r\n\r\nЗа последние пол года я получил порядка 10 дропов разного размера, но все перекрыл Arbitrum, вот критерии, все по максимуму, кроме объемов, получено 4000 ARB, и это я еще не очень ранний пользователь, многие начинали активности два года назад:\r\n![Поздравления от Arbitrum](https://i.ibb.co/PzSTLBS/2023-06-15-16-22-06.png)\r\n\r\n\r\nПри этом минимальный критерий - хотя бы одна транзакция через официальный мост мог принести ~600 ARB. Большую часть я пока что не продал, а то что продал понемногу трачу на другие интересные мне активности.\r\n\r\nВ заключении обещанный список не реферальных ссылок:\r\n[Link3](https://link3.to/) - платформа с WEST\r\n\r\n[Layer3](https://layer3.xyz/) - платформа с квестами и лидербордом\r\n\r\n[Voltz](https://app.voltz.xyz/) - площадка на которой можно славно пожечь эфир в обмен на SBT\r\n\r\n[Debank](https://debank.com/) - удобный способ следить за всеми активами во всех сетях на вашем/чужом кошельке\r\n\r\n[Arkham](https://platform.arkhamintelligence.com/) - удобный способ следить за движениями средств и связями кошельков\r\n\r\nЕсли у вас остались вопросы/предложения/замечания или нужна АМА сессия в клубе по этой теме - жду вас в комментариях. Там же предлагаю делиться перспективными, с вашей точки зрения проектами.	<blockquote>\n<p>Дисклеймеры: так вышло, что я амбассадор (тут это не модное слово, а, вроде, должности) криптопроекта со своей приваткой (платным каналом, где разбираются пути заработка в крипте) и, дабы не вышло конфликтов интересов, сообщаю что я вам ничего не продаю в данной статье и не распространяю тут информацию из этого сообщества. Кроме того, в тексте вам будут попадаться ссылки, некоторые из них реферальные, если для вас это неприемлемо, то в конце я дам ссылки на все эти проекты без реферальной составляющей, но буду признателен, если вы используете ссылки из текста. Некоторые слова и понятия я буду приводить в корявой транслитерации, такой сленг в моих источниках, если что непонятно - уточняйте в комментариях. Отдельно отмечу, что безопасность в сфере криптовалют это отдельная тема, всегда думайте куда подключаете свой кошелек и что подписываете. В данном тексте нет ни одной финансовой рекомендации (NFA) и всегда стоит подумать своей головой (DYOR). В тексте вы встретите очень много скобок, ни одна из них не смайлик, это лишь наследие образования в области формальной логики. И еще: автор знает разницу между coin и token, но в тексте может использовать эти понятия не всегда корректно, простите его, пожалуйста.</p>\n</blockquote>\n<p>Давеча в нашем уютном Вастрик.Крипта попросили поделиться мыслями/опытом про такого зверя, как ретродроп. Не то, что бы я прямо большой знаток, но немного погрузился в эту сферу последнее время, а ценности клуба подстегивают написать пост несмотря на то, что в клубе полно людей с большим опытом/успехами в этом нелегком деле.</p>\n<h1 id="Pervaia-chast-ona-zhe-vst"><a href="#Pervaia-chast-ona-zhe-vst">Первая часть, она же вступление, биографическая:</a></h1>\n<p>До 24 февраля прошлого года у меня были:</p>\n<ul>\n<li>Стабильная работа с устраивающей меня зарплатой и приключениями в придачу (все еще думаю, что когда-то напишу пост про дальнюю (во всех смыслах) радиолокации и как я провел в ней 15 лет, но не уверен, что после <a href="https://vas3k.club/post/19055/">этого</a> поста осталась необходимость);</li>\n<li>Интерес к бонус-хантингу от банков (скорее спортивный азарт, чем желание прямо зарабатывать), да, я был тем человеком из реклам каналов в телеграмме с десятками банков и сотнями карт который знает какую карту с каким MCC кодом надо сочетать для сказочного кэшбека или как строить лесенки в ТКС;</li>\n<li>Некоторый интерес к крипте, как к технологии. У моей первой транзакции в биткоине скоро 10-летний юбилей, а мощностью моей майнинг фермы, что крутилась на роутере с подключенными в USB-hub внешними устройствами можно сильно повеселить современные сложности. Прошел я и через крах нескольких бирж, оставляя на каждой приличную для меня на тот момент сумму и через пропуск предыдущих бычьих фаз рынка.</li>\n</ul>\n<p>После 24 февраля у меня:</p>\n<ul>\n<li>стало много идей пожить за пределами РФ (что не сильно сочеталось с имеющейся работой);</li>\n<li>пропал интерес к бонус-хантингу от банков;</li>\n<li>значительно возрос интерес к крипте.</li>\n</ul>\n<p>Я подписался на много разнокалиберных телеграмм каналов, по изучал в них посты с кричащими заголовками, потом отписался от 99% и через некоторое время “залутал первый жирный ретродроп”. Не пугайтесь “профессионального” сленга в прошлом предложении, ниже попробую разъяснить.</p>\n<p>Сейчас я временно безработный (если у кого есть какая-никакая осмысленная вакансия в области построения команд, математики или программирования на С/С++ - дайте знать) и освободил немного времени для написания текстов которые раньше не успевал писать. Ниже один из таких текстов.</p>\n<h1 id="Chto-takoe-retrodrop-i-v"><a href="#Chto-takoe-retrodrop-i-v">Что  такое ретродроп и в чем смысл его существования.</a></h1>\n<p>Если вы что-то слышали про криптовалюты в период их прошлого пришествия (в 2015-2019 годах), то наверняка вспомните, что в моде были ICO. Это когда новый криптопроект продавал свои монеты до начала разработки продукта по самостоятельно придуманным командой ценам. На полученные деньги начиналась разработка, проект строил обещанный продукт, выводил монету на биржи и счастливые участники ICO, они же инверторы, становились богаче. Это в идеале. На самом деле значительная часть проектов даже не начинала разрабатываться, а инстаграмы фаундеров пополнялись фотографиями свеженьких ламборгини. В те времена на канале нашего бывшего соклубника была познавательная рубрика с разбором “Честный обзор ICO” (<a href="https://t.me/golden_borodutch/2551">1</a>,<a href="https://t.me/golden_borodutch/3783">2</a>) , хоть и без ссылок на пабмед, но познавательно. Где-то на рубеже 2017/2018 годов такие игры стали интересовать правоохранительные органы разных стран и всякие там SECи. <br>\n<figure class=""><img src="https://tradeinex.com/_pu/1/57103707.jpg" alt="Ворованная картинка с циклами рынка, сделаю вид, что разбираюсь"><figcaption>Ворованная картинка с циклами рынка, сделаю вид, что разбираюсь</figcaption></figure><br>\nВместе с тем отрасль росла, крепла и в ней стали появляться более фундаментальные проекты, которые могли внятно сформулировать свою идею и попросить денег на разработку не у абстрактных криптанов на форумах, а у институциональных инвесторов (часть из которых уже смогла осознать что крипта не всегда тождественно равна мошенничеству). Покупать ламборгини стало сложнее, не абстрактные инвесторы намекали на результат и хотели видеть цифры и отчеты и, внезапно, отбить свои инвестиции. Такие условия в отрасли породили идею о дропах (от английского drops)/аирдропах(это когда деньги с вертолета разбрасывают)/ретродропах(за былые заслуги). Фокус тут в том, что когда проект, с у же как-то работающим продуктом хочет как-то заработать и вернуть инвестиции самым простым оказалось выпустить свой собственный токен (часто, кстати, такой актив и применения никакого не имеет), распределить себе некоторую часть от общего числа, нанять маркетмейкера, завести ликвидность на биржи и начать торги. Только вот неплохо, чтобы в торгах было побольше участников.Для этого придумали раздавать часть общего количества новоявленной монеты ранним пользователям продукта. У этого сразу несколько побочных эффектов:</p>\n<ol>\n<li>Про проект начинают много говорить;</li>\n<li>Информационное пространство заливают волны специфического чувства FOMO;</li>\n<li>Следствие двух предыдущих пунктов - начинаются очень активные торги;</li>\n<li>Команда имеет удачный момент продать часть своей доли и порадовать инвесторов.</li>\n<li>Вроде как к такой схеме меньше претензий регуляторов (или было меньше претензий регуляторов до недавнего времени).</li>\n</ol>\n<p>Итого все в плюсе. Схема начала приживаться, начиная с дропа Uniswap осенью 2020 года. Это был не самый первый дроп, но самый на тот момент большой и громкий, ведь сумма полученные за хотя бы одну когда-то сделанную транзакцию составляла порядка 1000$. С тех пор история насчитывает порядка двух десятков крупных раздач и несчетное количество всякой мелочи. Причем раздают дропы, зачастую, достаточно большому количеству <del>людей</del> кошельков - порядка 600К.</p>\n<h1 id="Pereidem-k-praktike"><a href="#Pereidem-k-praktike">Перейдем к практике.</a></h1>\n<p>Итак, что бы получить своеобразный комплимент от протокола, DeFi-площадки, NFT-маркетплейса и т.д. нужно прослыть его активным пользователем (дропы за одну транзакцию теперь дают уже менее охотно, вместо этого практикуется схема с мультипликаторами). Кроме того, все больше слышно разговоров о том, что дропы должны получать реальные пользователи этих ваших блохчейнов, а не залетные кошельки с одной транзакцией.  Сформировались даже отдельные проекты для отсеивания, так называемых, <em>Sybil</em> accounts (не путать с атакой Sybil атакой) - множества аккаунтов с минимальной активностью имеющих одного физического владельца.<br>\n<figure class=""><img src="https://i.ibb.co/vsDgTRZ/2023-06-15-21-01-18.png" alt="Немножко сетей в моем MetaMask"><figcaption>Немножко сетей в моем MetaMask</figcaption></figure><br>\nУлучшить репутацию своего кошелька (ее еще называют ончейн идентичностью) можно многими способами, почти все из них сводятся к осуществлению транзакций в различных сетях (в рамках данной публикации я рассматриваю EVM сети, т.е. все те сети что имеют один общий адрес с вашем адресом в сети Ethereum и могут быть добавлены в MetaMask) и влекут комиссии (тут отмечу один, как оказалось, не очевидный момент: величина комиссии, в общем случае, не зависит от суммы операции, а только от сложности смартконтракта/типа операции и текущей загруженности блокчейна/цены газа, т.е. комиссия за перевод 10$ будет такой же, что и при переводе 1000$). Ниже несколько мыслей как такую репутацию “прокачать”:</p>\n<ol>\n<li>В сети Ethereum полезно (дорого, больно, но минимально необходимо, для удешевления транзакций следите за ценой газа, в последнее время удачным считается значение в районе 20 gwei):</li>\n</ol>\n<ul>\n<li>Иметь не нулевой баланс в L1 (для этого достаточно вывести немного средств с биржи);</li>\n<li>Произвести хотя бы одну транзакцию в сети Ethereum (дешевым вариантом тут может быть перевод на другой адрес или оборачивание небольшой суммы Eth например <a href="https://bebop.xyz/trade?buy=WETH&amp;sell=&amp;network=ethereum">тут</a>);</li>\n<li>Обладать хотя бы один NFT в сети Ethereum;</li>\n<li>Владеть <a href="https://app.ens.domains/">ENS доменом</a>, эта активность покроет и два предыдущих пункта, т.к. домен является NFT. ENS домен это такой способ иметь в дополнение к адресу кошелька состоящему из длинной последовательности букв и цифр дополнительный адрес того же кошелька состоящий из чуть меньшего количества букв, цифр и символов по вашему выбору (например, средства отправленные на vitalik.eth придут на кошелек с адресом 0xd8dA6BF26964aF9D7eEd9e03E53415D37aA96045). Домен на год обойдется в ~20$ при 20 gwei.</li>\n<li>Из не очевидного, возможно будет полезно, например, участие в <a href="https://ceremony.ethereum.org/">этой церемонии</a>.</li>\n</ul>\n<ol start="2">\n<li>В дешевых сетях (каковыми, на данный, момент являются Polygon, BSC, Arbitrum, Optimism и т.д.) комиссии значительно ниже и редко будут превышать 0,5$ за транзакцию. Имеет смысл попробовать различные DeFi приложения, DEX обменники и мосты (перевод средств из одного блокчейна в другой минуя централизованные биржи, дороже обычной транзакции). Список различных приложений по категориям можно найти, например, <a href="https://tools.crypton.xyz/ru/T0">тут</a>.</li>\n</ol>\n<p><figure class=""><img src="https://i.ibb.co/s59CT5v/2023-06-15-21-15-31.png" alt="Комиссии за переводы между основными сетями, Эфир = Боль "><figcaption>Комиссии за переводы между основными сетями, Эфир = Боль </figcaption></figure></p>\n<p>3. Гейимификация или агрегаторы квестов:<br>\n    Тут целое раздолье различных площадок выдающих различные памятные NFT, OAT, WEST или любое другое название памятной картинки за ваши действия в различных сетях, как правило, каждое задание подробно описано. Основные на данный момент площадки:</p>\n<ul>\n<li><a href="https://galxe.com/">galxe</a> (миллионы ОАТ от многих-многих проектов), бывают как ончейн задания, так и социальные, по типу подписки на Twitter и вступления в Discord. Если за клейм НФТ с вас просят комиссию дважды подумайте надо ли оно вам;</li>\n<li><a href="https://link3.to/cyberconnect/fanclub?r=0x12kda">link3 aka cyberconnect</a> выдают WEST-токены за присутствие на различных социальных мероприятиях (AMA-сессии, Recap, созвоны с командой и т.д.) все в том же Twitter и  Discord. Осенью собираются выпустить свой токен, возможно часть из них перепадет владельцам большого количества WEST, а быть может и нет;</li>\n<li><a href="https://quest.philand.xyz/list">Philand</a> интересен тем, что за каждый выполненный квест (а тут основная часть ончейн) дают НФТ фигурку которую потом можно разместить на своем участке и построить красивый или не очень городок. Все фигурки в сети Polygon (низкие комиссии), для логина нужен ENS домен;\n <figure class=""><img src="https://i.ibb.co/7tzsvWm/2023-06-15-20-48-05.png" alt="Мой корявый городок"><figcaption>Мой корявый городок</figcaption></figure></li>\n<li><a href="https://layer3.xyz/?ref=OQ8Q">Layer3</a> - ИМХО, лучший из доступных сейчас вариантов, содержит множество квестов затрагивающих различные проекты (дропы от всех этих проектов тоже исключать нельзя, иначе зачем они привлекают аудиторию) которые отлично прогревают кошелек. Есть фильтры по сетям. В награды раздают абстрактную экспу, с которой потом можно потешить ЧСВ. Реже встречаются наградные НФТ, некоторые из которых весьма успешно торгуются на <a href="https://opensea.io/collection/layer3">OpenSea</a>. Так же есть простые социальные квесты или викторины, кошелек они не прогревают, но XP подзаработать можно. Задания с репостами и лайками в Twitter почти всегда можно пропустить, чтобы не замусоривать личный аккаунт.</li>\n</ul>\n<ol start="4">\n<li>Голосования в DAO</li>\n</ol>\n<p>Большая часть доступных сейчас токенов имеют свое основное ютилити - вес голоса в DAO. Известен по крайней мере один случай, когда участие в такого вида демократии служило критерием дропа. Голосования бывают на разные темы и на разных площадках, вот основные из них: <a href="https://snapshot.org/">snapshot</a>, <a href="https://www.tally.xyz/">tally</a>. <br>\n5. Soulbound Tokens или токены идентификации и сертификаты<br>\nЭто непередаваемые токены выпускаемые большой площадкой, вроде Binance (BAB-token) или упомянутый выше  <a href="https://galxe.com/">galxe</a> (galxe паспорт). Для получения такого НФТ придется пройти KYC процедуру, т.е. показать паспорт и лицо в камеру. Если для вас это неприемлемо можете попробовать, например, заполучить <a href="https://degenscore.com/beacon">DegenScore Beacon SBT</a>, это дорого (не менее 400$), но открывает много приятных перспектив. Получение любых других SBT, например, бейджей <a href="https://app.voltz.xyz/#/welcome?invitedBy=GlZZcXXu">Voltz</a> или  <a href="http://app.sismo.io">Sismo</a> тоже сделают ваш кошелек живее и реалистичнее.<br>\n6. Участие в Gitcoin и актуализация gitcoin passport<br>\n<a href="https://www.gitcoin.co/">Gitcoin</a> - платформа для со финансирования различных блокчейн разработок и инициатив. Как правило, дважды в год они запускают двухнедельный раунд в ходе которого можно закинуть копеечку понравившимся вам проектам. Кроме того, что проекты, если доживают до выхода в продакшн, любят вознаградить своих спонсоров это еще и однозначный плюс в ончейн и офчейн карму. Для донатов потребуется определенный score <a href="https://passport.gitcoin.co/#/dashboard">Gitcoin pasport</a> (место где можно связать все свои социальные сети и кошелек в один неразделимый “документ”). Сейчас порог небольшой, получить его весьма легко. Думаю, со временем порог поднимут, а определенный уровень будет необходим для получения будущих ретродропов. Некоторые проекты уже сейчас просят предъявлять  паспорт со значением 20+ даже для доступа к тестнету.</p>\n<h1 id="Kak-vybirat-proekty"><a href="#Kak-vybirat-proekty">Как выбирать проекты</a></h1>\n<p>Тут у меня нет однозначного ответа, но при выборе не лишним будет:</p>\n<ul>\n<li>изучить Twitter проекта, подписки и активности в нем;</li>\n<li>изучить активность в Discord проекта (если ее нет, или она на уровне gm-gn, а в ветке Announcement пустовато - то, возможно, и проекта никакого на самом деле нет);</li>\n<li>изучить кто, сколько и когда <a href="https://www.crunchbase.com/">инвестировал в проект</a> (хорошим признаком является присутствие среди инвесторов <a href="https://twitter.com/janehk">a16z</a>, <a href="https://labs.binance.com/">Binance Labs</a>, <a href="https://www.animocabrands.com/">Animoca Brands</a> и т.д.);</li>\n<li>изучить кто пользуется проектом и насколько активно, тут вам могут помочь такие инструменты как <a href="dune.com">Dune</a>, <a href="https://debank.com/profile/0x9026a229b535ecf0162dfe48fdeb3c75f7b2a7ae?t=1686832835984&amp;r=34552">DeBank</a>, <a href="https://platform.arkhamintelligence.com/waitlist?referrer=a2RheDEyLmV0aEBtYWlsMy5tZQ">Arkhami</a> или поискать в <a href="https://t.me/c/1403326900/1/32797">наших чатах</a>;</li>\n</ul>\n<p><figure class=""><img src="https://i.ibb.co/nRjk3Gf/2023-06-15-20-39-45.png" alt="Дашборд со статистикой по самому ожидаемому на данный момент ретродропу"><figcaption>Дашборд со статистикой по самому ожидаемому на данный момент ретродропу</figcaption></figure></p>\n<ul>\n<li>если на github доступен код, то можно по изучать и его на предмет упоминания токена;</li>\n<li>если смотреть только в разрезе ретродропа, то не так уж и важно полезен ли разрабатываемый продукт, насколько он нужен и имеет ли смысл выпускать токен, т.к. любая команда стремится выйти на рынок и заработать, а потом уже можно и закрываться. Не имеет смысла и доверять заявлениям команды и CEO о том, что никакого токена, а уж, тем более, его раздачи не предвидится.</li>\n</ul>\n<p>Если самостоятельным анализом заниматься не хочется можно опуститься на дно Tg каналов по теме, информация там циркулирует примерно одна и та же, не зависимо от автора.</p>\n<h1 id="Proekt-vybran-chto-dalsh"><a href="#Proekt-vybran-chto-dalsh">Проект выбран, что дальше</a></h1>\n<p>Все просто: нужно оставить как можно более очевидный след в проекте и пользоваться им, причем периодическое использование на протяжении нескольких месяцев лучше, чем много транзакций в один день. Полезно бывает написать багрепорт или установить ноду если у вас есть на это время и желание. Следим за соцсетями проекта и ключевых членов команды (возможно не только оповещение о дропе или снепшоте для него, но и какие-то дополнительные активности). Если забивать ленту многими источниками не сильно хочется можно использовать, например, <a href="https://t.me/crypton_research_bot">этот бот</a> подписавшись на интересные проекты.</p>\n<p>Остается только дождаться дропа (можно периодически проверять сервисы вроде <a href="https://www.daylight.xyz/">daylight</a> или <a href="https://earni.fi/">earn.fi</a>) и грамотно его продать, но тут я совсем не советчик, это к трейдерам.</p>\n<h1 id="Kapelka-lichnogo-opyta"><a href="#Kapelka-lichnogo-opyta">Капелька личного опыта</a></h1>\n<p>За последние пол года я получил порядка 10 дропов разного размера, но все перекрыл Arbitrum, вот критерии, все по максимуму, кроме объемов, получено 4000 ARB, и это я еще не очень ранний пользователь, многие начинали активности два года назад:<br>\n<figure class=""><img src="https://i.ibb.co/PzSTLBS/2023-06-15-16-22-06.png" alt="Поздравления от Arbitrum"><figcaption>Поздравления от Arbitrum</figcaption></figure></p>\n<p>При этом минимальный критерий - хотя бы одна транзакция через официальный мост мог принести ~600 ARB. Большую часть я пока что не продал, а то что продал понемногу трачу на другие интересные мне активности.</p>\n<p>В заключении обещанный список не реферальных ссылок:<br>\n<a href="https://link3.to/">Link3</a> - платформа с WEST</p>\n<p><a href="https://layer3.xyz/">Layer3</a> - платформа с квестами и лидербордом</p>\n<p><a href="https://app.voltz.xyz/">Voltz</a> - площадка на которой можно славно пожечь эфир в обмен на SBT</p>\n<p><a href="https://debank.com/">Debank</a> - удобный способ следить за всеми активами во всех сетях на вашем/чужом кошельке</p>\n<p><a href="https://platform.arkhamintelligence.com/">Arkham</a> - удобный способ следить за движениями средств и связями кошельков</p>\n<p>Если у вас остались вопросы/предложения/замечания или нужна АМА сессия в клубе по этой теме - жду вас в комментариях. Там же предлагаю делиться перспективными, с вашей точки зрения проектами.</p>	\N	\N	{"badges": {"cool": {"count": 1, "title": "ОХУЕННО", "description": "Вот такой контент я хочу видеть в Клубе!"}}}	2023-06-16 10:18:07.714616+00	2023-06-16 10:25:00.505466+00	2023-06-16 12:13:56.264759+00	1	4	4	t	t	t	f	t	\N	90baa9ef-91c0-4b6b-9ac5-a2273cc1b848	\N	f	2023-06-16 10:18:22.612143+00	\N	0	\N	{}	\N	\N
