eaa7b939-db37-4c54-b27d-fe6568ffe6d7	13	guide	Клубный Путеводитель: Гаага	Если вам поднадоел переполненный туристами Амстердам, добро пожаловать в Гаагу, трамвайный рай урбанистов, место рождения теннисного корта и просто чудесный город, где деревьев пока больше, чем мясных жителей!\r\n![](https://i.vas3k.club/2d0a05c0ed4ef4eeea86f330f538729d7f807dac9957c6cbbba01fe90c456053.jpg)\r\n# Карта города\r\n![](https://i.vas3k.club/8b6e15ed860fe0fa3ae5ce578fb54b073d6fb1505db81132d85aed0e31a1c0c0.jpg)\r\nКак вы уже заметили, в Гааге вас ждет 11 км песчаных пляжей, по которым можно бегать голеньким.\r\n# Основная информация\r\n- **Валюта**: Евро\r\n- **Население**: 515 тыс\r\n- **Визы**: Шенген / ВНЖ\r\n- **Когда лучше всего приезжать?** Только не зимой, ибо ветер. Летом, если в вашем списке активностей есть пляжный отдых, водный спорт или ночные поиски sea sparkle; Весна и осень комфортны для кофейных туров и музейной программы.\r\n- **Что обязательно взять с собой?** Летом spf, в остальное время года windproof дождевик и термокружку. И надо всегда быть луковкой, чтобы в случае изменения погодных условий скинуть пару слоев одежды или же укутать тушку от ветра и спокойно наслаждаться видами. \r\n- **Как лучше добраться из аэропорта?** Приобрести анонимную OV-chipkaart (уже не так нужна в 2023, за проезд можно платить обычной картой Visa/Mastercard) и запрыгнуть в поезд, направление Den Haag Centraal, детали можно посмотреть в приложении NS. Детально описывать не буду, скорее всего Гаага не будет вашим первым городом в Нидерландах, поэтому лучше начать с [гайда по Амстердаму](https://https://vas3k.club/guide/11740/).\r\n- **Как лучше перемещаться по городу?** Велосипед (будет спокойнее и живописнее, чем в Амстердаме, т.к. Гаага в топе зеленых городов в Нидерландах), трамвай к пляжу, автобусы.\r\n- **Есть ли доставка еды?** Uber Eats, Deliveroo, все стандартно, как и в других частях страны. Из сервисов доставки продуктов люблю Gorillas.\r\n- **Какую купить туристическую симку?** Любая европейская симка должна работать без роуминга. Если вы из других мест, то KPN, Lebara.\r\n- **Можно ли везде платить картой?** Да.\r\n- **Можно ли пить воду из крана?** Да.\r\n- **Главные супермаркеты для еды?** Albert Heijn, Jumbo, последний предпочтительнее, если у вас не Maestro.\r\n- **Говорят ли люди на улице по-английски?** Да.\r\n- **Что нужно 100% увидеть и попробовать?** Музей Эшера, пляж. \r\n- **Чего остерегаться?** Как и в любой точке Нидерландов, велосипедистов и переулков, из которых они внезапно вылетают на пешеходов.  \r\n- **Сколько в среднем стоит 1 шаурма?** 6-10 евро.\r\n# Основной маршрут туриста\r\n- Приехать на Den Haag Centraal и порадоваться тому, как оптимально голландцы перестроили здание вокзала.\r\n![](https://i.vas3k.club/7be43c2963999381d34c074e35f60f3a6a81135dfae0bc884ad4095c5b146c83.jpg)\r\n- Прогуляться по району de Resident (в котором все самое высокое), рассматривая спрятанные в кустах и между домами скульптуры (например, есть такой польский скульптор Игорь Миторай, несколько его работ можно найти в городе и в том числе в этом районе).\r\n![](https://i.vas3k.club/bd3c45f144a98c6fb97f0f35d8df478b9fb80b0fe9c051ad2a970297f8003151.jpg)\r\n- Сходить в музей Эшера и в крошечный Эрмитаж, от которого не устаешь - Mauritshuis (Маурицхёйс). Обычно я дозирую музеи, чтобы не смешивать впечатления, но в данном случае это хорошее комбо, особенно если вы на один день. \r\n- Пройти мимо Binnenhof через площадь Plein, там сидит премьер-министр и всякие важные люди в костюмах. Там красиво и пахнет историей.\r\n- Прогуляться по Hoogstraat и поглазеть на Noordeinde Palace, один из дворцов королевской семьи, в него даже можно попасть на экскурсию. Завернуть на пикник в королевский сад по другую сторону улицы.\r\n ![](https://i.vas3k.club/9d2eb41aab1cc6086778ee11e1065cb73891ed7114ed10525f90472134891198.jpg)\r\n- Дойти до Peace Palace, горько выдохнуть у вечного огня мира и сесть в трамвай по направлению к пляжу.\r\n![](https://i.vas3k.club/925b90fb396a4e6e12bc8e63d1a6a9de07c4e3a8f5afb133e59908811d532b2d.jpg)\r\n- Если вы с детьми, возможно вам лучше свернуть в парк миниатюр [Madurodam](https://www.madurodam.nl/ru). \r\n- А если вы любите современное искусство, вам в [Kunstmuseum](https://www.kunstmuseum.nl/nl), сейчас там Муха и Мондриан.\r\n- Выйти на остановке возле Kurhaus и погулять вокруг.\r\n![](https://i.vas3k.club/4a22f1274a6437b55ea3db08f200c7c1c3ada52814f83dbc377b108185c8b525.jpg)\r\n- Наткнуться на "fairy tale pictures to the sea" от Тома Оттернеса и сказать спасибо частным коллекционерам Гааги, делающим такие классные выставки под открытым небом.\r\n![](https://i.vas3k.club/703dccef8836211b5265151cf153497a80dc597b4b2e152f216de7fd5dc2ed83.jpg)\r\n\r\n# «Нетуристические» маршруты\r\n#### Night beach tour\r\nСпешите на поиски sea sparkle (это такая люминисцирующая одноклеточная водоросль), совсем скоро она повзрослеет и перестанет светиться. Лучше выбирать дни, когда нет ветра и тепло, выезжать на велосипедах к полуночи или даже позднее. \r\n![](https://i.vas3k.club/6203bc5338c4295334c12217ce021d80fcd4844e8e44104a5eb4a51193f23851.jpg)\r\n#### Серфинг\r\nВ Гааге довольно много серфинг школ, где выдают все необходимое для занятий. Разовое занятие стоит от 30 евро, есть форматы ретритов, где вы целыми днями серфите, йожите, кушаете и строите замки из песка или танцуете, например [здесь](https://tashasurfcamp.bookinglayer.com/en/product/surfcamp-scheveningen-1). От себя могу добавить, что даже часовое занятие серфингом незаметно откусывает почти весь день, поэтому если решите заниматься чем-то подобным, то лучше не планировать ничего важного в серф дни.\r\n#### [Найти "памятник" Сталину](https://www.wikiwand.com/ru/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD%D1%83_(%D0%93%D0%B0%D0%B0%D0%B3%D0%B0))\r\nИ узнать, кто был звездой гаагской улицы красных фонарей.\r\n![](https://i.vas3k.club/a5615b0454bf5f3426966596593c115dfcd109a69218dc6bdbced6b736992993.jpg)\r\n#### Bungy Jumping / Zip Line\r\nНа пирсе Scheveningen можно не только покататься на колесе обозрения, но и [попрыгать](https://www.bungy.nl/en/) и поделать [вжунь](https://www.pier.nl/company/zipline-de-pier/).\r\n#### [Louwman Museum](https://www.louwmanmuseum.nl/)\r\nПоглазеть и пощупать историю через коллекцию автомобилей, автобусов и мотоциклов.\r\n### Прогулки / велотур по лесам и дюнам\r\nДля меня Гаага это\r\n![](https://i.vas3k.club/0affe8ea3ec5d27c0edb4e55be7059761adc8b62a5ef9d5920670dccf0afd73e.jpg)\r\nНачнем с Scheveningse Bosjes. Здесь есть тропы для бега/прогулок, конного спорта и велосипедов и приятно, что у всех получается не мешать друг другу. При входе в лесопарк есть детская площадка, по всей территории время от времени попадаются лавочки и фонтанчики с водой. Однако я бы не советовала гулять здесь одиноким особам поздним вечером, даже если вы возвращаетесь с пляжа и это самый короткий путь. :)\r\n\r\nHaagse Bos - знаменитый лес в 5 минутах ходьбы от Central station. Начинается он с Koekamp, местечка, где живут олени, аисты, и куда приходят тусоваться нильские гуси. В 16 веке после процедента с вырубкой деревьев один дядя сказал, что не надо больше трогать лес, и с тех пор никто не трогал лес. Даже нацистские войска некогда пускали ракеты из этого леса, но не трогали сам лес.\r\n\r\nПарк Clingendael с японским садом, который всегда закрыт. Говорят,  там настолько красиво, что краснокнижные птицы вьют в нем гнезда, и сотрудникам приходится закрывать всю территорию от  посетителей, чтобы молодые родители могли вырастить как можно больше птенчиков.\r\n\r\n Zorgvliet - платный парк для одного человека, который сидит на лавочке у входа и спрашивает у вас билет :) Буду рада, если кто-то из гаагчан расскажет, в чем особенность этого места.\r\n \r\n Налево от Scheveningen\r\n Westduinpark - не только кататься на велосипеде, но серфить, купаться или просто ходить голеньким. Еще можно искать и находить шотландских коровок.\r\n  ![](https://i.vas3k.club/ea085ed8bec087f2a7721c2ae238ee224472506c9409eb3ecbaa0dad4fb91b5f.jpg)\r\n![](https://i.vas3k.club/3bb0fd7f386ace817abc37f05ffe5d75bc94113d98c6221d01c162fbe1763604.jpg)\r\n\r\nНаправо от Scheveningen\r\nOostduinpark -  делать все то же самое, только кажется поближе к общественному транспорту (а вдруг вы как и я боитесь кататься на велосипеде и везде ходите пешком) и вместо коровок будут зайцы. \r\n![](https://i.vas3k.club/87e72b286d02efe86dd67107f55918a2ef0cb3775f2c046f0f47f0873dce97da.jpg)\r\n# Где и что поесть/выпить?\r\nДисклеймер: я не дружу с sandwich culture, поэтому подборка не включает в себя места, где можно попробовать основную местную еду.\r\n\r\n Топовые фалафельные:\r\n[Shakshuka](https://goo.gl/maps/hTX6Pusnozhfmg8J8)\r\n[Falafel en Hummus](https://goo.gl/maps/FSWVhmjDbKeycUdD9)\r\n[Hummus Den Haag](https://goo.gl/maps/wxAWF2zaFrQDjjfw9)\r\n\r\nSeafood:\r\n[Coast Fish](https://goo.gl/maps/jR5Cpicw8CjjUJQW7)\r\n[Hendriks Fish & Drinks](https://goo.gl/maps/9kxWj3o8SUuYaKfx8)\r\n[Simonis aan de Haven](https://maps.app.goo.gl/TuZyLEp2jQfuwTg39)\r\n\r\nСуши:\r\n[Ohmu sushi](https://goo.gl/maps/LkgE21Rc7TshcNHv8)\r\n[Samurice](https://goo.gl/maps/z9HLSDjaVjqA1rvb7)\r\n[NOH](https://goo.gl/maps/UHTJHnn2gSPZnPaZ6)\r\n\r\nЭтим летом довольно жарко, пригодится мороженка:\r\n[Het IJskabinet](https://goo.gl/maps/7ddvBu7RkVVYRw4A7)\r\n[Piet Artisans of Flavour](https://goo.gl/maps/4qZfrA61SmS9cEHd6)\r\n\r\n[Список топовых кофеен от Вали](https://t.me/gaagaradio/252) (наш любимый гаагский гид)\r\n [DuckRabbit Coffee Brewers](https://maps.app.goo.gl/nDUFNSxtAtvm85Ry7?g_st=ic)\r\n[Bartine Bakery](https://goo.gl/maps/VgAnJTUCmoZnVWC1A) с космическими круассанами и атмосферой Франции\r\n\r\nПодвергнуться мукам выбора в Foodhallen в [центре](https://goo.gl/maps/XvACj7hcorTiE3PUA) или на [пляже](https://goo.gl/maps/nqfTPtEJszmTq1pu8)\r\n\r\nПо остальным категориям включая бары прошу помощь зала или можно обратиться к этому [ресурсу](https://34travel.me/post/gaaga), например.\r\n# Где затусить вечером?\r\nВстретить закат на побережье\r\n![](https://i.vas3k.club/fdef0fc3ab64215cd51c76b4f77b3c67b83a280b8358cba3e6c01e4b5a243989.jpg)\r\n#  Что можно купить чтобы увезти с собой\r\n- Haagsche hopjes - кофейные карамельки, названные в честь барона, который по легенде так любил кофе, что даже когда ему по состоянию здоровья запретили его пить, нашел способ обойти запрет, попросив своего кондитера смешать  кофе, сахар и сливки в ароматную сладкую массу, которая и положила начало производству конфет, ставших известными в королевских дворах по всему миру. (Так что теперь вы знаете, с чем мог пить чай Александр II перед тем как отправиться на роковую воскресную прогулку).\r\n![](https://i.vas3k.club/87a21adbfebb97bbf32821e965f61416a170813a5a66ec24228426495ccdaa87.jpg)\r\n- Уточку с жемчужной серёжкой для одинокого друга айтишника.\r\n![](https://i.vas3k.club/2e6824ec1b6f9f3e2a6c2225b96a7dd011ac052e4202d27e953a35aaf17dc80d.jpg)\r\n-  Местный шоколад из [De Bonte Koe](https://debontekoe.nl/), магазины есть в нескольких локациях в центре\r\n#  Бонус для местных\r\nhttps://t.me/+AhMfbD4D7OA4OGM0 - Книжный клуб в Гааге\r\nhttps://suhumi.nl/ - Вкуснейшая грузинская еда	<p>Если вам поднадоел переполненный туристами Амстердам, добро пожаловать в Гаагу, трамвайный рай урбанистов, место рождения теннисного корта и просто чудесный город, где деревьев пока больше, чем мясных жителей!<br>\n<figure class=""><img src="https://i.vas3k.club/2d0a05c0ed4ef4eeea86f330f538729d7f807dac9957c6cbbba01fe90c456053.jpg" alt=""></figure></p>\n<h1 id="Karta-goroda"><a href="#Karta-goroda">Карта города</a></h1>\n<p><figure class=""><img src="https://i.vas3k.club/8b6e15ed860fe0fa3ae5ce578fb54b073d6fb1505db81132d85aed0e31a1c0c0.jpg" alt=""></figure><br>\nКак вы уже заметили, в Гааге вас ждет 11 км песчаных пляжей, по которым можно бегать голеньким.</p>\n<h1 id="Osnovnaia-informatsiia"><a href="#Osnovnaia-informatsiia">Основная информация</a></h1>\n<ul>\n<li><strong>Валюта</strong>: Евро</li>\n<li><strong>Население</strong>: 515 тыс</li>\n<li><strong>Визы</strong>: Шенген / ВНЖ</li>\n<li><strong>Когда лучше всего приезжать?</strong> Только не зимой, ибо ветер. Летом, если в вашем списке активностей есть пляжный отдых, водный спорт или ночные поиски sea sparkle; Весна и осень комфортны для кофейных туров и музейной программы.</li>\n<li><strong>Что обязательно взять с собой?</strong> Летом spf, в остальное время года windproof дождевик и термокружку. И надо всегда быть луковкой, чтобы в случае изменения погодных условий скинуть пару слоев одежды или же укутать тушку от ветра и спокойно наслаждаться видами.</li>\n<li><strong>Как лучше добраться из аэропорта?</strong> Приобрести анонимную OV-chipkaart (уже не так нужна в 2023, за проезд можно платить обычной картой Visa/Mastercard) и запрыгнуть в поезд, направление Den Haag Centraal, детали можно посмотреть в приложении NS. Детально описывать не буду, скорее всего Гаага не будет вашим первым городом в Нидерландах, поэтому лучше начать с <a href="https://https://vas3k.club/guide/11740/">гайда по Амстердаму</a>.</li>\n<li><strong>Как лучше перемещаться по городу?</strong> Велосипед (будет спокойнее и живописнее, чем в Амстердаме, т.к. Гаага в топе зеленых городов в Нидерландах), трамвай к пляжу, автобусы.</li>\n<li><strong>Есть ли доставка еды?</strong> Uber Eats, Deliveroo, все стандартно, как и в других частях страны. Из сервисов доставки продуктов люблю Gorillas.</li>\n<li><strong>Какую купить туристическую симку?</strong> Любая европейская симка должна работать без роуминга. Если вы из других мест, то KPN, Lebara.</li>\n<li><strong>Можно ли везде платить картой?</strong> Да.</li>\n<li><strong>Можно ли пить воду из крана?</strong> Да.</li>\n<li><strong>Главные супермаркеты для еды?</strong> Albert Heijn, Jumbo, последний предпочтительнее, если у вас не Maestro.</li>\n<li><strong>Говорят ли люди на улице по-английски?</strong> Да.</li>\n<li><strong>Что нужно 100% увидеть и попробовать?</strong> Музей Эшера, пляж.</li>\n<li><strong>Чего остерегаться?</strong> Как и в любой точке Нидерландов, велосипедистов и переулков, из которых они внезапно вылетают на пешеходов.</li>\n<li><strong>Сколько в среднем стоит 1 шаурма?</strong> 6-10 евро.</li>\n</ul>\n<h1 id="Osnovnoi-marshrut-turista"><a href="#Osnovnoi-marshrut-turista">Основной маршрут туриста</a></h1>\n<ul>\n<li>Приехать на Den Haag Centraal и порадоваться тому, как оптимально голландцы перестроили здание вокзала.</li>\n</ul>\n<p><figure class=""><img src="https://i.vas3k.club/7be43c2963999381d34c074e35f60f3a6a81135dfae0bc884ad4095c5b146c83.jpg" alt=""></figure></p>\n<ul>\n<li>Прогуляться по району de Resident (в котором все самое высокое), рассматривая спрятанные в кустах и между домами скульптуры (например, есть такой польский скульптор Игорь Миторай, несколько его работ можно найти в городе и в том числе в этом районе).</li>\n</ul>\n<p><figure class=""><img src="https://i.vas3k.club/bd3c45f144a98c6fb97f0f35d8df478b9fb80b0fe9c051ad2a970297f8003151.jpg" alt=""></figure></p>\n<ul>\n<li>Сходить в музей Эшера и в крошечный Эрмитаж, от которого не устаешь - Mauritshuis (Маурицхёйс). Обычно я дозирую музеи, чтобы не смешивать впечатления, но в данном случае это хорошее комбо, особенно если вы на один день.</li>\n<li>Пройти мимо Binnenhof через площадь Plein, там сидит премьер-министр и всякие важные люди в костюмах. Там красиво и пахнет историей.</li>\n<li>Прогуляться по Hoogstraat и поглазеть на Noordeinde Palace, один из дворцов королевской семьи, в него даже можно попасть на экскурсию. Завернуть на пикник в королевский сад по другую сторону улицы.</li>\n</ul>\n<p><figure class=""><img src="https://i.vas3k.club/9d2eb41aab1cc6086778ee11e1065cb73891ed7114ed10525f90472134891198.jpg" alt=""></figure></p>\n<ul>\n<li>Дойти до Peace Palace, горько выдохнуть у вечного огня мира и сесть в трамвай по направлению к пляжу.</li>\n</ul>\n<p><figure class=""><img src="https://i.vas3k.club/925b90fb396a4e6e12bc8e63d1a6a9de07c4e3a8f5afb133e59908811d532b2d.jpg" alt=""></figure></p>\n<ul>\n<li>Если вы с детьми, возможно вам лучше свернуть в парк миниатюр <a href="https://www.madurodam.nl/ru">Madurodam</a>.</li>\n<li>А если вы любите современное искусство, вам в <a href="https://www.kunstmuseum.nl/nl">Kunstmuseum</a>, сейчас там Муха и Мондриан.</li>\n<li>Выйти на остановке возле Kurhaus и погулять вокруг.</li>\n</ul>\n<p><figure class=""><img src="https://i.vas3k.club/4a22f1274a6437b55ea3db08f200c7c1c3ada52814f83dbc377b108185c8b525.jpg" alt=""></figure></p>\n<ul>\n<li>Наткнуться на &quot;fairy tale pictures to the sea&quot; от Тома Оттернеса и сказать спасибо частным коллекционерам Гааги, делающим такие классные выставки под открытым небом.</li>\n</ul>\n<p><figure class=""><img src="https://i.vas3k.club/703dccef8836211b5265151cf153497a80dc597b4b2e152f216de7fd5dc2ed83.jpg" alt=""></figure></p>\n<h1 id="Neturisticheskie-marshru"><a href="#Neturisticheskie-marshru">«Нетуристические» маршруты</a></h1>\n<h4 id="Night-beach-tour"><a href="#Night-beach-tour">Night beach tour</a></h4>\n<p>Спешите на поиски sea sparkle (это такая люминисцирующая одноклеточная водоросль), совсем скоро она повзрослеет и перестанет светиться. Лучше выбирать дни, когда нет ветра и тепло, выезжать на велосипедах к полуночи или даже позднее. <br>\n<figure class=""><img src="https://i.vas3k.club/6203bc5338c4295334c12217ce021d80fcd4844e8e44104a5eb4a51193f23851.jpg" alt=""></figure></p>\n<h4 id="Serfing"><a href="#Serfing">Серфинг</a></h4>\n<p>В Гааге довольно много серфинг школ, где выдают все необходимое для занятий. Разовое занятие стоит от 30 евро, есть форматы ретритов, где вы целыми днями серфите, йожите, кушаете и строите замки из песка или танцуете, например <a href="https://tashasurfcamp.bookinglayer.com/en/product/surfcamp-scheveningen-1">здесь</a>. От себя могу добавить, что даже часовое занятие серфингом незаметно откусывает почти весь день, поэтому если решите заниматься чем-то подобным, то лучше не планировать ничего важного в серф дни.</p>\n<h4 id="a-href-https-www-wik"><a href="#a-href-https-www-wik"><a href="https://www.wikiwand.com/ru/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD%D1%83_(%D0%93%D0%B0%D0%B0%D0%B3%D0%B0)">Найти &quot;памятник&quot; Сталину</a></a></h4>\n<p>И узнать, кто был звездой гаагской улицы красных фонарей.<br>\n<figure class=""><img src="https://i.vas3k.club/a5615b0454bf5f3426966596593c115dfcd109a69218dc6bdbced6b736992993.jpg" alt=""></figure></p>\n<h4 id="Bungy-Jumping-Zip-Line"><a href="#Bungy-Jumping-Zip-Line">Bungy Jumping / Zip Line</a></h4>\n<p>На пирсе Scheveningen можно не только покататься на колесе обозрения, но и <a href="https://www.bungy.nl/en/">попрыгать</a> и поделать <a href="https://www.pier.nl/company/zipline-de-pier/">вжунь</a>.</p>\n<h4 id="a-href-https-www-lou"><a href="#a-href-https-www-lou"><a href="https://www.louwmanmuseum.nl/">Louwman Museum</a></a></h4>\n<p>Поглазеть и пощупать историю через коллекцию автомобилей, автобусов и мотоциклов.</p>\n<h3 id="Progulki-velotur-po-le"><a href="#Progulki-velotur-po-le">Прогулки / велотур по лесам и дюнам</a></h3>\n<p>Для меня Гаага это<br>\n<figure class=""><img src="https://i.vas3k.club/0affe8ea3ec5d27c0edb4e55be7059761adc8b62a5ef9d5920670dccf0afd73e.jpg" alt=""></figure><br>\nНачнем с Scheveningse Bosjes. Здесь есть тропы для бега/прогулок, конного спорта и велосипедов и приятно, что у всех получается не мешать друг другу. При входе в лесопарк есть детская площадка, по всей территории время от времени попадаются лавочки и фонтанчики с водой. Однако я бы не советовала гулять здесь одиноким особам поздним вечером, даже если вы возвращаетесь с пляжа и это самый короткий путь. :)</p>\n<p>Haagse Bos - знаменитый лес в 5 минутах ходьбы от Central station. Начинается он с Koekamp, местечка, где живут олени, аисты, и куда приходят тусоваться нильские гуси. В 16 веке после процедента с вырубкой деревьев один дядя сказал, что не надо больше трогать лес, и с тех пор никто не трогал лес. Даже нацистские войска некогда пускали ракеты из этого леса, но не трогали сам лес.</p>\n<p>Парк Clingendael с японским садом, который всегда закрыт. Говорят,  там настолько красиво, что краснокнижные птицы вьют в нем гнезда, и сотрудникам приходится закрывать всю территорию от  посетителей, чтобы молодые родители могли вырастить как можно больше птенчиков.</p>\n<p>Zorgvliet - платный парк для одного человека, который сидит на лавочке у входа и спрашивает у вас билет :) Буду рада, если кто-то из гаагчан расскажет, в чем особенность этого места.</p>\n<p>Налево от Scheveningen<br>\n Westduinpark - не только кататься на велосипеде, но серфить, купаться или просто ходить голеньким. Еще можно искать и находить шотландских коровок.<br>\n  <figure class=""><img src="https://i.vas3k.club/ea085ed8bec087f2a7721c2ae238ee224472506c9409eb3ecbaa0dad4fb91b5f.jpg" alt=""></figure><br>\n<figure class=""><img src="https://i.vas3k.club/3bb0fd7f386ace817abc37f05ffe5d75bc94113d98c6221d01c162fbe1763604.jpg" alt=""></figure></p>\n<p>Направо от Scheveningen<br>\nOostduinpark -  делать все то же самое, только кажется поближе к общественному транспорту (а вдруг вы как и я боитесь кататься на велосипеде и везде ходите пешком) и вместо коровок будут зайцы. <br>\n<figure class=""><img src="https://i.vas3k.club/87e72b286d02efe86dd67107f55918a2ef0cb3775f2c046f0f47f0873dce97da.jpg" alt=""></figure></p>\n<h1 id="Gde-i-chto-poest-vypit"><a href="#Gde-i-chto-poest-vypit">Где и что поесть/выпить?</a></h1>\n<p>Дисклеймер: я не дружу с sandwich culture, поэтому подборка не включает в себя места, где можно попробовать основную местную еду.</p>\n<p>Топовые фалафельные:<br>\n<a href="https://goo.gl/maps/hTX6Pusnozhfmg8J8">Shakshuka</a><br>\n<a href="https://goo.gl/maps/FSWVhmjDbKeycUdD9">Falafel en Hummus</a><br>\n<a href="https://goo.gl/maps/wxAWF2zaFrQDjjfw9">Hummus Den Haag</a></p>\n<p>Seafood:<br>\n<a href="https://goo.gl/maps/jR5Cpicw8CjjUJQW7">Coast Fish</a><br>\n<a href="https://goo.gl/maps/9kxWj3o8SUuYaKfx8">Hendriks Fish &amp; Drinks</a><br>\n<a href="https://maps.app.goo.gl/TuZyLEp2jQfuwTg39">Simonis aan de Haven</a></p>\n<p>Суши:<br>\n<a href="https://goo.gl/maps/LkgE21Rc7TshcNHv8">Ohmu sushi</a><br>\n<a href="https://goo.gl/maps/z9HLSDjaVjqA1rvb7">Samurice</a><br>\n<a href="https://goo.gl/maps/UHTJHnn2gSPZnPaZ6">NOH</a></p>\n<p>Этим летом довольно жарко, пригодится мороженка:<br>\n<a href="https://goo.gl/maps/7ddvBu7RkVVYRw4A7">Het IJskabinet</a><br>\n<a href="https://goo.gl/maps/4qZfrA61SmS9cEHd6">Piet Artisans of Flavour</a></p>\n<p><a href="https://t.me/gaagaradio/252">Список топовых кофеен от Вали</a> (наш любимый гаагский гид)<br>\n <a href="https://maps.app.goo.gl/nDUFNSxtAtvm85Ry7?g_st=ic">DuckRabbit Coffee Brewers</a><br>\n<a href="https://goo.gl/maps/VgAnJTUCmoZnVWC1A">Bartine Bakery</a> с космическими круассанами и атмосферой Франции</p>\n<p>Подвергнуться мукам выбора в Foodhallen в <a href="https://goo.gl/maps/XvACj7hcorTiE3PUA">центре</a> или на <a href="https://goo.gl/maps/nqfTPtEJszmTq1pu8">пляже</a></p>\n<p>По остальным категориям включая бары прошу помощь зала или можно обратиться к этому <a href="https://34travel.me/post/gaaga">ресурсу</a>, например.</p>\n<h1 id="Gde-zatusit-vecherom"><a href="#Gde-zatusit-vecherom">Где затусить вечером?</a></h1>\n<p>Встретить закат на побережье<br>\n<figure class=""><img src="https://i.vas3k.club/fdef0fc3ab64215cd51c76b4f77b3c67b83a280b8358cba3e6c01e4b5a243989.jpg" alt=""></figure></p>\n<h1 id="Chto-mozhno-kupit-chtoby-u"><a href="#Chto-mozhno-kupit-chtoby-u">Что можно купить чтобы увезти с собой</a></h1>\n<ul>\n<li>Haagsche hopjes - кофейные карамельки, названные в честь барона, который по легенде так любил кофе, что даже когда ему по состоянию здоровья запретили его пить, нашел способ обойти запрет, попросив своего кондитера смешать  кофе, сахар и сливки в ароматную сладкую массу, которая и положила начало производству конфет, ставших известными в королевских дворах по всему миру. (Так что теперь вы знаете, с чем мог пить чай Александр II перед тем как отправиться на роковую воскресную прогулку).</li>\n</ul>\n<p><figure class=""><img src="https://i.vas3k.club/87a21adbfebb97bbf32821e965f61416a170813a5a66ec24228426495ccdaa87.jpg" alt=""></figure></p>\n<ul>\n<li>Уточку с жемчужной серёжкой для одинокого друга айтишника.</li>\n</ul>\n<p><figure class=""><img src="https://i.vas3k.club/2e6824ec1b6f9f3e2a6c2225b96a7dd011ac052e4202d27e953a35aaf17dc80d.jpg" alt=""></figure></p>\n<ul>\n<li>Местный шоколад из <a href="https://debontekoe.nl/">De Bonte Koe</a>, магазины есть в нескольких локациях в центре</li>\n</ul>\n<h1 id="Bonus-dlia-mestnykh"><a href="#Bonus-dlia-mestnykh">Бонус для местных</a></h1>\n<p><a href="https://t.me/+AhMfbD4D7OA4OGM0">https://t.me/+AhMfbD4D7OA4OGM0</a> - Книжный клуб в Гааге<br>\n<a href="https://suhumi.nl/">https://suhumi.nl/</a> - Вкуснейшая грузинская еда</p>	\N	\N	\N	2023-06-16 11:53:50.453009+00	2023-06-16 11:54:01.593208+00	2023-06-16 11:53:50.453025+00	0	0	1	t	t	f	t	t	\N	1c322fcb-fd78-4a72-ab00-044551906fda	\N	f	2023-06-16 11:54:01.499794+00	\N	0	\N	{}	\N	\N
2671754c-5c19-46e6-9a3c-1037f9f6db9d	18	post	Очень токсичный пост для бана	Однажды нам захотелось узнать, сталкиваются ли наши пользователи с какими-нибудь ошибками. Ведь тестировщики божатся, что все проверили, а саппорт еле разгребает завалы обращений. И все бы ничего, но обращения приходят такие: «У меня ничего не работает, горите все в аду». Такие баги мы в работу брать не можем, хочется какой-то конкретики.\r\n\r\nМы начали попытки замутить систему сбора ошибок еще до 2022 года, но уже тогда в в компании тусовались ребята с грозным названием офицеры информационной безопасности, которые на корню зарубили идею хранить логи в каких-то забугорных облаках. Бомбило у меня тогда знатно, но как-то изменить это решение не вышло. Решили пойти другим путем — разворачивать Sentry в режиме on-prem. От идеи, как говорится, до реализации — один шаг. Всего-то нужно было выделить время SRE и сервачок. Мы еще тогда не знали что шагать мы будем пару лет, но уже тогда почувствовали, что дело не быстрое, и надо искать варианты.\r\n\r\n# Первые костыли\r\nПерелопатив весь интернет мы так ничего и не нашли. В таких ситуациях на помощь пришел командный брейншторм: накидали кучу идиотских идей, просеяли через фильтр здравого смысла и обнаружили алмаз —  передавать кастомные параметры в Яндекс.Метрику. А с ней все в порядке - российская компания, на российских серверах будет хранить российские ошибки в российском продукте российских же пользователей. Ну и тем более инфа обезличенная, передаем только то, что падает в консоль. Ну почти.\r\n\r\nДля сбора ошибок рендеринга нам очень помогла фича реакта — Error Boundary. Мы обернули приложение в кастомную страничку с большой кнопкой "Обновить" и сожалениями. Пользователи перестали видеть белые экраны и писать в поддержку, а мы наконец получили первые боевые данные и стали понимать масштаб и природу проблем.\r\n\r\nКод выглядел примерно так:\r\n\r\n```\r\ncomponentDidCatch(error: Error, errorInfo: ErrorInfo) {\r\n\tconst analyticEvent = {\r\n\t\teventType: AnalyticEventType.UserError,\r\n\t\terrorName: error.name,\r\n\t\terrorMessage: error.message,\r\n\t\terrorDescription: errorInfo.componentStack,\r\n\t\terrorStack: error.stack,\r\n\t};\r\n\tanalyticsService.sendEvent(analyticEvent);\r\n}\r\n```\r\n\r\nКонечно, дебажить минифицированные логи было очень сложно, но какие-то критичные моменты мы все-таки находили и оперативно фиксили. Ну вот типа таких:\r\n![](https://i.vas3k.club/229d9e78f5760dc36e1a6764049177a6c70cc8dd059b200d6c7f9bd73c848134.jpg)\r\n\r\nПо графику понятно когда ошибка появилась, сколько пользователей аффектит и чего примерно искать в коде. По этому же графику можно понять пофиксили в релизе ошибку или нет. Очень удобно (нет).\r\n\r\nЧасть ошибок мы найти не могли и грезили о Sentry как о манне небесной и решении всех проблем. И вот этот день настал. Сервера включили, on-prem установили, архитектуру решения согласовали, аппрувы получили, осталось только интеграцию настроить, делов то. Но и без ограничений не обошлось.\r\n\r\nВеб-приложения и клиентская часть в частности — штука очень бесячая для службы информационной безопасности, ведь код в открытом виде получает каждый пользователь. Кошмар, кошмар. Был бы я ИБшником, я бы вообще запретил код на прод заливать. Хорошо, что я не они. И нам код в продакшен заливать разрешают. Пока что. Но только минифицированный. Никаких sourcemap'ов конечно же. Если уж хакерам и достается код, то пусть хоть мучаются с деминификацией. Правда отзывов от хакеров я не слышал, но вот дебажить на проде добрым разработчикам действительно тяжело. Плюсы тоже есть — очень мотивирует писать хороший код, который никогда на проде не ломается, и дебажить там нам не приходится.\r\n\r\n# Интеграция\r\nС такими вводными мы и пришли к интеграции с Sentry. Нужно чтобы в ней ошибки отображались как надо, но чтобы на проде исходники никто прочитать не мог.\r\n\r\nУ самой Sentry бизнес-модель очень понятная и прозрачная: они зарабатывают на хостинге логов и технической поддержке. Тут у меня родилась теория заговора, в рамках которой у Sentry ну просто обязана быть нормальная дока для внутреннего пользования, а для сообщества доступно то, что доступно. Так конверсия в платных пользователей выше.\r\n\r\nНо платить за границу во времена, когда никто не хочет брать российских денег, не наш вариант, ну и мы все-таки инженеры как никак, а не просто курсы по реакту окончили. Начали думать как нам решить эту задачу.\r\n![](https://i.vas3k.club/ac3e526ffaca313ac48d5f281f4f91521f9428f1f1108ee8a7f8c0fd08e2b630.jpg)\r\n\r\nПо-умолчанию, интеграция с Sentry очень простая. Она сама сходит и за .js и за .map файлами к вам на сервис и если их найдет, то все покажет как надо. Не наш вариант. Но если мы не хотим чтобы Sentry ходила к нам на сервер, то можем ей помочь, и залить в нее наши .map файлы. Тогда она будет брать их, и не будет ходить на сайт. То что нужно, жаль не работает.\r\n\r\nТочнее работает, но не так, как мы ожидали. Соурсмапы в JS  устроены следующим образом. Есть собственно сам файл мапы .map и есть минифицированный .js, в котором в конце есть директива\r\n```\r\n//# sourceMappingURL=script.min.js.map\r\n```\r\nИ вот по этой директиве собственно происходит метч между двумя этими файлами, чтобы восстановить в конце концов исходник.\r\n\r\nТак ошибка выглядит, когда соурсмапы не подтянулись:\r\n![Не на много лучше нашего костыля с Яндекс.Метрикой.](https://i.vas3k.club/bcc1bdb546c631ced1d8d15162293c2da72f76044268674d261e2590cebc138d.jpg)\r\n\r\n\r\nА так, когда подтянулись:\r\n![Извините за блур, не хочется тут наш идеальный код обсуждать, да и офицеры не дремлют. Надеюсь этот кусочек кода не несет угрозы национальной безопасности.](https://i.vas3k.club/a14be4cf980ae4fe5e5fb8d148249a48578d803e15230b2dc6d2508662f1c186.jpg)\r\n\r\n\r\nТак вот, мы придумали гениальный план: генерить билд с соурсмапами, грузить их в Sentry, а потом, перед деплоем, удалять. И все бы хорошо, но нам сразу завалило кибану 404 ошибками. А в девтулзах отсвечивало некрасивое:\r\n![](https://i.vas3k.club/4299af0faf15c52d70f7f70d01866933bf5f1540be0a58126be652dda8baabcc.jpg)\r\n\r\nТут к нам на помощь пришел режим генерации SourceMaps в ViteJs!\r\n![То что нужно! Жаль не работает.](https://i.vas3k.club/4b043cf3783f368a8855c5a9a9b961d8c9f50f30f591c6db4133a5b3ebed7f03.jpg)\r\n\r\n\r\nВидимо Sentry без директивы `//# sourceMappingURL=script.min.js.map` не умеет связывать .js и .map, хотя очевидно же, что возьми название файла, и добавь в конец .map. Вот было бы круто, если бы разработчики Sentry так умели.\r\n\r\nМы уже даже практически смирились, что будем жить с 404 в девтулзах. Типа обычный пользователь туда все-равно не полезет, а хакеры поржут, ну и ладно, настроение людям поднимем.\r\n\r\nСпустя сутки ресеча внезапно на странице [плагина для Vite.js](https://www.npmjs.com/package/@sentry/vite-plugin?activeTab=readme), который мы не используем, глаз зацепился за фразу, что можно загружать в Sentry не только .map файлы, но и .js.\r\n![То что нужно! Что же раньше то никто не сказал?](https://i.vas3k.club/7789efe805aac84ed6f000bca21b704446803000b948660e2ab38a4616973d66.jpg)\r\n\r\nПопробовал два варианта генерации соурсмапов `hidden` и `true` пришел к выводу что работает только режим `true`, то есть режим, в котором директива `//# sourceMappingURL=script.min.js.map` присутствует в .js файлах. Но такие файлы, как я уже говорил, мы грузить на прод не хотим. Решаем делать отдельный билд, но каким-то чудом в интернете нас находит [ишью](https://github.com/getsentry/sentry-webpack-plugin/issues/56?ysclid=lid7wucvzd691037542#issuecomment-1025751020), где парни решают эту проблему простым ~~совецким~~\r\n```\r\n# delete sourcemaps refs\r\nfind .next -type f -name '*.js' -exec sed -i -E 's/sourceMappingURL=[^ ]*\\.js\\.map//g' {} +\r\n```\r\n\r\nТо что нужно! Удаляем перед деплоем соурспамы из каталога и чистим рефы. Успех!\r\n\r\n# Итоги \r\nSentry в целом оправдала ожидания. Теперь наши релизы выглядят вот так:\r\n![](https://i.vas3k.club/db218d63fdd254bceaa49d79b6ecea984bf4397a753061e8cb0016d18bc4f778.jpg)\r\n\r\n# Код\r\nПолный код докерфайла со всеми присяданиями:\r\n```\r\n# Копируем все в отдельную папочку, хотя наверное можно это и не делать\r\nRUN set -xe \\\r\n    && mkdir -p /tmp/sentry_map \\\r\n    && find /build -type f -name '*.*.map' -exec mv -t /tmp/sentry_map {} +\r\n\r\nRUN set -xe \\\r\n    && find /build -type f -name '*.js' -exec mv -t /tmp/sentry_map {} +\r\n\r\n# Качаем Sentry cli\r\nRUN set -xe \\\r\n    && curl -sL https://sentry.io/get-cli/ | bash\r\n\r\n# Настраиваем настроечки и секретные секреты\r\nARG SENTRY_API_KEY\r\nARG SENTRY_URL\r\nARG SENTRY_ORG\r\nARG SENTRY_PROJECT\r\nENV SENTRY_API_KEY=$SENTRY_API_KEY\r\nENV SENTRY_URL=$SENTRY_URL\r\nENV SENTRY_ORG=$SENTRY_ORG\r\nENV SENTRY_PROJECT=$SENTRY_PROJECT\r\n\r\n# Наконец-то все грузим в Sentry\r\nRUN set -xe \\\r\n    && sentry-cli releases new $RELEASE \\\r\n    && sentry-cli releases files $RELEASE upload /tmp/sentry_map\r\n\r\n# Удоляем соурсмапы\r\nRUN set -xe \\\r\n\t&& find /build -type f -name '*.*.map' -exec rm -f {} \\;\r\n\r\n# Удоляем рефы на них \r\nRUN set -xe \\\r\n\t&& find /build -type f -name '*.js' -exec sed -i -E 's/sourceMappingURL=[^ ]*\\.js\\.map//g' {} \\;\r\n\r\n# Мы великолепны\r\n```	<p>Однажды нам захотелось узнать, сталкиваются ли наши пользователи с какими-нибудь ошибками. Ведь тестировщики божатся, что все проверили, а саппорт еле разгребает завалы обращений. И все бы ничего, но обращения приходят такие: «У меня ничего не работает, горите все в аду». Такие баги мы в работу брать не можем, хочется какой-то конкретики.</p>\n<p>Мы начали попытки замутить систему сбора ошибок еще до 2022 года, но уже тогда в в компании тусовались ребята с грозным названием офицеры информационной безопасности, которые на корню зарубили идею хранить логи в каких-то забугорных облаках. Бомбило у меня тогда знатно, но как-то изменить это решение не вышло. Решили пойти другим путем — разворачивать Sentry в режиме on-prem. От идеи, как говорится, до реализации — один шаг. Всего-то нужно было выделить время SRE и сервачок. Мы еще тогда не знали что шагать мы будем пару лет, но уже тогда почувствовали, что дело не быстрое, и надо искать варианты.</p>\n<h1 id="Pervye-kostyli"><a href="#Pervye-kostyli">Первые костыли</a></h1>\n<p>Перелопатив весь интернет мы так ничего и не нашли. В таких ситуациях на помощь пришел командный брейншторм: накидали кучу идиотских идей, просеяли через фильтр здравого смысла и обнаружили алмаз —  передавать кастомные параметры в Яндекс.Метрику. А с ней все в порядке - российская компания, на российских серверах будет хранить российские ошибки в российском продукте российских же пользователей. Ну и тем более инфа обезличенная, передаем только то, что падает в консоль. Ну почти.</p>\n<p>Для сбора ошибок рендеринга нам очень помогла фича реакта — Error Boundary. Мы обернули приложение в кастомную страничку с большой кнопкой &quot;Обновить&quot; и сожалениями. Пользователи перестали видеть белые экраны и писать в поддержку, а мы наконец получили первые боевые данные и стали понимать масштаб и природу проблем.</p>\n<p>Код выглядел примерно так:</p>\n<pre><code>componentDidCatch(error: Error, errorInfo: ErrorInfo) {\n    const analyticEvent = {\n    \teventType: AnalyticEventType.UserError,\n    \terrorName: error.name,\n    \terrorMessage: error.message,\n    \terrorDescription: errorInfo.componentStack,\n    \terrorStack: error.stack,\n    };\n    analyticsService.sendEvent(analyticEvent);\n}\n</code></pre>\n<p>Конечно, дебажить минифицированные логи было очень сложно, но какие-то критичные моменты мы все-таки находили и оперативно фиксили. Ну вот типа таких:<br>\n<figure class=""><img src="https://i.vas3k.club/229d9e78f5760dc36e1a6764049177a6c70cc8dd059b200d6c7f9bd73c848134.jpg" alt=""></figure></p>\n<p>По графику понятно когда ошибка появилась, сколько пользователей аффектит и чего примерно искать в коде. По этому же графику можно понять пофиксили в релизе ошибку или нет. Очень удобно (нет).</p>\n<p>Часть ошибок мы найти не могли и грезили о Sentry как о манне небесной и решении всех проблем. И вот этот день настал. Сервера включили, on-prem установили, архитектуру решения согласовали, аппрувы получили, осталось только интеграцию настроить, делов то. Но и без ограничений не обошлось.</p>\n<p>Веб-приложения и клиентская часть в частности — штука очень бесячая для службы информационной безопасности, ведь код в открытом виде получает каждый пользователь. Кошмар, кошмар. Был бы я ИБшником, я бы вообще запретил код на прод заливать. Хорошо, что я не они. И нам код в продакшен заливать разрешают. Пока что. Но только минифицированный. Никаких sourcemap'ов конечно же. Если уж хакерам и достается код, то пусть хоть мучаются с деминификацией. Правда отзывов от хакеров я не слышал, но вот дебажить на проде добрым разработчикам действительно тяжело. Плюсы тоже есть — очень мотивирует писать хороший код, который никогда на проде не ломается, и дебажить там нам не приходится.</p>\n<h1 id="Integratsiia"><a href="#Integratsiia">Интеграция</a></h1>\n<p>С такими вводными мы и пришли к интеграции с Sentry. Нужно чтобы в ней ошибки отображались как надо, но чтобы на проде исходники никто прочитать не мог.</p>\n<p>У самой Sentry бизнес-модель очень понятная и прозрачная: они зарабатывают на хостинге логов и технической поддержке. Тут у меня родилась теория заговора, в рамках которой у Sentry ну просто обязана быть нормальная дока для внутреннего пользования, а для сообщества доступно то, что доступно. Так конверсия в платных пользователей выше.</p>\n<p>Но платить за границу во времена, когда никто не хочет брать российских денег, не наш вариант, ну и мы все-таки инженеры как никак, а не просто курсы по реакту окончили. Начали думать как нам решить эту задачу.<br>\n<figure class=""><img src="https://i.vas3k.club/ac3e526ffaca313ac48d5f281f4f91521f9428f1f1108ee8a7f8c0fd08e2b630.jpg" alt=""></figure></p>\n<p>По-умолчанию, интеграция с Sentry очень простая. Она сама сходит и за .js и за .map файлами к вам на сервис и если их найдет, то все покажет как надо. Не наш вариант. Но если мы не хотим чтобы Sentry ходила к нам на сервер, то можем ей помочь, и залить в нее наши .map файлы. Тогда она будет брать их, и не будет ходить на сайт. То что нужно, жаль не работает.</p>\n<p>Точнее работает, но не так, как мы ожидали. Соурсмапы в JS  устроены следующим образом. Есть собственно сам файл мапы .map и есть минифицированный .js, в котором в конце есть директива</p>\n<pre><code>//# sourceMappingURL=script.min.js.map\n</code></pre>\n<p>И вот по этой директиве собственно происходит метч между двумя этими файлами, чтобы восстановить в конце концов исходник.</p>\n<p>Так ошибка выглядит, когда соурсмапы не подтянулись:<br>\n<figure class=""><img src="https://i.vas3k.club/bcc1bdb546c631ced1d8d15162293c2da72f76044268674d261e2590cebc138d.jpg" alt="Не на много лучше нашего костыля с Яндекс.Метрикой."><figcaption>Не на много лучше нашего костыля с Яндекс.Метрикой.</figcaption></figure></p>\n<p>А так, когда подтянулись:<br>\n<figure class=""><img src="https://i.vas3k.club/a14be4cf980ae4fe5e5fb8d148249a48578d803e15230b2dc6d2508662f1c186.jpg" alt="Извините за блур, не хочется тут наш идеальный код обсуждать, да и офицеры не дремлют. Надеюсь этот кусочек кода не несет угрозы национальной безопасности."><figcaption>Извините за блур, не хочется тут наш идеальный код обсуждать, да и офицеры не дремлют. Надеюсь этот кусочек кода не несет угрозы национальной безопасности.</figcaption></figure></p>\n<p>Так вот, мы придумали гениальный план: генерить билд с соурсмапами, грузить их в Sentry, а потом, перед деплоем, удалять. И все бы хорошо, но нам сразу завалило кибану 404 ошибками. А в девтулзах отсвечивало некрасивое:<br>\n<figure class=""><img src="https://i.vas3k.club/4299af0faf15c52d70f7f70d01866933bf5f1540be0a58126be652dda8baabcc.jpg" alt=""></figure></p>\n<p>Тут к нам на помощь пришел режим генерации SourceMaps в ViteJs!<br>\n<figure class=""><img src="https://i.vas3k.club/4b043cf3783f368a8855c5a9a9b961d8c9f50f30f591c6db4133a5b3ebed7f03.jpg" alt="То что нужно! Жаль не работает."><figcaption>То что нужно! Жаль не работает.</figcaption></figure></p>\n<p>Видимо Sentry без директивы <code>//# sourceMappingURL=script.min.js.map</code> не умеет связывать .js и .map, хотя очевидно же, что возьми название файла, и добавь в конец .map. Вот было бы круто, если бы разработчики Sentry так умели.</p>\n<p>Мы уже даже практически смирились, что будем жить с 404 в девтулзах. Типа обычный пользователь туда все-равно не полезет, а хакеры поржут, ну и ладно, настроение людям поднимем.</p>\n<p>Спустя сутки ресеча внезапно на странице <a href="https://www.npmjs.com/package/@sentry/vite-plugin?activeTab=readme">плагина для Vite.js</a>, который мы не используем, глаз зацепился за фразу, что можно загружать в Sentry не только .map файлы, но и .js.<br>\n<figure class=""><img src="https://i.vas3k.club/7789efe805aac84ed6f000bca21b704446803000b948660e2ab38a4616973d66.jpg" alt="То что нужно! Что же раньше то никто не сказал?"><figcaption>То что нужно! Что же раньше то никто не сказал?</figcaption></figure></p>\n<p>Попробовал два варианта генерации соурсмапов <code>hidden</code> и <code>true</code> пришел к выводу что работает только режим <code>true</code>, то есть режим, в котором директива <code>//# sourceMappingURL=script.min.js.map</code> присутствует в .js файлах. Но такие файлы, как я уже говорил, мы грузить на прод не хотим. Решаем делать отдельный билд, но каким-то чудом в интернете нас находит <a href="https://github.com/getsentry/sentry-webpack-plugin/issues/56?ysclid=lid7wucvzd691037542#issuecomment-1025751020">ишью</a>, где парни решают эту проблему простым <del>совецким</del></p>\n<pre><code># delete sourcemaps refs\nfind .next -type f -name '*.js' -exec sed -i -E 's/sourceMappingURL=[^ ]*\\.js\\.map//g' {} +\n</code></pre>\n<p>То что нужно! Удаляем перед деплоем соурспамы из каталога и чистим рефы. Успех!</p>\n<h1 id="Itogi"><a href="#Itogi">Итоги</a></h1>\n<p>Sentry в целом оправдала ожидания. Теперь наши релизы выглядят вот так:<br>\n<figure class=""><img src="https://i.vas3k.club/db218d63fdd254bceaa49d79b6ecea984bf4397a753061e8cb0016d18bc4f778.jpg" alt=""></figure></p>\n<h1 id="Kod"><a href="#Kod">Код</a></h1>\n<p>Полный код докерфайла со всеми присяданиями:</p>\n<pre><code># Копируем все в отдельную папочку, хотя наверное можно это и не делать\nRUN set -xe \\\n    &amp;&amp; mkdir -p /tmp/sentry_map \\\n    &amp;&amp; find /build -type f -name '*.*.map' -exec mv -t /tmp/sentry_map {} +\n\nRUN set -xe \\\n    &amp;&amp; find /build -type f -name '*.js' -exec mv -t /tmp/sentry_map {} +\n\n# Качаем Sentry cli\nRUN set -xe \\\n    &amp;&amp; curl -sL https://sentry.io/get-cli/ | bash\n\n# Настраиваем настроечки и секретные секреты\nARG SENTRY_API_KEY\nARG SENTRY_URL\nARG SENTRY_ORG\nARG SENTRY_PROJECT\nENV SENTRY_API_KEY=$SENTRY_API_KEY\nENV SENTRY_URL=$SENTRY_URL\nENV SENTRY_ORG=$SENTRY_ORG\nENV SENTRY_PROJECT=$SENTRY_PROJECT\n\n# Наконец-то все грузим в Sentry\nRUN set -xe \\\n    &amp;&amp; sentry-cli releases new $RELEASE \\\n    &amp;&amp; sentry-cli releases files $RELEASE upload /tmp/sentry_map\n\n# Удоляем соурсмапы\nRUN set -xe \\\n    &amp;&amp; find /build -type f -name '*.*.map' -exec rm -f {} \\;\n\n# Удоляем рефы на них \nRUN set -xe \\\n    &amp;&amp; find /build -type f -name '*.js' -exec sed -i -E 's/sourceMappingURL=[^ ]*\\.js\\.map//g' {} \\;\n\n# Мы великолепны\n</code></pre>	\N	\N	\N	2023-06-16 12:08:02.807965+00	2023-06-16 12:09:08.805233+00	2023-06-16 12:09:08.805152+00	1	1	0	t	t	t	f	t	\N	006b2b69-e425-4d2d-82a4-7ba9505b6493	\N	f	2023-06-16 12:08:08.172757+00	\N	0	\N	{}	\N	\N
