55682211-75b0-409c-87a0-f93d9756f53f	12	project	F365	С одной стороны, не хочется рассказывать о чем-то небольшом. С другой стороны, из маленьких кирпичиков строится большое здание, поэтому почему бы и нет? К черту скромность!\r\n\r\n\r\n![](https://i.vas3k.club/5532f95440515792c340c8c56db5fc684b65db0f56721cb40a5b1ff85358587a.jpg)\r\n\r\nСразу скажу, что проект не планирует никакой монетизации, а также что в посте будет много разных картинок. Но как рассказывать про фотографию без фотографий, а про проекты без мемов?\r\n\r\n\r\n### Расскажите о себе и сути проекта\r\n\r\n Про себя я писал в [#intro](https://vas3k.club/intro/tkf/). У меня есть несколько хобби, некоторые из которых вытекают друг из друга. Так, например, из увлечения LEGO выросло мое увлечение фотографией, и этот проект как раз посвящен именно этому увлечению. Увлечения нужны, чтобы не быть как котик на меме снизу. И без них очень легко в него попасть.\r\n\r\n![](https://i.vas3k.club/6ab54fa2cebe2342874e8bacf0d545539d2ba09d225322733d73e0c4bf5a807b.jpg)\r\n\r\nФотографирую я не так давно, сменил несколько камер, фотографировал вроде бы и часто, но не регулярно. В какой-то момент заметил, что стараюсь чаще оставлять камеру дома, а не тащить ее с собой. Так как я на какое-то время оказался далеко от громадной кучи любимых кубиков и от стационарного ПК, LEGO и игры в RTS временно стали задачей с меньшим приоритетом, а фотография - с большим. И я решил подумать на тему того, как же научиться фотографировать лучше.\r\n\r\nА как мы все знаем, лучший способ, чтобы научиться чему-либо, это практика.\r\n\r\n\r\n![](https://i.vas3k.club/98396649d42b00fd3dffdee068377999ae6e7571dc4c2346dbcbe57cfd0c9111.jpg)\r\n\r\nЕсть такой парень - Георгий Джеджея ([Сайт](https://jejeya.pictures/)), его еще @vas3k упоминал в [посте про вычислительную фотографию](https://vas3k.blog/blog/computational_photography) (если помните такой, конечно). Так вот, так как я решил подойти с точки зрения практики, я конечно же начал читать различные блоги (ахаха, все как всегда. Прокрастинация наше все. )\r\n\r\n![](https://i.vas3k.club/504ae1a489d8113f28389b7ce7004e670b9b1c198aac3f6e6cd70ddb09d0f1e0.jpg)\r\n\r\nНу так к чему это я? У Георгия есть Telegram канал, а у этого Telegram канала есть [чат](https://t.me/factory_chat), (Вастрик.фото и данный чат частично пересекаются, так что я думаю, о нем тоже кто-то из клуба знает). И вот в этом чате проходит челлендж, достаточно обычный, кстати — челлендж "365". Необходимо каждый день делать фотографию на протяжении года, обрабатывать ее в течение дня (вообще фотографию за сегодня можно выложить в течение сегодня и завтра) и выкладывать ее.\r\n\r\n![](https://i.vas3k.club/7836082aee16e631a563750c7b7f266c446c10654770d6ba83514d731d5ee1cf.jpg)\r\n*(я просто хотел выложить фотографию с акулой, сорри)*\r\n\r\nЯ пропускал эти челленджы, потому что:\r\nа) Да зачем оно мне нужно?\r\nб) Это же нужно самому как-то отслеживать и следить.\r\n\r\nА тут все было сделано достаточно удобно: был бот, который принимал фотографии в Telegram, и некоторый элемент геймификации, когда участники чата голосовали за лучшие работы, и в итоге каждый день подводились результаты голосования с виртуальными медальками.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/3711da994c773bdd20643a9b382e70f1edbd6735b0ed5a18bb39532f2a5fe9b2.jpg)\r\n\r\nЯ участвую в данном челлендже уже более 200 дней, и он во многом мне помог. Я не сказал бы, чтобы я стал снимать лучше. Бывает, я открываю свои достаточно старые фотографии и понимаю, что мой уровень не то что вырос, но я стал лучше понимать, когда фотография определенно не получится. Также я стал лучше разбираться в своей камере и подтянул навык быстрой обработки фотографий.\r\n\r\nНо и это не главное. Главное, наверное, то, что необходимость делать что-то заставляла меня подниматься и делать что-то, даже тогда, когда очень не хотелось. И за счет этого улучшая мою жизнь. Я вставал на рассвете, чтобы фотографировать рассветное солнце.\r\n\r\n\r\n![](https://i.vas3k.club/80d9894285db17671a7323dd6a3257a119f63c8f5b374123791844d5ad244f1c.jpg)\r\n\r\n И искал что-то интересное в обыденном.\r\n\r\n![](https://i.vas3k.club/f4b51fff4b874d5e8ab225434c673d9c409fe335fcc85c88e6f77970dce44190.jpg)\r\n\r\nНу и просто в целом тренировал дисциплину. Если бы я был большим экстравертом, наверное, познакомился бы таким образом с кучей людей. Но, так как я такой как я есть, я просто сделал кучу фотографий (ну ладно, я даже несколько раз подходил к незнакомым людям с просьбой их сфотографировать, прогресс собственно на лицо) , которые мне нравятся, а также подписывался на различные поездки, от которых возможно бы отказался в ином случае. Даже завел дрона, чтобы смотреть на вещи с другого угла :)\r\n\r\n![](https://i.vas3k.club/e3bbb91c4adc2b4b5187d0a33f9ebc2d7dc6cfe1ba713a8f81c889e29a816c92.jpg)\r\n\r\nНо искать свои фото в большой куче фотографий в канале было не очень удобно, а иногда хотелось понять, какая фотография набрала больше лайков, или просто посмотреть, с каких фото я начал челлендж, а какие идут сейчас, чтобы понять, что вот сейчас у тебя идет провал, и ты не можешь найти сюжеты, а раньше энтузиазм так и переполнял. Ну и просто пересмотреть кадры по принципу "кадр в день" — это очень интересно.\r\n\r\nЯ даже как-то [считал](https://t.me/factory_chat/1385166) небольшую статистику по результатам 2022 года в этом челлендже.\r\n\r\nИ меня не покидала идея, что было бы отлично иметь возможность легко посмотреть данные из канала. Поиск в Telegram по хештегу, конечно, работает, но в целом искать в ленте очень неудобно. Да и видеть какую-нибудь писькомерную статистику всегда приятно.\r\n\r\n\r\n![](https://i.vas3k.club/43ddeb3a94d0b8889f161da377b7191210e0a6e872d33003ebf4c40843030158.jpg)\r\n\r\nВ какой-то момент я решил, что хватит тянуть кота за яйца, и раз у меня не очень получается с фото выходить на первые места, можно сделать полезный для сообщества сервис, выложить фото с его интерфейсом и словить плюшки :)\r\n\r\n\r\n\r\n![](https://i.vas3k.club/f063638b70f757fe7f7e243d9d747e6346400c9e7cfb5e4dfa6ed969bc7ed692.jpg)\r\n\r\n\r\n\r\n### Что вошло в прототип, технологический стек и сколько времени на него было потрачено\r\n\r\n![](https://i.vas3k.club/44432d7c6b0e9fee76128e59052379425afb40ffe0cedfb4bf474d790e536dd2.jpg)\r\n\r\nЯ решил разбить проект на три части, чтобы максимально упростить дальнейшую поддержку или замену. Соответственно, получаем парсинг опубликованных ботом данных и их запись в базу. API для получения данных из этой базы и фронтенд, который будет показывать полученные данные. На все про все ушло несколько вечеров.\r\n\r\nСамой простой частью были парсинг и API. Так как фронт планировался на JavaScript, решил и бекэнд сделать на нем же. Взял Express.js, MySQL, набросал быстренько простенький API, развернул, проверил, что все нормально.\r\n\r\n\r\nЕдинственная проблема на бекэнде была с запросом, подсчитывающим самые длинные интервалы без проблем в публикациях. Наиболее адекватным и простым вариантом было использовать оконные функции, но в тот вечер, похоже, лыжи решили не ехать, и нужный вариант никак не хотел писаться. И тут меня осенило, мы же в будущем, где же вкалывающие роботы? Я открыл ChatGPT и попросил его написать запрос. Неожиданно запрос даже оказался почти верным. С помощью напильника (так как уточняющими вопросами заставить его исправить запрос не вышло), запрос был приведен в нужное состояние, и бекэнд стал полностью рабочим.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/407d6e557ee8461b17eb215fd1b555a94e4f8124ff4c31017863fa5e89fe2a77.jpg)\r\n\r\n\r\nНу что же, после этого настало время опуститься в авгиевы конюшни и собрать фронт на третьем Vue. Вообще на работе мне приходилось встречаться с вторым Vue (нет, встречался я со всем подряд, но с Vue было больше всего опыта), поэтому я подумал, что особых проблем с третьим Vue не будет. Сцуко, как же я ошибался. Ближайший час был занят различными попытками адаптировать свой опыт из Options API второго Vue на Composition API третьего. А также отойти от Vuex к Pinia. Казалось бы, что мешало поставить Vuex и Options API на третий Vue? Но ведь мы не ищем легких путей. Вообще ненавижу такие моменты, когда вместо того, чтобы решать проблему, приходится бороться с окружением.\r\n\r\nВ общем, после некоторого количества матюгов, я перешел к конкретной реализации самого интерфейса. Так как чукча ни разу не дизайнер, я взял готовый UI Kit. И после небольшой отладки был готов MVP на трех страницах.\r\n\r\n![](https://i.vas3k.club/d09383066ba8d3cf4917182ef3923d31e1a7b8500b3e68a46b460406c29f3de4.jpg)\r\n\r\nСписок фотографий дня, рандомная подборка случайных фото и страница фотографий пользователя. Так как данный челлендж проходит всего где-то 3.5 года, и количество участников не то чтобы запредельное, я решил отказаться от infinite scroll с подгрузкой и просто фигачить все изображения пользователя на страницу сразу.\r\n\r\n![](https://i.vas3k.club/b83bd8bc861a2f70e3bef8fd2d26b1cc78301e882b3b784eeacf3418e003fbb7.jpg)\r\n\r\n\r\nРазвернув это на собственном поддомене, я решил написать о проекте на следующий день. Ну а следующим вечером я решил, что будет неплохо добавить на страницу пользователя немного статистики.\r\n\r\nТакже решил добавить немного сортировок, ведь все любят сортировки. Кстати, про один из способов сортировки я интересовался в [Vas3k.nsfw](https://vas3k.club/network/chat/nsfw/).  Все-таки, сортировка по противоречивости это прикольно.\r\n\r\n![](https://i.vas3k.club/ad4943723c16b37f46f90447660896dddd40e5e3486dc0f75c78b80d67e64b9c.jpg)\r\n\r\nТак что общий совет всем на будущее: хотите сделать что-то быстро и просто, берите то, что знаете, не будьте как я. Ну, а если совмещать изучение нового с каким-нибудь пет-проектом, то почему бы и нет.\r\n\r\n\r\n### Как запускались и искали первых пользователей\r\n\r\nТак как я по сути делал инструмент для уже существующей аудитории, то никаких особых усилий для поиска пользователей не требовалось. Просто зашел в чатик и скинул ссылку. От хитрого плана с публикацией фото рабочего стола отказался. Как-то неспортивно все-таки.\r\n\r\nВ целом приняли положительно, сразу нашли пару багов. Одна была связана с парсингом, точнее с тем, что я не учел граничный случай, когда где-то в середине челленджа бот глюкнул и запостил одну и ту же запись два раза. Я полагался на идентификатор сообщения и не прописал уникальное ограничение. Обязательно прописывайте все ограничения. В итоге одна из длинных серий считалась неверно.\r\n\r\n![](https://i.vas3k.club/7086ebce9b014991435bd435658148fcc2b7a7b0f92727b3e2ef38e0b71ea915.jpg)\r\n\r\nПопросили прокинуть seed на главной, чтобы делиться выпавшими подборками лучших фото. Поправил это тоже. Ну и вывел ссылочки на соцсети тем, кто их скинул, чтобы, если кто вдруг наткнется на интересную фотографию, мог перейти дальше и посмотреть другие работы.\r\n\r\n\r\n### Сколько потратили и заработали? Есть идеи как это можно монетизировать?\r\n\r\nВ виду того, что проект простенький, а у всех есть под рукой некоторое количество свободных ресурсов, можно считать, что трат пока никаких и особо новые не планируются. Монетизации определенно не будет. Так что это просто pet-проект для себя и небольшого фотосообщества.\r\n\r\n\r\n\r\n\r\n### Какие планы на будущее?\r\nДа, вроде никаких, вероятней всего оно вообще не потребует какой-то особой поддержки. Так может код причесать и выложить все это на GitHub вместе с данными, чтобы, если что, это мог поднять кто-то еще. Поскольку bus factor у проекта, не то чтобы радовал.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/600bf0b061e978e7e772a019712887cd2cf26780133dddb5c7cf60ffe398c7bf.jpg)\r\n\r\nНу и наверное доделаю еще одно представление фотографий. Вместо грида будет приятно потом посмотреть на календарик, где на каждый день будет по фотографии.\r\n\r\n\r\n\r\n\r\n### Итоги\r\n\r\nЯ продолжаю 365, делая фотографию каждый день, но теперь мне гораздо проще вспоминать, какая именно из моих фотографий так провалилась на последнем голосовании.\r\n\r\n\r\nНадеюсь, что мой рассказ мотивирует кого-нибудь тоже поучаствовать в челлендже, ну или хотя бы постараться больше замечать вокруг, а не идти по улице, уткнувшись в телефон.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/11e9bb6f850fa3347410ad4f499a0e40718175a4b45530ad9401b66648be7515.jpg)\r\n\r\nКстати, вам не обязательно иметь фотоаппарат. Многие из участвующих в челлендже делают отличные фотки на мобильные телефоны. Необязательно, как я, таскать с собой тяжеленную бандуру тупо по приколу.\r\n\r\n![](https://i.vas3k.club/10921bf91ae200743ae3d7bb9296d08d36cf540a36f712b8089ebe53dfcb89c4.jpg)\r\n\r\n\r\nНу и главное в фотографии давно уже стало не умение сделать выверенную картинку. Для этого есть японцы с пометками, откуда фотографировать, а также вычислительная и обычная фотография. В современных камерах даже [автоспуск завезли](https://www.youtube.com/watch?v=tTyVaiJLSsE). Да и [нейронки](https://bjoernkarmann.dk/project/paragraphica) не дремлют. Так что главное в фотографии, на мой взгляд, давно стало не результат, хотя приятный результат всегда хорошо. Главное это умение видеть, чувствовать, ну и наслаждаться процессом.\r\n\r\nДа и правила челленджа не заставляют в нем активно участвовать. Многие просто время от времени выкладывают фотографии, как очередная площадка для поделиться.\r\n\r\nТакже не могу не напомнить, что у нас в клубе есть [секретный чат с фотографиями](https://vas3k.club/post/15747/). \r\n\r\np.s. покидая уютненький клуб вы рискуете нарваться на другое окружение. С другими мемасами и точками зрения. Я вас предупреждал.\r\n\r\n![](https://i.vas3k.club/7544973e3c49db12c8f88c2d5e60315233db51bcd331b72306bf721dd0dca115.jpg)	<p>С одной стороны, не хочется рассказывать о чем-то небольшом. С другой стороны, из маленьких кирпичиков строится большое здание, поэтому почему бы и нет? К черту скромность!</p>\n<p><figure class=""><img src="https://i.vas3k.club/5532f95440515792c340c8c56db5fc684b65db0f56721cb40a5b1ff85358587a.jpg" alt=""></figure></p>\n<p>Сразу скажу, что проект не планирует никакой монетизации, а также что в посте будет много разных картинок. Но как рассказывать про фотографию без фотографий, а про проекты без мемов?</p>\n<h3 id="Rasskazhite-o-sebe-i-suti"><a href="#Rasskazhite-o-sebe-i-suti">Расскажите о себе и сути проекта</a></h3>\n<p>Про себя я писал в <a href="https://vas3k.club/intro/tkf/">#intro</a>. У меня есть несколько хобби, некоторые из которых вытекают друг из друга. Так, например, из увлечения LEGO выросло мое увлечение фотографией, и этот проект как раз посвящен именно этому увлечению. Увлечения нужны, чтобы не быть как котик на меме снизу. И без них очень легко в него попасть.</p>\n<p><figure class=""><img src="https://i.vas3k.club/6ab54fa2cebe2342874e8bacf0d545539d2ba09d225322733d73e0c4bf5a807b.jpg" alt=""></figure></p>\n<p>Фотографирую я не так давно, сменил несколько камер, фотографировал вроде бы и часто, но не регулярно. В какой-то момент заметил, что стараюсь чаще оставлять камеру дома, а не тащить ее с собой. Так как я на какое-то время оказался далеко от громадной кучи любимых кубиков и от стационарного ПК, LEGO и игры в RTS временно стали задачей с меньшим приоритетом, а фотография - с большим. И я решил подумать на тему того, как же научиться фотографировать лучше.</p>\n<p>А как мы все знаем, лучший способ, чтобы научиться чему-либо, это практика.</p>\n<p><figure class=""><img src="https://i.vas3k.club/98396649d42b00fd3dffdee068377999ae6e7571dc4c2346dbcbe57cfd0c9111.jpg" alt=""></figure></p>\n<p>Есть такой парень - Георгий Джеджея (<a href="https://jejeya.pictures/">Сайт</a>), его еще <a href="/user/vas3k/">@vas3k</a> упоминал в <a href="https://vas3k.blog/blog/computational_photography">посте про вычислительную фотографию</a> (если помните такой, конечно). Так вот, так как я решил подойти с точки зрения практики, я конечно же начал читать различные блоги (ахаха, все как всегда. Прокрастинация наше все. )</p>\n<p><figure class=""><img src="https://i.vas3k.club/504ae1a489d8113f28389b7ce7004e670b9b1c198aac3f6e6cd70ddb09d0f1e0.jpg" alt=""></figure></p>\n<p>Ну так к чему это я? У Георгия есть Telegram канал, а у этого Telegram канала есть <a href="https://t.me/factory_chat">чат</a>, (Вастрик.фото и данный чат частично пересекаются, так что я думаю, о нем тоже кто-то из клуба знает). И вот в этом чате проходит челлендж, достаточно обычный, кстати — челлендж &quot;365&quot;. Необходимо каждый день делать фотографию на протяжении года, обрабатывать ее в течение дня (вообще фотографию за сегодня можно выложить в течение сегодня и завтра) и выкладывать ее.</p>\n<p><figure class=""><img src="https://i.vas3k.club/7836082aee16e631a563750c7b7f266c446c10654770d6ba83514d731d5ee1cf.jpg" alt=""></figure><br>\n<em>(я просто хотел выложить фотографию с акулой, сорри)</em></p>\n<p>Я пропускал эти челленджы, потому что:<br>\nа) Да зачем оно мне нужно?<br>\nб) Это же нужно самому как-то отслеживать и следить.</p>\n<p>А тут все было сделано достаточно удобно: был бот, который принимал фотографии в Telegram, и некоторый элемент геймификации, когда участники чата голосовали за лучшие работы, и в итоге каждый день подводились результаты голосования с виртуальными медальками.</p>\n<p><figure class=""><img src="https://i.vas3k.club/3711da994c773bdd20643a9b382e70f1edbd6735b0ed5a18bb39532f2a5fe9b2.jpg" alt=""></figure></p>\n<p>Я участвую в данном челлендже уже более 200 дней, и он во многом мне помог. Я не сказал бы, чтобы я стал снимать лучше. Бывает, я открываю свои достаточно старые фотографии и понимаю, что мой уровень не то что вырос, но я стал лучше понимать, когда фотография определенно не получится. Также я стал лучше разбираться в своей камере и подтянул навык быстрой обработки фотографий.</p>\n<p>Но и это не главное. Главное, наверное, то, что необходимость делать что-то заставляла меня подниматься и делать что-то, даже тогда, когда очень не хотелось. И за счет этого улучшая мою жизнь. Я вставал на рассвете, чтобы фотографировать рассветное солнце.</p>\n<p><figure class=""><img src="https://i.vas3k.club/80d9894285db17671a7323dd6a3257a119f63c8f5b374123791844d5ad244f1c.jpg" alt=""></figure></p>\n<p>И искал что-то интересное в обыденном.</p>\n<p><figure class=""><img src="https://i.vas3k.club/f4b51fff4b874d5e8ab225434c673d9c409fe335fcc85c88e6f77970dce44190.jpg" alt=""></figure></p>\n<p>Ну и просто в целом тренировал дисциплину. Если бы я был большим экстравертом, наверное, познакомился бы таким образом с кучей людей. Но, так как я такой как я есть, я просто сделал кучу фотографий (ну ладно, я даже несколько раз подходил к незнакомым людям с просьбой их сфотографировать, прогресс собственно на лицо) , которые мне нравятся, а также подписывался на различные поездки, от которых возможно бы отказался в ином случае. Даже завел дрона, чтобы смотреть на вещи с другого угла :)</p>\n<p><figure class=""><img src="https://i.vas3k.club/e3bbb91c4adc2b4b5187d0a33f9ebc2d7dc6cfe1ba713a8f81c889e29a816c92.jpg" alt=""></figure></p>\n<p>Но искать свои фото в большой куче фотографий в канале было не очень удобно, а иногда хотелось понять, какая фотография набрала больше лайков, или просто посмотреть, с каких фото я начал челлендж, а какие идут сейчас, чтобы понять, что вот сейчас у тебя идет провал, и ты не можешь найти сюжеты, а раньше энтузиазм так и переполнял. Ну и просто пересмотреть кадры по принципу &quot;кадр в день&quot; — это очень интересно.</p>\n<p>Я даже как-то <a href="https://t.me/factory_chat/1385166">считал</a> небольшую статистику по результатам 2022 года в этом челлендже.</p>\n<p>И меня не покидала идея, что было бы отлично иметь возможность легко посмотреть данные из канала. Поиск в Telegram по хештегу, конечно, работает, но в целом искать в ленте очень неудобно. Да и видеть какую-нибудь писькомерную статистику всегда приятно.</p>\n<p><figure class=""><img src="https://i.vas3k.club/43ddeb3a94d0b8889f161da377b7191210e0a6e872d33003ebf4c40843030158.jpg" alt=""></figure></p>\n<p>В какой-то момент я решил, что хватит тянуть кота за яйца, и раз у меня не очень получается с фото выходить на первые места, можно сделать полезный для сообщества сервис, выложить фото с его интерфейсом и словить плюшки :)</p>\n<p><figure class=""><img src="https://i.vas3k.club/f063638b70f757fe7f7e243d9d747e6346400c9e7cfb5e4dfa6ed969bc7ed692.jpg" alt=""></figure></p>\n<h3 id="Chto-voshlo-v-prototip-te"><a href="#Chto-voshlo-v-prototip-te">Что вошло в прототип, технологический стек и сколько времени на него было потрачено</a></h3>\n<p><figure class=""><img src="https://i.vas3k.club/44432d7c6b0e9fee76128e59052379425afb40ffe0cedfb4bf474d790e536dd2.jpg" alt=""></figure></p>\n<p>Я решил разбить проект на три части, чтобы максимально упростить дальнейшую поддержку или замену. Соответственно, получаем парсинг опубликованных ботом данных и их запись в базу. API для получения данных из этой базы и фронтенд, который будет показывать полученные данные. На все про все ушло несколько вечеров.</p>\n<p>Самой простой частью были парсинг и API. Так как фронт планировался на JavaScript, решил и бекэнд сделать на нем же. Взял Express.js, MySQL, набросал быстренько простенький API, развернул, проверил, что все нормально.</p>\n<p>Единственная проблема на бекэнде была с запросом, подсчитывающим самые длинные интервалы без проблем в публикациях. Наиболее адекватным и простым вариантом было использовать оконные функции, но в тот вечер, похоже, лыжи решили не ехать, и нужный вариант никак не хотел писаться. И тут меня осенило, мы же в будущем, где же вкалывающие роботы? Я открыл ChatGPT и попросил его написать запрос. Неожиданно запрос даже оказался почти верным. С помощью напильника (так как уточняющими вопросами заставить его исправить запрос не вышло), запрос был приведен в нужное состояние, и бекэнд стал полностью рабочим.</p>\n<p><figure class=""><img src="https://i.vas3k.club/407d6e557ee8461b17eb215fd1b555a94e4f8124ff4c31017863fa5e89fe2a77.jpg" alt=""></figure></p>\n<p>Ну что же, после этого настало время опуститься в авгиевы конюшни и собрать фронт на третьем Vue. Вообще на работе мне приходилось встречаться с вторым Vue (нет, встречался я со всем подряд, но с Vue было больше всего опыта), поэтому я подумал, что особых проблем с третьим Vue не будет. Сцуко, как же я ошибался. Ближайший час был занят различными попытками адаптировать свой опыт из Options API второго Vue на Composition API третьего. А также отойти от Vuex к Pinia. Казалось бы, что мешало поставить Vuex и Options API на третий Vue? Но ведь мы не ищем легких путей. Вообще ненавижу такие моменты, когда вместо того, чтобы решать проблему, приходится бороться с окружением.</p>\n<p>В общем, после некоторого количества матюгов, я перешел к конкретной реализации самого интерфейса. Так как чукча ни разу не дизайнер, я взял готовый UI Kit. И после небольшой отладки был готов MVP на трех страницах.</p>\n<p><figure class=""><img src="https://i.vas3k.club/d09383066ba8d3cf4917182ef3923d31e1a7b8500b3e68a46b460406c29f3de4.jpg" alt=""></figure></p>\n<p>Список фотографий дня, рандомная подборка случайных фото и страница фотографий пользователя. Так как данный челлендж проходит всего где-то 3.5 года, и количество участников не то чтобы запредельное, я решил отказаться от infinite scroll с подгрузкой и просто фигачить все изображения пользователя на страницу сразу.</p>\n<p><figure class=""><img src="https://i.vas3k.club/b83bd8bc861a2f70e3bef8fd2d26b1cc78301e882b3b784eeacf3418e003fbb7.jpg" alt=""></figure></p>\n<p>Развернув это на собственном поддомене, я решил написать о проекте на следующий день. Ну а следующим вечером я решил, что будет неплохо добавить на страницу пользователя немного статистики.</p>\n<p>Также решил добавить немного сортировок, ведь все любят сортировки. Кстати, про один из способов сортировки я интересовался в <a href="https://vas3k.club/network/chat/nsfw/">Vas3k.nsfw</a>.  Все-таки, сортировка по противоречивости это прикольно.</p>\n<p><figure class=""><img src="https://i.vas3k.club/ad4943723c16b37f46f90447660896dddd40e5e3486dc0f75c78b80d67e64b9c.jpg" alt=""></figure></p>\n<p>Так что общий совет всем на будущее: хотите сделать что-то быстро и просто, берите то, что знаете, не будьте как я. Ну, а если совмещать изучение нового с каким-нибудь пет-проектом, то почему бы и нет.</p>\n<h3 id="Kak-zapuskalis-i-iskali"><a href="#Kak-zapuskalis-i-iskali">Как запускались и искали первых пользователей</a></h3>\n<p>Так как я по сути делал инструмент для уже существующей аудитории, то никаких особых усилий для поиска пользователей не требовалось. Просто зашел в чатик и скинул ссылку. От хитрого плана с публикацией фото рабочего стола отказался. Как-то неспортивно все-таки.</p>\n<p>В целом приняли положительно, сразу нашли пару багов. Одна была связана с парсингом, точнее с тем, что я не учел граничный случай, когда где-то в середине челленджа бот глюкнул и запостил одну и ту же запись два раза. Я полагался на идентификатор сообщения и не прописал уникальное ограничение. Обязательно прописывайте все ограничения. В итоге одна из длинных серий считалась неверно.</p>\n<p><figure class=""><img src="https://i.vas3k.club/7086ebce9b014991435bd435658148fcc2b7a7b0f92727b3e2ef38e0b71ea915.jpg" alt=""></figure></p>\n<p>Попросили прокинуть seed на главной, чтобы делиться выпавшими подборками лучших фото. Поправил это тоже. Ну и вывел ссылочки на соцсети тем, кто их скинул, чтобы, если кто вдруг наткнется на интересную фотографию, мог перейти дальше и посмотреть другие работы.</p>\n<h3 id="Skolko-potratili-i-zara"><a href="#Skolko-potratili-i-zara">Сколько потратили и заработали? Есть идеи как это можно монетизировать?</a></h3>\n<p>В виду того, что проект простенький, а у всех есть под рукой некоторое количество свободных ресурсов, можно считать, что трат пока никаких и особо новые не планируются. Монетизации определенно не будет. Так что это просто pet-проект для себя и небольшого фотосообщества.</p>\n<h3 id="Kakie-plany-na-budushchee"><a href="#Kakie-plany-na-budushchee">Какие планы на будущее?</a></h3>\n<p>Да, вроде никаких, вероятней всего оно вообще не потребует какой-то особой поддержки. Так может код причесать и выложить все это на GitHub вместе с данными, чтобы, если что, это мог поднять кто-то еще. Поскольку bus factor у проекта, не то чтобы радовал.</p>\n<p><figure class=""><img src="https://i.vas3k.club/600bf0b061e978e7e772a019712887cd2cf26780133dddb5c7cf60ffe398c7bf.jpg" alt=""></figure></p>\n<p>Ну и наверное доделаю еще одно представление фотографий. Вместо грида будет приятно потом посмотреть на календарик, где на каждый день будет по фотографии.</p>\n<h3 id="Itogi"><a href="#Itogi">Итоги</a></h3>\n<p>Я продолжаю 365, делая фотографию каждый день, но теперь мне гораздо проще вспоминать, какая именно из моих фотографий так провалилась на последнем голосовании.</p>\n<p>Надеюсь, что мой рассказ мотивирует кого-нибудь тоже поучаствовать в челлендже, ну или хотя бы постараться больше замечать вокруг, а не идти по улице, уткнувшись в телефон.</p>\n<p><figure class=""><img src="https://i.vas3k.club/11e9bb6f850fa3347410ad4f499a0e40718175a4b45530ad9401b66648be7515.jpg" alt=""></figure></p>\n<p>Кстати, вам не обязательно иметь фотоаппарат. Многие из участвующих в челлендже делают отличные фотки на мобильные телефоны. Необязательно, как я, таскать с собой тяжеленную бандуру тупо по приколу.</p>\n<p><figure class=""><img src="https://i.vas3k.club/10921bf91ae200743ae3d7bb9296d08d36cf540a36f712b8089ebe53dfcb89c4.jpg" alt=""></figure></p>\n<p>Ну и главное в фотографии давно уже стало не умение сделать выверенную картинку. Для этого есть японцы с пометками, откуда фотографировать, а также вычислительная и обычная фотография. В современных камерах даже <a href="https://www.youtube.com/watch?v=tTyVaiJLSsE">автоспуск завезли</a>. Да и <a href="https://bjoernkarmann.dk/project/paragraphica">нейронки</a> не дремлют. Так что главное в фотографии, на мой взгляд, давно стало не результат, хотя приятный результат всегда хорошо. Главное это умение видеть, чувствовать, ну и наслаждаться процессом.</p>\n<p>Да и правила челленджа не заставляют в нем активно участвовать. Многие просто время от времени выкладывают фотографии, как очередная площадка для поделиться.</p>\n<p>Также не могу не напомнить, что у нас в клубе есть <a href="https://vas3k.club/post/15747/">секретный чат с фотографиями</a>.</p>\n<p>p.s. покидая уютненький клуб вы рискуете нарваться на другое окружение. С другими мемасами и точками зрения. Я вас предупреждал.</p>\n<p><figure class=""><img src="https://i.vas3k.club/7544973e3c49db12c8f88c2d5e60315233db51bcd331b72306bf721dd0dca115.jpg" alt=""></figure></p>	https://f365.zyuhel.ru/	https://i.vas3k.club/db78fce167bec43634ac4d3ee437b2299830f358567d27f2703ef556705c5f4e.jpg	{"badges": {"bmw": {"count": 1, "title": "Беха", "description": "Выдать автору беху по программе помощи миллионерам"}}}	2023-06-16 11:28:43.661473+00	2023-06-16 11:52:42.65524+00	2023-06-16 11:52:42.655089+00	6	3	2	t	t	t	t	t	\N	3b256275-bd5e-4980-9440-a5ba9f17acfc	\N	f	2023-06-16 11:28:52.815571+00	\N	0	\N	{}	\N	\N
