502e80e6-c72a-48a3-ba7c-bb6017bd0480	random_4vQhB0FhMs	intro	#intro от @random_4vQhB0FhMs	*Один мой друг навел меня на мысль, что надо написать интро так, будто ты выпендриваешься, потому что иначе выходит резюме, поэтому я решил переписать.*\r\n\r\nПривет, я Витян, родился и ~~живу~~ жил большую часть жизни в славном Петербурге, поэтому погода за окном меня вообще не беспокоит, с ней можно только смириться.\r\n\r\nНа свою первую работу я попал случайно, и это было очень круто, ведь ее можно описать так:\r\n- *Я делал сраных роботов!*\r\n- *Я помогал организовывать соревнования сраных роботов!*\r\n- *Оборудование для этих соревнований перевозили вооруженные люди!*\r\n- *Я жил на испытательном полигоне ГАЗа!*\r\n- *Я тусил на тренировочной базе МЧС в подмосковье, там вообще-то космонавты тренируются!*\r\n- *Я там еще и с офицерами МЧС в баре зависал!*\r\n\r\nА потом универ закончился, я перешел в другой отдел и стало грустно :(\r\n\r\nПоэтому я уволился и не менее случайно оказался в кажется лучшей конторе, о которой можно было только мечтать.\r\nТут делают клевые штуки, которые офигенно выглядят и с ними приятно работать. Процессы без лишней фигни, а сотрудники - основной ресурс, который стараются беречь, это ли не счастье?\r\n\r\n*Походу в основном меня определяет работа. Жаль, но не сильно*\r\n\r\nЖенат, живем втроем с кошкой. ~~Все мечтал поездить по России и миру, но видимо недостаточно сильно, чтобы реально поездить.~~\r\nАХХАХАХАХ\r\n\r\nРасширяем список жизненных достижений:\r\n- Проехал 2.5к км за сутки от Санкт-Петербурга до Астрахани и еще немного\r\n- А потом проторчал трое суток в пробке на границе с Казахстаном\r\n- *Я буквально видел как звезды двигаются по небу, и это просто волшебно*\r\n- Пожил месяц в Казахстане - там клево, рекомендую, одни из самых впечатляющих видов природы которые я когда-либо видел вообще.\r\n- И вот я в Сербии :)\r\n\r\nВсем привет, всех обнимаю. Буду рад поболтать о любой фигне, даже если я в ней ничего не понимаю - хоть вас послушаю. :)	<p><em>Один мой друг навел меня на мысль, что надо написать интро так, будто ты выпендриваешься, потому что иначе выходит резюме, поэтому я решил переписать.</em></p>\n<p>Привет, я Витян, родился и <del>живу</del> жил большую часть жизни в славном Петербурге, поэтому погода за окном меня вообще не беспокоит, с ней можно только смириться.</p>\n<p>На свою первую работу я попал случайно, и это было очень круто, ведь ее можно описать так:</p>\n<ul>\n<li><em>Я делал сраных роботов!</em></li>\n<li><em>Я помогал организовывать соревнования сраных роботов!</em></li>\n<li><em>Оборудование для этих соревнований перевозили вооруженные люди!</em></li>\n<li><em>Я жил на испытательном полигоне ГАЗа!</em></li>\n<li><em>Я тусил на тренировочной базе МЧС в подмосковье, там вообще-то космонавты тренируются!</em></li>\n<li><em>Я там еще и с офицерами МЧС в баре зависал!</em></li>\n</ul>\n<p>А потом универ закончился, я перешел в другой отдел и стало грустно :(</p>\n<p>Поэтому я уволился и не менее случайно оказался в кажется лучшей конторе, о которой можно было только мечтать.<br>\nТут делают клевые штуки, которые офигенно выглядят и с ними приятно работать. Процессы без лишней фигни, а сотрудники - основной ресурс, который стараются беречь, это ли не счастье?</p>\n<p><em>Походу в основном меня определяет работа. Жаль, но не сильно</em></p>\n<p>Женат, живем втроем с кошкой. <del>Все мечтал поездить по России и миру, но видимо недостаточно сильно, чтобы реально поездить.</del><br>\nАХХАХАХАХ</p>\n<p>Расширяем список жизненных достижений:</p>\n<ul>\n<li>Проехал 2.5к км за сутки от Санкт-Петербурга до Астрахани и еще немного</li>\n<li>А потом проторчал трое суток в пробке на границе с Казахстаном</li>\n<li><em>Я буквально видел как звезды двигаются по небу, и это просто волшебно</em></li>\n<li>Пожил месяц в Казахстане - там клево, рекомендую, одни из самых впечатляющих видов природы которые я когда-либо видел вообще.</li>\n<li>И вот я в Сербии :)</li>\n</ul>\n<p>Всем привет, всех обнимаю. Буду рад поболтать о любой фигне, даже если я в ней ничего не понимаю - хоть вас послушаю. :)</p>	\N	\N	\N	2023-06-16 10:26:56.083903+00	2023-06-16 10:27:12.405287+00	2023-06-16 10:26:56.083925+00	0	1	4	t	t	t	f	f	\N	2e006b8a-0f38-4b66-be06-c79b4b888b31	\N	f	2023-06-16 10:26:56.083542+00	\N	0	\N	{}	\N	\N
329ee87a-f39b-4f76-bc09-c351d8bc2b7d	19	post	Как я участвовал в соревнованиях роботов 🤖	*Disclaimer: технических подробностей не будет, у нас тут не Хабр, но если будет интересно - готов рассказать в деталях!*\r\n*Disclaimer2: я в первый раз в жизни пишу пост, понятия не имею, как это делается. Будет много картинок  :)*\r\n\r\n## Что за соревнования такие\r\n\r\nСуществует в России, в Санкт-Петербурге, странноватое место, которое называется ЦНИИ РТК.  В 2016 году я пришел туда работать, и оказалось, что они проводят свои соревнования, к тому моменту уже 1 или 2 года как.\r\n\r\n![Возможно кто-то узнает вот эту башенку](https://i.vas3k.club/92694f001e839fb97837e49e111665fa67793a6ac749000ce53d0e758e5abd70.jpg)\r\n\r\nПодробно про сами соревнования, регламент и вообще все можно узнать на [официальном сайте](https://cup.rtc.ru/) и [группе ВК](https://vk.com/rtccup), поэтому я тут кратенько.\r\n\r\nЕсть полигон, который состоит из кубиков, каждый кубик - испытание, проходишь испытание - получаешь баллы. Робот разваливается по дороге, требуется вмешательство или еще что-нибудь - теряешь баллы, кто набрал больше баллов - тот и молодец :)\r\nДве попытки по 10 минут, в зачет идет лучшая.\r\n\r\n![Как-то так выглядит полигон](https://i.vas3k.club/2f461433380b34453c6a14deaccd0d55f01522602b7ee0d8b6432a50cb1e4949.jpg)\r\n\r\nЕсть две основные категории: \r\n- Искатель - для тех кто младше, смотришь на робота, едешь по полигону\r\n- Экстремал - для тех то старше, сидишь в будке, робота не видишь, ориентируешься только по тому, что он тебе присылает. (Обычно это скучное видео с камеры, но жесткого правила нет, если будете ехать чисто по дальномерам - я хочу видео)\r\n\r\nЗадания можно разнести на три категории:\r\n- На проходимость - проехать по крыше, по искусственной траве, по куску линолеума смазанному WD-40, по всяким нагромождениям, все в таком духе\r\n- На использование манипулятора (если он есть конечно) - перекладывать разные штуки с места на место, поворачивать вентили и т.д.\r\n- На автономность - прям в выделенных под это ячейках есть только следование по линии, но потенциально можно проехать автономно хоть весь полигон, и чтоб сам еще манипулятором все пошевелил. Ограничение, на сколько я помню, в том, что нельзя совсем уж тупых штук вроде *ехать вперед 10 секунд, повернуть направо, ехать 5 секунд*\r\n\r\n## Что я там делал вообще\r\n\r\nС маркетингом первые годы все было плохо и тупо не хватало участников, поэтому было как-то так:\r\n— *Ты участвуешь в соревнованиях роботов*\r\n— *Эээээээ*\r\n— *Это не вопрос был, робота мы тебе дадим, на первое время*\r\n\r\nОбычно соревнования проводились в рамках каких-нибудь фестивалей типа [Робофиниста](https://robofinist.ru/) или [Robofest](http://www.russianrobofest.ru/), поэтому там были и просто посетители, которых надо было развлекать, этим мы и занимались. Ну еще собирали и разбирали полигон, придумывали и делали для него новые препятствия, помогали с проведением самих соревнований.\r\n\r\nВот так мы развлекали посетителей - давали роботом погонять. От первого лица!\r\n![Знакомьтесь, Лупоглаз (внизу)](https://i.vas3k.club/2777ea64b44a02b7b90892dacac6ad9017c68ee7b6afc26e78939d265056fdfd.jpg)\r\n\r\nНа мальчике слева - самопальный шлем виртуальной реальности, мальчик поворачивает голову - Лупоглаз поворачивает голову. Довольно прикольно. Иногда подходили девушки в юбках и хотели присесть перед Лупоглазом, чтобы рассмотреть получше, приходилось останавливать :)\r\n\r\n## Робот номер ноль\r\n\r\nЭто было странно, по другому не описать. Со стороны это похоже на гонки черепах, наверное. Большую часть времени ничего не происходит, какая-то непонятная херовина чем-то жалко пытается шевелиться, иногда застревает, изредка смешно падает.\r\nНо время от времени приходит участник, который умеет делать что-то руками, и тогда все получается куда более динамично.\r\n\r\n![Знакомьтесь, Степашка](https://i.vas3k.club/ec80d67b8cccdbebf7c29a4937c3d526a3479daf79a04dcbfe28dfeb8fbfe008.jpg)\r\n\r\nЕхех\r\n\r\nНет, ну с чужим роботом и у меня было динамично и весело. \r\nСтепашка был хорош, его даже потом в музее при ЦНИИ РТК оставили, может до сих пор стоит. Манипулятор из принтерного лотка для бумаги, вся поверхность в отверстиях с шагом 10 мм, что позволяло крепить сверху что угодно (нет, зато стоило очень дорого, в лазерной резке каждый врез увеличивает стоимость :) ), на месте разворачивался, как танк. А еще ему хватало сил на то, чтобы кирпичи с места сдвигать. На первых двух соревнованиях мы с ним даже первое место заняли, а потом нам сказали сделать наконец нового робота, потому что задолбали.\r\n\r\n![Внимательный читатель может заметить, что сзади появились два пропеллера](https://i.vas3k.club/7f70f1899e8ae12cdc96013db6b32e9799f42ab71de13e71236aa40f87211295.jpg)\r\n\r\nМы с ним все равно потом еще немного выступали, потому что участников было все еще мало, но призовых мест больше не было.\r\nПоправок внесли ему две - камеру заднего вида и два импеллера.\r\n\r\nКамера работала не постоянно, но давала клевый эффект - оператор мог, по нажатию на кнопку,  переключать изображение и инвертировать управление. Т.е. если ты встрял, и развернуться уже не получалось, можно было попробовать выехать задом. Не пригодилось ни разу правда :(\r\n\r\nС импеллерами смешная история получилась: на предыдущем фото шариков для пинг-понга - это вообще одно из самых сложных испытаний было, так вот мы задумали их раздуть и просто проехать :D\r\nИзначальный план был дуть перед собой, но не получилось, тогда воткнули ему в зад камеру, чтобы видеть, куда едешь, пока дуешь. Разумеется первая проверка этой идеи была прямо на соревнованиях, и оказалось что ничего нормально не работает :D\r\nКогда пропеллеры раскрутились, вибрация оказалась такой, что картинка с камеры превратилась в однородное пятно. Казалось бы ладно, нужно-то просто вперед проехать, но это оказалось тоже непросто. Держали когда-нибудь в руках джойстик от современной приставки? Знаете там стики такие, чтобы бегать? Вот чтобы дуло, нужно было жать на этот стик, а чтобы ехать - надо жать на стрелочку вверх на крестовине. И то и другое предназначено для одного левого большого пальца, мда. Мораль: *проверяйте идеи перед продакшеном!*\r\n\r\n## Робот номер один\r\n\r\nСпустя время нам окончательно запретили выступать со Степашкой, и тогда пришло время делать своего робота. \r\nУ моего руководителя *(Макс, привет, вряд ли ты это читаешь)* была идея фикс - сделать робота с подвеской как у марсохода. Не, ну он же должен ползать по пересеченной местности на другой планете, значит наверное должен быть проходимым, да?\r\n\r\nПолучился совсем не марсоход, ну да и я - не НАСА :)\r\n\r\nЯ не умею давать нормальные имена, поэтому...\r\n![Знакомьтесь, Ровер](https://i.vas3k.club/e49e0046f1bb06e3da442495fc2dbe34796516fb93ef3fdd265359b35d167ced.jpg)\r\n\r\nПро него, если честно, сложно что-то рассказать. Он получился просто никакой, хотя и прикольно выглядел :)\r\nМоторы вообще сразу были в разряде расходников, один-два менялись между попытками. Он был не очень быстрый, довольно слабый, фигово поворачивал, и при всем этом был еще и переусложненным. Не делайте так.\r\nА еще он был слишком высоким и легко переворачивался :)\r\n\r\nЗато у меня есть видео на котором можно посмотреть, как это примерно выглядит для того, кто управляет роботом.\r\nНа 4:40 видно как делали фотографию выше, а на 4:42 как робот перевернулся :D\r\n\r\nhttps://youtu.be/EGvWrroRmuY\r\n\r\nС ним я уверенно занимал места где-то в начале нижней половине общего рейтинга :)\r\n\r\n## Робот номер два\r\n\r\nМы немного подумали, и решили сделать новую версию, поработав над ошибками.\r\nПоэтому он вышел даже хуже, конечно же :D\r\n\r\n![Ровер 2.0](https://i.vas3k.club/8f7d94df32fe007ec94486cbccb213b801d02a06c9958ea3c40a351876f71ff5.jpg)\r\n\r\nМы смогли избавиться от одной болячки первой версии - этот гораздо лучше поворачивал. А вот от остальных проблем мы не избавились: моторы все еще были слабым местом и не давали никакой проходимости, а обслуживать его, в силу конструкции, стало только сложнее. В качестве бонуса: корпус ему нарезали из более мягкой стали, которая предназначена для сгибания, поэтому в процессе езды он колебался как желейка :D\r\nА поворачивающиеся колеса очень охотно застревали в самых неожиданных местах.\r\n\r\n![Памагити](https://i.vas3k.club/64a65fa266da332f5acdfaea5c4a02c76cf05a140549e7c3c52a5c3169c66abe.jpg)\r\n\r\nДоделывая его в вечер перед соревнованиями, я уже понимал, что это провал. Так и оказалось.\r\n\r\nЗато я очень хорошо запомнил тот вечер. Сидел один в кабинете, уже тупо смотрел на робота, ничего не хотелось делать. Время что-то около 10 вечера, через пол часа пора выходить на поезд. Неожиданно заходит @denisdenk и говорит "Что-то ты выглядишь плохо, давай я помогу тебе взбодриться, у меня вот есть с собой молотый бразильский кофе, давай сделаю тебе". Так я в первый раз в жизни попробовал по-настоящему крепкий кофе. Офигел знатно, сердце билось так, что когда я просто сидел - я покачивался. Кажется почти не спал в ту ночь, но на утро все равно чувствовал себя бодрячком! Хороший кофе, хороший друг :)\r\n\r\n## Робот номер три\r\n\r\nНу уж с третьего-то раза у нас должно было что-то получиться правда? \r\nА-ХА-ХА-ХА-ХА-ХА\r\nНу вообще-то почти получилось.\r\n\r\n![Ровер 3.0](https://i.vas3k.club/5436a3d7352a04c01b9ac5b07db8afee886e066542f0ba4961008cb97f32d69e.jpg)\r\n\r\nВот теперь мы действительно проделали работу над ошибками. Большие колеса, нормальные моторы, даже подвеска более-менее работает. \r\n\r\nК тому моменту в правила внесли изменения - теперь для нас было обязательно, чтобы робот умел в какую-никакую автономность. Как самый простой и очевидный вариант мы тоже решили делать следование по линии, но мы ж крутые, мы ж могем, мы ж не первый год участвуем. Короче мы решили выпендриваться и сделали распознавание линии при помощи отдельной камеры - серый конус между передними колесами - это она.\r\n\r\nФатальный недостаток у этой версии оказался всего один - он УЖАСНО медленный. Из 10 минут попытки, на прохождение по линии тратилось 5. Внимательнее смотрите, что заказываете с AliExpress :)\r\n\r\nА еще история про настойчивость: деталь к которой крепились моторы исправлялась и перепечатывалась 17 (семнадцать) раз. Может это история про мою невнимательность и глупость, конечно, я не уверен, но хочу думать, что про настойчивость.\r\n\r\nНа моменте с этим роботом произошел максимальный разъеб лично меня, я не могу назвать это по другому.\r\nЯ работал над этой железякой несколько месяцев, больше трех точно, думал что уж какой-то опыт я накопил и смогу вскарабкаться обратно к призовым местам. \r\n\r\nОбычно первая и вторая попытка проходят в разные дни, чтобы можно было успеть починить робота в случае чего. В тот раз один из давних участников не смог попасть на первый день соревнований и пришел только на второй. А потом оказалось, что он не успевал сделать ничего к обязательному условию про автономность, и воспользовался неоговоренной в правилах лазейкой. Перед своим заездом он даже обсуждал это с главным судьей соревнований примерно так:\r\n\r\n— *Ты же понимаешь, что это не твой уровень и просто лазейка?*\r\n— *Понимаю, но я не успевал, а по правилам так можно*\r\n— *Ладно, фиг с тобой, допущен до попытки*\r\n\r\nЕсли не ошибаюсь, он тогда занял второе место, а я четвертое. Снова не оказался на пъедистале, хех. Правда тогда мне дали грамоту за то, что больше других получил баллов за автономность, так что в каком-то смысле все равно получил приз :)\r\nЯ еще потом поинтересовался у него, сколько он своего робота делал. Он сказал, что меньше месяца.\r\n\r\nШтош.\r\n\r\nНе нужно переусложнять, получается.\r\n\r\nПарня я не виню, конечно же, он молодец, думаю у него все круто сложилось дальше, он умный. Но в моменте обидно было прямо до слез.\r\n\r\n## И еще много роботов\r\n\r\nТе соревнования для меня, как для участника, стали последними, больше не хотелось. Помогал коллегам своих роботов доделывать, моего Ровера потом другие доделывали, вроде с ним даже занимали призовые места, не уверен. \r\n\r\nНо история приняла интересный оборот. Нам сказали разработать новый полигон и к нему роботов, чтобы мы предоставляли и полигон, по которому кататься, и роботов, которые бы по нему ездили. Так мы сделали [робота](https://rtc.ru/solution/agro-robot/), под которого мы же сделали [полигон](https://rtc.ru/solution/poligon-rtk-agro/) :D\r\nСпециально проверяли, что он может пройти все препятствия, и придумывали новые специально под него. [А еще он умеет какать.](https://youtu.be/X_-UAc1eDTM) \r\n\r\n![Агро-робот](https://i.vas3k.club/4cc48bcca94904bcc785af0a1d0d6d0eb78b2961ad11b13aa8ec73718cbee191.jpg)\r\n\r\nТам были какие-то мутные истории с грантами, выделением средств, как водится, непонятно на что и всякое в таком духе, я не знаю ничего об этой стороне вопроса. \r\nЗато знаю, что пока я оттуда не уволился, мы собрали около 60 штук, а после этого - еще около 100, если не больше.\r\n\r\n![Много агро-роботов](https://i.vas3k.club/5daa7654fcf5728138924655661d67cf3a6e9c9b114277311a3e91aab9cc8402.jpg)\r\n\r\n## Вместо заключения\r\n\r\nНе знаю, что еще добавить, такая вот история. Теперь всем говорю, что роботов делал.\r\n\r\n![Буквально я](https://i.vas3k.club/62f7307fb627d5bec3dcbd407d3d57bbd949d89d6dbf572f2f1f2e5dda85386b.jpg)	<p><em>Disclaimer: технических подробностей не будет, у нас тут не Хабр, но если будет интересно - готов рассказать в деталях!</em><br>\n<em>Disclaimer2: я в первый раз в жизни пишу пост, понятия не имею, как это делается. Будет много картинок  :)</em></p>\n<h2 id="Chto-za-sorevnovaniia-taki"><a href="#Chto-za-sorevnovaniia-taki">Что за соревнования такие</a></h2>\n<p>Существует в России, в Санкт-Петербурге, странноватое место, которое называется ЦНИИ РТК.  В 2016 году я пришел туда работать, и оказалось, что они проводят свои соревнования, к тому моменту уже 1 или 2 года как.</p>\n<p><figure class=""><img src="https://i.vas3k.club/92694f001e839fb97837e49e111665fa67793a6ac749000ce53d0e758e5abd70.jpg" alt="Возможно кто-то узнает вот эту башенку"><figcaption>Возможно кто-то узнает вот эту башенку</figcaption></figure></p>\n<p>Подробно про сами соревнования, регламент и вообще все можно узнать на <a href="https://cup.rtc.ru/">официальном сайте</a> и <a href="https://vk.com/rtccup">группе ВК</a>, поэтому я тут кратенько.</p>\n<p>Есть полигон, который состоит из кубиков, каждый кубик - испытание, проходишь испытание - получаешь баллы. Робот разваливается по дороге, требуется вмешательство или еще что-нибудь - теряешь баллы, кто набрал больше баллов - тот и молодец :)<br>\nДве попытки по 10 минут, в зачет идет лучшая.</p>\n<p><figure class=""><img src="https://i.vas3k.club/2f461433380b34453c6a14deaccd0d55f01522602b7ee0d8b6432a50cb1e4949.jpg" alt="Как-то так выглядит полигон"><figcaption>Как-то так выглядит полигон</figcaption></figure></p>\n<p>Есть две основные категории:</p>\n<ul>\n<li>Искатель - для тех кто младше, смотришь на робота, едешь по полигону</li>\n<li>Экстремал - для тех то старше, сидишь в будке, робота не видишь, ориентируешься только по тому, что он тебе присылает. (Обычно это скучное видео с камеры, но жесткого правила нет, если будете ехать чисто по дальномерам - я хочу видео)</li>\n</ul>\n<p>Задания можно разнести на три категории:</p>\n<ul>\n<li>На проходимость - проехать по крыше, по искусственной траве, по куску линолеума смазанному WD-40, по всяким нагромождениям, все в таком духе</li>\n<li>На использование манипулятора (если он есть конечно) - перекладывать разные штуки с места на место, поворачивать вентили и т.д.</li>\n<li>На автономность - прям в выделенных под это ячейках есть только следование по линии, но потенциально можно проехать автономно хоть весь полигон, и чтоб сам еще манипулятором все пошевелил. Ограничение, на сколько я помню, в том, что нельзя совсем уж тупых штук вроде <em>ехать вперед 10 секунд, повернуть направо, ехать 5 секунд</em></li>\n</ul>\n<h2 id="Chto-ia-tam-delal-voobshche"><a href="#Chto-ia-tam-delal-voobshche">Что я там делал вообще</a></h2>\n<p>С маркетингом первые годы все было плохо и тупо не хватало участников, поэтому было как-то так:<br>\n— <em>Ты участвуешь в соревнованиях роботов</em><br>\n— <em>Эээээээ</em><br>\n— <em>Это не вопрос был, робота мы тебе дадим, на первое время</em></p>\n<p>Обычно соревнования проводились в рамках каких-нибудь фестивалей типа <a href="https://robofinist.ru/">Робофиниста</a> или <a href="http://www.russianrobofest.ru/">Robofest</a>, поэтому там были и просто посетители, которых надо было развлекать, этим мы и занимались. Ну еще собирали и разбирали полигон, придумывали и делали для него новые препятствия, помогали с проведением самих соревнований.</p>\n<p>Вот так мы развлекали посетителей - давали роботом погонять. От первого лица!<br>\n<figure class=""><img src="https://i.vas3k.club/2777ea64b44a02b7b90892dacac6ad9017c68ee7b6afc26e78939d265056fdfd.jpg" alt="Знакомьтесь, Лупоглаз (внизу)"><figcaption>Знакомьтесь, Лупоглаз (внизу)</figcaption></figure></p>\n<p>На мальчике слева - самопальный шлем виртуальной реальности, мальчик поворачивает голову - Лупоглаз поворачивает голову. Довольно прикольно. Иногда подходили девушки в юбках и хотели присесть перед Лупоглазом, чтобы рассмотреть получше, приходилось останавливать :)</p>\n<h2 id="Robot-nomer-nol"><a href="#Robot-nomer-nol">Робот номер ноль</a></h2>\n<p>Это было странно, по другому не описать. Со стороны это похоже на гонки черепах, наверное. Большую часть времени ничего не происходит, какая-то непонятная херовина чем-то жалко пытается шевелиться, иногда застревает, изредка смешно падает.<br>\nНо время от времени приходит участник, который умеет делать что-то руками, и тогда все получается куда более динамично.</p>\n<p><figure class=""><img src="https://i.vas3k.club/ec80d67b8cccdbebf7c29a4937c3d526a3479daf79a04dcbfe28dfeb8fbfe008.jpg" alt="Знакомьтесь, Степашка"><figcaption>Знакомьтесь, Степашка</figcaption></figure></p>\n<p>Ехех</p>\n<p>Нет, ну с чужим роботом и у меня было динамично и весело. <br>\nСтепашка был хорош, его даже потом в музее при ЦНИИ РТК оставили, может до сих пор стоит. Манипулятор из принтерного лотка для бумаги, вся поверхность в отверстиях с шагом 10 мм, что позволяло крепить сверху что угодно (нет, зато стоило очень дорого, в лазерной резке каждый врез увеличивает стоимость :) ), на месте разворачивался, как танк. А еще ему хватало сил на то, чтобы кирпичи с места сдвигать. На первых двух соревнованиях мы с ним даже первое место заняли, а потом нам сказали сделать наконец нового робота, потому что задолбали.</p>\n<p><figure class=""><img src="https://i.vas3k.club/7f70f1899e8ae12cdc96013db6b32e9799f42ab71de13e71236aa40f87211295.jpg" alt="Внимательный читатель может заметить, что сзади появились два пропеллера"><figcaption>Внимательный читатель может заметить, что сзади появились два пропеллера</figcaption></figure></p>\n<p>Мы с ним все равно потом еще немного выступали, потому что участников было все еще мало, но призовых мест больше не было.<br>\nПоправок внесли ему две - камеру заднего вида и два импеллера.</p>\n<p>Камера работала не постоянно, но давала клевый эффект - оператор мог, по нажатию на кнопку,  переключать изображение и инвертировать управление. Т.е. если ты встрял, и развернуться уже не получалось, можно было попробовать выехать задом. Не пригодилось ни разу правда :(</p>\n<p>С импеллерами смешная история получилась: на предыдущем фото шариков для пинг-понга - это вообще одно из самых сложных испытаний было, так вот мы задумали их раздуть и просто проехать :D<br>\nИзначальный план был дуть перед собой, но не получилось, тогда воткнули ему в зад камеру, чтобы видеть, куда едешь, пока дуешь. Разумеется первая проверка этой идеи была прямо на соревнованиях, и оказалось что ничего нормально не работает :D<br>\nКогда пропеллеры раскрутились, вибрация оказалась такой, что картинка с камеры превратилась в однородное пятно. Казалось бы ладно, нужно-то просто вперед проехать, но это оказалось тоже непросто. Держали когда-нибудь в руках джойстик от современной приставки? Знаете там стики такие, чтобы бегать? Вот чтобы дуло, нужно было жать на этот стик, а чтобы ехать - надо жать на стрелочку вверх на крестовине. И то и другое предназначено для одного левого большого пальца, мда. Мораль: <em>проверяйте идеи перед продакшеном!</em></p>\n<h2 id="Robot-nomer-odin"><a href="#Robot-nomer-odin">Робот номер один</a></h2>\n<p>Спустя время нам окончательно запретили выступать со Степашкой, и тогда пришло время делать своего робота. <br>\nУ моего руководителя <em>(Макс, привет, вряд ли ты это читаешь)</em> была идея фикс - сделать робота с подвеской как у марсохода. Не, ну он же должен ползать по пересеченной местности на другой планете, значит наверное должен быть проходимым, да?</p>\n<p>Получился совсем не марсоход, ну да и я - не НАСА :)</p>\n<p>Я не умею давать нормальные имена, поэтому...<br>\n<figure class=""><img src="https://i.vas3k.club/e49e0046f1bb06e3da442495fc2dbe34796516fb93ef3fdd265359b35d167ced.jpg" alt="Знакомьтесь, Ровер"><figcaption>Знакомьтесь, Ровер</figcaption></figure></p>\n<p>Про него, если честно, сложно что-то рассказать. Он получился просто никакой, хотя и прикольно выглядел :)<br>\nМоторы вообще сразу были в разряде расходников, один-два менялись между попытками. Он был не очень быстрый, довольно слабый, фигово поворачивал, и при всем этом был еще и переусложненным. Не делайте так.<br>\nА еще он был слишком высоким и легко переворачивался :)</p>\n<p>Зато у меня есть видео на котором можно посмотреть, как это примерно выглядит для того, кто управляет роботом.<br>\nНа 4:40 видно как делали фотографию выше, а на 4:42 как робот перевернулся :D</p>\n<p><figure><span class="ratio-16-9"><iframe loading="lazy" src="https://www.youtube.com/embed/EGvWrroRmuY?autoplay=0&amp;controls=1&amp;showinfo=1&amp;vq=hd1080"allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; fullscreen"allowfullscreen></iframe></span></figure></p>\n<p>С ним я уверенно занимал места где-то в начале нижней половине общего рейтинга :)</p>\n<h2 id="Robot-nomer-dva"><a href="#Robot-nomer-dva">Робот номер два</a></h2>\n<p>Мы немного подумали, и решили сделать новую версию, поработав над ошибками.<br>\nПоэтому он вышел даже хуже, конечно же :D</p>\n<p><figure class=""><img src="https://i.vas3k.club/8f7d94df32fe007ec94486cbccb213b801d02a06c9958ea3c40a351876f71ff5.jpg" alt="Ровер 2.0"><figcaption>Ровер 2.0</figcaption></figure></p>\n<p>Мы смогли избавиться от одной болячки первой версии - этот гораздо лучше поворачивал. А вот от остальных проблем мы не избавились: моторы все еще были слабым местом и не давали никакой проходимости, а обслуживать его, в силу конструкции, стало только сложнее. В качестве бонуса: корпус ему нарезали из более мягкой стали, которая предназначена для сгибания, поэтому в процессе езды он колебался как желейка :D<br>\nА поворачивающиеся колеса очень охотно застревали в самых неожиданных местах.</p>\n<p><figure class=""><img src="https://i.vas3k.club/64a65fa266da332f5acdfaea5c4a02c76cf05a140549e7c3c52a5c3169c66abe.jpg" alt="Памагити"><figcaption>Памагити</figcaption></figure></p>\n<p>Доделывая его в вечер перед соревнованиями, я уже понимал, что это провал. Так и оказалось.</p>\n<p>Зато я очень хорошо запомнил тот вечер. Сидел один в кабинете, уже тупо смотрел на робота, ничего не хотелось делать. Время что-то около 10 вечера, через пол часа пора выходить на поезд. Неожиданно заходит <a href="/user/denisdenk/">@denisdenk</a> и говорит &quot;Что-то ты выглядишь плохо, давай я помогу тебе взбодриться, у меня вот есть с собой молотый бразильский кофе, давай сделаю тебе&quot;. Так я в первый раз в жизни попробовал по-настоящему крепкий кофе. Офигел знатно, сердце билось так, что когда я просто сидел - я покачивался. Кажется почти не спал в ту ночь, но на утро все равно чувствовал себя бодрячком! Хороший кофе, хороший друг :)</p>\n<h2 id="Robot-nomer-tri"><a href="#Robot-nomer-tri">Робот номер три</a></h2>\n<p>Ну уж с третьего-то раза у нас должно было что-то получиться правда? <br>\nА-ХА-ХА-ХА-ХА-ХА<br>\nНу вообще-то почти получилось.</p>\n<p><figure class=""><img src="https://i.vas3k.club/5436a3d7352a04c01b9ac5b07db8afee886e066542f0ba4961008cb97f32d69e.jpg" alt="Ровер 3.0"><figcaption>Ровер 3.0</figcaption></figure></p>\n<p>Вот теперь мы действительно проделали работу над ошибками. Большие колеса, нормальные моторы, даже подвеска более-менее работает.</p>\n<p>К тому моменту в правила внесли изменения - теперь для нас было обязательно, чтобы робот умел в какую-никакую автономность. Как самый простой и очевидный вариант мы тоже решили делать следование по линии, но мы ж крутые, мы ж могем, мы ж не первый год участвуем. Короче мы решили выпендриваться и сделали распознавание линии при помощи отдельной камеры - серый конус между передними колесами - это она.</p>\n<p>Фатальный недостаток у этой версии оказался всего один - он УЖАСНО медленный. Из 10 минут попытки, на прохождение по линии тратилось 5. Внимательнее смотрите, что заказываете с AliExpress :)</p>\n<p>А еще история про настойчивость: деталь к которой крепились моторы исправлялась и перепечатывалась 17 (семнадцать) раз. Может это история про мою невнимательность и глупость, конечно, я не уверен, но хочу думать, что про настойчивость.</p>\n<p>На моменте с этим роботом произошел максимальный разъеб лично меня, я не могу назвать это по другому.<br>\nЯ работал над этой железякой несколько месяцев, больше трех точно, думал что уж какой-то опыт я накопил и смогу вскарабкаться обратно к призовым местам.</p>\n<p>Обычно первая и вторая попытка проходят в разные дни, чтобы можно было успеть починить робота в случае чего. В тот раз один из давних участников не смог попасть на первый день соревнований и пришел только на второй. А потом оказалось, что он не успевал сделать ничего к обязательному условию про автономность, и воспользовался неоговоренной в правилах лазейкой. Перед своим заездом он даже обсуждал это с главным судьей соревнований примерно так:</p>\n<p>— <em>Ты же понимаешь, что это не твой уровень и просто лазейка?</em><br>\n— <em>Понимаю, но я не успевал, а по правилам так можно</em><br>\n— <em>Ладно, фиг с тобой, допущен до попытки</em></p>\n<p>Если не ошибаюсь, он тогда занял второе место, а я четвертое. Снова не оказался на пъедистале, хех. Правда тогда мне дали грамоту за то, что больше других получил баллов за автономность, так что в каком-то смысле все равно получил приз :)<br>\nЯ еще потом поинтересовался у него, сколько он своего робота делал. Он сказал, что меньше месяца.</p>\n<p>Штош.</p>\n<p>Не нужно переусложнять, получается.</p>\n<p>Парня я не виню, конечно же, он молодец, думаю у него все круто сложилось дальше, он умный. Но в моменте обидно было прямо до слез.</p>\n<h2 id="I-eshche-mnogo-robotov"><a href="#I-eshche-mnogo-robotov">И еще много роботов</a></h2>\n<p>Те соревнования для меня, как для участника, стали последними, больше не хотелось. Помогал коллегам своих роботов доделывать, моего Ровера потом другие доделывали, вроде с ним даже занимали призовые места, не уверен.</p>\n<p>Но история приняла интересный оборот. Нам сказали разработать новый полигон и к нему роботов, чтобы мы предоставляли и полигон, по которому кататься, и роботов, которые бы по нему ездили. Так мы сделали <a href="https://rtc.ru/solution/agro-robot/">робота</a>, под которого мы же сделали <a href="https://rtc.ru/solution/poligon-rtk-agro/">полигон</a> :D<br>\nСпециально проверяли, что он может пройти все препятствия, и придумывали новые специально под него. <a href="https://youtu.be/X_-UAc1eDTM">А еще он умеет какать.</a></p>\n<p><figure class=""><img src="https://i.vas3k.club/4cc48bcca94904bcc785af0a1d0d6d0eb78b2961ad11b13aa8ec73718cbee191.jpg" alt="Агро-робот"><figcaption>Агро-робот</figcaption></figure></p>\n<p>Там были какие-то мутные истории с грантами, выделением средств, как водится, непонятно на что и всякое в таком духе, я не знаю ничего об этой стороне вопроса. <br>\nЗато знаю, что пока я оттуда не уволился, мы собрали около 60 штук, а после этого - еще около 100, если не больше.</p>\n<p><figure class=""><img src="https://i.vas3k.club/5daa7654fcf5728138924655661d67cf3a6e9c9b114277311a3e91aab9cc8402.jpg" alt="Много агро-роботов"><figcaption>Много агро-роботов</figcaption></figure></p>\n<h2 id="Vmesto-zakliucheniia"><a href="#Vmesto-zakliucheniia">Вместо заключения</a></h2>\n<p>Не знаю, что еще добавить, такая вот история. Теперь всем говорю, что роботов делал.</p>\n<p><figure class=""><img src="https://i.vas3k.club/62f7307fb627d5bec3dcbd407d3d57bbd949d89d6dbf572f2f1f2e5dda85386b.jpg" alt="Буквально я"><figcaption>Буквально я</figcaption></figure></p>	\N	\N	\N	2023-06-16 12:13:01.221816+00	2023-06-16 12:13:26.108886+00	2023-06-16 12:13:26.108786+00	1	0	0	t	t	t	f	t	\N	871cdf10-6fd9-4f6b-8431-1bcf12fe2823	\N	f	2023-06-16 12:13:16.763476+00	\N	0	\N	{}	\N	\N
