62f5bb9.jpg)\r\n\r\nВ целом, советы можно свести к трем пунктам:\r\nкоторые можно свести к двум пунктам:\r\n\r\n- Жри лучше и меньше\r\n- Двигайся больше\r\n- Не кури и не бухай\r\n\r\n![](https://i.vas3k.club/92327c9dc916f79c1741f09398c54d75aae691430c02ee5465c5c745fa1ecc31.jpg)\r\n\r\nДостаточно универсально, не так ли? Но за каждым пунктом скрывается бездна уточняющих вопросов:\r\n\r\n- А что можно есть?\r\n- А что лучше не надо?\r\n- А как часто питаться?\r\n- А как готовить?\r\n- А когда тренировки, до или после еды?\r\n- А какие тренировки?\r\n\r\nНе растекаясь по повествованию скажу кратко — ChatGPT мне ответил на все вопросы и составил рацион питания и план тренировок. Чтобы свалидировать эти советы и убедиться, что он мне не советует полную дичь, я заказал консультацию в Яндекс.Здоровье, где показал анализы и их разбор с рекомендациями ChatGPT под соусом: «ой посмотрите, тут мне доктор насоветовал, можете дать свою оценку и скорректировать, если что не так?»\r\n\r\n![](https://i.vas3k.club/177cfd6bd72735062e727c94189bebcd3dddbd86d4f078c26934a082588d3de2.jpg)\r\n\r\nНа что я получил обнадеживающий ответ: «Да, все отлично, тут нечего добавить, следуйте рекомендациям». Так начался мой путь под контролем ИИ.\r\n\r\n### Ежедневное использование\r\n\r\nЯ добавил на главный экран закладку на этот чат с ChatGPT и использовал его регулярно. Например:\r\n\r\n- План покупок: «Я иду в магазин, дай мне список продуктов для покупки с учетом моей диеты»\r\n\r\nИ получал простой чеклист. Так я открыл для себя новые продукты, которые раньше бы даже не подумал купить. Коричневый рис? Зачем это такое вообще? Киноа? Это что-то на хипстерском?\r\n\r\n![](https://i.vas3k.club/c692c5ed75030f7ad160b734e1ea11aaa844757f1b0ef7ab7ae3f00decc82ac5.jpg)\r\n\r\n- Рацион дня: «У меня есть такие продукты: A, B, ..., Y, Z. Составь рацион на день.»\r\n\r\nИ получал интересные несложные блюда, которые без особых проблем готовил самостоятельно своими некулинарными айтишными ручками. Только с граммовкой блюд были проблемы, пришлось купить кухонные весы. И по ходу готовки я задавал глупые вопросы, например, как сварить гречку, чтобы получилось 150 грамм по итогу?\r\n\r\n- Корректировки: «Сорри мистер ChatGPT, но я закинул в себя яичницу с беконом в кафешке. Оцени этот завтрак и скорректируй рацион на остаток дня»\r\n\r\n![](https://i.vas3k.club/9952e3ae68a66ae71681ea6fd4c2c109396be3175e91e094016e93a8ded0ca3a.jpg)\r\n\r\nИногда все идет не по плану — пошел на встречу в кофейню, а там только кофе и круассаны. Я думаю что это не повод радикально отказываться от всего неподходящего, скорее это про постепенное изменение своих пищевых привычек. И в таком ключе важно не сбрасывать со счетов весь план, если что-то в нем пошло не так, как хотелось.\r\n\r\n![](https://i.vas3k.club/8320d27d45dde2e11df60292d6bb05dbee6aa825a86dc7dfbd61ae13f9179140.jpg)\r\n\r\n### Главные инсайты для меня\r\n\r\nСпустя месяц ежедневного использования, где ИИ говорил мне как есть, что пить и как двигаться, примерно так изменилась моя жизнь:\r\n\r\n- Почти полностью отказался от сахара\r\n\r\nНачал читать циферки на банках и упаковках. Был в шоке что в баночке лимонной газировки, которая вообще не сладкая, 6 кубиков рафинада на 330 мл. Думаю про сахар это тема отдельного поста от знающих людей, но для меня это было прям откровением — он просто везде!\r\n\r\n![](https://i.vas3k.club/d0918c679e7cdf260148bbcad23314857eef32aa9ee00c5fdb74bfd824ba4371.jpg)\r\n\r\n- Отказался от части продуктов\r\n\r\nКурица и рыба стали моими друзьями (если, конечно, друзей едят). Почти сразу из жизни ушел фастфуд, красное мясо, выпечка (это было сложно) и любое масло кроме оливкового первого отжима.\r\n\r\n![](https://i.vas3k.club/5f47da87c7b76eea2be828adad7f3c3fde4770ab182c63364da0a5633c57012e.jpg)\r\n\r\n- Можно совмещать странные продукты!\r\n\r\nКогда я в первый раз посмотрел на рецепт от ChatGPT «манго с фисташками», то первой реакцией было\r\n\r\n![](https://i.vas3k.club/d8a6c778b82b19decdd41c5f41116465c4e5e56fbce261948f99c3b018920199.jpg)\r\n\r\nно оказалось, что это очень вкусно! И если раньше десерт был в виде кексика или синнабона, то теперь это фрукты и орехи или просто орехи с медом.\r\n\r\n- Жрать можно меньше!\r\n\r\nПорции уменьшились примерно на треть, просто добавились мелкие приемы пищи типа фруктов и йогуртов. Плюс перестал есть за 3 часа до сна, это стабилизировало заодно сам сон и его глубину.\r\n\r\n### Шо по цифрам, Артем?\r\n\r\nТак-с, инсайты это все чудесно, но вас ведь наверное интересуют цифры? Субъективно изменения я заметил уже через неделю — голова перестала болеть, спать стал лучше, жена тоже привыкла, что я постоянно переписываюсь с ИИ. Вес стабильно начал снижаться, за месяц 3 кило ушло.\r\n\r\n![](https://i.vas3k.club/9694fa3eeb0d18123bfea65692c3878ba54b0a168ed4c18c688afd9fc5fb07d3.jpg)\r\n\r\nНо самое главное я узнал после сдачи нового анализа крови.\r\n\r\n![](https://i.vas3k.club/d9463032a03b75339da93ecc028d9366f9bdf51d5f445eb525b3cb0a7d8778b7.jpg)\r\n\r\nРиск фактор уменьшился, показатели пошли в правильную сторону. Больше всего упал LDL - так называемый «плохой» холестерин, который влияет на всякие сердечно-сосудистые проблемы и может являться причиной закупокрки сосудов, инфарктов и других неприятных вещей.\r\n\r\nДоктора мне сказали что это отличный результат, учитывая что никаких медикаментов я не принимал.\r\n\r\n### Сбор данных и трекинг\r\n\r\nА еще я был удивлен, что в Apple Health нельзя трекать холестерин. То есть электрическую проводимость кожи пожалуйста, но один из ключевых факторов, влияющих на длительность жизни — «когда-нибудь потом добавим». Люди на форумах эппла просят об этом с 2014 года, но пока безрезультатно.\r\n\r\n![](https://i.vas3k.club/9f226dcdea19c0d416560b711e694ac156bf53c3dd7a7e8d91ec5574c40edf23.jpg)\r\n\r\nПоэтому я совместно с ChatGPT собрал за вечер приложение по трекингу холестерина, а на второй вечер опубликовал его в AppStore. Ну и на третий перевел на 5 языков: русский, украинский, испанский, английский и китайский. Надеюсь, моя китайская версия не будет выглядеть для китайцев как для нас описания товаров с алиэкспресса.\r\n\r\n![](https://i.vas3k.club/2595c3daa19b5020d1d8658500e18520115d7217bc5801bc1435a4c6d784bdf8.jpg)\r\n\r\n*Холестерин Компаньон: Никогда Больше Не Беспокойтесь О Своем Кровеносном Жиже!*\r\n\r\nКогда-нибудь эппл добавит трекинг холестерина в Apple Health, в этот день я напишу интеграцию, которая перенесет все данные туда. Но если вам тоже нужно собирать ваш холестерин в одном месте и радоваться хорошей динамике графиков, то буду рад, если моя бесплатная аппка будет вам полезна.\r\n\r\n[Ссылка на Appstore](https://apps.apple.com/cy/app/cholesterease/id6447473897)\r\n\r\n### Вместо итога\r\n\r\nЯ все еще в зоне риска, но не в такой глубокой, как был месяц назад. Я уже изменил свои пищевые привычки и мне это нравится. ChatGPT заменил мне диетолога/нутрициолога/доктора/переводчика, с которым я мог быть на связи 24/7 за 20 баксов в месяц. Та польза, которую он мне дал, не идет ни в какое сравнение со стоимостью его подписки.\r\n\r\nИ я рассказал только про один маленький кейс, как без надрыва маленькими шагами сделать свою жизнь чуточку лучше. Надеюсь что в комментах вы поделитесь своим опытом маленьких шагов с ИИ!	\N	\N	\N	t	t	22	2023-06-16 10:28:40.246154+00	\N	~	2e006b8a-0f38-4b66-be06-c79b4b888b31	\N	\N	{}	\N	\N
86c41c89-5cd5-446e-830f-8b7be4d79251	4	post	Месяц под контролем ИИ или медицинские эксперименты для отбитых	Я месяц жил, ел и спал так, как мне говорил ChatGPT. И, возможно, это спасло меня от инфаркта. Достаточно кликбейтно? Тогда поехали. И сразу предупреждаю, будет много глупых мемов, эксклюзивно для клуба.\r\n\r\nМесяц назад я был готов лезть на стену. Голова болела постоянно. Я думал что это из-за недосыпа, но спальный марафон проблему не решил. Что делаем, когда очевидные советы не работают? Собираем метрики. Сдал полный анализ крови, дождался непонятной таблички со списком циферок. Выглядело это так:\r\n\r\n![](https://i.vas3k.club/d2ac2ddf608aac51e499df201e636b35495eebe9c4bc9a5324195f5f9d04304c.jpg)\r\n\r\nСлева мои параметры, справа референсные значения. Холестеринчик, как видно, в каких-то совсем неприятных границах. Была пятница, доктор предложил придти на запись в четверг, где он подробно объяснит, что значат эти цифры и скажет, как жить дальше. Ну и, будьте добры, 70 евро приготовьте за консультацию. В общем, у меня есть метрики, но чтобы их понять, we need to go deeper.\r\n\r\nРешил не тянуть и, как настоящий пациент, загуглить самостоятельно. Потратил минут 40, разбираясь в этих всех деталях: что такое LDL-холестерин, как считается риск фактор, зачем нужен HDL и другие не менее интересные запросы.\r\n\r\n![](https://i.vas3k.club/639731b9733df9539b1187e997279c75348babc0659c31bba57c43da1c8d025f.jpg)\r\n\r\nКартинка немного сложилась, и картинка была неприятной — показатели херовые, надо что-то срочно с этим делать. Гуглить к этому моменту я уже задолбался, и решил попробовать спросить ChatGPT:\r\n\r\n![](https://i.vas3k.club/00d7288b11850335489b47494f20a19d9b65abee7b9294a01916edfbcf6df8da.jpg)\r\n\r\nИ как же было приятно получить за один вопрос всю информацию, которую я гуглил полчаса! Спросил, что мне с этим всем делать и как дальше жить — получил простые советы:\r\n\r\n![](https://i.vas3k.club/e01c7c391a514500dab9c2c1873d9270af4b4510891761f2a77874f1d62f5bb9.jpg)\r\n\r\nВ целом, советы можно свести к трем пунктам:\r\nкоторые можно свести к двум пунктам:\r\n\r\n- Жри лучше и меньше\r\n- Двигайся больше\r\n- Не кури и не бухай\r\n\r\n![](https://i.vas3k.club/92327c9dc916f79c1741f09398c54d75aae691430c02ee5465c5c745fa1ecc31.jpg)\r\n\r\nДостаточно универсально, не так ли? Но за каждым пунктом скрывается бездна уточняющих вопросов:\r\n\r\n- А что можно есть?\r\n- А что лучше не надо?\r\n- А как часто питаться?\r\n- А как готовить?\r\n- А когда тренировки, до или после еды?\r\n- А какие тренировки?\r\n\r\nНе растекаясь по повествованию скажу кратко — ChatGPT мне ответил на все вопросы и составил рацион питания и план тренировок. Чтобы свалидировать эти советы и убедиться, что он мне не советует полную дичь, я заказал консультацию в Яндекс.Здоровье, где показал анализы и их разбор с рекомендациями ChatGPT под соусом: «ой посмотрите, тут мне доктор насоветовал, можете дать свою оценку и скорректировать, если что не так?»\r\n\r\n![](https://i.vas3k.club/177cfd6bd72735062e727c94189bebcd3dddbd86d4f078c26934a082588d3de2.jpg)\r\n\r\nНа что я получил обнадеживающий ответ: «Да, все отлично, тут нечего добавить, следуйте рекомендациям». Так начался мой путь под контролем ИИ.\r\n\r\n### Ежедневное использование\r\n\r\nЯ добавил на главный экран закладку на этот чат с ChatGPT и использовал его регулярно. Например:\r\n\r\n- План покупок: «Я иду в магазин, дай мне список продуктов для покупки с учетом моей диеты»\r\n\r\nИ получал простой чеклист. Так я открыл для себя новые продукты, которые раньше бы даже не подумал купить. Коричневый рис? Зачем это такое вообще? Киноа? Это что-то на хипстерском?\r\n\r\n![](https://i.vas3k.club/c692c5ed75030f7ad160b734e1ea11aaa844757f1b0ef7ab7ae3f00decc82ac5.jpg)\r\n\r\n- Рацион дня: «У меня есть такие продукты: A, B, ..., Y, Z. Составь рацион на день.»\r\n\r\nИ получал интересные несложные блюда, которые без особых проблем готовил самостоятельно своими некулинарными айтишными ручками. Только с граммовкой блюд были проблемы, пришлось купить кухонные весы. И по ходу готовки я задавал глупые вопросы, например, как сварить гречку, чтобы получилось 150 грамм по итогу?\r\n\r\n- Корректировки: «Сорри мистер ChatGPT, но я закинул в себя яичницу с беконом в кафешке. Оцени этот завтрак и скорректируй рацион на остаток дня»\r\n\r\n![](https://i.vas3k.club/9952e3ae68a66ae71681ea6fd4c2c109396be3175e91e094016e93a8ded0ca3a.jpg)\r\n\r\nИногда все идет не по плану — пошел на встречу в кофейню, а там только кофе и круассаны. Я думаю что это не повод радикально отказываться от всего неподходящего, скорее это про постепенное изменение своих пищевых привычек. И в таком ключе важно не сбрасывать со счетов весь план, если что-то в нем пошло не так, как хотелось.\r\n\r\n![](https://i.vas3k.club/8320d27d45dde2e11df60292d6bb05dbee6aa825a86dc7dfbd61ae13f9179140.jpg)\r\n\r\n### Главные инсайты для меня\r\n\r\nСпустя месяц ежедневного использования, где ИИ говорил мне как есть, что пить и как двигаться, примерно так изменилась моя жизнь:\r\n\r\n- Почти полностью отказался от сахара\r\n\r\nНачал читать циферки на банках и упаковках. Был в шоке что в баночке лимонной газировки, которая вообще не сладкая, 6 кубиков рафинада на 330 мл. Думаю про сахар это тема отдельного поста от знающих людей, но для меня это было прям откровением — он просто везде!\r\n\r\n![](https://i.vas3k.club/d0918c679e7cdf260148bbcad23314857eef32aa9ee00c5fdb74bfd824ba4371.jpg)\r\n\r\n- Отказался от части продуктов\r\n\r\nКурица и рыба стали моими друзьями (если, конечно, друзей едят). Почти сразу из жизни ушел фастфуд, красное мясо, выпечка (это было сложно) и любое масло кроме оливкового первого отжима.\r\n\r\n![](https://i.vas3k.club/5f47da87c7b76eea2be828adad7f3c3fde4770ab182c63364da0a5633c57012e.jpg)\r\n\r\n- Можно совмещать странные продукты!\r\n\r\nКогда я в первый раз посмотрел на рецепт от ChatGPT «манго с фисташками», то первой реакцией было\r\n\r\n![](https://i.vas3k.club/d8a6c778b82b19decdd41c5f41116465c4e5e56fbce261948f99c3b018920199.jpg)\r\n\r\nно оказалось, что это очень вкусно! И если раньше десерт был в виде кексика или синнабона, то теперь это фрукты и орехи или просто орехи с медом.\r\n\r\n- Жрать можно меньше!\r\n\r\nПорции уменьшились примерно на треть, просто добавились мелкие приемы пищи типа фруктов и йогуртов. Плюс перестал есть за 3 часа до сна, это стабилизировало заодно сам сон и его глубину.\r\n\r\n### Шо по цифрам, Артем?\r\n\r\nТак-с, инсайты это все чудесно, но вас ведь наверное интересуют цифры? Субъективно изменения я заметил уже через неделю — голова перестала болеть, спать стал лучше, жена тоже привыкла, что я постоянно переписываюсь с ИИ. Вес стабильно начал снижаться, за месяц 3 кило ушло.\r\n\r\n![](https://i.vas3k.club/9694fa3eeb0d18123bfea65692c3878ba54b0a168ed4c18c688afd9fc5fb07d3.jpg)\r\n\r\nНо самое главное я узнал после сдачи нового анализа крови.\r\n\r\n![](https://i.vas3k.club/d9463032a03b75339da93ecc028d9366f9bdf51d5f445eb525b3cb0a7d8778b7.jpg)\r\n\r\nРиск фактор уменьшился, показатели пошли в правильную сторону. Больше всего упал LDL - так называемый «плохой» холестерин, который влияет на всякие сердечно-сосудистые проблемы и может являться причиной закупокрки сосудов, инфарктов и других неприятных вещей.\r\n\r\nДоктора мне сказали что это отличный результат, учитывая что никаких медикаментов я не принимал.\r\n\r\n### Сбор данных и трекинг\r\n\r\nА еще я был удивлен, что в Apple Health нельзя трекать холестерин. То есть электрическую проводимость кожи пожалуйста, но один из ключевых факторов, влияющих на длительность жизни — «когда-нибудь потом добавим». Люди на форумах эппла просят об этом с 2014 года, но пока безрезультатно.\r\n\r\n![](https://i.vas3k.club/9f226dcdea19c0d416560b711e694ac156bf53c3dd7a7e8d91ec5574c40edf23.jpg)\r\n\r\nПоэтому я совместно с ChatGPT собрал за вечер приложение по трекингу холестерина, а на второй вечер опубликовал его в AppStore. Ну и на третий перевел на 5 языков: русский, украинский, испанский, английский и китайский. Надеюсь, моя китайская версия не будет выглядеть для китайцев как для нас описания товаров с алиэкспресса.\r\n\r\n![](https://i.vas3k.club/2595c3daa19b5020d1d8658500e18520115d7217bc5801bc1435a4c6d784bdf8.jpg)\r\n\r\n*Холестерин Компаньон: Никогда Больше Не Беспокойтесь О Своем Кровеносном Жиже!*\r\n\r\nКогда-нибудь эппл добавит трекинг холестерина в Apple Health, в этот день я напишу интеграцию, которая перенесет все данные туда. Но если вам тоже нужно собирать ваш холестерин в одном месте и радоваться хорошей динамике графиков, то буду рад, если моя бесплатная аппка будет вам полезна.\r\n\r\n[Ссылка на Appstore](https://apps.apple.com/cy/app/cholesterease/id6447473897)\r\n\r\n### Вместо итога\r\n\r\nЯ все еще в зоне риска, но не в такой глубокой, как был месяц назад. Я уже изменил свои пищевые привычки и мне это нравится. ChatGPT заменил мне диетолога/нутрициолога/доктора/переводчика, с которым я мог быть на связи 24/7 за 20 баксов в месяц. Та польза, которую он мне дал, не идет ни в какое сравнение со стоимостью его подписки.\r\n\r\nИ я рассказал только про один маленький кейс, как без надрыва маленькими шагами сделать свою жизнь чуточку лучше. Надеюсь что в комментах вы поделитесь своим опытом маленьких шагов с ИИ!	\N	\N	\N	t	t	23	2023-06-16 10:28:40.302065+00	\N	~	2e006b8a-0f38-4b66-be06-c79b4b888b31	\N	\N	{}	\N	\N
