5cd3ccae-d027-42f3-a9af-33ca480b1f8e	11	event	Сходка Олегов	Расскажите кратко, что за мероприятие и зачем туда идти: какой формат, какие активности планируются. Если это серия ивентов, дайте ссылку на предыдущее или расскажите, как прошло.\r\n\r\n# Только для Олегов\r\n\r\nЕсли мероприятие тематическое (например, киноклуб или хакатон), расскажите какой минимальный порог вхождения или как нужно подготовиться.\r\nЗовёте в бар? Расскажите, чем он знаменит и что в меню.\r\n\r\n# Если вы Олег, вы уже зарегистрированы\r\n\r\nОтпишитесь в комментариях, кто идет.\r\n# Где и когда\r\n\r\nНью-Йорк, самый дорогой бар\r\n# Ограничения\r\n\r\nЕсть ограничения по вместимости? Не пускают с собаками? Нельзя алкоголь?\r\n# Контакты\r\n\r\nКонтакты организаторов или чатик, куда можно присылать вопросы и обсуждать организацию.	\N	\N	{"event": {"day": "14", "time": "10:00:00", "month": "3", "location": "Нью-Йорк", "timezone": "Europe/Moscow", "utc_offset": 180.0}}	t	f	75	2023-06-16 11:26:27.454648+00	\N	~	1c322fcb-fd78-4a72-ab00-044551906fda	\N	\N	{random_oFIxufEDJM}	\N	sekta_olegov
55682211-75b0-409c-87a0-f93d9756f53f	12	project	F365	С одной стороны, не хочется рассказывать о чем-то небольшом. С другой стороны, из маленьких кирпичиков строится большое здание, поэтому почему бы и нет? К черту скромность!\r\n\r\n\r\n![](https://i.vas3k.club/5532f95440515792c340c8c56db5fc684b65db0f56721cb40a5b1ff85358587a.jpg)\r\n\r\nСразу скажу, что проект не планирует никакой монетизации, а также что в посте будет много разных картинок. Но как рассказывать про фотографию без фотографий, а про проекты без мемов?\r\n\r\n\r\n### Расскажите о себе и сути проекта\r\n\r\n Про себя я писал в [#intro](https://vas3k.club/intro/tkf/). У меня есть несколько хобби, некоторые из которых вытекают друг из друга. Так, например, из увлечения LEGO выросло мое увлечение фотографией, и этот проект как раз посвящен именно этому увлечению. Увлечения нужны, чтобы не быть как котик на меме снизу. И без них очень легко в него попасть.\r\n\r\n![](https://i.vas3k.club/6ab54fa2cebe2342874e8bacf0d545539d2ba09d225322733d73e0c4bf5a807b.jpg)\r\n\r\nФотографирую я не так давно, сменил несколько камер, фотографировал вроде бы и часто, но не регулярно. В какой-то момент заметил, что стараюсь чаще оставлять камеру дома, а не тащить ее с собой. Так как я на какое-то время оказался далеко от громадной кучи любимых кубиков и от стационарного ПК, LEGO и игры в RTS временно стали задачей с меньшим приоритетом, а фотография - с большим. И я решил подумать на тему того, как же научиться фотографировать лучше.\r\n\r\nА как мы все знаем, лучший способ, чтобы научиться чему-либо, это практика.\r\n\r\n\r\n![](https://i.vas3k.club/98396649d42b00fd3dffdee068377999ae6e7571dc4c2346dbcbe57cfd0c9111.jpg)\r\n\r\nЕсть такой парень - Георгий Джеджея ([Сайт](https://jejeya.pictures/)), его еще @vas3k упоминал в [посте про вычислительную фотографию](https://vas3k.blog/blog/computational_photography) (если помните такой, конечно). Так вот, так как я решил подойти с точки зрения практики, я конечно же начал читать различные блоги (ахаха, все как всегда. Прокрастинация наше все. )\r\n\r\n![](https://i.vas3k.club/504ae1a489d8113f28389b7ce7004e670b9b1c198aac3f6e6cd70ddb09d0f1e0.jpg)\r\n\r\nНу так к чему это я? У Георгия есть Telegram канал, а у этого Telegram канала есть [чат](https://t.me/factory_chat), (Вастрик.фото и данный чат частично пересекаются, так что я думаю, о нем тоже кто-то из клуба знает). И вот в этом чате проходит челлендж, достаточно обычный, кстати — челлендж "365". Необходимо каждый день делать фотографию на протяжении года, обрабатывать ее в течение дня (вообще фотографию за сегодня можно выложить в течение сегодня и завтра) и выкладывать ее.\r\n\r\n![](https://i.vas3k.club/7836082aee16e631a563750c7b7f266c446c10654770d6ba83514d731d5ee1cf.jpg)\r\n*(я просто хотел выложить фотографию с акулой, сорри)*\r\n\r\nЯ пропускал эти челленджы, потому что:\r\nа) Да зачем оно мне нужно?\r\nб) Это же нужно самому как-то отслеживать и следить.\r\n\r\nА тут все было сделано достаточно удобно: был бот, который принимал фотографии в Telegram, и некоторый элемент геймификации, когда участники чата голосовали за лучшие работы, и в итоге каждый день подводились результаты голосования с виртуальными медальками.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/3711da994c773bdd20643a9b382e70f1edbd6735b0ed5a18bb39532f2a5fe9b2.jpg)\r\n\r\nЯ участвую в данном челлендже уже более 200 дней, и он во многом мне помог. Я не сказал бы, чтобы я стал снимать лучше. Бывает, я открываю свои достаточно старые фотографии и понимаю, что мой уровень не то что вырос, но я стал лучше понимать, когда фотография определенно не получится. Также я стал лучше разбираться в своей камере и подтянул навык быстрой обработки фотографий.\r\n\r\nНо и это не главное. Главное, наверное, то, что необходимость делать что-то заставляла меня подниматься и делать что-то, даже тогда, когда очень не хотелось. И за счет этого улучшая мою жизнь. Я вставал на рассвете, чтобы фотографировать рассветное солнце.\r\n\r\n\r\n![](https://i.vas3k.club/80d9894285db17671a7323dd6a3257a119f63c8f5b374123791844d5ad244f1c.jpg)\r\n\r\n И искал что-то интересное в обыденном.\r\n\r\n![](https://i.vas3k.club/f4b51fff4b874d5e8ab225434c673d9c409fe335fcc85c88e6f77970dce44190.jpg)\r\n\r\nНу и просто в целом тренировал дисциплину. Если бы я был большим экстравертом, наверное, познакомился бы таким образом с кучей людей. Но, так как я такой как я есть, я просто сделал кучу фотографий (ну ладно, я даже несколько раз подходил к незнакомым людям с просьбой их сфотографировать, прогресс собственно на лицо) , которые мне нравятся, а также подписывался на различные поездки, от которых возможно бы отказался в ином случае. Даже завел дрона, чтобы смотреть на вещи с другого угла :)\r\n\r\n![](https://i.vas3k.club/e3bbb91c4adc2b4b5187d0a33f9ebc2d7dc6cfe1ba713a8f81c889e29a816c92.jpg)\r\n\r\nНо искать свои фото в большой куче фотографий в канале было не очень удобно, а иногда хотелось понять, какая фотография набрала больше лайков, или просто посмотреть, с каких фото я начал челлендж, а какие идут сейчас, чтобы понять, что вот сейчас у тебя идет провал, и ты не можешь найти сюжеты, а раньше энтузиазм так и переполнял. Ну и просто пересмотреть кадры по принципу "кадр в день" — это очень интересно.\r\n\r\nЯ даже как-то [считал](https://t.me/factory_chat/1385166) небольшую статистику по результатам 2022 года в этом челлендже.\r\n\r\nИ меня не покидала идея, что было бы отлично иметь возможность легко посмотреть данные из канала. Поиск в Telegram по хештегу, конечно, работает, но в целом искать в ленте очень неудобно. Да и видеть какую-нибудь писькомерную статистику всегда приятно.\r\n\r\n\r\n![](https://i.vas3k.club/43ddeb3a94d0b8889f161da377b7191210e0a6e872d33003ebf4c40843030158.jpg)\r\n\r\nВ какой-то момент я решил, что хватит тянуть кота за яйца, и раз у меня не очень получается с фото выходить на первые места, можно сделать полезный для сообщества сервис, выложить фото с его интерфейсом и словить плюшки :)\r\n\r\n\r\n\r\n![](https://i.vas3k.club/f063638b70f757fe7f7e243d9d747e6346400c9e7cfb5e4dfa6ed969bc7ed692.jpg)\r\n\r\n\r\n\r\n### Что вошло в прототип, технологический стек и сколько времени на него было потрачено\r\n\r\n![](https://i.vas3k.club/44432d7c6b0e9fee76128e59052379425afb40ffe0cedfb4bf474d790e536dd2.jpg)\r\n\r\nЯ решил разбить проект на три части, чтобы максимально упростить дальнейшую поддержку или замену. Соответственно, получаем парсинг опубликованных ботом данных и их запись в базу. API для получения данных из этой базы и фронтенд, который будет показывать полученные данные. На все про все ушло несколько вечеров.\r\n\r\nСамой простой частью были парсинг и API. Так как фронт планировался на JavaScript, решил и бекэнд сделать на нем же. Взял Express.js, MySQL, набросал быстренько простенький API, развернул, проверил, что все нормально.\r\n\r\n\r\nЕдинственная проблема на бекэнде была с запросом, подсчитывающим самые длинные интервалы без проблем в публикациях. Наиболее адекватным и простым вариантом было использовать оконные функции, но в тот вечер, похоже, лыжи решили не ехать, и нужный вариант никак не хотел писаться. И тут меня осенило, мы же в будущем, где же вкалывающие роботы? Я открыл ChatGPT и попросил его написать запрос. Неожиданно запрос даже оказался почти верным. С помощью напильника (так как уточняющими вопросами заставить его исправить запрос не вышло), запрос был приведен в нужное состояние, и бекэнд стал полностью рабочим.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/407d6e557ee8461b17eb215fd1b555a94e4f8124ff4c31017863fa5e89fe2a77.jpg)\r\n\r\n\r\nНу что же, после этого настало время опуститься в авгиевы конюшни и собрать фронт на третьем Vue. Вообще на работе мне приходилось встречаться с вторым Vue (нет, встречался я со всем подряд, но с Vue было больше всего опыта), поэтому я подумал, что особых проблем с третьим Vue не будет. Сцуко, как же я ошибался. Ближайший час был занят различными попытками адаптировать свой опыт из Options API второго Vue на Composition API третьего. А также отойти от Vuex к Pinia. Казалось бы, что мешало поставить Vuex и Options API на третий Vue? Но ведь мы не ищем легких путей. Вообще ненавижу такие моменты, когда вместо того, чтобы решать проблему, приходится бороться с окружением.\r\n\r\nВ общем, после некоторого количества матюгов, я перешел к конкретной реализации самого интерфейса. Так как чукча ни разу не дизайнер, я взял готовый UI Kit. И после небольшой отладки был готов MVP на трех страницах.\r\n\r\n![](https://i.vas3k.club/d09383066ba8d3cf4917182ef3923d31e1a7b8500b3e68a46b460406c29f3de4.jpg)\r\n\r\nСписок фотографий дня, рандомная подборка случайных фото и страница фотографий пользователя. Так как данный челлендж проходит всего где-то 3.5 года, и количество участников не то чтобы запредельное, я решил отказаться от infinite scroll с подгрузкой и просто фигачить все изображения пользователя на страницу сразу.\r\n\r\n![](https://i.vas3k.club/b83bd8bc861a2f70e3bef8fd2d26b1cc78301e882b3b784eeacf3418e003fbb7.jpg)\r\n\r\n\r\nРазвернув это на собственном поддомене, я решил написать о проекте на следующий день. Ну а следующим вечером я решил, что будет неплохо добавить на страницу пользователя немного статистики.\r\n\r\nТакже решил добавить немного сортировок, ведь все любят сортировки. Кстати, про один из способов сортировки я интересовался в [Vas3k.nsfw](https://vas3k.club/network/chat/nsfw/).  Все-таки, сортировка по противоречивости это прикольно.\r\n\r\n![](https://i.vas3k.club/ad4943723c16b37f46f90447660896dddd40e5e3486dc0f75c78b80d67e64b9c.jpg)\r\n\r\nТак что общий совет всем на будущее: хотите сделать что-то быстро и просто, берите то, что знаете, не будьте как я. Ну, а если совмещать изучение нового с каким-нибудь пет-проектом, то почему бы и нет.\r\n\r\n\r\n### Как запускались и искали первых пользователей\r\n\r\nТак как я по сути делал инструмент для уже существующей аудитории, то никаких особых усилий для поиска пользователей не требовалось. Просто зашел в чатик и скинул ссылку. От хитрого плана с публикацией фото рабочего стола отказался. Как-то неспортивно все-таки.\r\n\r\nВ целом приняли положительно, сразу нашли пару багов. Одна была связана с парсингом, точнее с тем, что я не учел граничный случай, когда где-то в середине челленджа бот глюкнул и запостил одну и ту же запись два раза. Я полагался на идентификатор сообщения и не прописал уникальное ограничение. Обязательно прописывайте все ограничения. В итоге одна из длинных серий считалась неверно.\r\n\r\n![](https://i.vas3k.club/7086ebce9b014991435bd435658148fcc2b7a7b0f92727b3e2ef38e0b71ea915.jpg)\r\n\r\nПопросили прокинуть seed на главной, чтобы делиться выпавшими подборками лучших фото. Поправил это тоже. Ну и вывел ссылочки на соцсети тем, кто их скинул, чтобы, если кто вдруг наткнется на интересную фотографию, мог перейти дальше и посмотреть другие работы.\r\n\r\n\r\n### Сколько потратили и заработали? Есть идеи как это можно монетизировать?\r\n\r\nВ виду того, что проект простенький, а у всех есть под рукой некоторое количество свободных ресурсов, можно считать, что трат пока никаких и особо новые не планируются. Монетизации определенно не будет. Так что это просто pet-проект для себя и небольшого фотосообщества.\r\n\r\n\r\n\r\n\r\n### Какие планы на будущее?\r\nДа, вроде никаких, вероятней всего оно вообще не потребует какой-то особой поддержки. Так может код причесать и выложить все это на GitHub вместе с данными, чтобы, если что, это мог поднять кто-то еще. Поскольку bus factor у проекта, не то чтобы радовал.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/600bf0b061e978e7e772a019712887cd2cf26780133dddb5c7cf60ffe398c7bf.jpg)\r\n\r\nНу и наверное доделаю еще одно представление фотографий. Вместо грида будет приятно потом посмотреть на календарик, где на каждый день будет по фотографии.\r\n\r\n\r\n\r\n\r\n### Итоги\r\n\r\nЯ продолжаю 365, делая фотографию каждый день, но теперь мне гораздо проще вспоминать, какая именно из моих фотографий так провалилась на последнем голосовании.\r\n\r\n\r\nНадеюсь, что мой рассказ мотивирует кого-нибудь тоже поучаствовать в челлендже, ну или хотя бы постараться больше замечать вокруг, а не идти по улице, уткнувшись в телефон.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/11e9bb6f850fa3347410ad4f499a0e40718175a4b45530ad9401b66648be7515.jpg)\r\n\r\nКстати, вам не обязательно иметь фотоаппарат. Многие из участвующих в челлендже делают отличные фотки на мобильные телефоны. Необязательно, как я, таскать с собой тяжеленную бандуру тупо по приколу.\r\n\r\n![](https://i.vas3k.club/10921bf91ae200743ae3d7bb9296d08d36cf540a36f712b8089ebe53dfcb89c4.jpg)\r\n\r\n\r\nНу и главное в фотографии давно уже стало не умение сделать выверенную картинку. Для этого есть японцы с пометками, откуда фотографировать, а также вычислительная и обычная фотография. В современных камерах даже [автоспуск завезли](https://www.youtube.com/watch?v=tTyVaiJLSsE). Да и [нейронки](https://bjoernkarmann.dk/project/paragraphica) не дремлют. Так что главное в фотографии, на мой взгляд, давно стало не результат, хотя приятный результат всегда хорошо. Главное это умение видеть, чувствовать, ну и наслаждаться процессом.\r\n\r\nДа и правила челленджа не заставляют в нем активно участвовать. Многие просто время от времени выкладывают фотографии, как очередная площадка для поделиться.\r\n\r\nТакже не могу не напомнить, что у нас в клубе есть [секретный чат с фотографиями](https://vas3k.club/post/15747/). \r\n\r\np.s. покидая уютненький клуб вы рискуете нарваться на другое окружение. С другими мемасами и точками зрения. Я вас предупреждал.\r\n\r\n![](https://i.vas3k.club/7544973e3c49db12c8f88c2d5e60315233db51bcd331b72306bf721dd0dca115.jpg)	https://f365.zyuhel.ru/	\N	\N	f	t	76	2023-06-16 11:28:43.675759+00	\N	+	3b256275-bd5e-4980-9440-a5ba9f17acfc	\N	\N	{}	\N	\N
55682211-75b0-409c-87a0-f93d9756f53f	12	project	F365	С одной стороны, не хочется рассказывать о чем-то небольшом. С другой стороны, из маленьких кирпичиков строится большое здание, поэтому почему бы и нет? К черту скромность!\r\n\r\n\r\n![](https://i.vas3k.club/5532f95440515792c340c8c56db5fc684b65db0f56721cb40a5b1ff85358587a.jpg)\r\n\r\nСразу скажу, что проект не планирует никакой монетизации, а также что в посте будет много разных картинок. Но как рассказывать про фотографию без фотографий, а про проекты без мемов?\r\n\r\n\r\n### Расскажите о себе и сути проекта\r\n\r\n Про себя я писал в [#intro](https://vas3k.club/intro/tkf/). У меня есть несколько хобби, некоторые из которых вытекают друг из друга. Так, например, из увлечения LEGO выросло мое увлечение фотографией, и этот проект как раз посвящен именно этому увлечению. Увлечения нужны, чтобы не быть как котик на меме снизу. И без них очень легко в него попасть.\r\n\r\n![](https://i.vas3k.club/6ab54fa2cebe2342874e8bacf0d545539d2ba09d225322733d73e0c4bf5a807b.jpg)\r\n\r\nФотографирую я не так давно, сменил несколько камер, фотографировал вроде бы и часто, но не регулярно. В какой-то момент заметил, что стараюсь чаще оставлять камеру дома, а не тащить ее с собой. Так как я на какое-то время оказался далеко от громадной кучи любимых кубиков и от стационарного ПК, LEGO и игры в RTS временно стали задачей с меньшим приоритетом, а фотография - с большим. И я решил подумать на тему того, как же научиться фотографировать лучше.\r\n\r\nА как мы все знаем, лучший способ, чтобы научиться чему-либо, это практика.\r\n\r\n\r\n![](https://i.vas3k.club/98396649d42b00fd3dffdee068377999ae6e7571dc4c2346dbcbe57cfd0c9111.jpg)\r\n\r\nЕсть такой парень - Георгий Джеджея ([Сайт](https://jejeya.pictures/)), его еще @vas3k упоминал в [посте про вычислительную фотографию](https://vas3k.blog/blog/computational_photography) (если помните такой, конечно). Так вот, так как я решил подойти с точки зрения практики, я конечно же начал читать различные блоги (ахаха, все как всегда. Прокрастинация наше все. )\r\n\r\n![](https://i.vas3k.club/504ae1a489d8113f28389b7ce7004e670b9b1c198aac3f6e6cd70ddb09d0f1e0.jpg)\r\n\r\nНу так к чему это я? У Георгия есть Telegram канал, а у этого Telegram канала есть [чат](https://t.me/factory_chat), (Вастрик.фото и данный чат частично пересекаются, так что я думаю, о нем тоже кто-то из клуба знает). И вот в этом чате проходит челлендж, достаточно обычный, кстати — челлендж "365". Необходимо каждый день делать фотографию на протяжении года, обрабатывать ее в течение дня (вообще фотографию за сегодня можно выложить в течение сегодня и завтра) и выкладывать ее.\r\n\r\n![](https://i.vas3k.club/7836082aee16e631a563750c7b7f266c446c10654770d6ba83514d731d5ee1cf.jpg)\r\n*(я просто хотел выложить фотографию с акулой, сорри)*\r\n\r\nЯ пропускал эти челленджы, потому что:\r\nа) Да зачем оно мне нужно?\r\nб) Это же нужно самому как-то отслеживать и следить.\r\n\r\nА тут все было сделано достаточно удобно: был бот, который принимал фотографии в Telegram, и некоторый элемент геймификации, когда участники чата голосовали за лучшие работы, и в итоге каждый день подводились результаты голосования с виртуальными медальками.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/3711da994c773bdd20643a9b382e70f1edbd6735b0ed5a18bb39532f2a5fe9b2.jpg)\r\n\r\nЯ участвую в данном челлендже уже более 200 дней, и он во многом мне помог. Я не сказал бы, чтобы я стал снимать лучше. Бывает, я открываю свои достаточно старые фотографии и понимаю, что мой уровень не то что вырос, но я стал лучше понимать, когда фотография определенно не получится. Также я стал лучше разбираться в своей камере и подтянул навык быстрой обработки фотографий.\r\n\r\nНо и это не главное. Главное, наверное, то, что необходимость делать что-то заставляла меня подниматься и делать что-то, даже тогда, когда очень не хотелось. И за счет этого улучшая мою жизнь. Я вставал на рассвете, чтобы фотографировать рассветное солнце.\r\n\r\n\r\n![](https://i.vas3k.club/80d9894285db17671a7323dd6a3257a119f63c8f5b374123791844d5ad244f1c.jpg)\r\n\r\n И искал что-то интересное в обыденном.\r\n\r\n![](https://i.vas3k.club/f4b51fff4b874d5e8ab225434c673d9c409fe335fcc85c88e6f77970dce44190.jpg)\r\n\r\nНу и просто в целом тренировал дисциплину. Если бы я был большим экстравертом, наверное, познакомился бы таким образом с кучей людей. Но, так как я такой как я есть, я просто сделал кучу фотографий (ну ладно, я даже несколько раз подходил к незнакомым людям с просьбой их сфотографировать, прогресс собственно на лицо) , которые мне нравятся, а также подписывался на различные поездки, от которых возможно бы отказался в ином случае. Даже завел дрона, чтобы смотреть на вещи с другого угла :)\r\n\r\n![](https://i.vas3k.club/e3bbb91c4adc2b4b5187d0a33f9ebc2d7dc6cfe1ba713a8f81c889e29a816c92.jpg)\r\n\r\nНо искать свои фото в большой куче фотографий в канале было не очень удобно, а иногда хотелось понять, какая фотография набрала больше лайков, или просто посмотреть, с каких фото я начал челлендж, а какие идут сейчас, чтобы понять, что вот сейчас у тебя идет провал, и ты не можешь найти сюжеты, а раньше энтузиазм так и переполнял. Ну и просто пересмотреть кадры по принципу "кадр в день" — это очень интересно.\r\n\r\nЯ даже как-то [считал](https://t.me/factory_chat/1385166) небольшую статистику по результатам 2022 года в этом челлендже.\r\n\r\nИ меня не покидала идея, что было бы отлично иметь возможность легко посмотреть данные из канала. Поиск в Telegram по хештегу, конечно, работает, но в целом искать в ленте очень неудобно. Да и видеть какую-нибудь писькомерную статистику всегда приятно.\r\n\r\n\r\n![](https://i.vas3k.club/43ddeb3a94d0b8889f161da377b7191210e0a6e872d33003ebf4c40843030158.jpg)\r\n\r\nВ какой-то момент я решил, что хватит тянуть кота за яйца, и раз у меня не очень получается с фото выходить на первые места, можно сделать полезный для сообщества сервис, выложить фото с его интерфейсом и словить плюшки :)\r\n\r\n\r\n\r\n![](https://i.vas3k.club/f063638b70f757fe7f7e243d9d747e6346400c9e7cfb5e4dfa6ed969bc7ed692.jpg)\r\n\r\n\r\n\r\n### Что вошло в прототип, технологический стек и сколько времени на него было потрачено\r\n\r\n![](https://i.vas3k.club/44432d7c6b0e9fee76128e59052379425afb40ffe0cedfb4bf474d790e536dd2.jpg)\r\n\r\nЯ решил разбить проект на три части, чтобы максимально упростить дальнейшую поддержку или замену. Соответственно, получаем парсинг опубликованных ботом данных и их запись в базу. API для получения данных из этой базы и фронтенд, который будет показывать полученные данные. На все про все ушло несколько вечеров.\r\n\r\nСамой простой частью были парсинг и API. Так как фронт планировался на JavaScript, решил и бекэнд сделать на нем же. Взял Express.js, MySQL, набросал быстренько простенький API, развернул, проверил, что все нормально.\r\n\r\n\r\nЕдинственная проблема на бекэнде была с запросом, подсчитывающим самые длинные интервалы без проблем в публикациях. Наиболее адекватным и простым вариантом было использовать оконные функции, но в тот вечер, похоже, лыжи решили не ехать, и нужный вариант никак не хотел писаться. И тут меня осенило, мы же в будущем, где же вкалывающие роботы? Я открыл ChatGPT и попросил его написать запрос. Неожиданно запрос даже оказался почти верным. С помощью напильника (так как уточняющими вопросами заставить его исправить запрос не вышло), запрос был приведен в нужное состояние, и бекэнд стал полностью рабочим.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/407d6e557ee8461b17eb215fd1b555a94e4f8124ff4c31017863fa5e89fe2a77.jpg)\r\n\r\n\r\nНу что же, после этого настало время опуститься в авгиевы конюшни и собрать фронт на третьем Vue. Вообще на работе мне приходилось встречаться с вторым Vue (нет, встречался я со всем подряд, но с Vue было больше всего опыта), поэтому я подумал, что особых проблем с третьим Vue не будет. Сцуко, как же я ошибался. Ближайший час был занят различными попытками адаптировать свой опыт из Options API второго Vue на Composition API третьего. А также отойти от Vuex к Pinia. Казалось бы, что мешало поставить Vuex и Options API на третий Vue? Но ведь мы не ищем легких путей. Вообще ненавижу такие моменты, когда вместо того, чтобы решать проблему, приходится бороться с окружением.\r\n\r\nВ общем, после некоторого количества матюгов, я перешел к конкретной реализации самого интерфейса. Так как чукча ни разу не дизайнер, я взял готовый UI Kit. И после небольшой отладки был готов MVP на трех страницах.\r\n\r\n![](https://i.vas3k.club/d09383066ba8d3cf4917182ef3923d31e1a7b8500b3e68a46b460406c29f3de4.jpg)\r\n\r\nСписок фотографий дня, рандомная подборка случайных фото и страница фотографий пользователя. Так как данный челлендж проходит всего где-то 3.5 года, и количество участников не то чтобы запредельное, я решил отказаться от infinite scroll с подгрузкой и просто фигачить все изображения пользователя на страницу сразу.\r\n\r\n![](https://i.vas3k.club/b83bd8bc861a2f70e3bef8fd2d26b1cc78301e882b3b784eeacf3418e003fbb7.jpg)\r\n\r\n\r\nРазвернув это на собственном поддомене, я решил написать о проекте на следующий день. Ну а следующим вечером я решил, что будет неплохо добавить на страницу пользователя немного статистики.\r\n\r\nТакже решил добавить немного сортировок, ведь все любят сортировки. Кстати, про один из способов сортировки я интересовался в [Vas3k.nsfw](https://vas3k.club/network/chat/nsfw/).  Все-таки, сортировка по противоречивости это прикольно.\r\n\r\n![](https://i.vas3k.club/ad4943723c16b37f46f90447660896dddd40e5e3486dc0f75c78b80d67e64b9c.jpg)\r\n\r\nТак что общий совет всем на будущее: хотите сделать что-то быстро и просто, берите то, что знаете, не будьте как я. Ну, а если совмещать изучение нового с каким-нибудь пет-проектом, то почему бы и нет.\r\n\r\n\r\n### Как запускались и искали первых пользователей\r\n\r\nТак как я по сути делал инструмент для уже существующей аудитории, то никаких особых усилий для поиска пользователей не требовалось. Просто зашел в чатик и скинул ссылку. От хитрого плана с публикацией фото рабочего стола отказался. Как-то неспортивно все-таки.\r\n\r\nВ целом приняли положительно, сразу нашли пару багов. Одна была связана с парсингом, точнее с тем, что я не учел граничный случай, когда где-то в середине челленджа бот глюкнул и запостил одну и ту же запись два раза. Я полагался на идентификатор сообщения и не прописал уникальное ограничение. Обязательно прописывайте все ограничения. В итоге одна из длинных серий считалась неверно.\r\n\r\n![](https://i.vas3k.club/7086ebce9b014991435bd435658148fcc2b7a7b0f92727b3e2ef38e0b71ea915.jpg)\r\n\r\nПопросили прокинуть seed на главной, чтобы делиться выпавшими подборками лучших фото. Поправил это тоже. Ну и вывел ссылочки на соцсети тем, кто их скинул, чтобы, если кто вдруг наткнется на интересную фотографию, мог перейти дальше и посмотреть другие работы.\r\n\r\n\r\n### Сколько потратили и заработали? Есть идеи как это можно монетизировать?\r\n\r\nВ виду того, что проект простенький, а у всех есть под рукой некоторое количество свободных ресурсов, можно считать, что трат пока никаких и особо новые не планируются. Монетизации определенно не будет. Так что это просто pet-проект для себя и небольшого фотосообщества.\r\n\r\n\r\n\r\n\r\n### Какие планы на будущее?\r\nДа, вроде никаких, вероятней всего оно вообще не потребует какой-то особой поддержки. Так может код причесать и выложить все это на GitHub вместе с данными, чтобы, если что, это мог поднять кто-то еще. Поскольку bus factor у проекта, не то чтобы радовал.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/600bf0b061e978e7e772a019712887cd2cf26780133dddb5c7cf60ffe398c7bf.jpg)\r\n\r\nНу и наверное доделаю еще одно представление фотографий. Вместо грида будет приятно потом посмотреть на календарик, где на каждый день будет по фотографии.\r\n\r\n\r\n\r\n\r\n### Итоги\r\n\r\nЯ продолжаю 365, делая фотографию каждый день, но теперь мне гораздо проще вспоминать, какая именно из моих фотографий так провалилась на последнем голосовании.\r\n\r\n\r\nНадеюсь, что мой рассказ мотивирует кого-нибудь тоже поучаствовать в челлендже, ну или хотя бы постараться больше замечать вокруг, а не идти по улице, уткнувшись в телефон.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/11e9bb6f850fa3347410ad4f499a0e40718175a4b45530ad9401b66648be7515.jpg)\r\n\r\nКстати, вам не обязательно иметь фотоаппарат. Многие из участвующих в челлендже делают отличные фотки на мобильные телефоны. Необязательно, как я, таскать с собой тяжеленную бандуру тупо по приколу.\r\n\r\n![](https://i.vas3k.club/10921bf91ae200743ae3d7bb9296d08d36cf540a36f712b8089ebe53dfcb89c4.jpg)\r\n\r\n\r\nНу и главное в фотографии давно уже стало не умение сделать выверенную картинку. Для этого есть японцы с пометками, откуда фотографировать, а также вычислительная и обычная фотография. В современных камерах даже [автоспуск завезли](https://www.youtube.com/watch?v=tTyVaiJLSsE). Да и [нейронки](https://bjoernkarmann.dk/project/paragraphica) не дремлют. Так что главное в фотографии, на мой взгляд, давно стало не результат, хотя приятный результат всегда хорошо. Главное это умение видеть, чувствовать, ну и наслаждаться процессом.\r\n\r\nДа и правила челленджа не заставляют в нем активно участвовать. Многие просто время от времени выкладывают фотографии, как очередная площадка для поделиться.\r\n\r\nТакже не могу не напомнить, что у нас в клубе есть [секретный чат с фотографиями](https://vas3k.club/post/15747/). \r\n\r\np.s. покидая уютненький клуб вы рискуете нарваться на другое окружение. С другими мемасами и точками зрения. Я вас предупреждал.\r\n\r\n![](https://i.vas3k.club/7544973e3c49db12c8f88c2d5e60315233db51bcd331b72306bf721dd0dca115.jpg)	https://f365.zyuhel.ru/	\N	\N	f	t	77	2023-06-16 11:28:43.788537+00	\N	~	3b256275-bd5e-4980-9440-a5ba9f17acfc	\N	\N	{}	\N	\N
55682211-75b0-409c-87a0-f93d9756f53f	12	project	F365	С одной стороны, не хочется рассказывать о чем-то небольшом. С другой стороны, из маленьких кирпичиков строится большое здание, поэтому почему бы и нет? К черту скромность!\r\n\r\n\r\n![](https://i.vas3k.club/5532f95440515792c340c8c56db5fc684b65db0f56721cb40a5b1ff85358587a.jpg)\r\n\r\nСразу скажу, что проект не планирует никакой монетизации, а также что в посте будет много разных картинок. Но как рассказывать про фотографию без фотографий, а про проекты без мемов?\r\n\r\n\r\n### Расскажите о себе и сути проекта\r\n\r\n Про себя я писал в [#intro](https://vas3k.club/intro/tkf/). У меня есть несколько хобби, некоторые из которых вытекают друг из друга. Так, например, из увлечения LEGO выросло мое увлечение фотографией, и этот проект как раз посвящен именно этому увлечению. Увлечения нужны, чтобы не быть как котик на меме снизу. И без них очень легко в него попасть.\r\n\r\n![](https://i.vas3k.club/6ab54fa2cebe2342874e8bacf0d545539d2ba09d225322733d73e0c4bf5a807b.jpg)\r\n\r\nФотографирую я не так давно, сменил несколько камер, фотографировал вроде бы и часто, но не регулярно. В какой-то момент заметил, что стараюсь чаще оставлять камеру дома, а не тащить ее с собой. Так как я на какое-то время оказался далеко от громадной кучи любимых кубиков и от стационарного ПК, LEGO и игры в RTS временно стали задачей с меньшим приоритетом, а фотография - с большим. И я решил подумать на тему того, как же научиться фотографировать лучше.\r\n\r\nА как мы все знаем, лучший способ, чтобы научиться чему-либо, это практика.\r\n\r\n\r\n![](https://i.vas3k.club/98396649d42b00fd3dffdee068377999ae6e7571dc4c2346dbcbe57cfd0c9111.jpg)\r\n\r\nЕсть такой парень - Георгий Джеджея ([Сайт](https://jejeya.pictures/)), его еще @vas3k упоминал в [посте про вычислительную фотографию](https://vas3k.blog/blog/computational_photography) (если помните такой, конечно). Так вот, так как я решил подойти с точки зрения практики, я конечно же начал читать различные блоги (ахаха, все как всегда. Прокрастинация наше все. )\r\n\r\n![](https://i.vas3k.club/504ae1a489d8113f28389b7ce7004e670b9b1c198aac3f6e6cd70ddb09d0f1e0.jpg)\r\n\r\nНу так к чему это я? У Георгия есть Telegram канал, а у этого Telegram канала есть [чат](https://t.me/factory_chat), (Вастрик.фото и данный чат частично пересекаются, так что я думаю, о нем тоже кто-то из клуба знает). И вот в этом чате проходит челлендж, достаточно обычный, кстати — челлендж "365". Необходимо каждый день делать фотографию на протяжении года, обрабатывать ее в течение дня (вообще фотографию за сегодня можно выложить в течение сегодня и завтра) и выкладывать ее.\r\n\r\n![](https://i.vas3k.club/7836082aee16e631a563750c7b7f266c446c10654770d6ba83514d731d5ee1cf.jpg)\r\n*(я просто хотел выложить фотографию с акулой, сорри)*\r\n\r\nЯ пропускал эти челленджы, потому что:\r\nа) Да зачем оно мне нужно?\r\nб) Это же нужно самому как-то отслеживать и следить.\r\n\r\nА тут все было сделано достаточно удобно: был бот, который принимал фотографии в Telegram, и некоторый элемент геймификации, когда участники чата голосовали за лучшие работы, и в итоге каждый день подводились результаты голосования с виртуальными медальками.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/3711da994c773bdd20643a9b382e70f1edbd6735b0ed5a18bb39532f2a5fe9b2.jpg)\r\n\r\nЯ участвую в данном челлендже уже более 200 дней, и он во многом мне помог. Я не сказал бы, чтобы я стал снимать лучше. Бывает, я открываю свои достаточно старые фотографии и понимаю, что мой уровень не то что вырос, но я стал лучше понимать, когда фотография определенно не получится. Также я стал лучше разбираться в своей камере и подтянул навык быстрой обработки фотографий.\r\n\r\nНо и это не главное. Главное, наверное, то, что необходимость делать что-то заставляла меня подниматься и делать что-то, даже тогда, когда очень не хотелось. И за счет этого улучшая мою жизнь. Я вставал на рассвете, чтобы фотографировать рассветное солнце.\r\n\r\n\r\n![](https://i.vas3k.club/80d9894285db17671a7323dd6a3257a119f63c8f5b374123791844d5ad244f1c.jpg)\r\n\r\n И искал что-то интересное в обыденном.\r\n\r\n![](https://i.vas3k.club/f4b51fff4b874d5e8ab225434c673d9c409fe335fcc85c88e6f77970dce44190.jpg)\r\n\r\nНу и просто в целом тренировал дисциплину. Если бы я был большим экстравертом, наверное, познакомился бы таким образом с кучей людей. Но, так как я такой как я есть, я просто сделал кучу фотографий (ну ладно, я даже несколько раз подходил к незнакомым людям с просьбой их сфотографировать, прогресс собственно на лицо) , которые мне нравятся, а также подписывался на различные поездки, от которых возможно бы отказался в ином случае. Даже завел дрона, чтобы смотреть на вещи с другого угла :)\r\n\r\n![](https://i.vas3k.club/e3bbb91c4adc2b4b5187d0a33f9ebc2d7dc6cfe1ba713a8f81c889e29a816c92.jpg)\r\n\r\nНо искать свои фото в большой куче фотографий в канале было не очень удобно, а иногда хотелось понять, какая фотография набрала больше лайков, или просто посмотреть, с каких фото я начал челлендж, а какие идут сейчас, чтобы понять, что вот сейчас у тебя идет провал, и ты не можешь найти сюжеты, а раньше энтузиазм так и переполнял. Ну и просто пересмотреть кадры по принципу "кадр в день" — это очень интересно.\r\n\r\nЯ даже как-то [считал](https://t.me/factory_chat/1385166) небольшую статистику по результатам 2022 года в этом челлендже.\r\n\r\nИ меня не покидала идея, что было бы отлично иметь возможность легко посмотреть данные из канала. Поиск в Telegram по хештегу, конечно, работает, но в целом искать в ленте очень неудобно. Да и видеть какую-нибудь писькомерную статистику всегда приятно.\r\n\r\n\r\n![](https://i.vas3k.club/43ddeb3a94d0b8889f161da377b7191210e0a6e872d33003ebf4c40843030158.jpg)\r\n\r\nВ какой-то момент я решил, что хватит тянуть кота за яйца, и раз у меня не очень получается с фото выходить на первые места, можно сделать полезный для сообщества сервис, выложить фото с его интерфейсом и словить плюшки :)\r\n\r\n\r\n\r\n![](https://i.vas3k.club/f063638b70f757fe7f7e243d9d747e6346400c9e7cfb5e4dfa6ed969bc7ed692.jpg)\r\n\r\n\r\n\r\n### Что вошло в прототип, технологический стек и сколько времени на него было потрачено\r\n\r\n![](https://i.vas3k.club/44432d7c6b0e9fee76128e59052379425afb40ffe0cedfb4bf474d790e536dd2.jpg)\r\n\r\nЯ решил разбить проект на три части, чтобы максимально упростить дальнейшую поддержку или замену. Соответственно, получаем парсинг опубликованных ботом данных и их запись в базу. API для получения данных из этой базы и фронтенд, который будет показывать полученные данные. На все про все ушло несколько вечеров.\r\n\r\nСамой простой частью были парсинг и API. Так как фронт планировался на JavaScript, решил и бекэнд сделать на нем же. Взял Express.js, MySQL, набросал быстренько простенький API, развернул, проверил, что все нормально.\r\n\r\n\r\nЕдинственная проблема на бекэнде была с запросом, подсчитывающим самые длинные интервалы без проблем в публикациях. Наиболее адекватным и простым вариантом было использовать оконные функции, но в тот вечер, похоже, лыжи решили не ехать, и нужный вариант никак не хотел писаться. И тут меня осенило, мы же в будущем, где же вкалывающие роботы? Я открыл ChatGPT и попросил его написать запрос. Неожиданно запрос даже оказался почти верным. С помощью напильника (так как уточняющими вопросами заставить его исправить запрос не вышло), запрос был приведен в нужное состояние, и бекэнд стал полностью рабочим.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/407d6e557ee8461b17eb215fd1b555a94e4f8124ff4c31017863fa5e89fe2a77.jpg)\r\n\r\n\r\nНу что же, после этого настало время опуститься в авгиевы конюшни и собрать фронт на третьем Vue. Вообще на работе мне приходилось встречаться с вторым Vue (нет, встречался я со всем подряд, но с Vue было больше всего опыта), поэтому я подумал, что особых проблем с третьим Vue не будет. Сцуко, как же я ошибался. Ближайший час был занят различными попытками адаптировать свой опыт из Options API второго Vue на Composition API третьего. А также отойти от Vuex к Pinia. Казалось бы, что мешало поставить Vuex и Options API на третий Vue? Но ведь мы не ищем легких путей. Вообще ненавижу такие моменты, когда вместо того, чтобы решать проблему, приходится бороться с окружением.\r\n\r\nВ общем, после некоторого количества матюгов, я перешел к конкретной реализации самого интерфейса. Так как чукча ни разу не дизайнер, я взял готовый UI Kit. И после небольшой отладки был готов MVP на трех страницах.\r\n\r\n![](https://i.vas3k.club/d09383066ba8d3cf4917182ef3923d31e1a7b8500b3e68a46b460406c29f3de4.jpg)\r\n\r\nСписок фотографий дня, рандомная подборка случайных фото и страница фотографий пользователя. Так как данный челлендж проходит всего где-то 3.5 года, и количество участников не то чтобы запредельное, я решил отказаться от infinite scroll с подгрузкой и просто фигачить все изображения пользователя на страницу сразу.\r\n\r\n![](https://i.vas3k.club/b83bd8bc861a2f70e3bef8fd2d26b1cc78301e882b3b784eeacf3418e003fbb7.jpg)\r\n\r\n\r\nРазвернув это на собственном поддомене, я решил написать о проекте на следующий день. Ну а следующим вечером я решил, что будет неплохо добавить на страницу пользователя немного статистики.\r\n\r\nТакже решил добавить немного сортировок, ведь все любят сортировки. Кстати, про один из способов сортировки я интересовался в [Vas3k.nsfw](https://vas3k.club/network/chat/nsfw/).  Все-таки, сортировка по противоречивости это прикольно.\r\n\r\n![](https://i.vas3k.club/ad4943723c16b37f46f90447660896dddd40e5e3486dc0f75c78b80d67e64b9c.jpg)\r\n\r\nТак что общий совет всем на будущее: хотите сделать что-то быстро и просто, берите то, что знаете, не будьте как я. Ну, а если совмещать изучение нового с каким-нибудь пет-проектом, то почему бы и нет.\r\n\r\n\r\n### Как запускались и искали первых пользователей\r\n\r\nТак как я по сути делал инструмент для уже существующей аудитории, то никаких особых усилий для поиска пользователей не требовалось. Просто зашел в чатик и скинул ссылку. От хитрого плана с публикацией фото рабочего стола отказался. Как-то неспортивно все-таки.\r\n\r\nВ целом приняли положительно, сразу нашли пару багов. Одна была связана с парсингом, точнее с тем, что я не учел граничный случай, когда где-то в середине челленджа бот глюкнул и запостил одну и ту же запись два раза. Я полагался на идентификатор сообщения и не прописал уникальное ограничение. Обязательно прописывайте все ограничения. В итоге одна из длинных серий считалась неверно.\r\n\r\n![](https://i.vas3k.club/7086ebce9b014991435bd435658148fcc2b7a7b0f92727b3e2ef38e0b71ea915.jpg)\r\n\r\nПопросили прокинуть seed на главной, чтобы делиться выпавшими подборками лучших фото. Поправил это тоже. Ну и вывел ссылочки на соцсети тем, кто их скинул, чтобы, если кто вдруг наткнется на интересную фотографию, мог перейти дальше и посмотреть другие работы.\r\n\r\n\r\n### Сколько потратили и заработали? Есть идеи как это можно монетизировать?\r\n\r\nВ виду того, что проект простенький, а у всех есть под рукой некоторое количество свободных ресурсов, можно считать, что трат пока никаких и особо новые не планируются. Монетизации определенно не будет. Так что это просто pet-проект для себя и небольшого фотосообщества.\r\n\r\n\r\n\r\n\r\n### Какие планы на будущее?\r\nДа, вроде никаких, вероятней всего оно вообще не потребует какой-то особой поддержки. Так может код причесать и выложить все это на GitHub вместе с данными, чтобы, если что, это мог поднять кто-то еще. Поскольку bus factor у проекта, не то чтобы радовал.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/600bf0b061e978e7e772a019712887cd2cf26780133dddb5c7cf60ffe398c7bf.jpg)\r\n\r\nНу и наверное доделаю еще одно представление фотографий. Вместо грида будет приятно потом посмотреть на календарик, где на каждый день будет по фотографии.\r\n\r\n\r\n\r\n\r\n### Итоги\r\n\r\nЯ продолжаю 365, делая фотографию каждый день, но теперь мне гораздо проще вспоминать, какая именно из моих фотографий так провалилась на последнем голосовании.\r\n\r\n\r\nНадеюсь, что мой рассказ мотивирует кого-нибудь тоже поучаствовать в челлендже, ну или хотя бы постараться больше замечать вокруг, а не идти по улице, уткнувшись в телефон.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/11e9bb6f850fa3347410ad4f499a0e40718175a4b45530ad9401b66648be7515.jpg)\r\n\r\nКстати, вам не обязательно иметь фотоаппарат. Многие из участвующих в челлендже делают отличные фотки на мобильные телефоны. Необязательно, как я, таскать с собой тяжеленную бандуру тупо по приколу.\r\n\r\n![](https://i.vas3k.club/10921bf91ae200743ae3d7bb9296d08d36cf540a36f712b8089ebe53dfcb89c4.jpg)\r\n\r\n\r\nНу и главное в фотографии давно уже стало не умение сделать выверенную картинку. Для этого есть японцы с пометками, откуда фотографировать, а также вычислительная и обычная фотография. В современных камерах даже [автоспуск завезли](https://www.youtube.com/watch?v=tTyVaiJLSsE). Да и [нейронки](https://bjoernkarmann.dk/project/paragraphica) не дремлют. Так что главное в фотографии, на мой взгляд, давно стало не результат, хотя приятный результат всегда хорошо. Главное это умение видеть, чувствовать, ну и наслаждаться процессом.\r\n\r\nДа и правила челленджа не заставляют в нем активно участвовать. Многие просто время от времени выкладывают фотографии, как очередная площадка для поделиться.\r\n\r\nТакже не могу не напомнить, что у нас в клубе есть [секретный чат с фотографиями](https://vas3k.club/post/15747/). \r\n\r\np.s. покидая уютненький клуб вы рискуете нарваться на другое окружение. С другими мемасами и точками зрения. Я вас предупреждал.\r\n\r\n![](https://i.vas3k.club/7544973e3c49db12c8f88c2d5e60315233db51bcd331b72306bf721dd0dca115.jpg)	https://f365.zyuhel.ru/	\N	\N	f	t	78	2023-06-16 11:28:52.80246+00	\N	~	3b256275-bd5e-4980-9440-a5ba9f17acfc	\N	\N	{}	\N	\N
55682211-75b0-409c-87a0-f93d9756f53f	12	project	F365	С одной стороны, не хочется рассказывать о чем-то небольшом. С другой стороны, из маленьких кирпичиков строится большое здание, поэтому почему бы и нет? К черту скромность!\r\n\r\n\r\n![](https://i.vas3k.club/5532f95440515792c340c8c56db5fc684b65db0f56721cb40a5b1ff85358587a.jpg)\r\n\r\nСразу скажу, что проект не планирует никакой монетизации, а также что в посте будет много разных картинок. Но как рассказывать про фотографию без фотографий, а про проекты без мемов?\r\n\r\n\r\n### Расскажите о себе и сути проекта\r\n\r\n Про себя я писал в [#intro](https://vas3k.club/intro/tkf/). У меня есть несколько хобби, некоторые из которых вытекают друг из друга. Так, например, из увлечения LEGO выросло мое увлечение фотографией, и этот проект как раз посвящен именно этому увлечению. Увлечения нужны, чтобы не быть как котик на меме снизу. И без них очень легко в него попасть.\r\n\r\n![](https://i.vas3k.club/6ab54fa2cebe2342874e8bacf0d545539d2ba09d225322733d73e0c4bf5a807b.jpg)\r\n\r\nФотографирую я не так давно, сменил несколько камер, фотографировал вроде бы и часто, но не регулярно. В какой-то момент заметил, что стараюсь чаще оставлять камеру дома, а не тащить ее с собой. Так как я на какое-то время оказался далеко от громадной кучи любимых кубиков и от стационарного ПК, LEGO и игры в RTS временно стали задачей с меньшим приоритетом, а фотография - с большим. И я решил подумать на тему того, как же научиться фотографировать лучше.\r\n\r\nА как мы все знаем, лучший способ, чтобы научиться чему-либо, это практика.\r\n\r\n\r\n![](https://i.vas3k.club/98396649d42b00fd3dffdee068377999ae6e7571dc4c2346dbcbe57cfd0c9111.jpg)\r\n\r\nЕсть такой парень - Георгий Джеджея ([Сайт](https://jejeya.pictures/)), его еще @vas3k упоминал в [посте про вычислительную фотографию](https://vas3k.blog/blog/computational_photography) (если помните такой, конечно). Так вот, так как я решил подойти с точки зрения практики, я конечно же начал читать различные блоги (ахаха, все как всегда. Прокрастинация наше все. )\r\n\r\n![](https://i.vas3k.club/504ae1a489d8113f28389b7ce7004e670b9b1c198aac3f6e6cd70ddb09d0f1e0.jpg)\r\n\r\nНу так к чему это я? У Георгия есть Telegram канал, а у этого Telegram канала есть [чат](https://t.me/factory_chat), (Вастрик.фото и данный чат частично пересекаются, так что я думаю, о нем тоже кто-то из клуба знает). И вот в этом чате проходит челлендж, достаточно обычный, кстати — челлендж "365". Необходимо каждый день делать фотографию на протяжении года, обрабатывать ее в течение дня (вообще фотографию за сегодня можно выложить в течение сегодня и завтра) и выкладывать ее.\r\n\r\n![](https://i.vas3k.club/7836082aee16e631a563750c7b7f266c446c10654770d6ba83514d731d5ee1cf.jpg)\r\n*(я просто хотел выложить фотографию с акулой, сорри)*\r\n\r\nЯ пропускал эти челленджы, потому что:\r\nа) Да зачем оно мне нужно?\r\nб) Это же нужно самому как-то отслеживать и следить.\r\n\r\nА тут все было сделано достаточно удобно: был бот, который принимал фотографии в Telegram, и некоторый элемент геймификации, когда участники чата голосовали за лучшие работы, и в итоге каждый день подводились результаты голосования с виртуальными медальками.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/3711da994c773bdd20643a9b382e70f1edbd6735b0ed5a18bb39532f2a5fe9b2.jpg)\r\n\r\nЯ участвую в данном челлендже уже более 200 дней, и он во многом мне помог. Я не сказал бы, чтобы я стал снимать лучше. Бывает, я открываю свои достаточно старые фотографии и понимаю, что мой уровень не то что вырос, но я стал лучше понимать, когда фотография определенно не получится. Также я стал лучше разбираться в своей камере и подтянул навык быстрой обработки фотографий.\r\n\r\nНо и это не главное. Главное, наверное, то, что необходимость делать что-то заставляла меня подниматься и делать что-то, даже тогда, когда очень не хотелось. И за счет этого улучшая мою жизнь. Я вставал на рассвете, чтобы фотографировать рассветное солнце.\r\n\r\n\r\n![](https://i.vas3k.club/80d9894285db17671a7323dd6a3257a119f63c8f5b374123791844d5ad244f1c.jpg)\r\n\r\n И искал что-то интересное в обыденном.\r\n\r\n![](https://i.vas3k.club/f4b51fff4b874d5e8ab225434c673d9c409fe335fcc85c88e6f77970dce44190.jpg)\r\n\r\nНу и просто в целом тренировал дисциплину. Если бы я был большим экстравертом, наверное, познакомился бы таким образом с кучей людей. Но, так как я такой как я есть, я просто сделал кучу фотографий (ну ладно, я даже несколько раз подходил к незнакомым людям с просьбой их сфотографировать, прогресс собственно на лицо) , которые мне нравятся, а также подписывался на различные поездки, от которых возможно бы отказался в ином случае. Даже завел дрона, чтобы смотреть на вещи с другого угла :)\r\n\r\n![](https://i.vas3k.club/e3bbb91c4adc2b4b5187d0a33f9ebc2d7dc6cfe1ba713a8f81c889e29a816c92.jpg)\r\n\r\nНо искать свои фото в большой куче фотографий в канале было не очень удобно, а иногда хотелось понять, какая фотография набрала больше лайков, или просто посмотреть, с каких фото я начал челлендж, а какие идут сейчас, чтобы понять, что вот сейчас у тебя идет провал, и ты не можешь найти сюжеты, а раньше энтузиазм так и переполнял. Ну и просто пересмотреть кадры по принципу "кадр в день" — это очень интересно.\r\n\r\nЯ даже как-то [считал](https://t.me/factory_chat/1385166) небольшую статистику по результатам 2022 года в этом челлендже.\r\n\r\nИ меня не покидала идея, что было бы отлично иметь возможность легко посмотреть данные из канала. Поиск в Telegram по хештегу, конечно, работает, но в целом искать в ленте очень неудобно. Да и видеть какую-нибудь писькомерную статистику всегда приятно.\r\n\r\n\r\n![](https://i.vas3k.club/43ddeb3a94d0b8889f161da377b7191210e0a6e872d33003ebf4c40843030158.jpg)\r\n\r\nВ какой-то момент я решил, что хватит тянуть кота за яйца, и раз у меня не очень получается с фото выходить на первые места, можно сделать полезный для сообщества сервис, выложить фото с его интерфейсом и словить плюшки :)\r\n\r\n\r\n\r\n![](https://i.vas3k.club/f063638b70f757fe7f7e243d9d747e6346400c9e7cfb5e4dfa6ed969bc7ed692.jpg)\r\n\r\n\r\n\r\n### Что вошло в прототип, технологический стек и сколько времени на него было потрачено\r\n\r\n![](https://i.vas3k.club/44432d7c6b0e9fee76128e59052379425afb40ffe0cedfb4bf474d790e536dd2.jpg)\r\n\r\nЯ решил разбить проект на три части, чтобы максимально упростить дальнейшую поддержку или замену. Соответственно, получаем парсинг опубликованных ботом данных и их запись в базу. API для получения данных из этой базы и фронтенд, который будет показывать полученные данные. На все про все ушло несколько вечеров.\r\n\r\nСамой простой частью были парсинг и API. Так как фронт планировался на JavaScript, решил и бекэнд сделать на нем же. Взял Express.js, MySQL, набросал быстренько простенький API, развернул, проверил, что все нормально.\r\n\r\n\r\nЕдинственная проблема на бекэнде была с запросом, подсчитывающим самые длинные интервалы без проблем в публикациях. Наиболее адекватным и простым вариантом было использовать оконные функции, но в тот вечер, похоже, лыжи решили не ехать, и нужный вариант никак не хотел писаться. И тут меня осенило, мы же в будущем, где же вкалывающие роботы? Я открыл ChatGPT и попросил его написать запрос. Неожиданно запрос даже оказался почти верным. С помощью напильника (так как уточняющими вопросами заставить его исправить запрос не вышло), запрос был приведен в нужное состояние, и бекэнд стал полностью рабочим.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/407d6e557ee8461b17eb215fd1b555a94e4f8124ff4c31017863fa5e89fe2a77.jpg)\r\n\r\n\r\nНу что же, после этого настало время опуститься в авгиевы конюшни и собрать фронт на третьем Vue. Вообще на работе мне приходилось встречаться с вторым Vue (нет, встречался я со всем подряд, но с Vue было больше всего опыта), поэтому я подумал, что особых проблем с третьим Vue не будет. Сцуко, как же я ошибался. Ближайший час был занят различными попытками адаптировать свой опыт из Options API второго Vue на Composition API третьего. А также отойти от Vuex к Pinia. Казалось бы, что мешало поставить Vuex и Options API на третий Vue? Но ведь мы не ищем легких путей. Вообще ненавижу такие моменты, когда вместо того, чтобы решать проблему, приходится бороться с окружением.\r\n\r\nВ общем, после некоторого количества матюгов, я перешел к конкретной реализации самого интерфейса. Так как чукча ни разу не дизайнер, я взял готовый UI Kit. И после небольшой отладки был готов MVP на трех страницах.\r\n\r\n![](https://i.vas3k.club/d09383066ba8d3cf4917182ef3923d31e1a7b8500b3e68a46b460406c29f3de4.jpg)\r\n\r\nСписок фотографий дня, рандомная подборка случайных фото и страница фотографий пользователя. Так как данный челлендж проходит всего где-то 3.5 года, и количество участников не то чтобы запредельное, я решил отказаться от infinite scroll с подгрузкой и просто фигачить все изображения пользователя на страницу сразу.\r\n\r\n![](https://i.vas3k.club/b83bd8bc861a2f70e3bef8fd2d26b1cc78301e882b3b784eeacf3418e003fbb7.jpg)\r\n\r\n\r\nРазвернув это на собственном поддомене, я решил написать о проекте на следующий день. Ну а следующим вечером я решил, что будет неплохо добавить на страницу пользователя немного статистики.\r\n\r\nТакже решил добавить немного сортировок, ведь все любят сортировки. Кстати, про один из способов сортировки я интересовался в [Vas3k.nsfw](https://vas3k.club/network/chat/nsfw/).  Все-таки, сортировка по противоречивости это прикольно.\r\n\r\n![](https://i.vas3k.club/ad4943723c16b37f46f90447660896dddd40e5e3486dc0f75c78b80d67e64b9c.jpg)\r\n\r\nТак что общий совет всем на будущее: хотите сделать что-то быстро и просто, берите то, что знаете, не будьте как я. Ну, а если совмещать изучение нового с каким-нибудь пет-проектом, то почему бы и нет.\r\n\r\n\r\n### Как запускались и искали первых пользователей\r\n\r\nТак как я по сути делал инструмент для уже существующей аудитории, то никаких особых усилий для поиска пользователей не требовалось. Просто зашел в чатик и скинул ссылку. От хитрого плана с публикацией фото рабочего стола отказался. Как-то неспортивно все-таки.\r\n\r\nВ целом приняли положительно, сразу нашли пару багов. Одна была связана с парсингом, точнее с тем, что я не учел граничный случай, когда где-то в середине челленджа бот глюкнул и запостил одну и ту же запись два раза. Я полагался на идентификатор сообщения и не прописал уникальное ограничение. Обязательно прописывайте все ограничения. В итоге одна из длинных серий считалась неверно.\r\n\r\n![](https://i.vas3k.club/7086ebce9b014991435bd435658148fcc2b7a7b0f92727b3e2ef38e0b71ea915.jpg)\r\n\r\nПопросили прокинуть seed на главной, чтобы делиться выпавшими подборками лучших фото. Поправил это тоже. Ну и вывел ссылочки на соцсети тем, кто их скинул, чтобы, если кто вдруг наткнется на интересную фотографию, мог перейти дальше и посмотреть другие работы.\r\n\r\n\r\n### Сколько потратили и заработали? Есть идеи как это можно монетизировать?\r\n\r\nВ виду того, что проект простенький, а у всех есть под рукой некоторое количество свободных ресурсов, можно считать, что трат пока никаких и особо новые не планируются. Монетизации определенно не будет. Так что это просто pet-проект для себя и небольшого фотосообщества.\r\n\r\n\r\n\r\n\r\n### Какие планы на будущее?\r\nДа, вроде никаких, вероятней всего оно вообще не потребует какой-то особой поддержки. Так может код причесать и выложить все это на GitHub вместе с данными, чтобы, если что, это мог поднять кто-то еще. Поскольку bus factor у проекта, не то чтобы радовал.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/600bf0b061e978e7e772a019712887cd2cf26780133dddb5c7cf60ffe398c7bf.jpg)\r\n\r\nНу и наверное доделаю еще одно представление фотографий. Вместо грида будет приятно потом посмотреть на календарик, где на каждый день будет по фотографии.\r\n\r\n\r\n\r\n\r\n### Итоги\r\n\r\nЯ продолжаю 365, делая фотографию каждый день, но теперь мне гораздо проще вспоминать, какая именно из моих фотографий так провалилась на последнем голосовании.\r\n\r\n\r\nНадеюсь, что мой рассказ мотивирует кого-нибудь тоже поучаствовать в челлендже, ну или хотя бы постараться больше замечать вокруг, а не идти по улице, уткнувшись в телефон.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/11e9bb6f850fa3347410ad4f499a0e40718175a4b45530ad9401b66648be7515.jpg)\r\n\r\nКстати, вам не обязательно иметь фотоаппарат. Многие из участвующих в челлендже делают отличные фотки на мобильные телефоны. Необязательно, как я, таскать с собой тяжеленную бандуру тупо по приколу.\r\n\r\n![](https://i.vas3k.club/10921bf91ae200743ae3d7bb9296d08d36cf540a36f712b8089ebe53dfcb89c4.jpg)\r\n\r\n\r\nНу и главное в фотографии давно уже стало не умение сделать выверенную картинку. Для этого есть японцы с пометками, откуда фотографировать, а также вычислительная и обычная фотография. В современных камерах даже [автоспуск завезли](https://www.youtube.com/watch?v=tTyVaiJLSsE). Да и [нейронки](https://bjoernkarmann.dk/project/paragraphica) не дремлют. Так что главное в фотографии, на мой взгляд, давно стало не результат, хотя приятный результат всегда хорошо. Главное это умение видеть, чувствовать, ну и наслаждаться процессом.\r\n\r\nДа и правила челленджа не заставляют в нем активно участвовать. Многие просто время от времени выкладывают фотографии, как очередная площадка для поделиться.\r\n\r\nТакже не могу не напомнить, что у нас в клубе есть [секретный чат с фотографиями](https://vas3k.club/post/15747/). \r\n\r\np.s. покидая уютненький клуб вы рискуете нарваться на другое окружение. С другими мемасами и точками зрения. Я вас предупреждал.\r\n\r\n![](https://i.vas3k.club/7544973e3c49db12c8f88c2d5e60315233db51bcd331b72306bf721dd0dca115.jpg)	https://f365.zyuhel.ru/	\N	\N	t	t	79	2023-06-16 11:28:52.818984+00	\N	~	3b256275-bd5e-4980-9440-a5ba9f17acfc	\N	\N	{}	\N	\N
55682211-75b0-409c-87a0-f93d9756f53f	12	project	F365	С одной стороны, не хочется рассказывать о чем-то небольшом. С другой стороны, из маленьких кирпичиков строится большое здание, поэтому почему бы и нет? К черту скромность!\r\n\r\n\r\n![](https://i.vas3k.club/5532f95440515792c340c8c56db5fc684b65db0f56721cb40a5b1ff85358587a.jpg)\r\n\r\nСразу скажу, что проект не планирует никакой монетизации, а также что в посте будет много разных картинок. Но как рассказывать про фотографию без фотографий, а про проекты без мемов?\r\n\r\n\r\n### Расскажите о себе и сути проекта\r\n\r\n Про себя я писал в [#intro](https://vas3k.club/intro/tkf/). У меня есть несколько хобби, некоторые из которых вытекают друг из друга. Так, например, из увлечения LEGO выросло мое увлечение фотографией, и этот проект как раз посвящен именно этому увлечению. Увлечения нужны, чтобы не быть как котик на меме снизу. И без них очень легко в него попасть.\r\n\r\n![](https://i.vas3k.club/6ab54fa2cebe2342874e8bacf0d545539d2ba09d225322733d73e0c4bf5a807b.jpg)\r\n\r\nФотографирую я не так давно, сменил несколько камер, фотографировал вроде бы и часто, но не регулярно. В какой-то момент заметил, что стараюсь чаще оставлять камеру дома, а не тащить ее с собой. Так как я на какое-то время оказался далеко от громадной кучи любимых кубиков и от стационарного ПК, LEGO и игры в RTS временно стали задачей с меньшим приоритетом, а фотография - с большим. И я решил подумать на тему того, как же научиться фотографировать лучше.\r\n\r\nА как мы все знаем, лучший способ, чтобы научиться чему-либо, это практика.\r\n\r\n\r\n![](https://i.vas3k.club/98396649d42b00fd3dffdee068377999ae6e7571dc4c2346dbcbe57cfd0c9111.jpg)\r\n\r\nЕсть такой парень - Георгий Джеджея ([Сайт](https://jejeya.pictures/)), его еще @vas3k упоминал в [посте про вычислительную фотографию](https://vas3k.blog/blog/computational_photography) (если помните такой, конечно). Так вот, так как я решил подойти с точки зрения практики, я конечно же начал читать различные блоги (ахаха, все как всегда. Прокрастинация наше все. )\r\n\r\n![](https://i.vas3k.club/504ae1a489d8113f28389b7ce7004e670b9b1c198aac3f6e6cd70ddb09d0f1e0.jpg)\r\n\r\nНу так к чему это я? У Георгия есть Telegram канал, а у этого Telegram канала есть [чат](https://t.me/factory_chat), (Вастрик.фото и данный чат частично пересекаются, так что я думаю, о нем тоже кто-то из клуба знает). И вот в этом чате проходит челлендж, достаточно обычный, кстати — челлендж "365". Необходимо каждый день делать фотографию на протяжении года, обрабатывать ее в течение дня (вообще фотографию за сегодня можно выложить в течение сегодня и завтра) и выкладывать ее.\r\n\r\n![](https://i.vas3k.club/7836082aee16e631a563750c7b7f266c446c10654770d6ba83514d731d5ee1cf.jpg)\r\n*(я просто хотел выложить фотографию с акулой, сорри)*\r\n\r\nЯ пропускал эти челленджы, потому что:\r\nа) Да зачем оно мне нужно?\r\nб) Это же нужно самому как-то отслеживать и следить.\r\n\r\nА тут все было сделано достаточно удобно: был бот, который принимал фотографии в Telegram, и некоторый элемент геймификации, когда участники чата голосовали за лучшие работы, и в итоге каждый день подводились результаты голосования с виртуальными медальками.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/3711da994c773bdd20643a9b382e70f1edbd6735b0ed5a18bb39532f2a5fe9b2.jpg)\r\n\r\nЯ участвую в данном челлендже уже более 200 дней, и он во многом мне помог. Я не сказал бы, чтобы я стал снимать лучше. Бывает, я открываю свои достаточно старые фотографии и понимаю, что мой уровень не то что вырос, но я стал лучше понимать, когда фотография определенно не получится. Также я стал лучше разбираться в своей камере и подтянул навык быстрой обработки фотографий.\r\n\r\nНо и это не главное. Главное, наверное, то, что необходимость делать что-то заставляла меня подниматься и делать что-то, даже тогда, когда очень не хотелось. И за счет этого улучшая мою жизнь. Я вставал на рассвете, чтобы фотографировать рассветное солнце.\r\n\r\n\r\n![](https://i.vas3k.club/80d9894285db17671a7323dd6a3257a119f63c8f5b374123791844d5ad244f1c.jpg)\r\n\r\n И искал что-то интересное в обыденном.\r\n\r\n![](https://i.vas3k.club/f4b51fff4b874d5e8ab225434c673d9c409fe335fcc85c88e6f77970dce44190.jpg)\r\n\r\nНу и просто в целом тренировал дисциплину. Если бы я был большим экстравертом, наверное, познакомился бы таким образом с кучей людей. Но, так как я такой как я есть, я просто сделал кучу фотографий (ну ладно, я даже несколько раз подходил к незнакомым людям с просьбой их сфотографировать, прогресс собственно на лицо) , которые мне нравятся, а также подписывался на различные поездки, от которых возможно бы отказался в ином случае. Даже завел дрона, чтобы смотреть на вещи с другого угла :)\r\n\r\n![](https://i.vas3k.club/e3bbb91c4adc2b4b5187d0a33f9ebc2d7dc6cfe1ba713a8f81c889e29a816c92.jpg)\r\n\r\nНо искать свои фото в большой куче фотографий в канале было не очень удобно, а иногда хотелось понять, какая фотография набрала больше лайков, или просто посмотреть, с каких фото я начал челлендж, а какие идут сейчас, чтобы понять, что вот сейчас у тебя идет провал, и ты не можешь найти сюжеты, а раньше энтузиазм так и переполнял. Ну и просто пересмотреть кадры по принципу "кадр в день" — это очень интересно.\r\n\r\nЯ даже как-то [считал](https://t.me/factory_chat/1385166) небольшую статистику по результатам 2022 года в этом челлендже.\r\n\r\nИ меня не покидала идея, что было бы отлично иметь возможность легко посмотреть данные из канала. Поиск в Telegram по хештегу, конечно, работает, но в целом искать в ленте очень неудобно. Да и видеть какую-нибудь писькомерную статистику всегда приятно.\r\n\r\n\r\n![](https://i.vas3k.club/43ddeb3a94d0b8889f161da377b7191210e0a6e872d33003ebf4c40843030158.jpg)\r\n\r\nВ какой-то момент я решил, что хватит тянуть кота за яйца, и раз у меня не очень получается с фото выходить на первые места, можно сделать полезный для сообщества сервис, выложить фото с его интерфейсом и словить плюшки :)\r\n\r\n\r\n\r\n![](https://i.vas3k.club/f063638b70f757fe7f7e243d9d747e6346400c9e7cfb5e4dfa6ed969bc7ed692.jpg)\r\n\r\n\r\n\r\n### Что вошло в прототип, технологический стек и сколько времени на него было потрачено\r\n\r\n![](https://i.vas3k.club/44432d7c6b0e9fee76128e59052379425afb40ffe0cedfb4bf474d790e536dd2.jpg)\r\n\r\nЯ решил разбить проект на три части, чтобы максимально упростить дальнейшую поддержку или замену. Соответственно, получаем парсинг опубликованных ботом данных и их запись в базу. API для получения данных из этой базы и фронтенд, который будет показывать полученные данные. На все про все ушло несколько вечеров.\r\n\r\nСамой простой частью были парсинг и API. Так как фронт планировался на JavaScript, решил и бекэнд сделать на нем же. Взял Express.js, MySQL, набросал быстренько простенький API, развернул, проверил, что все нормально.\r\n\r\n\r\nЕдинственная проблема на бекэнде была с запросом, подсчитывающим самые длинные интервалы без проблем в публикациях. Наиболее адекватным и простым вариантом было использовать оконные функции, но в тот вечер, похоже, лыжи решили не ехать, и нужный вариант никак не хотел писаться. И тут меня осенило, мы же в будущем, где же вкалывающие роботы? Я открыл ChatGPT и попросил его написать запрос. Неожиданно запрос даже оказался почти верным. С помощью напильника (так как уточняющими вопросами заставить его исправить запрос не вышло), запрос был приведен в нужное состояние, и бекэнд стал полностью рабочим.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/407d6e557ee8461b17eb215fd1b555a94e4f8124ff4c31017863fa5e89fe2a77.jpg)\r\n\r\n\r\nНу что же, после этого настало время опуститься в авгиевы конюшни и собрать фронт на третьем Vue. Вообще на работе мне приходилось встречаться с вторым Vue (нет, встречался я со всем подряд, но с Vue было больше всего опыта), поэтому я подумал, что особых проблем с третьим Vue не будет. Сцуко, как же я ошибался. Ближайший час был занят различными попытками адаптировать свой опыт из Options API второго Vue на Composition API третьего. А также отойти от Vuex к Pinia. Казалось бы, что мешало поставить Vuex и Options API на третий Vue? Но ведь мы не ищем легких путей. Вообще ненавижу такие моменты, когда вместо того, чтобы решать проблему, приходится бороться с окружением.\r\n\r\nВ общем, после некоторого количества матюгов, я перешел к конкретной реализации самого интерфейса. Так как чукча ни разу не дизайнер, я взял готовый UI Kit. И после небольшой отладки был готов MVP на трех страницах.\r\n\r\n![](https://i.vas3k.club/d09383066ba8d3cf4917182ef3923d31e1a7b8500b3e68a46b460406c29f3de4.jpg)\r\n\r\nСписок фотографий дня, рандомная подборка случайных фото и страница фотографий пользователя. Так как данный челлендж проходит всего где-то 3.5 года, и количество участников не то чтобы запредельное, я решил отказаться от infinite scroll с подгрузкой и просто фигачить все изображения пользователя на страницу сразу.\r\n\r\n![](https://i.vas3k.club/b83bd8bc861a2f70e3bef8fd2d26b1cc78301e882b3b784eeacf3418e003fbb7.jpg)\r\n\r\n\r\nРазвернув это на собственном поддомене, я решил написать о проекте на следующий день. Ну а следующим вечером я решил, что будет неплохо добавить на страницу пользователя немного статистики.\r\n\r\nТакже решил добавить немного сортировок, ведь все любят сортировки. Кстати, про один из способов сортировки я интересовался в [Vas3k.nsfw](https://vas3k.club/network/chat/nsfw/).  Все-таки, сортировка по противоречивости это прикольно.\r\n\r\n![](https://i.vas3k.club/ad4943723c16b37f46f90447660896dddd40e5e3486dc0f75c78b80d67e64b9c.jpg)\r\n\r\nТак что общий совет всем на будущее: хотите сделать что-то быстро и просто, берите то, что знаете, не будьте как я. Ну, а если совмещать изучение нового с каким-нибудь пет-проектом, то почему бы и нет.\r\n\r\n\r\n### Как запускались и искали первых пользователей\r\n\r\nТак как я по сути делал инструмент для уже существующей аудитории, то никаких особых усилий для поиска пользователей не требовалось. Просто зашел в чатик и скинул ссылку. От хитрого плана с публикацией фото рабочего стола отказался. Как-то неспортивно все-таки.\r\n\r\nВ целом приняли положительно, сразу нашли пару багов. Одна была связана с парсингом, точнее с тем, что я не учел граничный случай, когда где-то в середине челленджа бот глюкнул и запостил одну и ту же запись два раза. Я полагался на идентификатор сообщения и не прописал уникальное ограничение. Обязательно прописывайте все ограничения. В итоге одна из длинных серий считалась неверно.\r\n\r\n![](https://i.vas3k.club/7086ebce9b014991435bd435658148fcc2b7a7b0f92727b3e2ef38e0b71ea915.jpg)\r\n\r\nПопросили прокинуть seed на главной, чтобы делиться выпавшими подборками лучших фото. Поправил это тоже. Ну и вывел ссылочки на соцсети тем, кто их скинул, чтобы, если кто вдруг наткнется на интересную фотографию, мог перейти дальше и посмотреть другие работы.\r\n\r\n\r\n### Сколько потратили и заработали? Есть идеи как это можно монетизировать?\r\n\r\nВ виду того, что проект простенький, а у всех есть под рукой некоторое количество свободных ресурсов, можно считать, что трат пока никаких и особо новые не планируются. Монетизации определенно не будет. Так что это просто pet-проект для себя и небольшого фотосообщества.\r\n\r\n\r\n\r\n\r\n### Какие планы на будущее?\r\nДа, вроде никаких, вероятней всего оно вообще не потребует какой-то особой поддержки. Так может код причесать и выложить все это на GitHub вместе с данными, чтобы, если что, это мог поднять кто-то еще. Поскольку bus factor у проекта, не то чтобы радовал.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/600bf0b061e978e7e772a019712887cd2cf26780133dddb5c7cf60ffe398c7bf.jpg)\r\n\r\nНу и наверное доделаю еще одно представление фотографий. Вместо грида будет приятно потом посмотреть на календарик, где на каждый день будет по фотографии.\r\n\r\n\r\n\r\n\r\n### Итоги\r\n\r\nЯ продолжаю 365, делая фотографию каждый день, но теперь мне гораздо проще вспоминать, какая именно из моих фотографий так провалилась на последнем голосовании.\r\n\r\n\r\nНадеюсь, что мой рассказ мотивирует кого-нибудь тоже поучаствовать в челлендже, ну или хотя бы постараться больше замечать вокруг, а не идти по улице, уткнувшись в телефон.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/11e9bb6f850fa3347410ad4f499a0e40718175a4b45530ad9401b66648be7515.jpg)\r\n\r\nКстати, вам не обязательно иметь фотоаппарат. Многие из участвующих в челлендже делают отличные фотки на мобильные телефоны. Необязательно, как я, таскать с собой тяжеленную бандуру тупо по приколу.\r\n\r\n![](https://i.vas3k.club/10921bf91ae200743ae3d7bb9296d08d36cf540a36f712b8089ebe53dfcb89c4.jpg)\r\n\r\n\r\nНу и главное в фотографии давно уже стало не умение сделать выверенную картинку. Для этого есть японцы с пометками, откуда фотографировать, а также вычислительная и обычная фотография. В современных камерах даже [автоспуск завезли](https://www.youtube.com/watch?v=tTyVaiJLSsE). Да и [нейронки](https://bjoernkarmann.dk/project/paragraphica) не дремлют. Так что главное в фотографии, на мой взгляд, давно стало не результат, хотя приятный результат всегда хорошо. Главное это умение видеть, чувствовать, ну и наслаждаться процессом.\r\n\r\nДа и правила челленджа не заставляют в нем активно участвовать. Многие просто время от времени выкладывают фотографии, как очередная площадка для поделиться.\r\n\r\nТакже не могу не напомнить, что у нас в клубе есть [секретный чат с фотографиями](https://vas3k.club/post/15747/). \r\n\r\np.s. покидая уютненький клуб вы рискуете нарваться на другое окружение. С другими мемасами и точками зрения. Я вас предупреждал.\r\n\r\n![](https://i.vas3k.club/7544973e3c49db12c8f88c2d5e60315233db51bcd331b72306bf721dd0dca115.jpg)	https://f365.zyuhel.ru/	\N	\N	t	t	80	2023-06-16 11:28:52.887976+00	\N	~	3b256275-bd5e-4980-9440-a5ba9f17acfc	\N	\N	{}	\N	\N
55682211-75b0-409c-87a0-f93d9756f53f	12	project	F365	С одной стороны, не хочется рассказывать о чем-то небольшом. С другой стороны, из маленьких кирпичиков строится большое здание, поэтому почему бы и нет? К черту скромность!\r\n\r\n\r\n![](https://i.vas3k.club/5532f95440515792c340c8c56db5fc684b65db0f56721cb40a5b1ff85358587a.jpg)\r\n\r\nСразу скажу, что проект не планирует никакой монетизации, а также что в посте будет много разных картинок. Но как рассказывать про фотографию без фотографий, а про проекты без мемов?\r\n\r\n\r\n### Расскажите о себе и сути проекта\r\n\r\n Про себя я писал в [#intro](https://vas3k.club/intro/tkf/). У меня есть несколько хобби, некоторые из которых вытекают друг из друга. Так, например, из увлечения LEGO выросло мое увлечение фотографией, и этот проект как раз посвящен именно этому увлечению. Увлечения нужны, чтобы не быть как котик на меме снизу. И без них очень легко в него попасть.\r\n\r\n![](https://i.vas3k.club/6ab54fa2cebe2342874e8bacf0d545539d2ba09d225322733d73e0c4bf5a807b.jpg)\r\n\r\nФотографирую я не так давно, сменил несколько камер, фотографировал вроде бы и часто, но не регулярно. В какой-то момент заметил, что стараюсь чаще оставлять камеру дома, а не тащить ее с собой. Так как я на какое-то время оказался далеко от громадной кучи любимых кубиков и от стационарного ПК, LEGO и игры в RTS временно стали задачей с меньшим приоритетом, а фотография - с большим. И я решил подумать на тему того, как же научиться фотографировать лучше.\r\n\r\nА как мы все знаем, лучший способ, чтобы научиться чему-либо, это практика.\r\n\r\n\r\n![](https://i.vas3k.club/98396649d42b00fd3dffdee068377999ae6e7571dc4c2346dbcbe57cfd0c9111.jpg)\r\n\r\nЕсть такой парень - Георгий Джеджея ([Сайт](https://jejeya.pictures/)), его еще @vas3k упоминал в [посте про вычислительную фотографию](https://vas3k.blog/blog/computational_photography) (если помните такой, конечно). Так вот, так как я решил подойти с точки зрения практики, я конечно же начал читать различные блоги (ахаха, все как всегда. Прокрастинация наше все. )\r\n\r\n![](https://i.vas3k.club/504ae1a489d8113f28389b7ce7004e670b9b1c198aac3f6e6cd70ddb09d0f1e0.jpg)\r\n\r\nНу так к чему это я? У Георгия есть Telegram канал, а у этого Telegram канала есть [чат](https://t.me/factory_chat), (Вастрик.фото и данный чат частично пересекаются, так что я думаю, о нем тоже кто-то из клуба знает). И вот в этом чате проходит челлендж, достаточно обычный, кстати — челлендж "365". Необходимо каждый день делать фотографию на протяжении года, обрабатывать ее в течение дня (вообще фотографию за сегодня можно выложить в течение сегодня и завтра) и выкладывать ее.\r\n\r\n![](https://i.vas3k.club/7836082aee16e631a563750c7b7f266c446c10654770d6ba83514d731d5ee1cf.jpg)\r\n*(я просто хотел выложить фотографию с акулой, сорри)*\r\n\r\nЯ пропускал эти челленджы, потому что:\r\nа) Да зачем оно мне нужно?\r\nб) Это же нужно самому как-то отслеживать и следить.\r\n\r\nА тут все было сделано достаточно удобно: был бот, который принимал фотографии в Telegram, и некоторый элемент геймификации, когда участники чата голосовали за лучшие работы, и в итоге каждый день подводились результаты голосования с виртуальными медальками.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/3711da994c773bdd20643a9b382e70f1edbd6735b0ed5a18bb39532f2a5fe9b2.jpg)\r\n\r\nЯ участвую в данном челлендже уже более 200 дней, и он во многом мне помог. Я не сказал бы, чтобы я стал снимать лучше. Бывает, я открываю свои достаточно старые фотографии и понимаю, что мой уровень не то что вырос, но я стал лучше понимать, когда фотография определенно не получится. Также я стал лучше разбираться в своей камере и подтянул навык быстрой обработки фотографий.\r\n\r\nНо и это не главное. Главное, наверное, то, что необходимость делать что-то заставляла меня подниматься и делать что-то, даже тогда, когда очень не хотелось. И за счет этого улучшая мою жизнь. Я вставал на рассвете, чтобы фотографировать рассветное солнце.\r\n\r\n\r\n![](https://i.vas3k.club/80d9894285db17671a7323dd6a3257a119f63c8f5b374123791844d5ad244f1c.jpg)\r\n\r\n И искал что-то интересное в обыденном.\r\n\r\n![](https://i.vas3k.club/f4b51fff4b874d5e8ab225434c673d9c409fe335fcc85c88e6f77970dce44190.jpg)\r\n\r\nНу и просто в целом тренировал дисциплину. Если бы я был большим экстравертом, наверное, познакомился бы таким образом с кучей людей. Но, так как я такой как я есть, я просто сделал кучу фотографий (ну ладно, я даже несколько раз подходил к незнакомым людям с просьбой их сфотографировать, прогресс собственно на лицо) , которые мне нравятся, а также подписывался на различные поездки, от которых возможно бы отказался в ином случае. Даже завел дрона, чтобы смотреть на вещи с другого угла :)\r\n\r\n![](https://i.vas3k.club/e3bbb91c4adc2b4b5187d0a33f9ebc2d7dc6cfe1ba713a8f81c889e29a816c92.jpg)\r\n\r\nНо искать свои фото в большой куче фотографий в канале было не очень удобно, а иногда хотелось понять, какая фотография набрала больше лайков, или просто посмотреть, с каких фото я начал челлендж, а какие идут сейчас, чтобы понять, что вот сейчас у тебя идет провал, и ты не можешь найти сюжеты, а раньше энтузиазм так и переполнял. Ну и просто пересмотреть кадры по принципу "кадр в день" — это очень интересно.\r\n\r\nЯ даже как-то [считал](https://t.me/factory_chat/1385166) небольшую статистику по результатам 2022 года в этом челлендже.\r\n\r\nИ меня не покидала идея, что было бы отлично иметь возможность легко посмотреть данные из канала. Поиск в Telegram по хештегу, конечно, работает, но в целом искать в ленте очень неудобно. Да и видеть какую-нибудь писькомерную статистику всегда приятно.\r\n\r\n\r\n![](https://i.vas3k.club/43ddeb3a94d0b8889f161da377b7191210e0a6e872d33003ebf4c40843030158.jpg)\r\n\r\nВ какой-то момент я решил, что хватит тянуть кота за яйца, и раз у меня не очень получается с фото выходить на первые места, можно сделать полезный для сообщества сервис, выложить фото с его интерфейсом и словить плюшки :)\r\n\r\n\r\n\r\n![](https://i.vas3k.club/f063638b70f757fe7f7e243d9d747e6346400c9e7cfb5e4dfa6ed969bc7ed692.jpg)\r\n\r\n\r\n\r\n### Что вошло в прототип, технологический стек и сколько времени на него было потрачено\r\n\r\n![](https://i.vas3k.club/44432d7c6b0e9fee76128e59052379425afb40ffe0cedfb4bf474d790e536dd2.jpg)\r\n\r\nЯ решил разбить проект на три части, чтобы максимально упростить дальнейшую поддержку или замену. Соответственно, получаем парсинг опубликованных ботом данных и их запись в базу. API для получения данных из этой базы и фронтенд, который будет показывать полученные данные. На все про все ушло несколько вечеров.\r\n\r\nСамой простой частью были парсинг и API. Так как фронт планировался на JavaScript, решил и бекэнд сделать на нем же. Взял Express.js, MySQL, набросал быстренько простенький API, развернул, проверил, что все нормально.\r\n\r\n\r\nЕдинственная проблема на бекэнде была с запросом, подсчитывающим самые длинные интервалы без проблем в публикациях. Наиболее адекватным и простым вариантом было использовать оконные функции, но в тот вечер, похоже, лыжи решили не ехать, и нужный вариант никак не хотел писаться. И тут меня осенило, мы же в будущем, где же вкалывающие роботы? Я открыл ChatGPT и попросил его написать запрос. Неожиданно запрос даже оказался почти верным. С помощью напильника (так как уточняющими вопросами заставить его исправить запрос не вышло), запрос был приведен в нужное состояние, и бекэнд стал полностью рабочим.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/407d6e557ee8461b17eb215fd1b555a94e4f8124ff4c31017863fa5e89fe2a77.jpg)\r\n\r\n\r\nНу что же, после этого настало время опуститься в авгиевы конюшни и собрать фронт на третьем Vue. Вообще на работе мне приходилось встречаться с вторым Vue (нет, встречался я со всем подряд, но с Vue было больше всего опыта), поэтому я подумал, что особых проблем с третьим Vue не будет. Сцуко, как же я ошибался. Ближайший час был занят различными попытками адаптировать свой опыт из Options API второго Vue на Composition API третьего. А также отойти от Vuex к Pinia. Казалось бы, что мешало поставить Vuex и Options API на третий Vue? Но ведь мы не ищем легких путей. Вообще ненавижу такие моменты, когда вместо того, чтобы решать проблему, приходится бороться с окружением.\r\n\r\nВ общем, после некоторого количества матюгов, я перешел к конкретной реализации самого интерфейса. Так как чукча ни разу не дизайнер, я взял готовый UI Kit. И после небольшой отладки был готов MVP на трех страницах.\r\n\r\n![](https://i.vas3k.club/d09383066ba8d3cf4917182ef3923d31e1a7b8500b3e68a46b460406c29f3de4.jpg)\r\n\r\nСписок фотографий дня, рандомная подборка случайных фото и страница фотографий пользователя. Так как данный челлендж проходит всего где-то 3.5 года, и количество участников не то чтобы запредельное, я решил отказаться от infinite scroll с подгрузкой и просто фигачить все изображения пользователя на страницу сразу.\r\n\r\n![](https://i.vas3k.club/b83bd8bc861a2f70e3bef8fd2d26b1cc78301e882b3b784eeacf3418e003fbb7.jpg)\r\n\r\n\r\nРазвернув это на собственном поддомене, я решил написать о проекте на следующий день. Ну а следующим вечером я решил, что будет неплохо добавить на страницу пользователя немного статистики.\r\n\r\nТакже решил добавить немного сортировок, ведь все любят сортировки. Кстати, про один из способов сортировки я интересовался в [Vas3k.nsfw](https://vas3k.club/network/chat/nsfw/).  Все-таки, сортировка по противоречивости это прикольно.\r\n\r\n![](https://i.vas3k.club/ad4943723c16b37f46f90447660896dddd40e5e3486dc0f75c78b80d67e64b9c.jpg)\r\n\r\nТак что общий совет всем на будущее: хотите сделать что-то быстро и просто, берите то, что знаете, не будьте как я. Ну, а если совмещать изучение нового с каким-нибудь пет-проектом, то почему бы и нет.\r\n\r\n\r\n### Как запускались и искали первых пользователей\r\n\r\nТак как я по сути делал инструмент для уже существующей аудитории, то никаких особых усилий для поиска пользователей не требовалось. Просто зашел в чатик и скинул ссылку. От хитрого плана с публикацией фото рабочего стола отказался. Как-то неспортивно все-таки.\r\n\r\nВ целом приняли положительно, сразу нашли пару багов. Одна была связана с парсингом, точнее с тем, что я не учел граничный случай, когда где-то в середине челленджа бот глюкнул и запостил одну и ту же запись два раза. Я полагался на идентификатор сообщения и не прописал уникальное ограничение. Обязательно прописывайте все ограничения. В итоге одна из длинных серий считалась неверно.\r\n\r\n![](https://i.vas3k.club/7086ebce9b014991435bd435658148fcc2b7a7b0f92727b3e2ef38e0b71ea915.jpg)\r\n\r\nПопросили прокинуть seed на главной, чтобы делиться выпавшими подборками лучших фото. Поправил это тоже. Ну и вывел ссылочки на соцсети тем, кто их скинул, чтобы, если кто вдруг наткнется на интересную фотографию, мог перейти дальше и посмотреть другие работы.\r\n\r\n\r\n### Сколько потратили и заработали? Есть идеи как это можно монетизировать?\r\n\r\nВ виду того, что проект простенький, а у всех есть под рукой некоторое количество свободных ресурсов, можно считать, что трат пока никаких и особо новые не планируются. Монетизации определенно не будет. Так что это просто pet-проект для себя и небольшого фотосообщества.\r\n\r\n\r\n\r\n\r\n### Какие планы на будущее?\r\nДа, вроде никаких, вероятней всего оно вообще не потребует какой-то особой поддержки. Так может код причесать и выложить все это на GitHub вместе с данными, чтобы, если что, это мог поднять кто-то еще. Поскольку bus factor у проекта, не то чтобы радовал.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/600bf0b061e978e7e772a019712887cd2cf26780133dddb5c7cf60ffe398c7bf.jpg)\r\n\r\nНу и наверное доделаю еще одно представление фотографий. Вместо грида будет приятно потом посмотреть на календарик, где на каждый день будет по фотографии.\r\n\r\n\r\n\r\n\r\n### Итоги\r\n\r\nЯ продолжаю 365, делая фотографию каждый день, но теперь мне гораздо проще вспоминать, какая именно из моих фотографий так провалилась на последнем голосовании.\r\n\r\n\r\nНадеюсь, что мой рассказ мотивирует кого-нибудь тоже поучаствовать в челлендже, ну или хотя бы постараться больше замечать вокруг, а не идти по улице, уткнувшись в телефон.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/11e9bb6f850fa3347410ad4f499a0e40718175a4b45530ad9401b66648be7515.jpg)\r\n\r\nКстати, вам не обязательно иметь фотоаппарат. Многие из участвующих в челлендже делают отличные фотки на мобильные телефоны. Необязательно, как я, таскать с собой тяжеленную бандуру тупо по приколу.\r\n\r\n![](https://i.vas3k.club/10921bf91ae200743ae3d7bb9296d08d36cf540a36f712b8089ebe53dfcb89c4.jpg)\r\n\r\n\r\nНу и главное в фотографии давно уже стало не умение сделать выверенную картинку. Для этого есть японцы с пометками, откуда фотографировать, а также вычислительная и обычная фотография. В современных камерах даже [автоспуск завезли](https://www.youtube.com/watch?v=tTyVaiJLSsE). Да и [нейронки](https://bjoernkarmann.dk/project/paragraphica) не дремлют. Так что главное в фотографии, на мой взгляд, давно стало не результат, хотя приятный результат всегда хорошо. Главное это умение видеть, чувствовать, ну и наслаждаться процессом.\r\n\r\nДа и правила челленджа не заставляют в нем активно участвовать. Многие просто время от времени выкладывают фотографии, как очередная площадка для поделиться.\r\n\r\nТакже не могу не напомнить, что у нас в клубе есть [секретный чат с фотографиями](https://vas3k.club/post/15747/). \r\n\r\np.s. покидая уютненький клуб вы рискуете нарваться на другое окружение. С другими мемасами и точками зрения. Я вас предупреждал.\r\n\r\n![](https://i.vas3k.club/7544973e3c49db12c8f88c2d5e60315233db51bcd331b72306bf721dd0dca115.jpg)	https://f365.zyuhel.ru/	https://i.vas3k.club/db78fce167bec43634ac4d3ee437b2299830f358567d27f2703ef556705c5f4e.jpg	\N	t	t	81	2023-06-16 11:50:48.94955+00	\N	~	3b256275-bd5e-4980-9440-a5ba9f17acfc	\N	\N	{}	\N	\N
55682211-75b0-409c-87a0-f93d9756f53f	12	project	F365	С одной стороны, не хочется рассказывать о чем-то небольшом. С другой стороны, из маленьких кирпичиков строится большое здание, поэтому почему бы и нет? К черту скромность!\r\n\r\n\r\n![](https://i.vas3k.club/5532f95440515792c340c8c56db5fc684b65db0f56721cb40a5b1ff85358587a.jpg)\r\n\r\nСразу скажу, что проект не планирует никакой монетизации, а также что в посте будет много разных картинок. Но как рассказывать про фотографию без фотографий, а про проекты без мемов?\r\n\r\n\r\n### Расскажите о себе и сути проекта\r\n\r\n Про себя я писал в [#intro](https://vas3k.club/intro/tkf/). У меня есть несколько хобби, некоторые из которых вытекают друг из друга. Так, например, из увлечения LEGO выросло мое увлечение фотографией, и этот проект как раз посвящен именно этому увлечению. Увлечения нужны, чтобы не быть как котик на меме снизу. И без них очень легко в него попасть.\r\n\r\n![](https://i.vas3k.club/6ab54fa2cebe2342874e8bacf0d545539d2ba09d225322733d73e0c4bf5a807b.jpg)\r\n\r\nФотографирую я не так давно, сменил несколько камер, фотографировал вроде бы и часто, но не регулярно. В какой-то момент заметил, что стараюсь чаще оставлять камеру дома, а не тащить ее с собой. Так как я на какое-то время оказался далеко от громадной кучи любимых кубиков и от стационарного ПК, LEGO и игры в RTS временно стали задачей с меньшим приоритетом, а фотография - с большим. И я решил подумать на тему того, как же научиться фотографировать лучше.\r\n\r\nА как мы все знаем, лучший способ, чтобы научиться чему-либо, это практика.\r\n\r\n\r\n![](https://i.vas3k.club/98396649d42b00fd3dffdee068377999ae6e7571dc4c2346dbcbe57cfd0c9111.jpg)\r\n\r\nЕсть такой парень - Георгий Джеджея ([Сайт](https://jejeya.pictures/)), его еще @vas3k упоминал в [посте про вычислительную фотографию](https://vas3k.blog/blog/computational_photography) (если помните такой, конечно). Так вот, так как я решил подойти с точки зрения практики, я конечно же начал читать различные блоги (ахаха, все как всегда. Прокрастинация наше все. )\r\n\r\n![](https://i.vas3k.club/504ae1a489d8113f28389b7ce7004e670b9b1c198aac3f6e6cd70ddb09d0f1e0.jpg)\r\n\r\nНу так к чему это я? У Георгия есть Telegram канал, а у этого Telegram канала есть [чат](https://t.me/factory_chat), (Вастрик.фото и данный чат частично пересекаются, так что я думаю, о нем тоже кто-то из клуба знает). И вот в этом чате проходит челлендж, достаточно обычный, кстати — челлендж "365". Необходимо каждый день делать фотографию на протяжении года, обрабатывать ее в течение дня (вообще фотографию за сегодня можно выложить в течение сегодня и завтра) и выкладывать ее.\r\n\r\n![](https://i.vas3k.club/7836082aee16e631a563750c7b7f266c446c10654770d6ba83514d731d5ee1cf.jpg)\r\n*(я просто хотел выложить фотографию с акулой, сорри)*\r\n\r\nЯ пропускал эти челленджы, потому что:\r\nа) Да зачем оно мне нужно?\r\nб) Это же нужно самому как-то отслеживать и следить.\r\n\r\nА тут все было сделано достаточно удобно: был бот, который принимал фотографии в Telegram, и некоторый элемент геймификации, когда участники чата голосовали за лучшие работы, и в итоге каждый день подводились результаты голосования с виртуальными медальками.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/3711da994c773bdd20643a9b382e70f1edbd6735b0ed5a18bb39532f2a5fe9b2.jpg)\r\n\r\nЯ участвую в данном челлендже уже более 200 дней, и он во многом мне помог. Я не сказал бы, чтобы я стал снимать лучше. Бывает, я открываю свои достаточно старые фотографии и понимаю, что мой уровень не то что вырос, но я стал лучше понимать, когда фотография определенно не получится. Также я стал лучше разбираться в своей камере и подтянул навык быстрой обработки фотографий.\r\n\r\nНо и это не главное. Главное, наверное, то, что необходимость делать что-то заставляла меня подниматься и делать что-то, даже тогда, когда очень не хотелось. И за счет этого улучшая мою жизнь. Я вставал на рассвете, чтобы фотографировать рассветное солнце.\r\n\r\n\r\n![](https://i.vas3k.club/80d9894285db17671a7323dd6a3257a119f63c8f5b374123791844d5ad244f1c.jpg)\r\n\r\n И искал что-то интересное в обыденном.\r\n\r\n![](https://i.vas3k.club/f4b51fff4b874d5e8ab225434c673d9c409fe335fcc85c88e6f77970dce44190.jpg)\r\n\r\nНу и просто в целом тренировал дисциплину. Если бы я был большим экстравертом, наверное, познакомился бы таким образом с кучей людей. Но, так как я такой как я есть, я просто сделал кучу фотографий (ну ладно, я даже несколько раз подходил к незнакомым людям с просьбой их сфотографировать, прогресс собственно на лицо) , которые мне нравятся, а также подписывался на различные поездки, от которых возможно бы отказался в ином случае. Даже завел дрона, чтобы смотреть на вещи с другого угла :)\r\n\r\n![](https://i.vas3k.club/e3bbb91c4adc2b4b5187d0a33f9ebc2d7dc6cfe1ba713a8f81c889e29a816c92.jpg)\r\n\r\nНо искать свои фото в большой куче фотографий в канале было не очень удобно, а иногда хотелось понять, какая фотография набрала больше лайков, или просто посмотреть, с каких фото я начал челлендж, а какие идут сейчас, чтобы понять, что вот сейчас у тебя идет провал, и ты не можешь найти сюжеты, а раньше энтузиазм так и переполнял. Ну и просто пересмотреть кадры по принципу "кадр в день" — это очень интересно.\r\n\r\nЯ даже как-то [считал](https://t.me/factory_chat/1385166) небольшую статистику по результатам 2022 года в этом челлендже.\r\n\r\nИ меня не покидала идея, что было бы отлично иметь возможность легко посмотреть данные из канала. Поиск в Telegram по хештегу, конечно, работает, но в целом искать в ленте очень неудобно. Да и видеть какую-нибудь писькомерную статистику всегда приятно.\r\n\r\n\r\n![](https://i.vas3k.club/43ddeb3a94d0b8889f161da377b7191210e0a6e872d33003ebf4c40843030158.jpg)\r\n\r\nВ какой-то момент я решил, что хватит тянуть кота за яйца, и раз у меня не очень получается с фото выходить на первые места, можно сделать полезный для сообщества сервис, выложить фото с его интерфейсом и словить плюшки :)\r\n\r\n\r\n\r\n![](https://i.vas3k.club/f063638b70f757fe7f7e243d9d747e6346400c9e7cfb5e4dfa6ed969bc7ed692.jpg)\r\n\r\n\r\n\r\n### Что вошло в прототип, технологический стек и сколько времени на него было потрачено\r\n\r\n![](https://i.vas3k.club/44432d7c6b0e9fee76128e59052379425afb40ffe0cedfb4bf474d790e536dd2.jpg)\r\n\r\nЯ решил разбить проект на три части, чтобы максимально упростить дальнейшую поддержку или замену. Соответственно, получаем парсинг опубликованных ботом данных и их запись в базу. API для получения данных из этой базы и фронтенд, который будет показывать полученные данные. На все про все ушло несколько вечеров.\r\n\r\nСамой простой частью были парсинг и API. Так как фронт планировался на JavaScript, решил и бекэнд сделать на нем же. Взял Express.js, MySQL, набросал быстренько простенький API, развернул, проверил, что все нормально.\r\n\r\n\r\nЕдинственная проблема на бекэнде была с запросом, подсчитывающим самые длинные интервалы без проблем в публикациях. Наиболее адекватным и простым вариантом было использовать оконные функции, но в тот вечер, похоже, лыжи решили не ехать, и нужный вариант никак не хотел писаться. И тут меня осенило, мы же в будущем, где же вкалывающие роботы? Я открыл ChatGPT и попросил его написать запрос. Неожиданно запрос даже оказался почти верным. С помощью напильника (так как уточняющими вопросами заставить его исправить запрос не вышло), запрос был приведен в нужное состояние, и бекэнд стал полностью рабочим.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/407d6e557ee8461b17eb215fd1b555a94e4f8124ff4c31017863fa5e89fe2a77.jpg)\r\n\r\n\r\nНу что же, после этого настало время опуститься в авгиевы конюшни и собрать фронт на третьем Vue. Вообще на работе мне приходилось встречаться с вторым Vue (нет, встречался я со всем подряд, но с Vue было больше всего опыта), поэтому я подумал, что особых проблем с третьим Vue не будет. Сцуко, как же я ошибался. Ближайший час был занят различными попытками адаптировать свой опыт из Options API второго Vue на Composition API третьего. А также отойти от Vuex к Pinia. Казалось бы, что мешало поставить Vuex и Options API на третий Vue? Но ведь мы не ищем легких путей. Вообще ненавижу такие моменты, когда вместо того, чтобы решать проблему, приходится бороться с окружением.\r\n\r\nВ общем, после некоторого количества матюгов, я перешел к конкретной реализации самого интерфейса. Так как чукча ни разу не дизайнер, я взял готовый UI Kit. И после небольшой отладки был готов MVP на трех страницах.\r\n\r\n![](https://i.vas3k.club/d09383066ba8d3cf4917182ef3923d31e1a7b8500b3e68a46b460406c29f3de4.jpg)\r\n\r\nСписок фотографий дня, рандомная подборка случайных фото и страница фотографий пользователя. Так как данный челлендж проходит всего где-то 3.5 года, и количество участников не то чтобы запредельное, я решил отказаться от infinite scroll с подгрузкой и просто фигачить все изображения пользователя на страницу сразу.\r\n\r\n![](https://i.vas3k.club/b83bd8bc861a2f70e3bef8fd2d26b1cc78301e882b3b784eeacf3418e003fbb7.jpg)\r\n\r\n\r\nРазвернув это на собственном поддомене, я решил написать о проекте на следующий день. Ну а следующим вечером я решил, что будет неплохо добавить на страницу пользователя немного статистики.\r\n\r\nТакже решил добавить немного сортировок, ведь все любят сортировки. Кстати, про один из способов сортировки я интересовался в [Vas3k.nsfw](https://vas3k.club/network/chat/nsfw/).  Все-таки, сортировка по противоречивости это прикольно.\r\n\r\n![](https://i.vas3k.club/ad4943723c16b37f46f90447660896dddd40e5e3486dc0f75c78b80d67e64b9c.jpg)\r\n\r\nТак что общий совет всем на будущее: хотите сделать что-то быстро и просто, берите то, что знаете, не будьте как я. Ну, а если совмещать изучение нового с каким-нибудь пет-проектом, то почему бы и нет.\r\n\r\n\r\n### Как запускались и искали первых пользователей\r\n\r\nТак как я по сути делал инструмент для уже существующей аудитории, то никаких особых усилий для поиска пользователей не требовалось. Просто зашел в чатик и скинул ссылку. От хитрого плана с публикацией фото рабочего стола отказался. Как-то неспортивно все-таки.\r\n\r\nВ целом приняли положительно, сразу нашли пару багов. Одна была связана с парсингом, точнее с тем, что я не учел граничный случай, когда где-то в середине челленджа бот глюкнул и запостил одну и ту же запись два раза. Я полагался на идентификатор сообщения и не прописал уникальное ограничение. Обязательно прописывайте все ограничения. В итоге одна из длинных серий считалась неверно.\r\n\r\n![](https://i.vas3k.club/7086ebce9b014991435bd435658148fcc2b7a7b0f92727b3e2ef38e0b71ea915.jpg)\r\n\r\nПопросили прокинуть seed на главной, чтобы делиться выпавшими подборками лучших фото. Поправил это тоже. Ну и вывел ссылочки на соцсети тем, кто их скинул, чтобы, если кто вдруг наткнется на интересную фотографию, мог перейти дальше и посмотреть другие работы.\r\n\r\n\r\n### Сколько потратили и заработали? Есть идеи как это можно монетизировать?\r\n\r\nВ виду того, что проект простенький, а у всех есть под рукой некоторое количество свободных ресурсов, можно считать, что трат пока никаких и особо новые не планируются. Монетизации определенно не будет. Так что это просто pet-проект для себя и небольшого фотосообщества.\r\n\r\n\r\n\r\n\r\n### Какие планы на будущее?\r\nДа, вроде никаких, вероятней всего оно вообще не потребует какой-то особой поддержки. Так может код причесать и выложить все это на GitHub вместе с данными, чтобы, если что, это мог поднять кто-то еще. Поскольку bus factor у проекта, не то чтобы радовал.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/600bf0b061e978e7e772a019712887cd2cf26780133dddb5c7cf60ffe398c7bf.jpg)\r\n\r\nНу и наверное доделаю еще одно представление фотографий. Вместо грида будет приятно потом посмотреть на календарик, где на каждый день будет по фотографии.\r\n\r\n\r\n\r\n\r\n### Итоги\r\n\r\nЯ продолжаю 365, делая фотографию каждый день, но теперь мне гораздо проще вспоминать, какая именно из моих фотографий так провалилась на последнем голосовании.\r\n\r\n\r\nНадеюсь, что мой рассказ мотивирует кого-нибудь тоже поучаствовать в челлендже, ну или хотя бы постараться больше замечать вокруг, а не идти по улице, уткнувшись в телефон.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/11e9bb6f850fa3347410ad4f499a0e40718175a4b45530ad9401b66648be7515.jpg)\r\n\r\nКстати, вам не обязательно иметь фотоаппарат. Многие из участвующих в челлендже делают отличные фотки на мобильные телефоны. Необязательно, как я, таскать с собой тяжеленную бандуру тупо по приколу.\r\n\r\n![](https://i.vas3k.club/10921bf91ae200743ae3d7bb9296d08d36cf540a36f712b8089ebe53dfcb89c4.jpg)\r\n\r\n\r\nНу и главное в фотографии давно уже стало не умение сделать выверенную картинку. Для этого есть японцы с пометками, откуда фотографировать, а также вычислительная и обычная фотография. В современных камерах даже [автоспуск завезли](https://www.youtube.com/watch?v=tTyVaiJLSsE). Да и [нейронки](https://bjoernkarmann.dk/project/paragraphica) не дремлют. Так что главное в фотографии, на мой взгляд, давно стало не результат, хотя приятный результат всегда хорошо. Главное это умение видеть, чувствовать, ну и наслаждаться процессом.\r\n\r\nДа и правила челленджа не заставляют в нем активно участвовать. Многие просто время от времени выкладывают фотографии, как очередная площадка для поделиться.\r\n\r\nТакже не могу не напомнить, что у нас в клубе есть [секретный чат с фотографиями](https://vas3k.club/post/15747/). \r\n\r\np.s. покидая уютненький клуб вы рискуете нарваться на другое окружение. С другими мемасами и точками зрения. Я вас предупреждал.\r\n\r\n![](https://i.vas3k.club/7544973e3c49db12c8f88c2d5e60315233db51bcd331b72306bf721dd0dca115.jpg)	https://f365.zyuhel.ru/	https://i.vas3k.club/db78fce167bec43634ac4d3ee437b2299830f358567d27f2703ef556705c5f4e.jpg	\N	t	t	82	2023-06-16 11:51:21.335137+00	\N	~	3b256275-bd5e-4980-9440-a5ba9f17acfc	\N	\N	{}	\N	\N
55682211-75b0-409c-87a0-f93d9756f53f	12	project	F365	С одной стороны, не хочется рассказывать о чем-то небольшом. С другой стороны, из маленьких кирпичиков строится большое здание, поэтому почему бы и нет? К черту скромность!\r\n\r\n\r\n![](https://i.vas3k.club/5532f95440515792c340c8c56db5fc684b65db0f56721cb40a5b1ff85358587a.jpg)\r\n\r\nСразу скажу, что проект не планирует никакой монетизации, а также что в посте будет много разных картинок. Но как рассказывать про фотографию без фотографий, а про проекты без мемов?\r\n\r\n\r\n### Расскажите о себе и сути проекта\r\n\r\n Про себя я писал в [#intro](https://vas3k.club/intro/tkf/). У меня есть несколько хобби, некоторые из которых вытекают друг из друга. Так, например, из увлечения LEGO выросло мое увлечение фотографией, и этот проект как раз посвящен именно этому увлечению. Увлечения нужны, чтобы не быть как котик на меме снизу. И без них очень легко в него попасть.\r\n\r\n![](https://i.vas3k.club/6ab54fa2cebe2342874e8bacf0d545539d2ba09d225322733d73e0c4bf5a807b.jpg)\r\n\r\nФотографирую я не так давно, сменил несколько камер, фотографировал вроде бы и часто, но не регулярно. В какой-то момент заметил, что стараюсь чаще оставлять камеру дома, а не тащить ее с собой. Так как я на какое-то время оказался далеко от громадной кучи любимых кубиков и от стационарного ПК, LEGO и игры в RTS временно стали задачей с меньшим приоритетом, а фотография - с большим. И я решил подумать на тему того, как же научиться фотографировать лучше.\r\n\r\nА как мы все знаем, лучший способ, чтобы научиться чему-либо, это практика.\r\n\r\n\r\n![](https://i.vas3k.club/98396649d42b00fd3dffdee068377999ae6e7571dc4c2346dbcbe57cfd0c9111.jpg)\r\n\r\nЕсть такой парень - Георгий Джеджея ([Сайт](https://jejeya.pictures/)), его еще @vas3k упоминал в [посте про вычислительную фотографию](https://vas3k.blog/blog/computational_photography) (если помните такой, конечно). Так вот, так как я решил подойти с точки зрения практики, я конечно же начал читать различные блоги (ахаха, все как всегда. Прокрастинация наше все. )\r\n\r\n![](https://i.vas3k.club/504ae1a489d8113f28389b7ce7004e670b9b1c198aac3f6e6cd70ddb09d0f1e0.jpg)\r\n\r\nНу так к чему это я? У Георгия есть Telegram канал, а у этого Telegram канала есть [чат](https://t.me/factory_chat), (Вастрик.фото и данный чат частично пересекаются, так что я думаю, о нем тоже кто-то из клуба знает). И вот в этом чате проходит челлендж, достаточно обычный, кстати — челлендж "365". Необходимо каждый день делать фотографию на протяжении года, обрабатывать ее в течение дня (вообще фотографию за сегодня можно выложить в течение сегодня и завтра) и выкладывать ее.\r\n\r\n![](https://i.vas3k.club/7836082aee16e631a563750c7b7f266c446c10654770d6ba83514d731d5ee1cf.jpg)\r\n*(я просто хотел выложить фотографию с акулой, сорри)*\r\n\r\nЯ пропускал эти челленджы, потому что:\r\nа) Да зачем оно мне нужно?\r\nб) Это же нужно самому как-то отслеживать и следить.\r\n\r\nА тут все было сделано достаточно удобно: был бот, который принимал фотографии в Telegram, и некоторый элемент геймификации, когда участники чата голосовали за лучшие работы, и в итоге каждый день подводились результаты голосования с виртуальными медальками.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/3711da994c773bdd20643a9b382e70f1edbd6735b0ed5a18bb39532f2a5fe9b2.jpg)\r\n\r\nЯ участвую в данном челлендже уже более 200 дней, и он во многом мне помог. Я не сказал бы, чтобы я стал снимать лучше. Бывает, я открываю свои достаточно старые фотографии и понимаю, что мой уровень не то что вырос, но я стал лучше понимать, когда фотография определенно не получится. Также я стал лучше разбираться в своей камере и подтянул навык быстрой обработки фотографий.\r\n\r\nНо и это не главное. Главное, наверное, то, что необходимость делать что-то заставляла меня подниматься и делать что-то, даже тогда, когда очень не хотелось. И за счет этого улучшая мою жизнь. Я вставал на рассвете, чтобы фотографировать рассветное солнце.\r\n\r\n\r\n![](https://i.vas3k.club/80d9894285db17671a7323dd6a3257a119f63c8f5b374123791844d5ad244f1c.jpg)\r\n\r\n И искал что-то интересное в обыденном.\r\n\r\n![](https://i.vas3k.club/f4b51fff4b874d5e8ab225434c673d9c409fe335fcc85c88e6f77970dce44190.jpg)\r\n\r\nНу и просто в целом тренировал дисциплину. Если бы я был большим экстравертом, наверное, познакомился бы таким образом с кучей людей. Но, так как я такой как я есть, я просто сделал кучу фотографий (ну ладно, я даже несколько раз подходил к незнакомым людям с просьбой их сфотографировать, прогресс собственно на лицо) , которые мне нравятся, а также подписывался на различные поездки, от которых возможно бы отказался в ином случае. Даже завел дрона, чтобы смотреть на вещи с другого угла :)\r\n\r\n![](https://i.vas3k.club/e3bbb91c4adc2b4b5187d0a33f9ebc2d7dc6cfe1ba713a8f81c889e29a816c92.jpg)\r\n\r\nНо искать свои фото в большой куче фотографий в канале было не очень удобно, а иногда хотелось понять, какая фотография набрала больше лайков, или просто посмотреть, с каких фото я начал челлендж, а какие идут сейчас, чтобы понять, что вот сейчас у тебя идет провал, и ты не можешь найти сюжеты, а раньше энтузиазм так и переполнял. Ну и просто пересмотреть кадры по принципу "кадр в день" — это очень интересно.\r\n\r\nЯ даже как-то [считал](https://t.me/factory_chat/1385166) небольшую статистику по результатам 2022 года в этом челлендже.\r\n\r\nИ меня не покидала идея, что было бы отлично иметь возможность легко посмотреть данные из канала. Поиск в Telegram по хештегу, конечно, работает, но в целом искать в ленте очень неудобно. Да и видеть какую-нибудь писькомерную статистику всегда приятно.\r\n\r\n\r\n![](https://i.vas3k.club/43ddeb3a94d0b8889f161da377b7191210e0a6e872d33003ebf4c40843030158.jpg)\r\n\r\nВ какой-то момент я решил, что хватит тянуть кота за яйца, и раз у меня не очень получается с фото выходить на первые места, можно сделать полезный для сообщества сервис, выложить фото с его интерфейсом и словить плюшки :)\r\n\r\n\r\n\r\n![](https://i.vas3k.club/f063638b70f757fe7f7e243d9d747e6346400c9e7cfb5e4dfa6ed969bc7ed692.jpg)\r\n\r\n\r\n\r\n### Что вошло в прототип, технологический стек и сколько времени на него было потрачено\r\n\r\n![](https://i.vas3k.club/44432d7c6b0e9fee76128e59052379425afb40ffe0cedfb4bf474d790e536dd2.jpg)\r\n\r\nЯ решил разбить проект на три части, чтобы максимально упростить дальнейшую поддержку или замену. Соответственно, получаем парсинг опубликованных ботом данных и их запись в базу. API для получения данных из этой базы и фронтенд, который будет показывать полученные данные. На все про все ушло несколько вечеров.\r\n\r\nСамой простой частью были парсинг и API. Так как фронт планировался на JavaScript, решил и бекэнд сделать на нем же. Взял Express.js, MySQL, набросал быстренько простенький API, развернул, проверил, что все нормально.\r\n\r\n\r\nЕдинственная проблема на бекэнде была с запросом, подсчитывающим самые длинные интервалы без проблем в публикациях. Наиболее адекватным и простым вариантом было использовать оконные функции, но в тот вечер, похоже, лыжи решили не ехать, и нужный вариант никак не хотел писаться. И тут меня осенило, мы же в будущем, где же вкалывающие роботы? Я открыл ChatGPT и попросил его написать запрос. Неожиданно запрос даже оказался почти верным. С помощью напильника (так как уточняющими вопросами заставить его исправить запрос не вышло), запрос был приведен в нужное состояние, и бекэнд стал полностью рабочим.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/407d6e557ee8461b17eb215fd1b555a94e4f8124ff4c31017863fa5e89fe2a77.jpg)\r\n\r\n\r\nНу что же, после этого настало время опуститься в авгиевы конюшни и собрать фронт на третьем Vue. Вообще на работе мне приходилось встречаться с вторым Vue (нет, встречался я со всем подряд, но с Vue было больше всего опыта), поэтому я подумал, что особых проблем с третьим Vue не будет. Сцуко, как же я ошибался. Ближайший час был занят различными попытками адаптировать свой опыт из Options API второго Vue на Composition API третьего. А также отойти от Vuex к Pinia. Казалось бы, что мешало поставить Vuex и Options API на третий Vue? Но ведь мы не ищем легких путей. Вообще ненавижу такие моменты, когда вместо того, чтобы решать проблему, приходится бороться с окружением.\r\n\r\nВ общем, после некоторого количества матюгов, я перешел к конкретной реализации самого интерфейса. Так как чукча ни разу не дизайнер, я взял готовый UI Kit. И после небольшой отладки был готов MVP на трех страницах.\r\n\r\n![](https://i.vas3k.club/d09383066ba8d3cf4917182ef3923d31e1a7b8500b3e68a46b460406c29f3de4.jpg)\r\n\r\nСписок фотографий дня, рандомная подборка случайных фото и страница фотографий пользователя. Так как данный челлендж проходит всего где-то 3.5 года, и количество участников не то чтобы запредельное, я решил отказаться от infinite scroll с подгрузкой и просто фигачить все изображения пользователя на страницу сразу.\r\n\r\n![](https://i.vas3k.club/b83bd8bc861a2f70e3bef8fd2d26b1cc78301e882b3b784eeacf3418e003fbb7.jpg)\r\n\r\n\r\nРазвернув это на собственном поддомене, я решил написать о проекте на следующий день. Ну а следующим вечером я решил, что будет неплохо добавить на страницу пользователя немного статистики.\r\n\r\nТакже решил добавить немного сортировок, ведь все любят сортировки. Кстати, про один из способов сортировки я интересовался в [Vas3k.nsfw](https://vas3k.club/network/chat/nsfw/).  Все-таки, сортировка по противоречивости это прикольно.\r\n\r\n![](https://i.vas3k.club/ad4943723c16b37f46f90447660896dddd40e5e3486dc0f75c78b80d67e64b9c.jpg)\r\n\r\nТак что общий совет всем на будущее: хотите сделать что-то быстро и просто, берите то, что знаете, не будьте как я. Ну, а если совмещать изучение нового с каким-нибудь пет-проектом, то почему бы и нет.\r\n\r\n\r\n### Как запускались и искали первых пользователей\r\n\r\nТак как я по сути делал инструмент для уже существующей аудитории, то никаких особых усилий для поиска пользователей не требовалось. Просто зашел в чатик и скинул ссылку. От хитрого плана с публикацией фото рабочего стола отказался. Как-то неспортивно все-таки.\r\n\r\nВ целом приняли положительно, сразу нашли пару багов. Одна была связана с парсингом, точнее с тем, что я не учел граничный случай, когда где-то в середине челленджа бот глюкнул и запостил одну и ту же запись два раза. Я полагался на идентификатор сообщения и не прописал уникальное ограничение. Обязательно прописывайте все ограничения. В итоге одна из длинных серий считалась неверно.\r\n\r\n![](https://i.vas3k.club/7086ebce9b014991435bd435658148fcc2b7a7b0f92727b3e2ef38e0b71ea915.jpg)\r\n\r\nПопросили прокинуть seed на главной, чтобы делиться выпавшими подборками лучших фото. Поправил это тоже. Ну и вывел ссылочки на соцсети тем, кто их скинул, чтобы, если кто вдруг наткнется на интересную фотографию, мог перейти дальше и посмотреть другие работы.\r\n\r\n\r\n### Сколько потратили и заработали? Есть идеи как это можно монетизировать?\r\n\r\nВ виду того, что проект простенький, а у всех есть под рукой некоторое количество свободных ресурсов, можно считать, что трат пока никаких и особо новые не планируются. Монетизации определенно не будет. Так что это просто pet-проект для себя и небольшого фотосообщества.\r\n\r\n\r\n\r\n\r\n### Какие планы на будущее?\r\nДа, вроде никаких, вероятней всего оно вообще не потребует какой-то особой поддержки. Так может код причесать и выложить все это на GitHub вместе с данными, чтобы, если что, это мог поднять кто-то еще. Поскольку bus factor у проекта, не то чтобы радовал.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/600bf0b061e978e7e772a019712887cd2cf26780133dddb5c7cf60ffe398c7bf.jpg)\r\n\r\nНу и наверное доделаю еще одно представление фотографий. Вместо грида будет приятно потом посмотреть на календарик, где на каждый день будет по фотографии.\r\n\r\n\r\n\r\n\r\n### Итоги\r\n\r\nЯ продолжаю 365, делая фотографию каждый день, но теперь мне гораздо проще вспоминать, какая именно из моих фотографий так провалилась на последнем голосовании.\r\n\r\n\r\nНадеюсь, что мой рассказ мотивирует кого-нибудь тоже поучаствовать в челлендже, ну или хотя бы постараться больше замечать вокруг, а не идти по улице, уткнувшись в телефон.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/11e9bb6f850fa3347410ad4f499a0e40718175a4b45530ad9401b66648be7515.jpg)\r\n\r\nКстати, вам не обязательно иметь фотоаппарат. Многие из участвующих в челлендже делают отличные фотки на мобильные телефоны. Необязательно, как я, таскать с собой тяжеленную бандуру тупо по приколу.\r\n\r\n![](https://i.vas3k.club/10921bf91ae200743ae3d7bb9296d08d36cf540a36f712b8089ebe53dfcb89c4.jpg)\r\n\r\n\r\nНу и главное в фотографии давно уже стало не умение сделать выверенную картинку. Для этого есть японцы с пометками, откуда фотографировать, а также вычислительная и обычная фотография. В современных камерах даже [автоспуск завезли](https://www.youtube.com/watch?v=tTyVaiJLSsE). Да и [нейронки](https://bjoernkarmann.dk/project/paragraphica) не дремлют. Так что главное в фотографии, на мой взгляд, давно стало не результат, хотя приятный результат всегда хорошо. Главное это умение видеть, чувствовать, ну и наслаждаться процессом.\r\n\r\nДа и правила челленджа не заставляют в нем активно участвовать. Многие просто время от времени выкладывают фотографии, как очередная площадка для поделиться.\r\n\r\nТакже не могу не напомнить, что у нас в клубе есть [секретный чат с фотографиями](https://vas3k.club/post/15747/). \r\n\r\np.s. покидая уютненький клуб вы рискуете нарваться на другое окружение. С другими мемасами и точками зрения. Я вас предупреждал.\r\n\r\n![](https://i.vas3k.club/7544973e3c49db12c8f88c2d5e60315233db51bcd331b72306bf721dd0dca115.jpg)	https://f365.zyuhel.ru/	https://i.vas3k.club/db78fce167bec43634ac4d3ee437b2299830f358567d27f2703ef556705c5f4e.jpg	{"badges": {"bmw": {"count": 1, "title": "Беха", "description": "Выдать автору беху по программе помощи миллионерам"}}}	t	t	83	2023-06-16 11:52:02.857192+00	\N	~	3b256275-bd5e-4980-9440-a5ba9f17acfc	\N	\N	{}	\N	\N
55682211-75b0-409c-87a0-f93d9756f53f	12	project	F365	С одной стороны, не хочется рассказывать о чем-то небольшом. С другой стороны, из маленьких кирпичиков строится большое здание, поэтому почему бы и нет? К черту скромность!\r\n\r\n\r\n![](https://i.vas3k.club/5532f95440515792c340c8c56db5fc684b65db0f56721cb40a5b1ff85358587a.jpg)\r\n\r\nСразу скажу, что проект не планирует никакой монетизации, а также что в посте будет много разных картинок. Но как рассказывать про фотографию без фотографий, а про проекты без мемов?\r\n\r\n\r\n### Расскажите о себе и сути проекта\r\n\r\n Про себя я писал в [#intro](https://vas3k.club/intro/tkf/). У меня есть несколько хобби, некоторые из которых вытекают друг из друга. Так, например, из увлечения LEGO выросло мое увлечение фотографией, и этот проект как раз посвящен именно этому увлечению. Увлечения нужны, чтобы не быть как котик на меме снизу. И без них очень легко в него попасть.\r\n\r\n![](https://i.vas3k.club/6ab54fa2cebe2342874e8bacf0d545539d2ba09d225322733d73e0c4bf5a807b.jpg)\r\n\r\nФотографирую я не так давно, сменил несколько камер, фотографировал вроде бы и часто, но не регулярно. В какой-то момент заметил, что стараюсь чаще оставлять камеру дома, а не тащить ее с собой. Так как я на какое-то время оказался далеко от громадной кучи любимых кубиков и от стационарного ПК, LEGO и игры в RTS временно стали задачей с меньшим приоритетом, а фотография - с большим. И я решил подумать на тему того, как же научиться фотографировать лучше.\r\n\r\nА как мы все знаем, лучший способ, чтобы научиться чему-либо, это практика.\r\n\r\n\r\n![](https://i.vas3k.club/98396649d42b00fd3dffdee068377999ae6e7571dc4c2346dbcbe57cfd0c9111.jpg)\r\n\r\nЕсть такой парень - Георгий Джеджея ([Сайт](https://jejeya.pictures/)), его еще @vas3k упоминал в [посте про вычислительную фотографию](https://vas3k.blog/blog/computational_photography) (если помните такой, конечно). Так вот, так как я решил подойти с точки зрения практики, я конечно же начал читать различные блоги (ахаха, все как всегда. Прокрастинация наше все. )\r\n\r\n![](https://i.vas3k.club/504ae1a489d8113f28389b7ce7004e670b9b1c198aac3f6e6cd70ddb09d0f1e0.jpg)\r\n\r\nНу так к чему это я? У Георгия есть Telegram канал, а у этого Telegram канала есть [чат](https://t.me/factory_chat), (Вастрик.фото и данный чат частично пересекаются, так что я думаю, о нем тоже кто-то из клуба знает). И вот в этом чате проходит челлендж, достаточно обычный, кстати — челлендж "365". Необходимо каждый день делать фотографию на протяжении года, обрабатывать ее в течение дня (вообще фотографию за сегодня можно выложить в течение сегодня и завтра) и выкладывать ее.\r\n\r\n![](https://i.vas3k.club/7836082aee16e631a563750c7b7f266c446c10654770d6ba83514d731d5ee1cf.jpg)\r\n*(я просто хотел выложить фотографию с акулой, сорри)*\r\n\r\nЯ пропускал эти челленджы, потому что:\r\nа) Да зачем оно мне нужно?\r\nб) Это же нужно самому как-то отслеживать и следить.\r\n\r\nА тут все было сделано достаточно удобно: был бот, который принимал фотографии в Telegram, и некоторый элемент геймификации, когда участники чата голосовали за лучшие работы, и в итоге каждый день подводились результаты голосования с виртуальными медальками.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/3711da994c773bdd20643a9b382e70f1edbd6735b0ed5a18bb39532f2a5fe9b2.jpg)\r\n\r\nЯ участвую в данном челлендже уже более 200 дней, и он во многом мне помог. Я не сказал бы, чтобы я стал снимать лучше. Бывает, я открываю свои достаточно старые фотографии и понимаю, что мой уровень не то что вырос, но я стал лучше понимать, когда фотография определенно не получится. Также я стал лучше разбираться в своей камере и подтянул навык быстрой обработки фотографий.\r\n\r\nНо и это не главное. Главное, наверное, то, что необходимость делать что-то заставляла меня подниматься и делать что-то, даже тогда, когда очень не хотелось. И за счет этого улучшая мою жизнь. Я вставал на рассвете, чтобы фотографировать рассветное солнце.\r\n\r\n\r\n![](https://i.vas3k.club/80d9894285db17671a7323dd6a3257a119f63c8f5b374123791844d5ad244f1c.jpg)\r\n\r\n И искал что-то интересное в обыденном.\r\n\r\n![](https://i.vas3k.club/f4b51fff4b874d5e8ab225434c673d9c409fe335fcc85c88e6f77970dce44190.jpg)\r\n\r\nНу и просто в целом тренировал дисциплину. Если бы я был большим экстравертом, наверное, познакомился бы таким образом с кучей людей. Но, так как я такой как я есть, я просто сделал кучу фотографий (ну ладно, я даже несколько раз подходил к незнакомым людям с просьбой их сфотографировать, прогресс собственно на лицо) , которые мне нравятся, а также подписывался на различные поездки, от которых возможно бы отказался в ином случае. Даже завел дрона, чтобы смотреть на вещи с другого угла :)\r\n\r\n![](https://i.vas3k.club/e3bbb91c4adc2b4b5187d0a33f9ebc2d7dc6cfe1ba713a8f81c889e29a816c92.jpg)\r\n\r\nНо искать свои фото в большой куче фотографий в канале было не очень удобно, а иногда хотелось понять, какая фотография набрала больше лайков, или просто посмотреть, с каких фото я начал челлендж, а какие идут сейчас, чтобы понять, что вот сейчас у тебя идет провал, и ты не можешь найти сюжеты, а раньше энтузиазм так и переполнял. Ну и просто пересмотреть кадры по принципу "кадр в день" — это очень интересно.\r\n\r\nЯ даже как-то [считал](https://t.me/factory_chat/1385166) небольшую статистику по результатам 2022 года в этом челлендже.\r\n\r\nИ меня не покидала идея, что было бы отлично иметь возможность легко посмотреть данные из канала. Поиск в Telegram по хештегу, конечно, работает, но в целом искать в ленте очень неудобно. Да и видеть какую-нибудь писькомерную статистику всегда приятно.\r\n\r\n\r\n![](https://i.vas3k.club/43ddeb3a94d0b8889f161da377b7191210e0a6e872d33003ebf4c40843030158.jpg)\r\n\r\nВ какой-то момент я решил, что хватит тянуть кота за яйца, и раз у меня не очень получается с фото выходить на первые места, можно сделать полезный для сообщества сервис, выложить фото с его интерфейсом и словить плюшки :)\r\n\r\n\r\n\r\n![](https://i.vas3k.club/f063638b70f757fe7f7e243d9d747e6346400c9e7cfb5e4dfa6ed969bc7ed692.jpg)\r\n\r\n\r\n\r\n### Что вошло в прототип, технологический стек и сколько времени на него было потрачено\r\n\r\n![](https://i.vas3k.club/44432d7c6b0e9fee76128e59052379425afb40ffe0cedfb4bf474d790e536dd2.jpg)\r\n\r\nЯ решил разбить проект на три части, чтобы максимально упростить дальнейшую поддержку или замену. Соответственно, получаем парсинг опубликованных ботом данных и их запись в базу. API для получения данных из этой базы и фронтенд, который будет показывать полученные данные. На все про все ушло несколько вечеров.\r\n\r\nСамой простой частью были парсинг и API. Так как фронт планировался на JavaScript, решил и бекэнд сделать на нем же. Взял Express.js, MySQL, набросал быстренько простенький API, развернул, проверил, что все нормально.\r\n\r\n\r\nЕдинственная проблема на бекэнде была с запросом, подсчитывающим самые длинные интервалы без проблем в публикациях. Наиболее адекватным и простым вариантом было использовать оконные функции, но в тот вечер, похоже, лыжи решили не ехать, и нужный вариант никак не хотел писаться. И тут меня осенило, мы же в будущем, где же вкалывающие роботы? Я открыл ChatGPT и попросил его написать запрос. Неожиданно запрос даже оказался почти верным. С помощью напильника (так как уточняющими вопросами заставить его исправить запрос не вышло), запрос был приведен в нужное состояние, и бекэнд стал полностью рабочим.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/407d6e557ee8461b17eb215fd1b555a94e4f8124ff4c31017863fa5e89fe2a77.jpg)\r\n\r\n\r\nНу что же, после этого настало время опуститься в авгиевы конюшни и собрать фронт на третьем Vue. Вообще на работе мне приходилось встречаться с вторым Vue (нет, встречался я со всем подряд, но с Vue было больше всего опыта), поэтому я подумал, что особых проблем с третьим Vue не будет. Сцуко, как же я ошибался. Ближайший час был занят различными попытками адаптировать свой опыт из Options API второго Vue на Composition API третьего. А также отойти от Vuex к Pinia. Казалось бы, что мешало поставить Vuex и Options API на третий Vue? Но ведь мы не ищем легких путей. Вообще ненавижу такие моменты, когда вместо того, чтобы решать проблему, приходится бороться с окружением.\r\n\r\nВ общем, после некоторого количества матюгов, я перешел к конкретной реализации самого интерфейса. Так как чукча ни разу не дизайнер, я взял готовый UI Kit. И после небольшой отладки был готов MVP на трех страницах.\r\n\r\n![](https://i.vas3k.club/d09383066ba8d3cf4917182ef3923d31e1a7b8500b3e68a46b460406c29f3de4.jpg)\r\n\r\nСписок фотографий дня, рандомная подборка случайных фото и страница фотографий пользователя. Так как данный челлендж проходит всего где-то 3.5 года, и количество участников не то чтобы запредельное, я решил отказаться от infinite scroll с подгрузкой и просто фигачить все изображения пользователя на страницу сразу.\r\n\r\n![](https://i.vas3k.club/b83bd8bc861a2f70e3bef8fd2d26b1cc78301e882b3b784eeacf3418e003fbb7.jpg)\r\n\r\n\r\nРазвернув это на собственном поддомене, я решил написать о проекте на следующий день. Ну а следующим вечером я решил, что будет неплохо добавить на страницу пользователя немного статистики.\r\n\r\nТакже решил добавить немного сортировок, ведь все любят сортировки. Кстати, про один из способов сортировки я интересовался в [Vas3k.nsfw](https://vas3k.club/network/chat/nsfw/).  Все-таки, сортировка по противоречивости это прикольно.\r\n\r\n![](https://i.vas3k.club/ad4943723c16b37f46f90447660896dddd40e5e3486dc0f75c78b80d67e64b9c.jpg)\r\n\r\nТак что общий совет всем на будущее: хотите сделать что-то быстро и просто, берите то, что знаете, не будьте как я. Ну, а если совмещать изучение нового с каким-нибудь пет-проектом, то почему бы и нет.\r\n\r\n\r\n### Как запускались и искали первых пользователей\r\n\r\nТак как я по сути делал инструмент для уже существующей аудитории, то никаких особых усилий для поиска пользователей не требовалось. Просто зашел в чатик и скинул ссылку. От хитрого плана с публикацией фото рабочего стола отказался. Как-то неспортивно все-таки.\r\n\r\nВ целом приняли положительно, сразу нашли пару багов. Одна была связана с парсингом, точнее с тем, что я не учел граничный случай, когда где-то в середине челленджа бот глюкнул и запостил одну и ту же запись два раза. Я полагался на идентификатор сообщения и не прописал уникальное ограничение. Обязательно прописывайте все ограничения. В итоге одна из длинных серий считалась неверно.\r\n\r\n![](https://i.vas3k.club/7086ebce9b014991435bd435658148fcc2b7a7b0f92727b3e2ef38e0b71ea915.jpg)\r\n\r\nПопросили прокинуть seed на главной, чтобы делиться выпавшими подборками лучших фото. Поправил это тоже. Ну и вывел ссылочки на соцсети тем, кто их скинул, чтобы, если кто вдруг наткнется на интересную фотографию, мог перейти дальше и посмотреть другие работы.\r\n\r\n\r\n### Сколько потратили и заработали? Есть идеи как это можно монетизировать?\r\n\r\nВ виду того, что проект простенький, а у всех есть под рукой некоторое количество свободных ресурсов, можно считать, что трат пока никаких и особо новые не планируются. Монетизации определенно не будет. Так что это просто pet-проект для себя и небольшого фотосообщества.\r\n\r\n\r\n\r\n\r\n### Какие планы на будущее?\r\nДа, вроде никаких, вероятней всего оно вообще не потребует какой-то особой поддержки. Так может код причесать и выложить все это на GitHub вместе с данными, чтобы, если что, это мог поднять кто-то еще. Поскольку bus factor у проекта, не то чтобы радовал.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/600bf0b061e978e7e772a019712887cd2cf26780133dddb5c7cf60ffe398c7bf.jpg)\r\n\r\nНу и наверное доделаю еще одно представление фотографий. Вместо грида будет приятно потом посмотреть на календарик, где на каждый день будет по фотографии.\r\n\r\n\r\n\r\n\r\n### Итоги\r\n\r\nЯ продолжаю 365, делая фотографию каждый день, но теперь мне гораздо проще вспоминать, какая именно из моих фотографий так провалилась на последнем голосовании.\r\n\r\n\r\nНадеюсь, что мой рассказ мотивирует кого-нибудь тоже поучаствовать в челлендже, ну или хотя бы постараться больше замечать вокруг, а не идти по улице, уткнувшись в телефон.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/11e9bb6f850fa3347410ad4f499a0e40718175a4b45530ad9401b66648be7515.jpg)\r\n\r\nКстати, вам не обязательно иметь фотоаппарат. Многие из участвующих в челлендже делают отличные фотки на мобильные телефоны. Необязательно, как я, таскать с собой тяжеленную бандуру тупо по приколу.\r\n\r\n![](https://i.vas3k.club/10921bf91ae200743ae3d7bb9296d08d36cf540a36f712b8089ebe53dfcb89c4.jpg)\r\n\r\n\r\nНу и главное в фотографии давно уже стало не умение сделать выверенную картинку. Для этого есть японцы с пометками, откуда фотографировать, а также вычислительная и обычная фотография. В современных камерах даже [автоспуск завезли](https://www.youtube.com/watch?v=tTyVaiJLSsE). Да и [нейронки](https://bjoernkarmann.dk/project/paragraphica) не дремлют. Так что главное в фотографии, на мой взгляд, давно стало не результат, хотя приятный результат всегда хорошо. Главное это умение видеть, чувствовать, ну и наслаждаться процессом.\r\n\r\nДа и правила челленджа не заставляют в нем активно участвовать. Многие просто время от времени выкладывают фотографии, как очередная площадка для поделиться.\r\n\r\nТакже не могу не напомнить, что у нас в клубе есть [секретный чат с фотографиями](https://vas3k.club/post/15747/). \r\n\r\np.s. покидая уютненький клуб вы рискуете нарваться на другое окружение. С другими мемасами и точками зрения. Я вас предупреждал.\r\n\r\n![](https://i.vas3k.club/7544973e3c49db12c8f88c2d5e60315233db51bcd331b72306bf721dd0dca115.jpg)	https://f365.zyuhel.ru/	https://i.vas3k.club/db78fce167bec43634ac4d3ee437b2299830f358567d27f2703ef556705c5f4e.jpg	{"badges": {"bmw": {"count": 1, "title": "Беха", "description": "Выдать автору беху по программе помощи миллионерам"}}}	t	t	84	2023-06-16 11:52:09.927848+00	\N	~	3b256275-bd5e-4980-9440-a5ba9f17acfc	\N	\N	{}	\N	\N
55682211-75b0-409c-87a0-f93d9756f53f	12	project	F365	С одной стороны, не хочется рассказывать о чем-то небольшом. С другой стороны, из маленьких кирпичиков строится большое здание, поэтому почему бы и нет? К черту скромность!\r\n\r\n\r\n![](https://i.vas3k.club/5532f95440515792c340c8c56db5fc684b65db0f56721cb40a5b1ff85358587a.jpg)\r\n\r\nСразу скажу, что проект не планирует никакой монетизации, а также что в посте будет много разных картинок. Но как рассказывать про фотографию без фотографий, а про проекты без мемов?\r\n\r\n\r\n### Расскажите о себе и сути проекта\r\n\r\n Про себя я писал в [#intro](https://vas3k.club/intro/tkf/). У меня есть несколько хобби, некоторые из которых вытекают друг из друга. Так, например, из увлечения LEGO выросло мое увлечение фотографией, и этот проект как раз посвящен именно этому увлечению. Увлечения нужны, чтобы не быть как котик на меме снизу. И без них очень легко в него попасть.\r\n\r\n![](https://i.vas3k.club/6ab54fa2cebe2342874e8bacf0d545539d2ba09d225322733d73e0c4bf5a807b.jpg)\r\n\r\nФотографирую я не так давно, сменил несколько камер, фотографировал вроде бы и часто, но не регулярно. В какой-то момент заметил, что стараюсь чаще оставлять камеру дома, а не тащить ее с собой. Так как я на какое-то время оказался далеко от громадной кучи любимых кубиков и от стационарного ПК, LEGO и игры в RTS временно стали задачей с меньшим приоритетом, а фотография - с большим. И я решил подумать на тему того, как же научиться фотографировать лучше.\r\n\r\nА как мы все знаем, лучший способ, чтобы научиться чему-либо, это практика.\r\n\r\n\r\n![](https://i.vas3k.club/98396649d42b00fd3dffdee068377999ae6e7571dc4c2346dbcbe57cfd0c9111.jpg)\r\n\r\nЕсть такой парень - Георгий Джеджея ([Сайт](https://jejeya.pictures/)), его еще @vas3k упоминал в [посте про вычислительную фотографию](https://vas3k.blog/blog/computational_photography) (если помните такой, конечно). Так вот, так как я решил подойти с точки зрения практики, я конечно же начал читать различные блоги (ахаха, все как всегда. Прокрастинация наше все. )\r\n\r\n![](https://i.vas3k.club/504ae1a489d8113f28389b7ce7004e670b9b1c198aac3f6e6cd70ddb09d0f1e0.jpg)\r\n\r\nНу так к чему это я? У Георгия есть Telegram канал, а у этого Telegram канала есть [чат](https://t.me/factory_chat), (Вастрик.фото и данный чат частично пересекаются, так что я думаю, о нем тоже кто-то из клуба знает). И вот в этом чате проходит челлендж, достаточно обычный, кстати — челлендж "365". Необходимо каждый день делать фотографию на протяжении года, обрабатывать ее в течение дня (вообще фотографию за сегодня можно выложить в течение сегодня и завтра) и выкладывать ее.\r\n\r\n![](https://i.vas3k.club/7836082aee16e631a563750c7b7f266c446c10654770d6ba83514d731d5ee1cf.jpg)\r\n*(я просто хотел выложить фотографию с акулой, сорри)*\r\n\r\nЯ пропускал эти челленджы, потому что:\r\nа) Да зачем оно мне нужно?\r\nб) Это же нужно самому как-то отслеживать и следить.\r\n\r\nА тут все было сделано достаточно удобно: был бот, который принимал фотографии в Telegram, и некоторый элемент геймификации, когда участники чата голосовали за лучшие работы, и в итоге каждый день подводились результаты голосования с виртуальными медальками.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/3711da994c773bdd20643a9b382e70f1edbd6735b0ed5a18bb39532f2a5fe9b2.jpg)\r\n\r\nЯ участвую в данном челлендже уже более 200 дней, и он во многом мне помог. Я не сказал бы, чтобы я стал снимать лучше. Бывает, я открываю свои достаточно старые фотографии и понимаю, что мой уровень не то что вырос, но я стал лучше понимать, когда фотография определенно не получится. Также я стал лучше разбираться в своей камере и подтянул навык быстрой обработки фотографий.\r\n\r\nНо и это не главное. Главное, наверное, то, что необходимость делать что-то заставляла меня подниматься и делать что-то, даже тогда, когда очень не хотелось. И за счет этого улучшая мою жизнь. Я вставал на рассвете, чтобы фотографировать рассветное солнце.\r\n\r\n\r\n![](https://i.vas3k.club/80d9894285db17671a7323dd6a3257a119f63c8f5b374123791844d5ad244f1c.jpg)\r\n\r\n И искал что-то интересное в обыденном.\r\n\r\n![](https://i.vas3k.club/f4b51fff4b874d5e8ab225434c673d9c409fe335fcc85c88e6f77970dce44190.jpg)\r\n\r\nНу и просто в целом тренировал дисциплину. Если бы я был большим экстравертом, наверное, познакомился бы таким образом с кучей людей. Но, так как я такой как я есть, я просто сделал кучу фотографий (ну ладно, я даже несколько раз подходил к незнакомым людям с просьбой их сфотографировать, прогресс собственно на лицо) , которые мне нравятся, а также подписывался на различные поездки, от которых возможно бы отказался в ином случае. Даже завел дрона, чтобы смотреть на вещи с другого угла :)\r\n\r\n![](https://i.vas3k.club/e3bbb91c4adc2b4b5187d0a33f9ebc2d7dc6cfe1ba713a8f81c889e29a816c92.jpg)\r\n\r\nНо искать свои фото в большой куче фотографий в канале было не очень удобно, а иногда хотелось понять, какая фотография набрала больше лайков, или просто посмотреть, с каких фото я начал челлендж, а какие идут сейчас, чтобы понять, что вот сейчас у тебя идет провал, и ты не можешь найти сюжеты, а раньше энтузиазм так и переполнял. Ну и просто пересмотреть кадры по принципу "кадр в день" — это очень интересно.\r\n\r\nЯ даже как-то [считал](https://t.me/factory_chat/1385166) небольшую статистику по результатам 2022 года в этом челлендже.\r\n\r\nИ меня не покидала идея, что было бы отлично иметь возможность легко посмотреть данные из канала. Поиск в Telegram по хештегу, конечно, работает, но в целом искать в ленте очень неудобно. Да и видеть какую-нибудь писькомерную статистику всегда приятно.\r\n\r\n\r\n![](https://i.vas3k.club/43ddeb3a94d0b8889f161da377b7191210e0a6e872d33003ebf4c40843030158.jpg)\r\n\r\nВ какой-то момент я решил, что хватит тянуть кота за яйца, и раз у меня не очень получается с фото выходить на первые места, можно сделать полезный для сообщества сервис, выложить фото с его интерфейсом и словить плюшки :)\r\n\r\n\r\n\r\n![](https://i.vas3k.club/f063638b70f757fe7f7e243d9d747e6346400c9e7cfb5e4dfa6ed969bc7ed692.jpg)\r\n\r\n\r\n\r\n### Что вошло в прототип, технологический стек и сколько времени на него было потрачено\r\n\r\n![](https://i.vas3k.club/44432d7c6b0e9fee76128e59052379425afb40ffe0cedfb4bf474d790e536dd2.jpg)\r\n\r\nЯ решил разбить проект на три части, чтобы максимально упростить дальнейшую поддержку или замену. Соответственно, получаем парсинг опубликованных ботом данных и их запись в базу. API для получения данных из этой базы и фронтенд, который будет показывать полученные данные. На все про все ушло несколько вечеров.\r\n\r\nСамой простой частью были парсинг и API. Так как фронт планировался на JavaScript, решил и бекэнд сделать на нем же. Взял Express.js, MySQL, набросал быстренько простенький API, развернул, проверил, что все нормально.\r\n\r\n\r\nЕдинственная проблема на бекэнде была с запросом, подсчитывающим самые длинные интервалы без проблем в публикациях. Наиболее адекватным и простым вариантом было использовать оконные функции, но в тот вечер, похоже, лыжи решили не ехать, и нужный вариант никак не хотел писаться. И тут меня осенило, мы же в будущем, где же вкалывающие роботы? Я открыл ChatGPT и попросил его написать запрос. Неожиданно запрос даже оказался почти верным. С помощью напильника (так как уточняющими вопросами заставить его исправить запрос не вышло), запрос был приведен в нужное состояние, и бекэнд стал полностью рабочим.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/407d6e557ee8461b17eb215fd1b555a94e4f8124ff4c31017863fa5e89fe2a77.jpg)\r\n\r\n\r\nНу что же, после этого настало время опуститься в авгиевы конюшни и собрать фронт на третьем Vue. Вообще на работе мне приходилось встречаться с вторым Vue (нет, встречался я со всем подряд, но с Vue было больше всего опыта), поэтому я подумал, что особых проблем с третьим Vue не будет. Сцуко, как же я ошибался. Ближайший час был занят различными попытками адаптировать свой опыт из Options API второго Vue на Composition API третьего. А также отойти от Vuex к Pinia. Казалось бы, что мешало поставить Vuex и Options API на третий Vue? Но ведь мы не ищем легких путей. Вообще ненавижу такие моменты, когда вместо того, чтобы решать проблему, приходится бороться с окружением.\r\n\r\nВ общем, после некоторого количества матюгов, я перешел к конкретной реализации самого интерфейса. Так как чукча ни разу не дизайнер, я взял готовый UI Kit. И после небольшой отладки был готов MVP на трех страницах.\r\n\r\n![](https://i.vas3k.club/d09383066ba8d3cf4917182ef3923d31e1a7b8500b3e68a46b460406c29f3de4.jpg)\r\n\r\nСписок фотографий дня, рандомная подборка случайных фото и страница фотографий пользователя. Так как данный челлендж проходит всего где-то 3.5 года, и количество участников не то чтобы запредельное, я решил отказаться от infinite scroll с подгрузкой и просто фигачить все изображения пользователя на страницу сразу.\r\n\r\n![](https://i.vas3k.club/b83bd8bc861a2f70e3bef8fd2d26b1cc78301e882b3b784eeacf3418e003fbb7.jpg)\r\n\r\n\r\nРазвернув это на собственном поддомене, я решил написать о проекте на следующий день. Ну а следующим вечером я решил, что будет неплохо добавить на страницу пользователя немного статистики.\r\n\r\nТакже решил добавить немного сортировок, ведь все любят сортировки. Кстати, про один из способов сортировки я интересовался в [Vas3k.nsfw](https://vas3k.club/network/chat/nsfw/).  Все-таки, сортировка по противоречивости это прикольно.\r\n\r\n![](https://i.vas3k.club/ad4943723c16b37f46f90447660896dddd40e5e3486dc0f75c78b80d67e64b9c.jpg)\r\n\r\nТак что общий совет всем на будущее: хотите сделать что-то быстро и просто, берите то, что знаете, не будьте как я. Ну, а если совмещать изучение нового с каким-нибудь пет-проектом, то почему бы и нет.\r\n\r\n\r\n### Как запускались и искали первых пользователей\r\n\r\nТак как я по сути делал инструмент для уже существующей аудитории, то никаких особых усилий для поиска пользователей не требовалось. Просто зашел в чатик и скинул ссылку. От хитрого плана с публикацией фото рабочего стола отказался. Как-то неспортивно все-таки.\r\n\r\nВ целом приняли положительно, сразу нашли пару багов. Одна была связана с парсингом, точнее с тем, что я не учел граничный случай, когда где-то в середине челленджа бот глюкнул и запостил одну и ту же запись два раза. Я полагался на идентификатор сообщения и не прописал уникальное ограничение. Обязательно прописывайте все ограничения. В итоге одна из длинных серий считалась неверно.\r\n\r\n![](https://i.vas3k.club/7086ebce9b014991435bd435658148fcc2b7a7b0f92727b3e2ef38e0b71ea915.jpg)\r\n\r\nПопросили прокинуть seed на главной, чтобы делиться выпавшими подборками лучших фото. Поправил это тоже. Ну и вывел ссылочки на соцсети тем, кто их скинул, чтобы, если кто вдруг наткнется на интересную фотографию, мог перейти дальше и посмотреть другие работы.\r\n\r\n\r\n### Сколько потратили и заработали? Есть идеи как это можно монетизировать?\r\n\r\nВ виду того, что проект простенький, а у всех есть под рукой некоторое количество свободных ресурсов, можно считать, что трат пока никаких и особо новые не планируются. Монетизации определенно не будет. Так что это просто pet-проект для себя и небольшого фотосообщества.\r\n\r\n\r\n\r\n\r\n### Какие планы на будущее?\r\nДа, вроде никаких, вероятней всего оно вообще не потребует какой-то особой поддержки. Так может код причесать и выложить все это на GitHub вместе с данными, чтобы, если что, это мог поднять кто-то еще. Поскольку bus factor у проекта, не то чтобы радовал.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/600bf0b061e978e7e772a019712887cd2cf26780133dddb5c7cf60ffe398c7bf.jpg)\r\n\r\nНу и наверное доделаю еще одно представление фотографий. Вместо грида будет приятно потом посмотреть на календарик, где на каждый день будет по фотографии.\r\n\r\n\r\n\r\n\r\n### Итоги\r\n\r\nЯ продолжаю 365, делая фотографию каждый день, но теперь мне гораздо проще вспоминать, какая именно из моих фотографий так провалилась на последнем голосовании.\r\n\r\n\r\nНадеюсь, что мой рассказ мотивирует кого-нибудь тоже поучаствовать в челлендже, ну или хотя бы постараться больше замечать вокруг, а не идти по улице, уткнувшись в телефон.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/11e9bb6f850fa3347410ad4f499a0e40718175a4b45530ad9401b66648be7515.jpg)\r\n\r\nКстати, вам не обязательно иметь фотоаппарат. Многие из участвующих в челлендже делают отличные фотки на мобильные телефоны. Необязательно, как я, таскать с собой тяжеленную бандуру тупо по приколу.\r\n\r\n![](https://i.vas3k.club/10921bf91ae200743ae3d7bb9296d08d36cf540a36f712b8089ebe53dfcb89c4.jpg)\r\n\r\n\r\nНу и главное в фотографии давно уже стало не умение сделать выверенную картинку. Для этого есть японцы с пометками, откуда фотографировать, а также вычислительная и обычная фотография. В современных камерах даже [автоспуск завезли](https://www.youtube.com/watch?v=tTyVaiJLSsE). Да и [нейронки](https://bjoernkarmann.dk/project/paragraphica) не дремлют. Так что главное в фотографии, на мой взгляд, давно стало не результат, хотя приятный результат всегда хорошо. Главное это умение видеть, чувствовать, ну и наслаждаться процессом.\r\n\r\nДа и правила челленджа не заставляют в нем активно участвовать. Многие просто время от времени выкладывают фотографии, как очередная площадка для поделиться.\r\n\r\nТакже не могу не напомнить, что у нас в клубе есть [секретный чат с фотографиями](https://vas3k.club/post/15747/). \r\n\r\np.s. покидая уютненький клуб вы рискуете нарваться на другое окружение. С другими мемасами и точками зрения. Я вас предупреждал.\r\n\r\n![](https://i.vas3k.club/7544973e3c49db12c8f88c2d5e60315233db51bcd331b72306bf721dd0dca115.jpg)	https://f365.zyuhel.ru/	https://i.vas3k.club/db78fce167bec43634ac4d3ee437b2299830f358567d27f2703ef556705c5f4e.jpg	{"badges": {"bmw": {"count": 1, "title": "Беха", "description": "Выдать автору беху по программе помощи миллионерам"}}}	t	t	85	2023-06-16 11:52:14.921759+00	\N	~	3b256275-bd5e-4980-9440-a5ba9f17acfc	\N	\N	{}	\N	\N
55682211-75b0-409c-87a0-f93d9756f53f	12	project	F365	С одной стороны, не хочется рассказывать о чем-то небольшом. С другой стороны, из маленьких кирпичиков строится большое здание, поэтому почему бы и нет? К черту скромность!\r\n\r\n\r\n![](https://i.vas3k.club/5532f95440515792c340c8c56db5fc684b65db0f56721cb40a5b1ff85358587a.jpg)\r\n\r\nСразу скажу, что проект не планирует никакой монетизации, а также что в посте будет много разных картинок. Но как рассказывать про фотографию без фотографий, а про проекты без мемов?\r\n\r\n\r\n### Расскажите о себе и сути проекта\r\n\r\n Про себя я писал в [#intro](https://vas3k.club/intro/tkf/). У меня есть несколько хобби, некоторые из которых вытекают друг из друга. Так, например, из увлечения LEGO выросло мое увлечение фотографией, и этот проект как раз посвящен именно этому увлечению. Увлечения нужны, чтобы не быть как котик на меме снизу. И без них очень легко в него попасть.\r\n\r\n![](https://i.vas3k.club/6ab54fa2cebe2342874e8bacf0d545539d2ba09d225322733d73e0c4bf5a807b.jpg)\r\n\r\nФотографирую я не так давно, сменил несколько камер, фотографировал вроде бы и часто, но не регулярно. В какой-то момент заметил, что стараюсь чаще оставлять камеру дома, а не тащить ее с собой. Так как я на какое-то время оказался далеко от громадной кучи любимых кубиков и от стационарного ПК, LEGO и игры в RTS временно стали задачей с меньшим приоритетом, а фотография - с большим. И я решил подумать на тему того, как же научиться фотографировать лучше.\r\n\r\nА как мы все знаем, лучший способ, чтобы научиться чему-либо, это практика.\r\n\r\n\r\n![](https://i.vas3k.club/98396649d42b00fd3dffdee068377999ae6e7571dc4c2346dbcbe57cfd0c9111.jpg)\r\n\r\nЕсть такой парень - Георгий Джеджея ([Сайт](https://jejeya.pictures/)), его еще @vas3k упоминал в [посте про вычислительную фотографию](https://vas3k.blog/blog/computational_photography) (если помните такой, конечно). Так вот, так как я решил подойти с точки зрения практики, я конечно же начал читать различные блоги (ахаха, все как всегда. Прокрастинация наше все. )\r\n\r\n![](https://i.vas3k.club/504ae1a489d8113f28389b7ce7004e670b9b1c198aac3f6e6cd70ddb09d0f1e0.jpg)\r\n\r\nНу так к чему это я? У Георгия есть Telegram канал, а у этого Telegram канала есть [чат](https://t.me/factory_chat), (Вастрик.фото и данный чат частично пересекаются, так что я думаю, о нем тоже кто-то из клуба знает). И вот в этом чате проходит челлендж, достаточно обычный, кстати — челлендж "365". Необходимо каждый день делать фотографию на протяжении года, обрабатывать ее в течение дня (вообще фотографию за сегодня можно выложить в течение сегодня и завтра) и выкладывать ее.\r\n\r\n![](https://i.vas3k.club/7836082aee16e631a563750c7b7f266c446c10654770d6ba83514d731d5ee1cf.jpg)\r\n*(я просто хотел выложить фотографию с акулой, сорри)*\r\n\r\nЯ пропускал эти челленджы, потому что:\r\nа) Да зачем оно мне нужно?\r\nб) Это же нужно самому как-то отслеживать и следить.\r\n\r\nА тут все было сделано достаточно удобно: был бот, который принимал фотографии в Telegram, и некоторый элемент геймификации, когда участники чата голосовали за лучшие работы, и в итоге каждый день подводились результаты голосования с виртуальными медальками.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/3711da994c773bdd20643a9b382e70f1edbd6735b0ed5a18bb39532f2a5fe9b2.jpg)\r\n\r\nЯ участвую в данном челлендже уже более 200 дней, и он во многом мне помог. Я не сказал бы, чтобы я стал снимать лучше. Бывает, я открываю свои достаточно старые фотографии и понимаю, что мой уровень не то что вырос, но я стал лучше понимать, когда фотография определенно не получится. Также я стал лучше разбираться в своей камере и подтянул навык быстрой обработки фотографий.\r\n\r\nНо и это не главное. Главное, наверное, то, что необходимость делать что-то заставляла меня подниматься и делать что-то, даже тогда, когда очень не хотелось. И за счет этого улучшая мою жизнь. Я вставал на рассвете, чтобы фотографировать рассветное солнце.\r\n\r\n\r\n![](https://i.vas3k.club/80d9894285db17671a7323dd6a3257a119f63c8f5b374123791844d5ad244f1c.jpg)\r\n\r\n И искал что-то интересное в обыденном.\r\n\r\n![](https://i.vas3k.club/f4b51fff4b874d5e8ab225434c673d9c409fe335fcc85c88e6f77970dce44190.jpg)\r\n\r\nНу и просто в целом тренировал дисциплину. Если бы я был большим экстравертом, наверное, познакомился бы таким образом с кучей людей. Но, так как я такой как я есть, я просто сделал кучу фотографий (ну ладно, я даже несколько раз подходил к незнакомым людям с просьбой их сфотографировать, прогресс собственно на лицо) , которые мне нравятся, а также подписывался на различные поездки, от которых возможно бы отказался в ином случае. Даже завел дрона, чтобы смотреть на вещи с другого угла :)\r\n\r\n![](https://i.vas3k.club/e3bbb91c4adc2b4b5187d0a33f9ebc2d7dc6cfe1ba713a8f81c889e29a816c92.jpg)\r\n\r\nНо искать свои фото в большой куче фотографий в канале было не очень удобно, а иногда хотелось понять, какая фотография набрала больше лайков, или просто посмотреть, с каких фото я начал челлендж, а какие идут сейчас, чтобы понять, что вот сейчас у тебя идет провал, и ты не можешь найти сюжеты, а раньше энтузиазм так и переполнял. Ну и просто пересмотреть кадры по принципу "кадр в день" — это очень интересно.\r\n\r\nЯ даже как-то [считал](https://t.me/factory_chat/1385166) небольшую статистику по результатам 2022 года в этом челлендже.\r\n\r\nИ меня не покидала идея, что было бы отлично иметь возможность легко посмотреть данные из канала. Поиск в Telegram по хештегу, конечно, работает, но в целом искать в ленте очень неудобно. Да и видеть какую-нибудь писькомерную статистику всегда приятно.\r\n\r\n\r\n![](https://i.vas3k.club/43ddeb3a94d0b8889f161da377b7191210e0a6e872d33003ebf4c40843030158.jpg)\r\n\r\nВ какой-то момент я решил, что хватит тянуть кота за яйца, и раз у меня не очень получается с фото выходить на первые места, можно сделать полезный для сообщества сервис, выложить фото с его интерфейсом и словить плюшки :)\r\n\r\n\r\n\r\n![](https://i.vas3k.club/f063638b70f757fe7f7e243d9d747e6346400c9e7cfb5e4dfa6ed969bc7ed692.jpg)\r\n\r\n\r\n\r\n### Что вошло в прототип, технологический стек и сколько времени на него было потрачено\r\n\r\n![](https://i.vas3k.club/44432d7c6b0e9fee76128e59052379425afb40ffe0cedfb4bf474d790e536dd2.jpg)\r\n\r\nЯ решил разбить проект на три части, чтобы максимально упростить дальнейшую поддержку или замену. Соответственно, получаем парсинг опубликованных ботом данных и их запись в базу. API для получения данных из этой базы и фронтенд, который будет показывать полученные данные. На все про все ушло несколько вечеров.\r\n\r\nСамой простой частью были парсинг и API. Так как фронт планировался на JavaScript, решил и бекэнд сделать на нем же. Взял Express.js, MySQL, набросал быстренько простенький API, развернул, проверил, что все нормально.\r\n\r\n\r\nЕдинственная проблема на бекэнде была с запросом, подсчитывающим самые длинные интервалы без проблем в публикациях. Наиболее адекватным и простым вариантом было использовать оконные функции, но в тот вечер, похоже, лыжи решили не ехать, и нужный вариант никак не хотел писаться. И тут меня осенило, мы же в будущем, где же вкалывающие роботы? Я открыл ChatGPT и попросил его написать запрос. Неожиданно запрос даже оказался почти верным. С помощью напильника (так как уточняющими вопросами заставить его исправить запрос не вышло), запрос был приведен в нужное состояние, и бекэнд стал полностью рабочим.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/407d6e557ee8461b17eb215fd1b555a94e4f8124ff4c31017863fa5e89fe2a77.jpg)\r\n\r\n\r\nНу что же, после этого настало время опуститься в авгиевы конюшни и собрать фронт на третьем Vue. Вообще на работе мне приходилось встречаться с вторым Vue (нет, встречался я со всем подряд, но с Vue было больше всего опыта), поэтому я подумал, что особых проблем с третьим Vue не будет. Сцуко, как же я ошибался. Ближайший час был занят различными попытками адаптировать свой опыт из Options API второго Vue на Composition API третьего. А также отойти от Vuex к Pinia. Казалось бы, что мешало поставить Vuex и Options API на третий Vue? Но ведь мы не ищем легких путей. Вообще ненавижу такие моменты, когда вместо того, чтобы решать проблему, приходится бороться с окружением.\r\n\r\nВ общем, после некоторого количества матюгов, я перешел к конкретной реализации самого интерфейса. Так как чукча ни разу не дизайнер, я взял готовый UI Kit. И после небольшой отладки был готов MVP на трех страницах.\r\n\r\n![](https://i.vas3k.club/d09383066ba8d3cf4917182ef3923d31e1a7b8500b3e68a46b460406c29f3de4.jpg)\r\n\r\nСписок фотографий дня, рандомная подборка случайных фото и страница фотографий пользователя. Так как данный челлендж проходит всего где-то 3.5 года, и количество участников не то чтобы запредельное, я решил отказаться от infinite scroll с подгрузкой и просто фигачить все изображения пользователя на страницу сразу.\r\n\r\n![](https://i.vas3k.club/b83bd8bc861a2f70e3bef8fd2d26b1cc78301e882b3b784eeacf3418e003fbb7.jpg)\r\n\r\n\r\nРазвернув это на собственном поддомене, я решил написать о проекте на следующий день. Ну а следующим вечером я решил, что будет неплохо добавить на страницу пользователя немного статистики.\r\n\r\nТакже решил добавить немного сортировок, ведь все любят сортировки. Кстати, про один из способов сортировки я интересовался в [Vas3k.nsfw](https://vas3k.club/network/chat/nsfw/).  Все-таки, сортировка по противоречивости это прикольно.\r\n\r\n![](https://i.vas3k.club/ad4943723c16b37f46f90447660896dddd40e5e3486dc0f75c78b80d67e64b9c.jpg)\r\n\r\nТак что общий совет всем на будущее: хотите сделать что-то быстро и просто, берите то, что знаете, не будьте как я. Ну, а если совмещать изучение нового с каким-нибудь пет-проектом, то почему бы и нет.\r\n\r\n\r\n### Как запускались и искали первых пользователей\r\n\r\nТак как я по сути делал инструмент для уже существующей аудитории, то никаких особых усилий для поиска пользователей не требовалось. Просто зашел в чатик и скинул ссылку. От хитрого плана с публикацией фото рабочего стола отказался. Как-то неспортивно все-таки.\r\n\r\nВ целом приняли положительно, сразу нашли пару багов. Одна была связана с парсингом, точнее с тем, что я не учел граничный случай, когда где-то в середине челленджа бот глюкнул и запостил одну и ту же запись два раза. Я полагался на идентификатор сообщения и не прописал уникальное ограничение. Обязательно прописывайте все ограничения. В итоге одна из длинных серий считалась неверно.\r\n\r\n![](https://i.vas3k.club/7086ebce9b014991435bd435658148fcc2b7a7b0f92727b3e2ef38e0b71ea915.jpg)\r\n\r\nПопросили прокинуть seed на главной, чтобы делиться выпавшими подборками лучших фото. Поправил это тоже. Ну и вывел ссылочки на соцсети тем, кто их скинул, чтобы, если кто вдруг наткнется на интересную фотографию, мог перейти дальше и посмотреть другие работы.\r\n\r\n\r\n### Сколько потратили и заработали? Есть идеи как это можно монетизировать?\r\n\r\nВ виду того, что проект простенький, а у всех есть под рукой некоторое количество свободных ресурсов, можно считать, что трат пока никаких и особо новые не планируются. Монетизации определенно не будет. Так что это просто pet-проект для себя и небольшого фотосообщества.\r\n\r\n\r\n\r\n\r\n### Какие планы на будущее?\r\nДа, вроде никаких, вероятней всего оно вообще не потребует какой-то особой поддержки. Так может код причесать и выложить все это на GitHub вместе с данными, чтобы, если что, это мог поднять кто-то еще. Поскольку bus factor у проекта, не то чтобы радовал.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/600bf0b061e978e7e772a019712887cd2cf26780133dddb5c7cf60ffe398c7bf.jpg)\r\n\r\nНу и наверное доделаю еще одно представление фотографий. Вместо грида будет приятно потом посмотреть на календарик, где на каждый день будет по фотографии.\r\n\r\n\r\n\r\n\r\n### Итоги\r\n\r\nЯ продолжаю 365, делая фотографию каждый день, но теперь мне гораздо проще вспоминать, какая именно из моих фотографий так провалилась на последнем голосовании.\r\n\r\n\r\nНадеюсь, что мой рассказ мотивирует кого-нибудь тоже поучаствовать в челлендже, ну или хотя бы постараться больше замечать вокруг, а не идти по улице, уткнувшись в телефон.\r\n\r\n\r\n\r\n![](https://i.vas3k.club/11e9bb6f850fa3347410ad4f499a0e40718175a4b45530ad9401b66648be7515.jpg)\r\n\r\nКстати, вам не обязательно иметь фотоаппарат. Многие из участвующих в челлендже делают отличные фотки на мобильные телефоны. Необязательно, как я, таскать с собой тяжеленную бандуру тупо по приколу.\r\n\r\n![](https://i.vas3k.club/10921bf91ae200743ae3d7bb9296d08d36cf540a36f712b8089ebe53dfcb89c4.jpg)\r\n\r\n\r\nНу и главное в фотографии давно уже стало не умение сделать выверенную картинку. Для этого есть японцы с пометками, откуда фотографировать, а также вычислительная и обычная фотография. В современных камерах даже [автоспуск завезли](https://www.youtube.com/watch?v=tTyVaiJLSsE). Да и [нейронки](https://bjoernkarmann.dk/project/paragraphica) не дремлют. Так что главное в фотографии, на мой взгляд, давно стало не результат, хотя приятный результат всегда хорошо. Главное это умение видеть, чувствовать, ну и наслаждаться процессом.\r\n\r\nДа и правила челленджа не заставляют в нем активно участвовать. Многие просто время от времени выкладывают фотографии, как очередная площадка для поделиться.\r\n\r\nТакже не могу не напомнить, что у нас в клубе есть [секретный чат с фотографиями](https://vas3k.club/post/15747/). \r\n\r\np.s. покидая уютненький клуб вы рискуете нарваться на другое окружение. С другими мемасами и точками зрения. Я вас предупреждал.\r\n\r\n![](https://i.vas3k.club/7544973e3c49db12c8f88c2d5e60315233db51bcd331b72306bf721dd0dca115.jpg)	https://f365.zyuhel.ru/	https://i.vas3k.club/db78fce167bec43634ac4d3ee437b2299830f358567d27f2703ef556705c5f4e.jpg	{"badges": {"bmw": {"count": 1, "title": "Беха", "description": "Выдать автору беху по программе помощи миллионерам"}}}	t	t	86	2023-06-16 11:52:42.66123+00	\N	~	3b256275-bd5e-4980-9440-a5ba9f17acfc	\N	\N	{}	\N	\N
eaa7b939-db37-4c54-b27d-fe6568ffe6d7	13	guide	Клубный Путеводитель: Гаага	Если вам поднадоел переполненный туристами Амстердам, добро пожаловать в Гаагу, трамвайный рай урбанистов, место рождения теннисного корта и просто чудесный город, где деревьев пока больше, чем мясных жителей!\r\n![](https://i.vas3k.club/2d0a05c0ed4ef4eeea86f330f538729d7f807dac9957c6cbbba01fe90c456053.jpg)\r\n# Карта города\r\n![](https://i.vas3k.club/8b6e15ed860fe0fa3ae5ce578fb54b073d6fb1505db81132d85aed0e31a1c0c0.jpg)\r\nКак вы уже заметили, в Гааге вас ждет 11 км песчаных пляжей, по которым можно бегать голеньким.\r\n# Основная информация\r\n- **Валюта**: Евро\r\n- **Население**: 515 тыс\r\n- **Визы**: Шенген / ВНЖ\r\n- **Когда лучше всего приезжать?** Только не зимой, ибо ветер. Летом, если в вашем списке активностей есть пляжный отдых, водный спорт или ночные поиски sea sparkle; Весна и осень комфортны для кофейных туров и музейной программы.\r\n- **Что обязательно взять с собой?** Летом spf, в остальное время года windproof дождевик и термокружку. И надо всегда быть луковкой, чтобы в случае изменения погодных условий скинуть пару слоев одежды или же укутать тушку от ветра и спокойно наслаждаться видами. \r\n- **Как лучше добраться из аэропорта?** Приобрести анонимную OV-chipkaart (уже не так нужна в 2023, за проезд можно платить обычной картой Visa/Mastercard) и запрыгнуть в поезд, направление Den Haag Centraal, детали можно посмотреть в приложении NS. Детально описывать не буду, скорее всего Гаага не будет вашим первым городом в Нидерландах, поэтому лучше начать с [гайда по Амстердаму](https://https://vas3k.club/guide/11740/).\r\n- **Как лучше перемещаться по городу?** Велосипед (будет спокойнее и живописнее, чем в Амстердаме, т.к. Гаага в топе зеленых городов в Нидерландах), трамвай к пляжу, автобусы.\r\n- **Есть ли доставка еды?** Uber Eats, Deliveroo, все стандартно, как и в других частях страны. Из сервисов доставки продуктов люблю Gorillas.\r\n- **Какую купить туристическую симку?** Любая европейская симка должна работать без роуминга. Если вы из других мест, то KPN, Lebara.\r\n- **Можно ли везде платить картой?** Да.\r\n- **Можно ли пить воду из крана?** Да.\r\n- **Главные супермаркеты для еды?** Albert Heijn, Jumbo, последний предпочтительнее, если у вас не Maestro.\r\n- **Говорят ли люди на улице по-английски?** Да.\r\n- **Что нужно 100% увидеть и попробовать?** Музей Эшера, пляж. \r\n- **Чего остерегаться?** Как и в любой точке Нидерландов, велосипедистов и переулков, из которых они внезапно вылетают на пешеходов.  \r\n- **Сколько в среднем стоит 1 шаурма?** 6-10 евро.\r\n# Основной маршрут туриста\r\n- Приехать на Den Haag Centraal и порадоваться тому, как оптимально голландцы перестроили здание вокзала.\r\n![](https://i.vas3k.club/7be43c2963999381d34c074e35f60f3a6a81135dfae0bc884ad4095c5b146c83.jpg)\r\n- Прогуляться по району de Resident (в котором все самое высокое), рассматривая спрятанные в кустах и между домами скульптуры (например, есть такой польский скульптор Игорь Миторай, несколько его работ можно найти в городе и в том числе в этом районе).\r\n![](https://i.vas3k.club/bd3c45f144a98c6fb97f0f35d8df478b9fb80b0fe9c051ad2a970297f8003151.jpg)\r\n- Сходить в музей Эшера и в крошечный Эрмитаж, от которого не устаешь - Mauritshuis (Маурицхёйс). Обычно я дозирую музеи, чтобы не смешивать впечатления, но в данном случае это хорошее комбо, особенно если вы на один день. \r\n- Пройти мимо Binnenhof через площадь Plein, там сидит премьер-министр и всякие важные люди в костюмах. Там красиво и пахнет историей.\r\n- Прогуляться по Hoogstraat и поглазеть на Noordeinde Palace, один из дворцов королевской семьи, в него даже можно попасть на экскурсию. Завернуть на пикник в королевский сад по другую сторону улицы.\r\n ![](https://i.vas3k.club/9d2eb41aab1cc6086778ee11e1065cb73891ed7114ed10525f90472134891198.jpg)\r\n- Дойти до Peace Palace, горько выдохнуть у вечного огня мира и сесть в трамвай по направлению к пляжу.\r\n![](https://i.vas3k.club/925b90fb396a4e6e12bc8e63d1a6a9de07c4e3a8f5afb133e59908811d532b2d.jpg)\r\n- Если вы с детьми, возможно вам лучше свернуть в парк миниатюр [Madurodam](https://www.madurodam.nl/ru). \r\n- А если вы любите современное искусство, вам в [Kunstmuseum](https://www.kunstmuseum.nl/nl), сейчас там Муха и Мондриан.\r\n- Выйти на остановке возле Kurhaus и погулять вокруг.\r\n![](https://i.vas3k.club/4a22f1274a6437b55ea3db08f200c7c1c3ada52814f83dbc377b108185c8b525.jpg)\r\n- Наткнуться на "fairy tale pictures to the sea" от Тома Оттернеса и сказать спасибо частным коллекционерам Гааги, делающим такие классные выставки под открытым небом.\r\n![](https://i.vas3k.club/703dccef8836211b5265151cf153497a80dc597b4b2e152f216de7fd5dc2ed83.jpg)\r\n\r\n# «Нетуристические» маршруты\r\n#### Night beach tour\r\nСпешите на поиски sea sparkle (это такая люминисцирующая одноклеточная водоросль), совсем скоро она повзрослеет и перестанет светиться. Лучше выбирать дни, когда нет ветра и тепло, выезжать на велосипедах к полуночи или даже позднее. \r\n![](https://i.vas3k.club/6203bc5338c4295334c12217ce021d80fcd4844e8e44104a5eb4a51193f23851.jpg)\r\n#### Серфинг\r\nВ Гааге довольно много серфинг школ, где выдают все необходимое для занятий. Разовое занятие стоит от 30 евро, есть форматы ретритов, где вы целыми днями серфите, йожите, кушаете и строите замки из песка или танцуете, например [здесь](https://tashasurfcamp.bookinglayer.com/en/product/surfcamp-scheveningen-1). От себя могу добавить, что даже часовое занятие серфингом незаметно откусывает почти весь день, поэтому если решите заниматься чем-то подобным, то лучше не планировать ничего важного в серф дни.\r\n#### [Найти "памятник" Сталину](https://www.wikiwand.com/ru/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD%D1%83_(%D0%93%D0%B0%D0%B0%D0%B3%D0%B0))\r\nИ узнать, кто был звездой гаагской улицы красных фонарей.\r\n![](https://i.vas3k.club/a5615b0454bf5f3426966596593c115dfcd109a69218dc6bdbced6b736992993.jpg)\r\n#### Bungy Jumping / Zip Line\r\nНа пирсе Scheveningen можно не только покататься на колесе обозрения, но и [попрыгать](https://www.bungy.nl/en/) и поделать [вжунь](https://www.pier.nl/company/zipline-de-pier/).\r\n#### [Louwman Museum](https://www.louwmanmuseum.nl/)\r\nПоглазеть и пощупать историю через коллекцию автомобилей, автобусов и мотоциклов.\r\n### Прогулки / велотур по лесам и дюнам\r\nДля меня Гаага это\r\n![](https://i.vas3k.club/0affe8ea3ec5d27c0edb4e55be7059761adc8b62a5ef9d5920670dccf0afd73e.jpg)\r\nНачнем с Scheveningse Bosjes. Здесь есть тропы для бега/прогулок, конного спорта и велосипедов и приятно, что у всех получается не мешать друг другу. При входе в лесопарк есть детская площадка, по всей территории время от времени попадаются лавочки и фонтанчики с водой. Однако я бы не советовала гулять здесь одиноким особам поздним вечером, даже если вы возвращаетесь с пляжа и это самый короткий путь. :)\r\n\r\nHaagse Bos - знаменитый лес в 5 минутах ходьбы от Central station. Начинается он с Koekamp, местечка, где живут олени, аисты, и куда приходят тусоваться нильские гуси. В 16 веке после процедента с вырубкой деревьев один дядя сказал, что не надо больше трогать лес, и с тех пор никто не трогал лес. Даже нацистские войска некогда пускали ракеты из этого леса, но не трогали сам лес.\r\n\r\nПарк Clingendael с японским садом, который всегда закрыт. Говорят,  там настолько красиво, что краснокнижные птицы вьют в нем гнезда, и сотрудникам приходится закрывать всю территорию от  посетителей, чтобы молодые родители могли вырастить как можно больше птенчиков.\r\n\r\n Zorgvliet - платный парк для одного человека, который сидит на лавочке у входа и спрашивает у вас билет :) Буду рада, если кто-то из гаагчан расскажет, в чем особенность этого места.\r\n \r\n Налево от Scheveningen\r\n Westduinpark - не только кататься на велосипеде, но серфить, купаться или просто ходить голеньким. Еще можно искать и находить шотландских коровок.\r\n  ![](https://i.vas3k.club/ea085ed8bec087f2a7721c2ae238ee224472506c9409eb3ecbaa0dad4fb91b5f.jpg)\r\n![](https://i.vas3k.club/3bb0fd7f386ace817abc37f05ffe5d75bc94113d98c6221d01c162fbe1763604.jpg)\r\n\r\nНаправо от Scheveningen\r\nOostduinpark -  делать все то же самое, только кажется поближе к общественному транспорту (а вдруг вы как и я боитесь кататься на велосипеде и везде ходите пешком) и вместо коровок будут зайцы. \r\n![](https://i.vas3k.club/87e72b286d02efe86dd67107f55918a2ef0cb3775f2c046f0f47f0873dce97da.jpg)\r\n# Где и что поесть/выпить?\r\nДисклеймер: я не дружу с sandwich culture, поэтому подборка не включает в себя места, где можно попробовать основную местную еду.\r\n\r\n Топовые фалафельные:\r\n[Shakshuka](https://goo.gl/maps/hTX6Pusnozhfmg8J8)\r\n[Falafel en Hummus](https://goo.gl/maps/FSWVhmjDbKeycUdD9)\r\n[Hummus Den Haag](https://goo.gl/maps/wxAWF2zaFrQDjjfw9)\r\n\r\nSeafood:\r\n[Coast Fish](https://goo.gl/maps/jR5Cpicw8CjjUJQW7)\r\n[Hendriks Fish & Drinks](https://goo.gl/maps/9kxWj3o8SUuYaKfx8)\r\n[Simonis aan de Haven](https://maps.app.goo.gl/TuZyLEp2jQfuwTg39)\r\n\r\nСуши:\r\n[Ohmu sushi](https://goo.gl/maps/LkgE21Rc7TshcNHv8)\r\n[Samurice](https://goo.gl/maps/z9HLSDjaVjqA1rvb7)\r\n[NOH](https://goo.gl/maps/UHTJHnn2gSPZnPaZ6)\r\n\r\nЭтим летом довольно жарко, пригодится мороженка:\r\n[Het IJskabinet](https://goo.gl/maps/7ddvBu7RkVVYRw4A7)\r\n[Piet Artisans of Flavour](https://goo.gl/maps/4qZfrA61SmS9cEHd6)\r\n\r\n[Список топовых кофеен от Вали](https://t.me/gaagaradio/252) (наш любимый гаагский гид)\r\n [DuckRabbit Coffee Brewers](https://maps.app.goo.gl/nDUFNSxtAtvm85Ry7?g_st=ic)\r\n[Bartine Bakery](https://goo.gl/maps/VgAnJTUCmoZnVWC1A) с космическими круассанами и атмосферой Франции\r\n\r\nПодвергнуться мукам выбора в Foodhallen в [центре](https://goo.gl/maps/XvACj7hcorTiE3PUA) или на [пляже](https://goo.gl/maps/nqfTPtEJszmTq1pu8)\r\n\r\nПо остальным категориям включая бары прошу помощь зала или можно обратиться к этому [ресурсу](https://34travel.me/post/gaaga), например.\r\n# Где затусить вечером?\r\nВстретить закат на побережье\r\n![](https://i.vas3k.club/fdef0fc3ab64215cd51c76b4f77b3c67b83a280b8358cba3e6c01e4b5a243989.jpg)\r\n#  Что можно купить чтобы увезти с собой\r\n- Haagsche hopjes - кофейные карамельки, названные в честь барона, который по легенде так любил кофе, что даже когда ему по состоянию здоровья запретили его пить, нашел способ обойти запрет, попросив своего кондитера смешать  кофе, сахар и сливки в ароматную сладкую массу, которая и положила начало производству конфет, ставших известными в королевских дворах по всему миру. (Так что теперь вы знаете, с чем мог пить чай Александр II перед тем как отправиться на роковую воскресную прогулку).\r\n![](https://i.vas3k.club/87a21adbfebb97bbf32821e965f61416a170813a5a66ec24228426495ccdaa87.jpg)\r\n- Уточку с жемчужной серёжкой для одинокого друга айтишника.\r\n![](https://i.vas3k.club/2e6824ec1b6f9f3e2a6c2225b96a7dd011ac052e4202d27e953a35aaf17dc80d.jpg)\r\n-  Местный шоколад из [De Bonte Koe](https://debontekoe.nl/), магазины есть в нескольких локациях в центре\r\n#  Бонус для местных\r\nhttps://t.me/+AhMfbD4D7OA4OGM0 - Книжный клуб в Гааге\r\nhttps://suhumi.nl/ - Вкуснейшая грузинская еда	\N	\N	\N	f	t	87	2023-06-16 11:53:50.456013+00	\N	+	1c322fcb-fd78-4a72-ab00-044551906fda	\N	\N	{}	\N	\N
eaa7b939-db37-4c54-b27d-fe6568ffe6d7	13	guide	Клубный Путеводитель: Гаага	Если вам поднадоел переполненный туристами Амстердам, добро пожаловать в Гаагу, трамвайный рай урбанистов, место рождения теннисного корта и просто чудесный город, где деревьев пока больше, чем мясных жителей!\r\n![](https://i.vas3k.club/2d0a05c0ed4ef4eeea86f330f538729d7f807dac9957c6cbbba01fe90c456053.jpg)\r\n# Карта города\r\n![](https://i.vas3k.club/8b6e15ed860fe0fa3ae5ce578fb54b073d6fb1505db81132d85aed0e31a1c0c0.jpg)\r\nКак вы уже заметили, в Гааге вас ждет 11 км песчаных пляжей, по которым можно бегать голеньким.\r\n# Основная информация\r\n- **Валюта**: Евро\r\n- **Население**: 515 тыс\r\n- **Визы**: Шенген / ВНЖ\r\n- **Когда лучше всего приезжать?** Только не зимой, ибо ветер. Летом, если в вашем списке активностей есть пляжный отдых, водный спорт или ночные поиски sea sparkle; Весна и осень комфортны для кофейных туров и музейной программы.\r\n- **Что обязательно взять с собой?** Летом spf, в остальное время года windproof дождевик и термокружку. И надо всегда быть луковкой, чтобы в случае изменения погодных условий скинуть пару слоев одежды или же укутать тушку от ветра и спокойно наслаждаться видами. \r\n- **Как лучше добраться из аэропорта?** Приобрести анонимную OV-chipkaart (уже не так нужна в 2023, за проезд можно платить обычной картой Visa/Mastercard) и запрыгнуть в поезд, направление Den Haag Centraal, детали можно посмотреть в приложении NS. Детально описывать не буду, скорее всего Гаага не будет вашим первым городом в Нидерландах, поэтому лучше начать с [гайда по Амстердаму](https://https://vas3k.club/guide/11740/).\r\n- **Как лучше перемещаться по городу?** Велосипед (будет спокойнее и живописнее, чем в Амстердаме, т.к. Гаага в топе зеленых городов в Нидерландах), трамвай к пляжу, автобусы.\r\n- **Есть ли доставка еды?** Uber Eats, Deliveroo, все стандартно, как и в других частях страны. Из сервисов доставки продуктов люблю Gorillas.\r\n- **Какую купить туристическую симку?** Любая европейская симка должна работать без роуминга. Если вы из других мест, то KPN, Lebara.\r\n- **Можно ли везде платить картой?** Да.\r\n- **Можно ли пить воду из крана?** Да.\r\n- **Главные супермаркеты для еды?** Albert Heijn, Jumbo, последний предпочтительнее, если у вас не Maestro.\r\n- **Говорят ли люди на улице по-английски?** Да.\r\n- **Что нужно 100% увидеть и попробовать?** Музей Эшера, пляж. \r\n- **Чего остерегаться?** Как и в любой точке Нидерландов, велосипедистов и переулков, из которых они внезапно вылетают на пешеходов.  \r\n- **Сколько в среднем стоит 1 шаурма?** 6-10 евро.\r\n# Основной маршрут туриста\r\n- Приехать на Den Haag Centraal и порадоваться тому, как оптимально голландцы перестроили здание вокзала.\r\n![](https://i.vas3k.club/7be43c2963999381d34c074e35f60f3a6a81135dfae0bc884ad4095c5b146c83.jpg)\r\n- Прогуляться по району de Resident (в котором все самое высокое), рассматривая спрятанные в кустах и между домами скульптуры (например, есть такой польский скульптор Игорь Миторай, несколько его работ можно найти в городе и в том числе в этом районе).\r\n![](https://i.vas3k.club/bd3c45f144a98c6fb97f0f35d8df478b9fb80b0fe9c051ad2a970297f8003151.jpg)\r\n- Сходить в музей Эшера и в крошечный Эрмитаж, от которого не устаешь - Mauritshuis (Маурицхёйс). Обычно я дозирую музеи, чтобы не смешивать впечатления, но в данном случае это хорошее комбо, особенно если вы на один день. \r\n- Пройти мимо Binnenhof через площадь Plein, там сидит премьер-министр и всякие важные люди в костюмах. Там красиво и пахнет историей.\r\n- Прогуляться по Hoogstraat и поглазеть на Noordeinde Palace, один из дворцов королевской семьи, в него даже можно попасть на экскурсию. Завернуть на пикник в королевский сад по другую сторону улицы.\r\n ![](https://i.vas3k.club/9d2eb41aab1cc6086778ee11e1065cb73891ed7114ed10525f90472134891198.jpg)\r\n- Дойти до Peace Palace, горько выдохнуть у вечного огня мира и сесть в трамвай по направлению к пляжу.\r\n![](https://i.vas3k.club/925b90fb396a4e6e12bc8e63d1a6a9de07c4e3a8f5afb133e59908811d532b2d.jpg)\r\n- Если вы с детьми, возможно вам лучше свернуть в парк миниатюр [Madurodam](https://www.madurodam.nl/ru). \r\n- А если вы любите современное искусство, вам в [Kunstmuseum](https://www.kunstmuseum.nl/nl), сейчас там Муха и Мондриан.\r\n- Выйти на остановке возле Kurhaus и погулять вокруг.\r\n![](https://i.vas3k.club/4a22f1274a6437b55ea3db08f200c7c1c3ada52814f83dbc377b108185c8b525.jpg)\r\n- Наткнуться на "fairy tale pictures to the sea" от Тома Оттернеса и сказать спасибо частным коллекционерам Гааги, делающим такие классные выставки под открытым небом.\r\n![](https://i.vas3k.club/703dccef8836211b5265151cf153497a80dc597b4b2e152f216de7fd5dc2ed83.jpg)\r\n\r\n# «Нетуристические» маршруты\r\n#### Night beach tour\r\nСпешите на поиски sea sparkle (это такая люминисцирующая одноклеточная водоросль), совсем скоро она повзрослеет и перестанет светиться. Лучше выбирать дни, когда нет ветра и тепло, выезжать на велосипедах к полуночи или даже позднее. \r\n![](https://i.vas3k.club/6203bc5338c4295334c12217ce021d80fcd4844e8e44104a5eb4a51193f23851.jpg)\r\n#### Серфинг\r\nВ Гааге довольно много серфинг школ, где выдают все необходимое для занятий. Разовое занятие стоит от 30 евро, есть форматы ретритов, где вы целыми днями серфите, йожите, кушаете и строите замки из песка или танцуете, например [здесь](https://tashasurfcamp.bookinglayer.com/en/product/surfcamp-scheveningen-1). От себя могу добавить, что даже часовое занятие серфингом незаметно откусывает почти весь день, поэтому если решите заниматься чем-то подобным, то лучше не планировать ничего важного в серф дни.\r\n#### [Найти "памятник" Сталину](https://www.wikiwand.com/ru/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD%D1%83_(%D0%93%D0%B0%D0%B0%D0%B3%D0%B0))\r\nИ узнать, кто был звездой гаагской улицы красных фонарей.\r\n![](https://i.vas3k.club/a5615b0454bf5f3426966596593c115dfcd109a69218dc6bdbced6b736992993.jpg)\r\n#### Bungy Jumping / Zip Line\r\nНа пирсе Scheveningen можно не только покататься на колесе обозрения, но и [попрыгать](https://www.bungy.nl/en/) и поделать [вжунь](https://www.pier.nl/company/zipline-de-pier/).\r\n#### [Louwman Museum](https://www.louwmanmuseum.nl/)\r\nПоглазеть и пощупать историю через коллекцию автомобилей, автобусов и мотоциклов.\r\n### Прогулки / велотур по лесам и дюнам\r\nДля меня Гаага это\r\n![](https://i.vas3k.club/0affe8ea3ec5d27c0edb4e55be7059761adc8b62a5ef9d5920670dccf0afd73e.jpg)\r\nНачнем с Scheveningse Bosjes. Здесь есть тропы для бега/прогулок, конного спорта и велосипедов и приятно, что у всех получается не мешать друг другу. При входе в лесопарк есть детская площадка, по всей территории время от времени попадаются лавочки и фонтанчики с водой. Однако я бы не советовала гулять здесь одиноким особам поздним вечером, даже если вы возвращаетесь с пляжа и это самый короткий путь. :)\r\n\r\nHaagse Bos - знаменитый лес в 5 минутах ходьбы от Central station. Начинается он с Koekamp, местечка, где живут олени, аисты, и куда приходят тусоваться нильские гуси. В 16 веке после процедента с вырубкой деревьев один дядя сказал, что не надо больше трогать лес, и с тех пор никто не трогал лес. Даже нацистские войска некогда пускали ракеты из этого леса, но не трогали сам лес.\r\n\r\nПарк Clingendael с японским садом, который всегда закрыт. Говорят,  там настолько красиво, что краснокнижные птицы вьют в нем гнезда, и сотрудникам приходится закрывать всю территорию от  посетителей, чтобы молодые родители могли вырастить как можно больше птенчиков.\r\n\r\n Zorgvliet - платный парк для одного человека, который сидит на лавочке у входа и спрашивает у вас билет :) Буду рада, если кто-то из гаагчан расскажет, в чем особенность этого места.\r\n \r\n Налево от Scheveningen\r\n Westduinpark - не только кататься на велосипеде, но серфить, купаться или просто ходить голеньким. Еще можно искать и находить шотландских коровок.\r\n  ![](https://i.vas3k.club/ea085ed8bec087f2a7721c2ae238ee224472506c9409eb3ecbaa0dad4fb91b5f.jpg)\r\n![](https://i.vas3k.club/3bb0fd7f386ace817abc37f05ffe5d75bc94113d98c6221d01c162fbe1763604.jpg)\r\n\r\nНаправо от Scheveningen\r\nOostduinpark -  делать все то же самое, только кажется поближе к общественному транспорту (а вдруг вы как и я боитесь кататься на велосипеде и везде ходите пешком) и вместо коровок будут зайцы. \r\n![](https://i.vas3k.club/87e72b286d02efe86dd67107f55918a2ef0cb3775f2c046f0f47f0873dce97da.jpg)\r\n# Где и что поесть/выпить?\r\nДисклеймер: я не дружу с sandwich culture, поэтому подборка не включает в себя места, где можно попробовать основную местную еду.\r\n\r\n Топовые фалафельные:\r\n[Shakshuka](https://goo.gl/maps/hTX6Pusnozhfmg8J8)\r\n[Falafel en Hummus](https://goo.gl/maps/FSWVhmjDbKeycUdD9)\r\n[Hummus Den Haag](https://goo.gl/maps/wxAWF2zaFrQDjjfw9)\r\n\r\nSeafood:\r\n[Coast Fish](https://goo.gl/maps/jR5Cpicw8CjjUJQW7)\r\n[Hendriks Fish & Drinks](https://goo.gl/maps/9kxWj3o8SUuYaKfx8)\r\n[Simonis aan de Haven](https://maps.app.goo.gl/TuZyLEp2jQfuwTg39)\r\n\r\nСуши:\r\n[Ohmu sushi](https://goo.gl/maps/LkgE21Rc7TshcNHv8)\r\n[Samurice](https://goo.gl/maps/z9HLSDjaVjqA1rvb7)\r\n[NOH](https://goo.gl/maps/UHTJHnn2gSPZnPaZ6)\r\n\r\nЭтим летом довольно жарко, пригодится мороженка:\r\n[Het IJskabinet](https://goo.gl/maps/7ddvBu7RkVVYRw4A7)\r\n[Piet Artisans of Flavour](https://goo.gl/maps/4qZfrA61SmS9cEHd6)\r\n\r\n[Список топовых кофеен от Вали](https://t.me/gaagaradio/252) (наш любимый гаагский гид)\r\n [DuckRabbit Coffee Brewers](https://maps.app.goo.gl/nDUFNSxtAtvm85Ry7?g_st=ic)\r\n[Bartine Bakery](https://goo.gl/maps/VgAnJTUCmoZnVWC1A) с космическими круассанами и атмосферой Франции\r\n\r\nПодвергнуться мукам выбора в Foodhallen в [центре](https://goo.gl/maps/XvACj7hcorTiE3PUA) или на [пляже](https://goo.gl/maps/nqfTPtEJszmTq1pu8)\r\n\r\nПо остальным категориям включая бары прошу помощь зала или можно обратиться к этому [ресурсу](https://34travel.me/post/gaaga), например.\r\n# Где затусить вечером?\r\nВстретить закат на побережье\r\n![](https://i.vas3k.club/fdef0fc3ab64215cd51c76b4f77b3c67b83a280b8358cba3e6c01e4b5a243989.jpg)\r\n#  Что можно купить чтобы увезти с собой\r\n- Haagsche hopjes - кофейные карамельки, названные в честь барона, который по легенде так любил кофе, что даже когда ему по состоянию здоровья запретили его пить, нашел способ обойти запрет, попросив своего кондитера смешать  кофе, сахар и сливки в ароматную сладкую массу, которая и положила начало производству конфет, ставших известными в королевских дворах по всему миру. (Так что теперь вы знаете, с чем мог пить чай Александр II перед тем как отправиться на роковую воскресную прогулку).\r\n![](https://i.vas3k.club/87a21adbfebb97bbf32821e965f61416a170813a5a66ec24228426495ccdaa87.jpg)\r\n- Уточку с жемчужной серёжкой для одинокого друга айтишника.\r\n![](https://i.vas3k.club/2e6824ec1b6f9f3e2a6c2225b96a7dd011ac052e4202d27e953a35aaf17dc80d.jpg)\r\n-  Местный шоколад из [De Bonte Koe](https://debontekoe.nl/), магазины есть в нескольких локациях в центре\r\n#  Бонус для местных\r\nhttps://t.me/+AhMfbD4D7OA4OGM0 - Книжный клуб в Гааге\r\nhttps://suhumi.nl/ - Вкуснейшая грузинская еда	\N	\N	\N	f	t	88	2023-06-16 11:53:50.511668+00	\N	~	1c322fcb-fd78-4a72-ab00-044551906fda	\N	\N	{}	\N	\N
eaa7b939-db37-4c54-b27d-fe6568ffe6d7	13	guide	Клубный Путеводитель: Гаага	Если вам поднадоел переполненный туристами Амстердам, добро пожаловать в Гаагу, трамвайный рай урбанистов, место рождения теннисного корта и просто чудесный город, где деревьев пока больше, чем мясных жителей!\r\n![](https://i.vas3k.club/2d0a05c0ed4ef4eeea86f330f538729d7f807dac9957c6cbbba01fe90c456053.jpg)\r\n# Карта города\r\n![](https://i.vas3k.club/8b6e15ed860fe0fa3ae5ce578fb54b073d6fb1505db81132d85aed0e31a1c0c0.jpg)\r\nКак вы уже заметили, в Гааге вас ждет 11 км песчаных пляжей, по которым можно бегать голеньким.\r\n# Основная информация\r\n- **Валюта**: Евро\r\n- **Население**: 515 тыс\r\n- **Визы**: Шенген / ВНЖ\r\n- **Когда лучше всего приезжать?** Только не зимой, ибо ветер. Летом, если в вашем списке активностей есть пляжный отдых, водный спорт или ночные поиски sea sparkle; Весна и осень комфортны для кофейных туров и музейной программы.\r\n- **Что обязательно взять с собой?** Летом spf, в остальное время года windproof дождевик и термокружку. И надо всегда быть луковкой, чтобы в случае изменения погодных условий скинуть пару слоев одежды или же укутать тушку от ветра и спокойно наслаждаться видами. \r\n- **Как лучше добраться из аэропорта?** Приобрести анонимную OV-chipkaart (уже не так нужна в 2023, за проезд можно платить обычной картой Visa/Mastercard) и запрыгнуть в поезд, направление Den Haag Centraal, детали можно посмотреть в приложении NS. Детально описывать не буду, скорее всего Гаага не будет вашим первым городом в Нидерландах, поэтому лучше начать с [гайда по Амстердаму](https://https://vas3k.club/guide/11740/).\r\n- **Как лучше перемещаться по городу?** Велосипед (будет спокойнее и живописнее, чем в Амстердаме, т.к. Гаага в топе зеленых городов в Нидерландах), трамвай к пляжу, автобусы.\r\n- **Есть ли доставка еды?** Uber Eats, Deliveroo, все стандартно, как и в других частях страны. Из сервисов доставки продуктов люблю Gorillas.\r\n- **Какую купить туристическую симку?** Любая европейская симка должна работать без роуминга. Если вы из других мест, то KPN, Lebara.\r\n- **Можно ли везде платить картой?** Да.\r\n- **Можно ли пить воду из крана?** Да.\r\n- **Главные супермаркеты для еды?** Albert Heijn, Jumbo, последний предпочтительнее, если у вас не Maestro.\r\n- **Говорят ли люди на улице по-английски?** Да.\r\n- **Что нужно 100% увидеть и попробовать?** Музей Эшера, пляж. \r\n- **Чего остерегаться?** Как и в любой точке Нидерландов, велосипедистов и переулков, из которых они внезапно вылетают на пешеходов.  \r\n- **Сколько в среднем стоит 1 шаурма?** 6-10 евро.\r\n# Основной маршрут туриста\r\n- Приехать на Den Haag Centraal и порадоваться тому, как оптимально голландцы перестроили здание вокзала.\r\n![](https://i.vas3k.club/7be43c2963999381d34c074e35f60f3a6a81135dfae0bc884ad4095c5b146c83.jpg)\r\n- Прогуляться по району de Resident (в котором все самое высокое), рассматривая спрятанные в кустах и между домами скульптуры (например, есть такой польский скульптор Игорь Миторай, несколько его работ можно найти в городе и в том числе в этом районе).\r\n![](https://i.vas3k.club/bd3c45f144a98c6fb97f0f35d8df478b9fb80b0fe9c051ad2a970297f8003151.jpg)\r\n- Сходить в музей Эшера и в крошечный Эрмитаж, от которого не устаешь - Mauritshuis (Маурицхёйс). Обычно я дозирую музеи, чтобы не смешивать впечатления, но в данном случае это хорошее комбо, особенно если вы на один день. \r\n- Пройти мимо Binnenhof через площадь Plein, там сидит премьер-министр и всякие важные люди в костюмах. Там красиво и пахнет историей.\r\n- Прогуляться по Hoogstraat и поглазеть на Noordeinde Palace, один из дворцов королевской семьи, в него даже можно попасть на экскурсию. Завернуть на пикник в королевский сад по другую сторону улицы.\r\n ![](https://i.vas3k.club/9d2eb41aab1cc6086778ee11e1065cb73891ed7114ed10525f90472134891198.jpg)\r\n- Дойти до Peace Palace, горько выдохнуть у вечного огня мира и сесть в трамвай по направлению к пляжу.\r\n![](https://i.vas3k.club/925b90fb396a4e6e12bc8e63d1a6a9de07c4e3a8f5afb133e59908811d532b2d.jpg)\r\n- Если вы с детьми, возможно вам лучше свернуть в парк миниатюр [Madurodam](https://www.madurodam.nl/ru). \r\n- А если вы любите современное искусство, вам в [Kunstmuseum](https://www.kunstmuseum.nl/nl), сейчас там Муха и Мондриан.\r\n- Выйти на остановке возле Kurhaus и погулять вокруг.\r\n![](https://i.vas3k.club/4a22f1274a6437b55ea3db08f200c7c1c3ada52814f83dbc377b108185c8b525.jpg)\r\n- Наткнуться на "fairy tale pictures to the sea" от Тома Оттернеса и сказать спасибо частным коллекционерам Гааги, делающим такие классные выставки под открытым небом.\r\n![](https://i.vas3k.club/703dccef8836211b5265151cf153497a80dc597b4b2e152f216de7fd5dc2ed83.jpg)\r\n\r\n# «Нетуристические» маршруты\r\n#### Night beach tour\r\nСпешите на поиски sea sparkle (это такая люминисцирующая одноклеточная водоросль), совсем скоро она повзрослеет и перестанет светиться. Лучше выбирать дни, когда нет ветра и тепло, выезжать на велосипедах к полуночи или даже позднее. \r\n![](https://i.vas3k.club/6203bc5338c4295334c12217ce021d80fcd4844e8e44104a5eb4a51193f23851.jpg)\r\n#### Серфинг\r\nВ Гааге довольно много серфинг школ, где выдают все необходимое для занятий. Разовое занятие стоит от 30 евро, есть форматы ретритов, где вы целыми днями серфите, йожите, кушаете и строите замки из песка или танцуете, например [здесь](https://tashasurfcamp.bookinglayer.com/en/product/surfcamp-scheveningen-1). От себя могу добавить, что даже часовое занятие серфингом незаметно откусывает почти весь день, поэтому если решите заниматься чем-то подобным, то лучше не планировать ничего важного в серф дни.\r\n#### [Найти "памятник" Сталину](https://www.wikiwand.com/ru/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD%D1%83_(%D0%93%D0%B0%D0%B0%D0%B3%D0%B0))\r\nИ узнать, кто был звездой гаагской улицы красных фонарей.\r\n![](https://i.vas3k.club/a5615b0454bf5f3426966596593c115dfcd109a69218dc6bdbced6b736992993.jpg)\r\n#### Bungy Jumping / Zip Line\r\nНа пирсе Scheveningen можно не только покататься на колесе обозрения, но и [попрыгать](https://www.bungy.nl/en/) и поделать [вжунь](https://www.pier.nl/company/zipline-de-pier/).\r\n#### [Louwman Museum](https://www.louwmanmuseum.nl/)\r\nПоглазеть и пощупать историю через коллекцию автомобилей, автобусов и мотоциклов.\r\n### Прогулки / велотур по лесам и дюнам\r\nДля меня Гаага это\r\n![](https://i.vas3k.club/0affe8ea3ec5d27c0edb4e55be7059761adc8b62a5ef9d5920670dccf0afd73e.jpg)\r\nНачнем с Scheveningse Bosjes. Здесь есть тропы для бега/прогулок, конного спорта и велосипедов и приятно, что у всех получается не мешать друг другу. При входе в лесопарк есть детская площадка, по всей территории время от времени попадаются лавочки и фонтанчики с водой. Однако я бы не советовала гулять здесь одиноким особам поздним вечером, даже если вы возвращаетесь с пляжа и это самый короткий путь. :)\r\n\r\nHaagse Bos - знаменитый лес в 5 минутах ходьбы от Central station. Начинается он с Koekamp, местечка, где живут олени, аисты, и куда приходят тусоваться нильские гуси. В 16 веке после процедента с вырубкой деревьев один дядя сказал, что не надо больше трогать лес, и с тех пор никто не трогал лес. Даже нацистские войска некогда пускали ракеты из этого леса, но не трогали сам лес.\r\n\r\nПарк Clingendael с японским садом, который всегда закрыт. Говорят,  там настолько красиво, что краснокнижные птицы вьют в нем гнезда, и сотрудникам приходится закрывать всю территорию от  посетителей, чтобы молодые родители могли вырастить как можно больше птенчиков.\r\n\r\n Zorgvliet - платный парк для одного человека, который сидит на лавочке у входа и спрашивает у вас билет :) Буду рада, если кто-то из гаагчан расскажет, в чем особенность этого места.\r\n \r\n Налево от Scheveningen\r\n Westduinpark - не только кататься на велосипеде, но серфить, купаться или просто ходить голеньким. Еще можно искать и находить шотландских коровок.\r\n  ![](https://i.vas3k.club/ea085ed8bec087f2a7721c2ae238ee224472506c9409eb3ecbaa0dad4fb91b5f.jpg)\r\n![](https://i.vas3k.club/3bb0fd7f386ace817abc37f05ffe5d75bc94113d98c6221d01c162fbe1763604.jpg)\r\n\r\nНаправо от Scheveningen\r\nOostduinpark -  делать все то же самое, только кажется поближе к общественному транспорту (а вдруг вы как и я боитесь кататься на велосипеде и везде ходите пешком) и вместо коровок будут зайцы. \r\n![](https://i.vas3k.club/87e72b286d02efe86dd67107f55918a2ef0cb3775f2c046f0f47f0873dce97da.jpg)\r\n# Где и что поесть/выпить?\r\nДисклеймер: я не дружу с sandwich culture, поэтому подборка не включает в себя места, где можно попробовать основную местную еду.\r\n\r\n Топовые фалафельные:\r\n[Shakshuka](https://goo.gl/maps/hTX6Pusnozhfmg8J8)\r\n[Falafel en Hummus](https://goo.gl/maps/FSWVhmjDbKeycUdD9)\r\n[Hummus Den Haag](https://goo.gl/maps/wxAWF2zaFrQDjjfw9)\r\n\r\nSeafood:\r\n[Coast Fish](https://goo.gl/maps/jR5Cpicw8CjjUJQW7)\r\n[Hendriks Fish & Drinks](https://goo.gl/maps/9kxWj3o8SUuYaKfx8)\r\n[Simonis aan de Haven](https://maps.app.goo.gl/TuZyLEp2jQfuwTg39)\r\n\r\nСуши:\r\n[Ohmu sushi](https://goo.gl/maps/LkgE21Rc7TshcNHv8)\r\n[Samurice](https://goo.gl/maps/z9HLSDjaVjqA1rvb7)\r\n[NOH](https://goo.gl/maps/UHTJHnn2gSPZnPaZ6)\r\n\r\nЭтим летом довольно жарко, пригодится мороженка:\r\n[Het IJskabinet](https://goo.gl/maps/7ddvBu7RkVVYRw4A7)\r\n[Piet Artisans of Flavour](https://goo.gl/maps/4qZfrA61SmS9cEHd6)\r\n\r\n[Список топовых кофеен от Вали](https://t.me/gaagaradio/252) (наш любимый гаагский гид)\r\n [DuckRabbit Coffee Brewers](https://maps.app.goo.gl/nDUFNSxtAtvm85Ry7?g_st=ic)\r\n[Bartine Bakery](https://goo.gl/maps/VgAnJTUCmoZnVWC1A) с космическими круассанами и атмосферой Франции\r\n\r\nПодвергнуться мукам выбора в Foodhallen в [центре](https://goo.gl/maps/XvACj7hcorTiE3PUA) или на [пляже](https://goo.gl/maps/nqfTPtEJszmTq1pu8)\r\n\r\nПо остальным категориям включая бары прошу помощь зала или можно обратиться к этому [ресурсу](https://34travel.me/post/gaaga), например.\r\n# Где затусить вечером?\r\nВстретить закат на побережье\r\n![](https://i.vas3k.club/fdef0fc3ab64215cd51c76b4f77b3c67b83a280b8358cba3e6c01e4b5a243989.jpg)\r\n#  Что можно купить чтобы увезти с собой\r\n- Haagsche hopjes - кофейные карамельки, названные в честь барона, который по легенде так любил кофе, что даже когда ему по состоянию здоровья запретили его пить, нашел способ обойти запрет, попросив своего кондитера смешать  кофе, сахар и сливки в ароматную сладкую массу, которая и положила начало производству конфет, ставших известными в королевских дворах по всему миру. (Так что теперь вы знаете, с чем мог пить чай Александр II перед тем как отправиться на роковую воскресную прогулку).\r\n![](https://i.vas3k.club/87a21adbfebb97bbf32821e965f61416a170813a5a66ec24228426495ccdaa87.jpg)\r\n- Уточку с жемчужной серёжкой для одинокого друга айтишника.\r\n![](https://i.vas3k.club/2e6824ec1b6f9f3e2a6c2225b96a7dd011ac052e4202d27e953a35aaf17dc80d.jpg)\r\n-  Местный шоколад из [De Bonte Koe](https://debontekoe.nl/), магазины есть в нескольких локациях в центре\r\n#  Бонус для местных\r\nhttps://t.me/+AhMfbD4D7OA4OGM0 - Книжный клуб в Гааге\r\nhttps://suhumi.nl/ - Вкуснейшая грузинская еда	\N	\N	\N	f	t	89	2023-06-16 11:54:01.494319+00	\N	~	1c322fcb-fd78-4a72-ab00-044551906fda	\N	\N	{}	\N	\N
eaa7b939-db37-4c54-b27d-fe6568ffe6d7	13	guide	Клубный Путеводитель: Гаага	Если вам поднадоел переполненный туристами Амстердам, добро пожаловать в Гаагу, трамвайный рай урбанистов, место рождения теннисного корта и просто чудесный город, где деревьев пока больше, чем мясных жителей!\r\n![](https://i.vas3k.club/2d0a05c0ed4ef4eeea86f330f538729d7f807dac9957c6cbbba01fe90c456053.jpg)\r\n# Карта города\r\n![](https://i.vas3k.club/8b6e15ed860fe0fa3ae5ce578fb54b073d6fb1505db81132d85aed0e31a1c0c0.jpg)\r\nКак вы уже заметили, в Гааге вас ждет 11 км песчаных пляжей, по которым можно бегать голеньким.\r\n# Основная информация\r\n- **Валюта**: Евро\r\n- **Население**: 515 тыс\r\n- **Визы**: Шенген / ВНЖ\r\n- **Когда лучше всего приезжать?** Только не зимой, ибо ветер. Летом, если в вашем списке активностей есть пляжный отдых, водный спорт или ночные поиски sea sparkle; Весна и осень комфортны для кофейных туров и музейной программы.\r\n- **Что обязательно взять с собой?** Летом spf, в остальное время года windproof дождевик и термокружку. И надо всегда быть луковкой, чтобы в случае изменения погодных условий скинуть пару слоев одежды или же укутать тушку от ветра и спокойно наслаждаться видами. \r\n- **Как лучше добраться из аэропорта?** Приобрести анонимную OV-chipkaart (уже не так нужна в 2023, за проезд можно платить обычной картой Visa/Mastercard) и запрыгнуть в поезд, направление Den Haag Centraal, детали можно посмотреть в приложении NS. Детально описывать не буду, скорее всего Гаага не будет вашим первым городом в Нидерландах, поэтому лучше начать с [гайда по Амстердаму](https://https://vas3k.club/guide/11740/).\r\n- **Как лучше перемещаться по городу?** Велосипед (будет спокойнее и живописнее, чем в Амстердаме, т.к. Гаага в топе зеленых городов в Нидерландах), трамвай к пляжу, автобусы.\r\n- **Есть ли доставка еды?** Uber Eats, Deliveroo, все стандартно, как и в других частях страны. Из сервисов доставки продуктов люблю Gorillas.\r\n- **Какую купить туристическую симку?** Любая европейская симка должна работать без роуминга. Если вы из других мест, то KPN, Lebara.\r\n- **Можно ли везде платить картой?** Да.\r\n- **Можно ли пить воду из крана?** Да.\r\n- **Главные супермаркеты для еды?** Albert Heijn, Jumbo, последний предпочтительнее, если у вас не Maestro.\r\n- **Говорят ли люди на улице по-английски?** Да.\r\n- **Что нужно 100% увидеть и попробовать?** Музей Эшера, пляж. \r\n- **Чего остерегаться?** Как и в любой точке Нидерландов, велосипедистов и переулков, из которых они внезапно вылетают на пешеходов.  \r\n- **Сколько в среднем стоит 1 шаурма?** 6-10 евро.\r\n# Основной маршрут туриста\r\n- Приехать на Den Haag Centraal и порадоваться тому, как оптимально голландцы перестроили здание вокзала.\r\n![](https://i.vas3k.club/7be43c2963999381d34c074e35f60f3a6a81135dfae0bc884ad4095c5b146c83.jpg)\r\n- Прогуляться по району de Resident (в котором все самое высокое), рассматривая спрятанные в кустах и между домами скульптуры (например, есть такой польский скульптор Игорь Миторай, несколько его работ можно найти в городе и в том числе в этом районе).\r\n![](https://i.vas3k.club/bd3c45f144a98c6fb97f0f35d8df478b9fb80b0fe9c051ad2a970297f8003151.jpg)\r\n- Сходить в музей Эшера и в крошечный Эрмитаж, от которого не устаешь - Mauritshuis (Маурицхёйс). Обычно я дозирую музеи, чтобы не смешивать впечатления, но в данном случае это хорошее комбо, особенно если вы на один день. \r\n- Пройти мимо Binnenhof через площадь Plein, там сидит премьер-министр и всякие важные люди в костюмах. Там красиво и пахнет историей.\r\n- Прогуляться по Hoogstraat и поглазеть на Noordeinde Palace, один из дворцов королевской семьи, в него даже можно попасть на экскурсию. Завернуть на пикник в королевский сад по другую сторону улицы.\r\n ![](https://i.vas3k.club/9d2eb41aab1cc6086778ee11e1065cb73891ed7114ed10525f90472134891198.jpg)\r\n- Дойти до Peace Palace, горько выдохнуть у вечного огня мира и сесть в трамвай по направлению к пляжу.\r\n![](https://i.vas3k.club/925b90fb396a4e6e12bc8e63d1a6a9de07c4e3a8f5afb133e59908811d532b2d.jpg)\r\n- Если вы с детьми, возможно вам лучше свернуть в парк миниатюр [Madurodam](https://www.madurodam.nl/ru). \r\n- А если вы любите современное искусство, вам в [Kunstmuseum](https://www.kunstmuseum.nl/nl), сейчас там Муха и Мондриан.\r\n- Выйти на остановке возле Kurhaus и погулять вокруг.\r\n![](https://i.vas3k.club/4a22f1274a6437b55ea3db08f200c7c1c3ada52814f83dbc377b108185c8b525.jpg)\r\n- Наткнуться на "fairy tale pictures to the sea" от Тома Оттернеса и сказать спасибо частным коллекционерам Гааги, делающим такие классные выставки под открытым небом.\r\n![](https://i.vas3k.club/703dccef8836211b5265151cf153497a80dc597b4b2e152f216de7fd5dc2ed83.jpg)\r\n\r\n# «Нетуристические» маршруты\r\n#### Night beach tour\r\nСпешите на поиски sea sparkle (это такая люминисцирующая одноклеточная водоросль), совсем скоро она повзрослеет и перестанет светиться. Лучше выбирать дни, когда нет ветра и тепло, выезжать на велосипедах к полуночи или даже позднее. \r\n![](https://i.vas3k.club/6203bc5338c4295334c12217ce021d80fcd4844e8e44104a5eb4a51193f23851.jpg)\r\n#### Серфинг\r\nВ Гааге довольно много серфинг школ, где выдают все необходимое для занятий. Разовое занятие стоит от 30 евро, есть форматы ретритов, где вы целыми днями серфите, йожите, кушаете и строите замки из песка или танцуете, например [здесь](https://tashasurfcamp.bookinglayer.com/en/product/surfcamp-scheveningen-1). От себя могу добавить, что даже часовое занятие серфингом незаметно откусывает почти весь день, поэтому если решите заниматься чем-то подобным, то лучше не планировать ничего важного в серф дни.\r\n#### [Найти "памятник" Сталину](https://www.wikiwand.com/ru/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD%D1%83_(%D0%93%D0%B0%D0%B0%D0%B3%D0%B0))\r\nИ узнать, кто был звездой гаагской улицы красных фонарей.\r\n![](https://i.vas3k.club/a5615b0454bf5f3426966596593c115dfcd109a69218dc6bdbced6b736992993.jpg)\r\n#### Bungy Jumping / Zip Line\r\nНа пирсе Scheveningen можно не только покататься на колесе обозрения, но и [попрыгать](https://www.bungy.nl/en/) и поделать [вжунь](https://www.pier.nl/company/zipline-de-pier/).\r\n#### [Louwman Museum](https://www.louwmanmuseum.nl/)\r\nПоглазеть и пощупать историю через коллекцию автомобилей, автобусов и мотоциклов.\r\n### Прогулки / велотур по лесам и дюнам\r\nДля меня Гаага это\r\n![](https://i.vas3k.club/0affe8ea3ec5d27c0edb4e55be7059761adc8b62a5ef9d5920670dccf0afd73e.jpg)\r\nНачнем с Scheveningse Bosjes. Здесь есть тропы для бега/прогулок, конного спорта и велосипедов и приятно, что у всех получается не мешать друг другу. При входе в лесопарк есть детская площадка, по всей территории время от времени попадаются лавочки и фонтанчики с водой. Однако я бы не советовала гулять здесь одиноким особам поздним вечером, даже если вы возвращаетесь с пляжа и это самый короткий путь. :)\r\n\r\nHaagse Bos - знаменитый лес в 5 минутах ходьбы от Central station. Начинается он с Koekamp, местечка, где живут олени, аисты, и куда приходят тусоваться нильские гуси. В 16 веке после процедента с вырубкой деревьев один дядя сказал, что не надо больше трогать лес, и с тех пор никто не трогал лес. Даже нацистские войска некогда пускали ракеты из этого леса, но не трогали сам лес.\r\n\r\nПарк Clingendael с японским садом, который всегда закрыт. Говорят,  там настолько красиво, что краснокнижные птицы вьют в нем гнезда, и сотрудникам приходится закрывать всю территорию от  посетителей, чтобы молодые родители могли вырастить как можно больше птенчиков.\r\n\r\n Zorgvliet - платный парк для одного человека, который сидит на лавочке у входа и спрашивает у вас билет :) Буду рада, если кто-то из гаагчан расскажет, в чем особенность этого места.\r\n \r\n Налево от Scheveningen\r\n Westduinpark - не только кататься на велосипеде, но серфить, купаться или просто ходить голеньким. Еще можно искать и находить шотландских коровок.\r\n  ![](https://i.vas3k.club/ea085ed8bec087f2a7721c2ae238ee224472506c9409eb3ecbaa0dad4fb91b5f.jpg)\r\n![](https://i.vas3k.club/3bb0fd7f386ace817abc37f05ffe5d75bc94113d98c6221d01c162fbe1763604.jpg)\r\n\r\nНаправо от Scheveningen\r\nOostduinpark -  делать все то же самое, только кажется поближе к общественному транспорту (а вдруг вы как и я боитесь кататься на велосипеде и везде ходите пешком) и вместо коровок будут зайцы. \r\n![](https://i.vas3k.club/87e72b286d02efe86dd67107f55918a2ef0cb3775f2c046f0f47f0873dce97da.jpg)\r\n# Где и что поесть/выпить?\r\nДисклеймер: я не дружу с sandwich culture, поэтому подборка не включает в себя места, где можно попробовать основную местную еду.\r\n\r\n Топовые фалафельные:\r\n[Shakshuka](https://goo.gl/maps/hTX6Pusnozhfmg8J8)\r\n[Falafel en Hummus](https://goo.gl/maps/FSWVhmjDbKeycUdD9)\r\n[Hummus Den Haag](https://goo.gl/maps/wxAWF2zaFrQDjjfw9)\r\n\r\nSeafood:\r\n[Coast Fish](https://goo.gl/maps/jR5Cpicw8CjjUJQW7)\r\n[Hendriks Fish & Drinks](https://goo.gl/maps/9kxWj3o8SUuYaKfx8)\r\n[Simonis aan de Haven](https://maps.app.goo.gl/TuZyLEp2jQfuwTg39)\r\n\r\nСуши:\r\n[Ohmu sushi](https://goo.gl/maps/LkgE21Rc7TshcNHv8)\r\n[Samurice](https://goo.gl/maps/z9HLSDjaVjqA1rvb7)\r\n[NOH](https://goo.gl/maps/UHTJHnn2gSPZnPaZ6)\r\n\r\nЭтим летом довольно жарко, пригодится мороженка:\r\n[Het IJskabinet](https://goo.gl/maps/7ddvBu7RkVVYRw4A7)\r\n[Piet Artisans of Flavour](https://goo.gl/maps/4qZfrA61SmS9cEHd6)\r\n\r\n[Список топовых кофеен от Вали](https://t.me/gaagaradio/252) (наш любимый гаагский гид)\r\n [DuckRabbit Coffee Brewers](https://maps.app.goo.gl/nDUFNSxtAtvm85Ry7?g_st=ic)\r\n[Bartine Bakery](https://goo.gl/maps/VgAnJTUCmoZnVWC1A) с космическими круассанами и атмосферой Франции\r\n\r\nПодвергнуться мукам выбора в Foodhallen в [центре](https://goo.gl/maps/XvACj7hcorTiE3PUA) или на [пляже](https://goo.gl/maps/nqfTPtEJszmTq1pu8)\r\n\r\nПо остальным категориям включая бары прошу помощь зала или можно обратиться к этому [ресурсу](https://34travel.me/post/gaaga), например.\r\n# Где затусить вечером?\r\nВстретить закат на побережье\r\n![](https://i.vas3k.club/fdef0fc3ab64215cd51c76b4f77b3c67b83a280b8358cba3e6c01e4b5a243989.jpg)\r\n#  Что можно купить чтобы увезти с собой\r\n- Haagsche hopjes - кофейные карамельки, названные в честь барона, который по легенде так любил кофе, что даже когда ему по состоянию здоровья запретили его пить, нашел способ обойти запрет, попросив своего кондитера смешать  кофе, сахар и сливки в ароматную сладкую массу, которая и положила начало производству конфет, ставших известными в королевских дворах по всему миру. (Так что теперь вы знаете, с чем мог пить чай Александр II перед тем как отправиться на роковую воскресную прогулку).\r\n![](https://i.vas3k.club/87a21adbfebb97bbf32821e965f61416a170813a5a66ec24228426495ccdaa87.jpg)\r\n- Уточку с жемчужной серёжкой для одинокого друга айтишника.\r\n![](https://i.vas3k.club/2e6824ec1b6f9f3e2a6c2225b96a7dd011ac052e4202d27e953a35aaf17dc80d.jpg)\r\n-  Местный шоколад из [De Bonte Koe](https://debontekoe.nl/), магазины есть в нескольких локациях в центре\r\n#  Бонус для местных\r\nhttps://t.me/+AhMfbD4D7OA4OGM0 - Книжный клуб в Гааге\r\nhttps://suhumi.nl/ - Вкуснейшая грузинская еда	\N	\N	\N	t	t	90	2023-06-16 11:54:01.502303+00	\N	~	1c322fcb-fd78-4a72-ab00-044551906fda	\N	\N	{}	\N	\N
eaa7b939-db37-4c54-b27d-fe6568ffe6d7	13	guide	Клубный Путеводитель: Гаага	Если вам поднадоел переполненный туристами Амстердам, добро пожаловать в Гаагу, трамвайный рай урбанистов, место рождения теннисного корта и просто чудесный город, где деревьев пока больше, чем мясных жителей!\r\n![](https://i.vas3k.club/2d0a05c0ed4ef4eeea86f330f538729d7f807dac9957c6cbbba01fe90c456053.jpg)\r\n# Карта города\r\n![](https://i.vas3k.club/8b6e15ed860fe0fa3ae5ce578fb54b073d6fb1505db81132d85aed0e31a1c0c0.jpg)\r\nКак вы уже заметили, в Гааге вас ждет 11 км песчаных пляжей, по которым можно бегать голеньким.\r\n# Основная информация\r\n- **Валюта**: Евро\r\n- **Население**: 515 тыс\r\n- **Визы**: Шенген / ВНЖ\r\n- **Когда лучше всего приезжать?** Только не зимой, ибо ветер. Летом, если в вашем списке активностей есть пляжный отдых, водный спорт или ночные поиски sea sparkle; Весна и осень комфортны для кофейных туров и музейной программы.\r\n- **Что обязательно взять с собой?** Летом spf, в остальное время года windproof дождевик и термокружку. И надо всегда быть луковкой, чтобы в случае изменения погодных условий скинуть пару слоев одежды или же укутать тушку от ветра и спокойно наслаждаться видами. \r\n- **Как лучше добраться из аэропорта?** Приобрести анонимную OV-chipkaart (уже не так нужна в 2023, за проезд можно платить обычной картой Visa/Mastercard) и запрыгнуть в поезд, направление Den Haag Centraal, детали можно посмотреть в приложении NS. Детально описывать не буду, скорее всего Гаага не будет вашим первым городом в Нидерландах, поэтому лучше начать с [гайда по Амстердаму](https://https://vas3k.club/guide/11740/).\r\n- **Как лучше перемещаться по городу?** Велосипед (будет спокойнее и живописнее, чем в Амстердаме, т.к. Гаага в топе зеленых городов в Нидерландах), трамвай к пляжу, автобусы.\r\n- **Есть ли доставка еды?** Uber Eats, Deliveroo, все стандартно, как и в других частях страны. Из сервисов доставки продуктов люблю Gorillas.\r\n- **Какую купить туристическую симку?** Любая европейская симка должна работать без роуминга. Если вы из других мест, то KPN, Lebara.\r\n- **Можно ли везде платить картой?** Да.\r\n- **Можно ли пить воду из крана?** Да.\r\n- **Главные супермаркеты для еды?** Albert Heijn, Jumbo, последний предпочтительнее, если у вас не Maestro.\r\n- **Говорят ли люди на улице по-английски?** Да.\r\n- **Что нужно 100% увидеть и попробовать?** Музей Эшера, пляж. \r\n- **Чего остерегаться?** Как и в любой точке Нидерландов, велосипедистов и переулков, из которых они внезапно вылетают на пешеходов.  \r\n- **Сколько в среднем стоит 1 шаурма?** 6-10 евро.\r\n# Основной маршрут туриста\r\n- Приехать на Den Haag Centraal и порадоваться тому, как оптимально голландцы перестроили здание вокзала.\r\n![](https://i.vas3k.club/7be43c2963999381d34c074e35f60f3a6a81135dfae0bc884ad4095c5b146c83.jpg)\r\n- Прогуляться по району de Resident (в котором все самое высокое), рассматривая спрятанные в кустах и между домами скульптуры (например, есть такой польский скульптор Игорь Миторай, несколько его работ можно найти в городе и в том числе в этом районе).\r\n![](https://i.vas3k.club/bd3c45f144a98c6fb97f0f35d8df478b9fb80b0fe9c051ad2a970297f8003151.jpg)\r\n- Сходить в музей Эшера и в крошечный Эрмитаж, от которого не устаешь - Mauritshuis (Маурицхёйс). Обычно я дозирую музеи, чтобы не смешивать впечатления, но в данном случае это хорошее комбо, особенно если вы на один день. \r\n- Пройти мимо Binnenhof через площадь Plein, там сидит премьер-министр и всякие важные люди в костюмах. Там красиво и пахнет историей.\r\n- Прогуляться по Hoogstraat и поглазеть на Noordeinde Palace, один из дворцов королевской семьи, в него даже можно попасть на экскурсию. Завернуть на пикник в королевский сад по другую сторону улицы.\r\n ![](https://i.vas3k.club/9d2eb41aab1cc6086778ee11e1065cb73891ed7114ed10525f90472134891198.jpg)\r\n- Дойти до Peace Palace, горько выдохнуть у вечного огня мира и сесть в трамвай по направлению к пляжу.\r\n![](https://i.vas3k.club/925b90fb396a4e6e12bc8e63d1a6a9de07c4e3a8f5afb133e59908811d532b2d.jpg)\r\n- Если вы с детьми, возможно вам лучше свернуть в парк миниатюр [Madurodam](https://www.madurodam.nl/ru). \r\n- А если вы любите современное искусство, вам в [Kunstmuseum](https://www.kunstmuseum.nl/nl), сейчас там Муха и Мондриан.\r\n- Выйти на остановке возле Kurhaus и погулять вокруг.\r\n![](https://i.vas3k.club/4a22f1274a6437b55ea3db08f200c7c1c3ada52814f83dbc377b108185c8b525.jpg)\r\n- Наткнуться на "fairy tale pictures to the sea" от Тома Оттернеса и сказать спасибо частным коллекционерам Гааги, делающим такие классные выставки под открытым небом.\r\n![](https://i.vas3k.club/703dccef8836211b5265151cf153497a80dc597b4b2e152f216de7fd5dc2ed83.jpg)\r\n\r\n# «Нетуристические» маршруты\r\n#### Night beach tour\r\nСпешите на поиски sea sparkle (это такая люминисцирующая одноклеточная водоросль), совсем скоро она повзрослеет и перестанет светиться. Лучше выбирать дни, когда нет ветра и тепло, выезжать на велосипедах к полуночи или даже позднее. \r\n![](https://i.vas3k.club/6203bc5338c4295334c12217ce021d80fcd4844e8e44104a5eb4a51193f23851.jpg)\r\n#### Серфинг\r\nВ Гааге довольно много серфинг школ, где выдают все необходимое для занятий. Разовое занятие стоит от 30 евро, есть форматы ретритов, где вы целыми днями серфите, йожите, кушаете и строите замки из песка или танцуете, например [здесь](https://tashasurfcamp.bookinglayer.com/en/product/surfcamp-scheveningen-1). От себя могу добавить, что даже часовое занятие серфингом незаметно откусывает почти весь день, поэтому если решите заниматься чем-то подобным, то лучше не планировать ничего важного в серф дни.\r\n#### [Найти "памятник" Сталину](https://www.wikiwand.com/ru/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD%D1%83_(%D0%93%D0%B0%D0%B0%D0%B3%D0%B0))\r\nИ узнать, кто был звездой гаагской улицы красных фонарей.\r\n![](https://i.vas3k.club/a5615b0454bf5f3426966596593c115dfcd109a69218dc6bdbced6b736992993.jpg)\r\n#### Bungy Jumping / Zip Line\r\nНа пирсе Scheveningen можно не только покататься на колесе обозрения, но и [попрыгать](https://www.bungy.nl/en/) и поделать [вжунь](https://www.pier.nl/company/zipline-de-pier/).\r\n#### [Louwman Museum](https://www.louwmanmuseum.nl/)\r\nПоглазеть и пощупать историю через коллекцию автомобилей, автобусов и мотоциклов.\r\n### Прогулки / велотур по лесам и дюнам\r\nДля меня Гаага это\r\n![](https://i.vas3k.club/0affe8ea3ec5d27c0edb4e55be7059761adc8b62a5ef9d5920670dccf0afd73e.jpg)\r\nНачнем с Scheveningse Bosjes. Здесь есть тропы для бега/прогулок, конного спорта и велосипедов и приятно, что у всех получается не мешать друг другу. При входе в лесопарк есть детская площадка, по всей территории время от времени попадаются лавочки и фонтанчики с водой. Однако я бы не советовала гулять здесь одиноким особам поздним вечером, даже если вы возвращаетесь с пляжа и это самый короткий путь. :)\r\n\r\nHaagse Bos - знаменитый лес в 5 минутах ходьбы от Central station. Начинается он с Koekamp, местечка, где живут олени, аисты, и куда приходят тусоваться нильские гуси. В 16 веке после процедента с вырубкой деревьев один дядя сказал, что не надо больше трогать лес, и с тех пор никто не трогал лес. Даже нацистские войска некогда пускали ракеты из этого леса, но не трогали сам лес.\r\n\r\nПарк Clingendael с японским садом, который всегда закрыт. Говорят,  там настолько красиво, что краснокнижные птицы вьют в нем гнезда, и сотрудникам приходится закрывать всю территорию от  посетителей, чтобы молодые родители могли вырастить как можно больше птенчиков.\r\n\r\n Zorgvliet - платный парк для одного человека, который сидит на лавочке у входа и спрашивает у вас билет :) Буду рада, если кто-то из гаагчан расскажет, в чем особенность этого места.\r\n \r\n Налево от Scheveningen\r\n Westduinpark - не только кататься на велосипеде, но серфить, купаться или просто ходить голеньким. Еще можно искать и находить шотландских коровок.\r\n  ![](https://i.vas3k.club/ea085ed8bec087f2a7721c2ae238ee224472506c9409eb3ecbaa0dad4fb91b5f.jpg)\r\n![](https://i.vas3k.club/3bb0fd7f386ace817abc37f05ffe5d75bc94113d98c6221d01c162fbe1763604.jpg)\r\n\r\nНаправо от Scheveningen\r\nOostduinpark -  делать все то же самое, только кажется поближе к общественному транспорту (а вдруг вы как и я боитесь кататься на велосипеде и везде ходите пешком) и вместо коровок будут зайцы. \r\n![](https://i.vas3k.club/87e72b286d02efe86dd67107f55918a2ef0cb3775f2c046f0f47f0873dce97da.jpg)\r\n# Где и что поесть/выпить?\r\nДисклеймер: я не дружу с sandwich culture, поэтому подборка не включает в себя места, где можно попробовать основную местную еду.\r\n\r\n Топовые фалафельные:\r\n[Shakshuka](https://goo.gl/maps/hTX6Pusnozhfmg8J8)\r\n[Falafel en Hummus](https://goo.gl/maps/FSWVhmjDbKeycUdD9)\r\n[Hummus Den Haag](https://goo.gl/maps/wxAWF2zaFrQDjjfw9)\r\n\r\nSeafood:\r\n[Coast Fish](https://goo.gl/maps/jR5Cpicw8CjjUJQW7)\r\n[Hendriks Fish & Drinks](https://goo.gl/maps/9kxWj3o8SUuYaKfx8)\r\n[Simonis aan de Haven](https://maps.app.goo.gl/TuZyLEp2jQfuwTg39)\r\n\r\nСуши:\r\n[Ohmu sushi](https://goo.gl/maps/LkgE21Rc7TshcNHv8)\r\n[Samurice](https://goo.gl/maps/z9HLSDjaVjqA1rvb7)\r\n[NOH](https://goo.gl/maps/UHTJHnn2gSPZnPaZ6)\r\n\r\nЭтим летом довольно жарко, пригодится мороженка:\r\n[Het IJskabinet](https://goo.gl/maps/7ddvBu7RkVVYRw4A7)\r\n[Piet Artisans of Flavour](https://goo.gl/maps/4qZfrA61SmS9cEHd6)\r\n\r\n[Список топовых кофеен от Вали](https://t.me/gaagaradio/252) (наш любимый гаагский гид)\r\n [DuckRabbit Coffee Brewers](https://maps.app.goo.gl/nDUFNSxtAtvm85Ry7?g_st=ic)\r\n[Bartine Bakery](https://goo.gl/maps/VgAnJTUCmoZnVWC1A) с космическими круассанами и атмосферой Франции\r\n\r\nПодвергнуться мукам выбора в Foodhallen в [центре](https://goo.gl/maps/XvACj7hcorTiE3PUA) или на [пляже](https://goo.gl/maps/nqfTPtEJszmTq1pu8)\r\n\r\nПо остальным категориям включая бары прошу помощь зала или можно обратиться к этому [ресурсу](https://34travel.me/post/gaaga), например.\r\n# Где затусить вечером?\r\nВстретить закат на побережье\r\n![](https://i.vas3k.club/fdef0fc3ab64215cd51c76b4f77b3c67b83a280b8358cba3e6c01e4b5a243989.jpg)\r\n#  Что можно купить чтобы увезти с собой\r\n- Haagsche hopjes - кофейные карамельки, названные в честь барона, который по легенде так любил кофе, что даже когда ему по состоянию здоровья запретили его пить, нашел способ обойти запрет, попросив своего кондитера смешать  кофе, сахар и сливки в ароматную сладкую массу, которая и положила начало производству конфет, ставших известными в королевских дворах по всему миру. (Так что теперь вы знаете, с чем мог пить чай Александр II перед тем как отправиться на роковую воскресную прогулку).\r\n![](https://i.vas3k.club/87a21adbfebb97bbf32821e965f61416a170813a5a66ec24228426495ccdaa87.jpg)\r\n- Уточку с жемчужной серёжкой для одинокого друга айтишника.\r\n![](https://i.vas3k.club/2e6824ec1b6f9f3e2a6c2225b96a7dd011ac052e4202d27e953a35aaf17dc80d.jpg)\r\n-  Местный шоколад из [De Bonte Koe](https://debontekoe.nl/), магазины есть в нескольких локациях в центре\r\n#  Бонус для местных\r\nhttps://t.me/+AhMfbD4D7OA4OGM0 - Книжный клуб в Гааге\r\nhttps://suhumi.nl/ - Вкуснейшая грузинская еда	\N	\N	\N	t	t	91	2023-06-16 11:54:01.596155+00	\N	~	1c322fcb-fd78-4a72-ab00-044551906fda	\N	\N	{}	\N	\N
2671754c-5c19-46e6-9a3c-1037f9f6db9d	18	post	Очень токсичный пост для бана	Однажды нам захотелось узнать, сталкиваются ли наши пользователи с какими-нибудь ошибками. Ведь тестировщики божатся, что все проверили, а саппорт еле разгребает завалы обращений. И все бы ничего, но обращения приходят такие: «У меня ничего не работает, горите все в аду». Такие баги мы в работу брать не можем, хочется какой-то конкретики.\r\n\r\nМы начали попытки замутить систему сбора ошибок еще до 2022 года, но уже тогда в в компании тусовались ребята с грозным названием офицеры информационной безопасности, которые на корню зарубили идею хранить логи в каких-то забугорных облаках. Бомбило у меня тогда знатно, но как-то изменить это решение не вышло. Решили пойти другим путем — разворачивать Sentry в режиме on-prem. От идеи, как говорится, до реализации — один шаг. Всего-то нужно было выделить время SRE и сервачок. Мы еще тогда не знали что шагать мы будем пару лет, но уже тогда почувствовали, что дело не быстрое, и надо искать варианты.\r\n\r\n# Первые костыли\r\nПерелопатив весь интернет мы так ничего и не нашли. В таких ситуациях на помощь пришел командный брейншторм: накидали кучу идиотских идей, просеяли через фильтр здравого смысла и обнаружили алмаз —  передавать кастомные параметры в Яндекс.Метрику. А с ней все в порядке - российская компания, на российских серверах будет хранить российские ошибки в российском продукте российских же пользователей. Ну и тем более инфа обезличенная, передаем только то, что падает в консоль. Ну почти.\r\n\r\nДля сбора ошибок рендеринга нам очень помогла фича реакта — Error Boundary. Мы обернули приложение в кастомную страничку с большой кнопкой "Обновить" и сожалениями. Пользователи перестали видеть белые экраны и писать в поддержку, а мы наконец получили первые боевые данные и стали понимать масштаб и природу проблем.\r\n\r\nКод выглядел примерно так:\r\n\r\n```\r\ncomponentDidCatch(error: Error, errorInfo: ErrorInfo) {\r\n\tconst analyticEvent = {\r\n\t\teventType: AnalyticEventType.UserError,\r\n\t\terrorName: error.name,\r\n\t\terrorMessage: error.message,\r\n\t\terrorDescription: errorInfo.componentStack,\r\n\t\terrorStack: error.stack,\r\n\t};\r\n\tanalyticsService.sendEvent(analyticEvent);\r\n}\r\n```\r\n\r\nКонечно, дебажить минифицированные логи было очень сложно, но какие-то критичные моменты мы все-таки находили и оперативно фиксили. Ну вот типа таких:\r\n![](https://i.vas3k.club/229d9e78f5760dc36e1a6764049177a6c70cc8dd059b200d6c7f9bd73c848134.jpg)\r\n\r\nПо графику понятно когда ошибка появилась, сколько пользователей аффектит и чего примерно искать в коде. По этому же графику можно понять пофиксили в релизе ошибку или нет. Очень удобно (нет).\r\n\r\nЧасть ошибок мы найти не могли и грезили о Sentry как о манне небесной и решении всех проблем. И вот этот день настал. Сервера включили, on-prem установили, архитектуру решения согласовали, аппрувы получили, осталось только интеграцию настроить, делов то. Но и без ограничений не обошлось.\r\n\r\nВеб-приложения и клиентская часть в частности — штука очень бесячая для службы информационной безопасности, ведь код в открытом виде получает каждый пользователь. Кошмар, кошмар. Был бы я ИБшником, я бы вообще запретил код на прод заливать. Хорошо, что я не они. И нам код в продакшен заливать разрешают. Пока что. Но только минифицированный. Никаких sourcemap'ов конечно же. Если уж хакерам и достается код, то пусть хоть мучаются с деминификацией. Правда отзывов от хакеров я не слышал, но вот дебажить на проде добрым разработчикам действительно тяжело. Плюсы тоже есть — очень мотивирует писать хороший код, который никогда на проде не ломается, и дебажить там нам не приходится.\r\n\r\n# Интеграция\r\nС такими вводными мы и пришли к интеграции с Sentry. Нужно чтобы в ней ошибки отображались как надо, но чтобы на проде исходники никто прочитать не мог.\r\n\r\nУ самой Sentry бизнес-модель очень понятная и прозрачная: они зарабатывают на хостинге логов и технической поддержке. Тут у меня родилась теория заговора, в рамках которой у Sentry ну просто обязана быть нормальная дока для внутреннего пользования, а для сообщества доступно то, что доступно. Так конверсия в платных пользователей выше.\r\n\r\nНо платить за границу во времена, когда никто не хочет брать российских денег, не наш вариант, ну и мы все-таки инженеры как никак, а не просто курсы по реакту окончили. Начали думать как нам решить эту задачу.\r\n![](https://i.vas3k.club/ac3e526ffaca313ac48d5f281f4f91521f9428f1f1108ee8a7f8c0fd08e2b630.jpg)\r\n\r\nПо-умолчанию, интеграция с Sentry очень простая. Она сама сходит и за .js и за .map файлами к вам на сервис и если их найдет, то все покажет как надо. Не наш вариант. Но если мы не хотим чтобы Sentry ходила к нам на сервер, то можем ей помочь, и залить в нее наши .map файлы. Тогда она будет брать их, и не будет ходить на сайт. То что нужно, жаль не работает.\r\n\r\nТочнее работает, но не так, как мы ожидали. Соурсмапы в JS  устроены следующим образом. Есть собственно сам файл мапы .map и есть минифицированный .js, в котором в конце есть директива\r\n```\r\n//# sourceMappingURL=script.min.js.map\r\n```\r\nИ вот по этой директиве собственно происходит метч между двумя этими файлами, чтобы восстановить в конце концов исходник.\r\n\r\nТак ошибка выглядит, когда соурсмапы не подтянулись:\r\n![Не на много лучше нашего костыля с Яндекс.Метрикой.](https://i.vas3k.club/bcc1bdb546c631ced1d8d15162293c2da72f76044268674d261e2590cebc138d.jpg)\r\n\r\n\r\nА так, когда подтянулись:\r\n![Извините за блур, не хочется тут наш идеальный код обсуждать, да и офицеры не дремлют. Надеюсь этот кусочек кода не несет угрозы национальной безопасности.](https://i.vas3k.club/a14be4cf980ae4fe5e5fb8d148249a48578d803e15230b2dc6d2508662f1c186.jpg)\r\n\r\n\r\nТак вот, мы придумали гениальный план: генерить билд с соурсмапами, грузить их в Sentry, а потом, перед деплоем, удалять. И все бы хорошо, но нам сразу завалило кибану 404 ошибками. А в девтулзах отсвечивало некрасивое:\r\n![](https://i.vas3k.club/4299af0faf15c52d70f7f70d01866933bf5f1540be0a58126be652dda8baabcc.jpg)\r\n\r\nТут к нам на помощь пришел режим генерации SourceMaps в ViteJs!\r\n![То что нужно! Жаль не работает.](https://i.vas3k.club/4b043cf3783f368a8855c5a9a9b961d8c9f50f30f591c6db4133a5b3ebed7f03.jpg)\r\n\r\n\r\nВидимо Sentry без директивы `//# sourceMappingURL=script.min.js.map` не умеет связывать .js и .map, хотя очевидно же, что возьми название файла, и добавь в конец .map. Вот было бы круто, если бы разработчики Sentry так умели.\r\n\r\nМы уже даже практически смирились, что будем жить с 404 в девтулзах. Типа обычный пользователь туда все-равно не полезет, а хакеры поржут, ну и ладно, настроение людям поднимем.\r\n\r\nСпустя сутки ресеча внезапно на странице [плагина для Vite.js](https://www.npmjs.com/package/@sentry/vite-plugin?activeTab=readme), который мы не используем, глаз зацепился за фразу, что можно загружать в Sentry не только .map файлы, но и .js.\r\n![То что нужно! Что же раньше то никто не сказал?](https://i.vas3k.club/7789efe805aac84ed6f000bca21b704446803000b948660e2ab38a4616973d66.jpg)\r\n\r\nПопробовал два варианта генерации соурсмапов `hidden` и `true` пришел к выводу что работает только режим `true`, то есть режим, в котором директива `//# sourceMappingURL=script.min.js.map` присутствует в .js файлах. Но такие файлы, как я уже говорил, мы грузить на прод не хотим. Решаем делать отдельный билд, но каким-то чудом в интернете нас находит [ишью](https://github.com/getsentry/sentry-webpack-plugin/issues/56?ysclid=lid7wucvzd691037542#issuecomment-1025751020), где парни решают эту проблему простым ~~совецким~~\r\n```\r\n# delete sourcemaps refs\r\nfind .next -type f -name '*.js' -exec sed -i -E 's/sourceMappingURL=[^ ]*\\.js\\.map//g' {} +\r\n```\r\n\r\nТо что нужно! Удаляем перед деплоем соурспамы из каталога и чистим рефы. Успех!\r\n\r\n# Итоги \r\nSentry в целом оправдала ожидания. Теперь наши релизы выглядят вот так:\r\n![](https://i.vas3k.club/db218d63fdd254bceaa49d79b6ecea984bf4397a753061e8cb0016d18bc4f778.jpg)\r\n\r\n# Код\r\nПолный код докерфайла со всеми присяданиями:\r\n```\r\n# Копируем все в отдельную папочку, хотя наверное можно это и не делать\r\nRUN set -xe \\\r\n    && mkdir -p /tmp/sentry_map \\\r\n    && find /build -type f -name '*.*.map' -exec mv -t /tmp/sentry_map {} +\r\n\r\nRUN set -xe \\\r\n    && find /build -type f -name '*.js' -exec mv -t /tmp/sentry_map {} +\r\n\r\n# Качаем Sentry cli\r\nRUN set -xe \\\r\n    && curl -sL https://sentry.io/get-cli/ | bash\r\n\r\n# Настраиваем настроечки и секретные секреты\r\nARG SENTRY_API_KEY\r\nARG SENTRY_URL\r\nARG SENTRY_ORG\r\nARG SENTRY_PROJECT\r\nENV SENTRY_API_KEY=$SENTRY_API_KEY\r\nENV SENTRY_URL=$SENTRY_URL\r\nENV SENTRY_ORG=$SENTRY_ORG\r\nENV SENTRY_PROJECT=$SENTRY_PROJECT\r\n\r\n# Наконец-то все грузим в Sentry\r\nRUN set -xe \\\r\n    && sentry-cli releases new $RELEASE \\\r\n    && sentry-cli releases files $RELEASE upload /tmp/sentry_map\r\n\r\n# Удоляем соурсмапы\r\nRUN set -xe \\\r\n\t&& find /build -type f -name '*.*.map' -exec rm -f {} \\;\r\n\r\n# Удоляем рефы на них \r\nRUN set -xe \\\r\n\t&& find /build -type f -name '*.js' -exec sed -i -E 's/sourceMappingURL=[^ ]*\\.js\\.map//g' {} \\;\r\n\r\n# Мы великолепны\r\n```	\N	\N	\N	f	t	106	2023-06-16 12:08:02.865274+00	\N	~	006b2b69-e425-4d2d-82a4-7ba9505b6493	\N	\N	{}	\N	\N
2671754c-5c19-46e6-9a3c-1037f9f6db9d	18	post	Очень токсичный пост для бана	Однажды нам захотелось узнать, сталкиваются ли наши пользователи с какими-нибудь ошибками. Ведь тестировщики божатся, что все проверили, а саппорт еле разгребает завалы обращений. И все бы ничего, но обращения приходят такие: «У меня ничего не работает, горите все в аду». Такие баги мы в работу брать не можем, хочется какой-то конкретики.\r\n\r\nМы начали попытки замутить систему сбора ошибок еще до 2022 года, но уже тогда в в компании тусовались ребята с грозным названием офицеры информационной безопасности, которые на корню зарубили идею хранить логи в каких-то забугорных облаках. Бомбило у меня тогда знатно, но как-то изменить это решение не вышло. Решили пойти другим путем — разворачивать Sentry в режиме on-prem. От идеи, как говорится, до реализации — один шаг. Всего-то нужно было выделить время SRE и сервачок. Мы еще тогда не знали что шагать мы будем пару лет, но уже тогда почувствовали, что дело не быстрое, и надо искать варианты.\r\n\r\n# Первые костыли\r\nПерелопатив весь интернет мы так ничего и не нашли. В таких ситуациях на помощь пришел командный брейншторм: накидали кучу идиотских идей, просеяли через фильтр здравого смысла и обнаружили алмаз —  передавать кастомные параметры в Яндекс.Метрику. А с ней все в порядке - российская компания, на российских серверах будет хранить российские ошибки в российском продукте российских же пользователей. Ну и тем более инфа обезличенная, передаем только то, что падает в консоль. Ну почти.\r\n\r\nДля сбора ошибок рендеринга нам очень помогла фича реакта — Error Boundary. Мы обернули приложение в кастомную страничку с большой кнопкой "Обновить" и сожалениями. Пользователи перестали видеть белые экраны и писать в поддержку, а мы наконец получили первые боевые данные и стали понимать масштаб и природу проблем.\r\n\r\nКод выглядел примерно так:\r\n\r\n```\r\ncomponentDidCatch(error: Error, errorInfo: ErrorInfo) {\r\n\tconst analyticEvent = {\r\n\t\teventType: AnalyticEventType.UserError,\r\n\t\terrorName: error.name,\r\n\t\terrorMessage: error.message,\r\n\t\terrorDescription: errorInfo.componentStack,\r\n\t\terrorStack: error.stack,\r\n\t};\r\n\tanalyticsService.sendEvent(analyticEvent);\r\n}\r\n```\r\n\r\nКонечно, дебажить минифицированные логи было очень сложно, но какие-то критичные моменты мы все-таки находили и оперативно фиксили. Ну вот типа таких:\r\n![](https://i.vas3k.club/229d9e78f5760dc36e1a6764049177a6c70cc8dd059b200d6c7f9bd73c848134.jpg)\r\n\r\nПо графику понятно когда ошибка появилась, сколько пользователей аффектит и чего примерно искать в коде. По этому же графику можно понять пофиксили в релизе ошибку или нет. Очень удобно (нет).\r\n\r\nЧасть ошибок мы найти не могли и грезили о Sentry как о манне небесной и решении всех проблем. И вот этот день настал. Сервера включили, on-prem установили, архитектуру решения согласовали, аппрувы получили, осталось только интеграцию настроить, делов то. Но и без ограничений не обошлось.\r\n\r\nВеб-приложения и клиентская часть в частности — штука очень бесячая для службы информационной безопасности, ведь код в открытом виде получает каждый пользователь. Кошмар, кошмар. Был бы я ИБшником, я бы вообще запретил код на прод заливать. Хорошо, что я не они. И нам код в продакшен заливать разрешают. Пока что. Но только минифицированный. Никаких sourcemap'ов конечно же. Если уж хакерам и достается код, то пусть хоть мучаются с деминификацией. Правда отзывов от хакеров я не слышал, но вот дебажить на проде добрым разработчикам действительно тяжело. Плюсы тоже есть — очень мотивирует писать хороший код, который никогда на проде не ломается, и дебажить там нам не приходится.\r\n\r\n# Интеграция\r\nС такими вводными мы и пришли к интеграции с Sentry. Нужно чтобы в ней ошибки отображались как надо, но чтобы на проде исходники никто прочитать не мог.\r\n\r\nУ самой Sentry бизнес-модель очень понятная и прозрачная: они зарабатывают на хостинге логов и технической поддержке. Тут у меня родилась теория заговора, в рамках которой у Sentry ну просто обязана быть нормальная дока для внутреннего пользования, а для сообщества доступно то, что доступно. Так конверсия в платных пользователей выше.\r\n\r\nНо платить за границу во времена, когда никто не хочет брать российских денег, не наш вариант, ну и мы все-таки инженеры как никак, а не просто курсы по реакту окончили. Начали думать как нам решить эту задачу.\r\n![](https://i.vas3k.club/ac3e526ffaca313ac48d5f281f4f91521f9428f1f1108ee8a7f8c0fd08e2b630.jpg)\r\n\r\nПо-умолчанию, интеграция с Sentry очень простая. Она сама сходит и за .js и за .map файлами к вам на сервис и если их найдет, то все покажет как надо. Не наш вариант. Но если мы не хотим чтобы Sentry ходила к нам на сервер, то можем ей помочь, и залить в нее наши .map файлы. Тогда она будет брать их, и не будет ходить на сайт. То что нужно, жаль не работает.\r\n\r\nТочнее работает, но не так, как мы ожидали. Соурсмапы в JS  устроены следующим образом. Есть собственно сам файл мапы .map и есть минифицированный .js, в котором в конце есть директива\r\n```\r\n//# sourceMappingURL=script.min.js.map\r\n```\r\nИ вот по этой директиве собственно происходит метч между двумя этими файлами, чтобы восстановить в конце концов исходник.\r\n\r\nТак ошибка выглядит, когда соурсмапы не подтянулись:\r\n![Не на много лучше нашего костыля с Яндекс.Метрикой.](https://i.vas3k.club/bcc1bdb546c631ced1d8d15162293c2da72f76044268674d261e2590cebc138d.jpg)\r\n\r\n\r\nА так, когда подтянулись:\r\n![Извините за блур, не хочется тут наш идеальный код обсуждать, да и офицеры не дремлют. Надеюсь этот кусочек кода не несет угрозы национальной безопасности.](https://i.vas3k.club/a14be4cf980ae4fe5e5fb8d148249a48578d803e15230b2dc6d2508662f1c186.jpg)\r\n\r\n\r\nТак вот, мы придумали гениальный план: генерить билд с соурсмапами, грузить их в Sentry, а потом, перед деплоем, удалять. И все бы хорошо, но нам сразу завалило кибану 404 ошибками. А в девтулзах отсвечивало некрасивое:\r\n![](https://i.vas3k.club/4299af0faf15c52d70f7f70d01866933bf5f1540be0a58126be652dda8baabcc.jpg)\r\n\r\nТут к нам на помощь пришел режим генерации SourceMaps в ViteJs!\r\n![То что нужно! Жаль не работает.](https://i.vas3k.club/4b043cf3783f368a8855c5a9a9b961d8c9f50f30f591c6db4133a5b3ebed7f03.jpg)\r\n\r\n\r\nВидимо Sentry без директивы `//# sourceMappingURL=script.min.js.map` не умеет связывать .js и .map, хотя очевидно же, что возьми название файла, и добавь в конец .map. Вот было бы круто, если бы разработчики Sentry так умели.\r\n\r\nМы уже даже практически смирились, что будем жить с 404 в девтулзах. Типа обычный пользователь туда все-равно не полезет, а хакеры поржут, ну и ладно, настроение людям поднимем.\r\n\r\nСпустя сутки ресеча внезапно на странице [плагина для Vite.js](https://www.npmjs.com/package/@sentry/vite-plugin?activeTab=readme), который мы не используем, глаз зацепился за фразу, что можно загружать в Sentry не только .map файлы, но и .js.\r\n![То что нужно! Что же раньше то никто не сказал?](https://i.vas3k.club/7789efe805aac84ed6f000bca21b704446803000b948660e2ab38a4616973d66.jpg)\r\n\r\nПопробовал два варианта генерации соурсмапов `hidden` и `true` пришел к выводу что работает только режим `true`, то есть режим, в котором директива `//# sourceMappingURL=script.min.js.map` присутствует в .js файлах. Но такие файлы, как я уже говорил, мы грузить на прод не хотим. Решаем делать отдельный билд, но каким-то чудом в интернете нас находит [ишью](https://github.com/getsentry/sentry-webpack-plugin/issues/56?ysclid=lid7wucvzd691037542#issuecomment-1025751020), где парни решают эту проблему простым ~~совецким~~\r\n```\r\n# delete sourcemaps refs\r\nfind .next -type f -name '*.js' -exec sed -i -E 's/sourceMappingURL=[^ ]*\\.js\\.map//g' {} +\r\n```\r\n\r\nТо что нужно! Удаляем перед деплоем соурспамы из каталога и чистим рефы. Успех!\r\n\r\n# Итоги \r\nSentry в целом оправдала ожидания. Теперь наши релизы выглядят вот так:\r\n![](https://i.vas3k.club/db218d63fdd254bceaa49d79b6ecea984bf4397a753061e8cb0016d18bc4f778.jpg)\r\n\r\n# Код\r\nПолный код докерфайла со всеми присяданиями:\r\n```\r\n# Копируем все в отдельную папочку, хотя наверное можно это и не делать\r\nRUN set -xe \\\r\n    && mkdir -p /tmp/sentry_map \\\r\n    && find /build -type f -name '*.*.map' -exec mv -t /tmp/sentry_map {} +\r\n\r\nRUN set -xe \\\r\n    && find /build -type f -name '*.js' -exec mv -t /tmp/sentry_map {} +\r\n\r\n# Качаем Sentry cli\r\nRUN set -xe \\\r\n    && curl -sL https://sentry.io/get-cli/ | bash\r\n\r\n# Настраиваем настроечки и секретные секреты\r\nARG SENTRY_API_KEY\r\nARG SENTRY_URL\r\nARG SENTRY_ORG\r\nARG SENTRY_PROJECT\r\nENV SENTRY_API_KEY=$SENTRY_API_KEY\r\nENV SENTRY_URL=$SENTRY_URL\r\nENV SENTRY_ORG=$SENTRY_ORG\r\nENV SENTRY_PROJECT=$SENTRY_PROJECT\r\n\r\n# Наконец-то все грузим в Sentry\r\nRUN set -xe \\\r\n    && sentry-cli releases new $RELEASE \\\r\n    && sentry-cli releases files $RELEASE upload /tmp/sentry_map\r\n\r\n# Удоляем соурсмапы\r\nRUN set -xe \\\r\n\t&& find /build -type f -name '*.*.map' -exec rm -f {} \\;\r\n\r\n# Удоляем рефы на них \r\nRUN set -xe \\\r\n\t&& find /build -type f -name '*.js' -exec sed -i -E 's/sourceMappingURL=[^ ]*\\.js\\.map//g' {} \\;\r\n\r\n# Мы великолепны\r\n```	\N	\N	\N	t	t	110	2023-06-16 12:09:08.80816+00	\N	~	006b2b69-e425-4d2d-82a4-7ba9505b6493	\N	\N	{}	\N	\N
